INSERT INTO `counselors` VALUES (1,'박철우','남자',1306,'갈등상황이나 힘들 때 나누어주세요','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/15065783075827_.png',1,1),(2,'김효린','여자',1080,'완벽하지 않아서 더 사랑스러운거에요','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/15065782615741_.png',1,1),(3,'변명숙','여자',424,'당신은 그 누구보다 잘 할 수 있어요','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/15065783925952_.png',1,1),(4,'권효석','남자',1410,'함께 나누며 치유와  평화, 안식을','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/15065782575737_.png',1,1),(5,'천세경','여자',1578,'오늘, \'나\'를 만나러 잘 오셨어요.','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/15065782115651_.png',1,1),(6,'김수한','여자',1117,'당신의 마음자리에 함께 하고싶습니다.','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/1548650937_.png',1,1),(7,'임명숙','여자',884,'든든한 당신의 편이 되어 드릴게요. ','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/15065781245524_.png',1,1),(8,'이경숙','여자',87,'고통에서 벗어나 행복하기를...','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/1576046516_.png',2,0),(9,'김한나','여자',272,'그 무엇도 당신의 잘못이 아니에요.','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/1550580755_.png',2,1),(10,'유성희','여자',50,'당신의 아픔은 당신의 잘못이 아닙니다','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/1554456894_.png',2,0),(11,'노희정','여자',7,'소중한 당신에게 징검다리가 되겠습니다','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/1583972403_.png',2,0),(12,'이승호','남자',50,'힘들 때 함께하는 사람이고 싶습니다.','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/1585531352_.png',2,0),(13,'전명찬','남자',93,'함께 찾아요,나다운 선택을.','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/1586833993_.png',2,0),(14,'이윤희','여자',126,'솔루션을 위한 첫 시작 ','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/1580178998_.png',2,0),(15,'유현정','여자',194,'당신의 용기를 응원합니다.','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/1580179001_.png',2,1),(16,'조은아','여자',121,'다치기 쉬운 유리같은 사람의 마음','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/1586833991_.png',2,0),(17,'이진영','여자',257,'\'나\'를 만나는 여정으로 초대합니다!','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/1556545383_.png',2,1),(18,'양지우','여자',132,'과거로부터 자유를, 이 순간에 희망을','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/1583972402_.png',2,0),(19,'강은혜','여자',302,' 언제나 당신을 응원합니다!','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/15065782594521_.png',2,1),(20,'연성흠','남자',48,'괜찮아요. 최선을 다했을거니까','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/1550721901_.png',3,0),(21,'류민경','여자',241,'억압된 것은 회귀한다 -freud-','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/1578798668_.png',3,1),(22,'심지현','여자',315,'회복&성장을 위한 온라인 연극심리상담','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/1580178997_.png',3,1),(23,'전지은','여자',153,'지금 마음이 어때요?','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/1580178999_.png',3,1),(24,'오형경','여자',0,'편안한 마음길 여행이 되시기를....','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/1587533344_.png',3,0),(25,'고미경','여자',415,'진정한 위로로 함께하고 싶어요. ','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/1571275375_.png',3,1),(26,'이지연','여자',240,'따뜻하고 안전한 장소가 필요하시다면.','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/15065783155835_.png',3,1),(27,'정다운','여자',1,'괜찮아, 다 괜찮아.','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/1586833996_.png',3,0),(28,'박은솔','여자',29,'있는 그대로 참 소중한 당신입니다','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/1548650940_.png',3,0),(29,'이주현','여자',10,'오늘, 당신이 행복했으면 좋겠습니다.','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/1551777267_.png',3,0),(30,'강혜원','여자',17,'소통과 공감으로 함께 해요~','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/1585531358_.png',3,0),(31,'윤수민','여자',6,'변화를 위한 시작, 같이 하겠습니다!','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/1549926956_.png',3,0),(32,'홍수현','여자',37,'따뜻한 위안이 필요하다면 소통해요','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/1554100748_.png',3,0),(33,'강수민','여자',15,'누구나 하는 고민이란 생각만은 말아요','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/1583972404_.png',3,0),(34,'김애경','여자',298,'마음을 털어내는 시간, 함께 해요','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/1564625220_.png',3,1),(35,'신종원','남자',14,'당신의 어려움을 함께 고민하고자 합니다.','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/1580179002_.png',3,0),(36,'조윤경','여자',264,'모든 것은 \"지금부터\" 입니다.','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/15065781775617_.png',3,1),(37,'현은정','여자',73,'마음의 짐을 내려놓고 함께  나눠요.','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/15065781135513_.png',3,0),(38,'최해나','여자',208,'당신의 마음은 안녕하십니까?','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/15065781055505_.png',3,1),(39,'최진영','여자',203,'내 마음의 소리를 들어보는 방법','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/15065781935633_.png',3,1),(40,'이봉재','남자',626,'위안의 시작을 함께하고 싶어요~','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/1551777266_.png',3,1),(41,'김진형','남자',2,'걱정하지 말아요. ','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/1587533341_.png',3,0),(42,'정수형','여자',87,'마음이 편안한 시간되시기를....','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/1549530163_.png',3,0),(43,'김유리','여자',1128,'당신이 있는 그 자리서부터 토닥토닥','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/15065782555735_.png',3,1),(44,'염선영','여자',0,'내 탓도, 혼자도 아니예요...','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/1585815921_.png',3,0),(45,'노은혜','여자',1436,'따뜻한 한마디가 필요할 때 두드리세요','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/1548650939_.png',3,1),(46,'유영임','여자',583,'공감, 진실, 이해로 함께 합니다.','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/1558482518_.png',3,1),(47,'김미현','여자',34,'\'살아있는 동반자\'로 함께 하겠습니다','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/1552613635_.png',3,0),(48,'박소형','여자',577,'당신이 있어 이 세상은 존재합니다.','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/1557795917_.png',3,1),(49,'연하영','여자',225,'당신은 그 누구보다 잘 할 수 있어요','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/1554100750_.png',3,1),(50,'허혜정','여자',947,'이야기를 나누면 당신의 고민이 줄어듭니다','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/1554100747_.png',3,1),(51,'천주녕','남자',360,'해가 뜨기 전 가장 어두운 새벽일 뿐','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/1551666305_.png',3,1),(52,'최소희','여자',18,'괜찮아요...기대고 울어도...','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/15065781115511_.png',3,0),(53,'윤지선','여자',161,'제가 당신을 만난 것은 축복입니다','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/1564625218_.png',3,1),(54,'김지유','여자',0,'따뜻하고 진솔한 편안한 삶의 안내자','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/1586833992_.png',3,0),(55,'한아름','남자',503,'','https://d2qrvi4l1nprmf.cloudfront.net/images/partner/15065781155515_.png',3,1);
