INSERT INTO `reviews` VALUES (1,'2019-12-20 00:00:00.000000',5,'내가 왜이러지? 내가 문제가있나? 나한테만 왜 이런일이 생기지? 하는 생각들이 너무 강해 힘들었어요. 여러 상담사분 고민하다가 선택했는데 잘 한 것 같아요.\n아무런 편견없이 차분히 잘 들어주시고 넘겨짚는 부분 없이 하나하나 꼼꼼하게 제 의견을 여쭤봐주셔서 많이 위로받는 기분이었습니다. 단시간인데도 불구하고 뭐 하나라도 더 도와주시려고 노력해주시는 모습에 감동 받고 갑니다^^',1),(2,'2019-09-25 00:00:00.000000',5,'감사합니다. 많은 도움이 되었습니다.\n\n',2),(3,'2019-09-11 00:00:00.000000',4,'사실 짧은시간이라 많은 상담은 못했지만\n핵심만 딱 찝어주시고 문제해결을 좀 쉽게 도와주셨어요!!!! 정말감사합니다',3),(4,'2019-09-05 00:00:00.000000',5,'제 안의 문제를 깨달아서 더 나아갈 수 있는 긍정적인 변화를 느꼈습니다',4),(5,'2019-09-02 00:00:00.000000',5,'순간적인 안좋은 생각을 많이 눌러주셔서 감사합니다\n제가 문제라고 생각했던 부분을 잘 캐치 할수 있었습니다 \n앞으로 희망적인 부분을 많이 보겠습니다',5),(6,'2019-09-01 00:00:00.000000',5,'마음의 위안을 얻을 수 있었습니다',6),(7,'2019-08-14 00:00:00.000000',5,'연성흠 선생님과의 상담 후기입니다.\n\n일단 어디에 말 못하고 외로운분들에게 이 어플 자체를 추천합니다.\n\n저는 부부,가족갈등으로 고민이 많았습니다\n결혼생활로 인해 몸도 지쳐있고 우울증도 오고있었어요 마침 이 어플을 보게되어서 기대하지않고 시작했어요\n사실 선생님에게 후기가 없었나..? 조금있었나..? 지금은 당장 위로 떠있는 선생님들이 아니었어요 그렇기에 저에게 더 필요한 선생님이었어요\n아무것도 모르는, 정보가 없는 상태에서 시작하는 새로운 마음이 저에게 필요했어요\n\n첫날은 익명이고 얼굴이 안보여지니 발가벗는것처럼 제이야기들을 술술했어요 그저 공감,경청만 있는 상태니 누구에게도 하지못한 이야기들을 할 수 있었어요 제 이야기를 듣고 공감해주시고 위로해주시니 마음이 편안했어요\n\n두번째날은 제 마음에 대해 분석을 하셨는지 지금 절 나아지게끔 만든 많은 생각이 드는 질문을 준비해오셨어요 그 질문들에 답하면서 행복은 그렇게 먼곳에 있지않구나 그렇다고 내가 기다린다고 오는것도 아니구나를 느꼈어요 직접적으로 말을 안해주셔도 내담자 스스로가 느끼게끔 만들어주시는것같아요\n\n세번째 네번째날은 이미 제가 마음이 한결 편안해진 상태로 가볍게 대화를 이어나갔어요\n선생님의 솔루션에 남편도 바뀌어가고 무엇보다 제가 바뀌었어요\n감사하단 말론 부족하고 이런 감정들은 글로썬 전해지지않아서 그것만 아쉽네요..\n\n제가 남들보다 좀 더 빨리 행복을 알아챈걸 수도 있어요 그래도 선생님과 꾸준히 대화를 하고 자신에게 솔직해진다면 누구든 변할 수 있을것같아요\n\n선생님 적극 추천합니다\n\n같이 고민해주시고 또 좋은 질문들 감사했습니다',7),(8,'2020-05-15 00:00:00.000000',5,'상담해주셔서 감사합니다 ',8),(9,'2020-05-04 00:00:00.000000',5,'얘길.잘들어주셔서 좋았어요. 희망을 찾아가는 시작점이라 생각해요',9),(10,'2020-02-28 00:00:00.000000',5,'시간과 공간에 제약이 없이 모바일을 통해 상담을 받는 것이 정말 편하고 좋았습니다.\n상담사님이 친절하시고 마음 편하게 해주시려고 노력해 주셔서 감사했습니다.\n바쁘다는 핑계로 추천해 주신 책을 다 읽지 못하고 여러 제시해 주신 방법들을 모두 실천하지는 못했답니다. \n하지만 이내 다 읽을 예정이고 하나씩 실천해 나가면 변화할거라는 기대와 희망이 생겼답니다.\n힘들 때 아무도 몰래 마음 나눌 수 있는 공간이 생겨서 마음이 든든해졌어요. \n10주간 답답한 이야기 들어주시느라 너무나 고생하셨습니다. 감사합니다.',10),(11,'2020-02-07 00:00:00.000000',3.5,'첫 상담때 우울감이 완치되어 그 이후 상담필요를 못느꼈는데 상담사님이 연락주셔서 다시 찾아왔어요ㅎㅎ',11),(12,'2020-02-04 00:00:00.000000',5,'차분해 졌어요',12),(13,'2020-01-30 00:00:00.000000',5,'무슨 얘기부터 해야할까요?? 선생님이랑 상담하는 시간이 늘 설레 4주간 행복했습니다~ 상담마다 너무 좋은 꿈을꾸었네요! 좀 힘든 일이 여러가지 있었는데.. 이제는 강하게 이겨 낼 수 있을 것 같아요~ 좋은 조언들이 힘이 되었습니다. 더 강하고 지혜로워져 행복할께요! 선생님 감사합니다~~',13),(14,'2020-01-17 00:00:00.000000',5,'최대한 이해해주시려고 노력하시는게 잘 보여서 좋았고 제 감정에 대해서 잘 대처해주신 것 같아요 ',14),(15,'2020-01-14 00:00:00.000000',5,'들어주신 것만으로도 감사합니다.\n마음의 안정은 제가 잘 할 수 있어요ㅎ\n제 고민에 대해서 상담선생님께서 깊이 공감하고 진심어린 조언과 말씀 그리고 공감에 대헤서 상담을 받아보길 정말 잘한일인것 같습니다.\n현제 어머니께선 새아빠에 대한 마음이 남아있는지 고소는 하지말자고 하십니다. 가장 힘들어하는건 제가 아니라 어머니라고 생각해요. 한평생을 약속했던 반려자의 배신과 친딸이 자기를 기만했다는 사실에도 깊은 우울증을 가지고 있습니다. 저는 지금 엄마에게 죄인이에요. 엄마가 가고자 하는것, 원하고자 하는걸 해드릴 생각입니다.\n상담선생님 이야기 들어주셔서 너무 감사드려요. 이제 꽃같다는 24살. 이 악물고 마음 다스리며 잊어버리려 애쓰고 버티고 또 버티다 쓰러질꺼 같으면 그 전에 다시 상담선생님 찾아 뵙겠습니다. 그냥 응원해주세요. 아직 마음이 여리다면 여린나이라고 하지만 저 정말 강하게 앞으로 나아갈 수 있습니다. 엄마와 둘이 이제 사는 이상 이제 그래야합니다.\n더이상 20살이라는 여리고 약한 학생으로 남아있을 수 없어요.',15),(16,'2020-01-13 00:00:00.000000',5,'덕분에 마음 정리하는데 도움이 많이 되었습니다. 감사합니다.',16),(17,'2019-12-20 00:00:00.000000',5,'제가 처음이라 4회기만 했는데 그 짧은 시간동안 저의 고민에 대해 같이 생각해주고 자세하게 제가 탐색할수있겠끔 도와주시고 특히 에니어그램 책 추천해주신게 신의한수였습니다  정말 좋았어요 선생님이 말씀해주신것들 다시 생각하면서 포기하지않고 살아갈  용기 희망이 생겼습니다 그리고 정말 따뜻함에 울컥한적도 있었고 나중에 힘이들거나 누군가에게 도움을 받고 싶을때 먼저 생각날것같습니다 감사합니다 선생님!!',10),(18,'2019-12-19 00:00:00.000000',5,'상담하면서 생각정리도 되고 앞으로 어떻게\n일해야 하는지 정리가 좀 된것 같아서 너무 좋았어요. 감사합니다-!!^_^!!\n',17),(19,'2019-12-18 00:00:00.000000',5,'진심어린 상담 감사합니다\n항상건강하고\n행복하세요',18),(20,'2019-12-17 00:00:00.000000',5,'여러가지 솔루션을 주셔서 감사해여',19),(21,'2019-12-17 00:00:00.000000',5,'처음 트로스트앱을 이용해보았습니다. 누구에게도 하기쉽지않은이야기를 솔직하게 다 말씀드리다보니 마음이 편안해지고 문제점이 무엇인지도 알게되었고 편안한 감정을 느끼게되었습니다. 1회성이안되도록 매주 상담사분이랑 이야기나누면서 감정정리를 하고 안정을 찾아야할 것 같아요~너무 감사드리고 강력추천드립니다.^^ 당분간여행가신다고 하셨는데 즐거운여행되시고 다시 또 상담하고 싶습니다.',20),(22,'2019-12-15 00:00:00.000000',5,'제 고민을 잘이해해서 들어주시고 쌤이랑얘기하다보니 근본적인 원인이 어디서부터 시작된건지 알게됬어요 사실 반신반의하며 상담신청을했는데 기분이 어제보다 훨씬 나아졌어요!',21),(23,'2019-12-15 00:00:00.000000',5,'잘 들어 주시고 \n같이 울어 주셔서 감사해요.\n제가 무슨 말을 하려는지 알아차려 주셔서\n마음에 불편한 것 없이 털어 놓을 수 있었던 것 같아요.\n감사합니다.',21),(24,'2019-12-14 00:00:00.000000',5,'마음이 너무 답답해서 다급하게 상담신청했는데 생각보다 훨씬더 잘 응대해주셔서 매우 만족했습니다. 다음에 또 힘들거나 상담하고 싶을때 다시 찾고 싶습니다. 잘 들어주시고 잘 다독여주셔서 마음이 많이 안정되고 힐링되는 시간을 보낼수 있었습니다. 감사합니다~^^',22),(25,'2020-06-23 00:00:00.000000',5,'친절하십니다.',23),(26,'2020-05-26 00:00:00.000000',5,'문제해결을 위한 구체적인 방법을 제시해주셔서 좋았어요. \n',24),(27,'2020-05-26 00:00:00.000000',5,' 짧은 시간이라 많은 것을 얘기하지 못했지만 그 안에서 저를 충분히 이해하려 노력하시고 혼자서는 알 수 없는 문제의 근본이 되는 부분을 짚어주어서 혼자서 혼란스러울때와는 다르게 생각이 분산되는 일이 없었어요. 핵심을 잘 보시는 것 같아요. 또 좋은  방안도 알려주셔서 걱정 됐던 일이 좀 누그러졌어요. \n작은 고민이지만 자신에게 문제가 된다고 생각하면 시도해보세요. 근본적인 문제를 알아 갈 수도 있어요. 또 상담사님이 얘기를 진심으로 들어주시니까 그것만으로도 충분히 고민에 대한 해소가 돼요. ',25),(28,'2020-05-23 00:00:00.000000',5,'생각하지 못했던 부분을 지적해주셔서 제 문제에 대해 다른 시각으로 볼 수 있어서 좋았습니다. ',24),(29,'2020-05-15 00:00:00.000000',5,'상담사선생님께서 너무 친절하셨고, 따뜻함과 서로 공감대를 통해 제 마음을 더 편하게 털어놓을 수 있었습니다. 이유를 모르고 답답했던 부분이 한결 나아졌습니다.',26),(30,'2020-04-28 00:00:00.000000',5,'감사해요:)',27),(31,'2020-04-19 00:00:00.000000',5,'얘기 다 들어주시고 친근하게 공감해주시면서 소통해주셔서 넘 감사하구 좋은 시간이었어요 비록 짧은 시간이었지만 알게 된 것도 많았고요 뜻깊은 50분이었다고 생각해요 감사합니다',28),(32,'2020-04-15 00:00:00.000000',5,'\n너무 만족스러웠습니다\n',29),(33,'2020-04-09 00:00:00.000000',5,'희망 없는 저에게 어떻게 하면 행복해 질 수 있는지 조언해주시고 희망을 얻게 해주셔서 감사합니다.',30),(34,'2020-04-03 00:00:00.000000',5,'현실적으로 조언해 주시고 편안하게 제 이야기를 들어 주셔서 좋았어요\n',31),(35,'2020-03-12 00:00:00.000000',5,'정말 감사하고 다음주에 다시 결제할거에요!\n',32),(36,'2020-02-08 00:00:00.000000',5,'제가 잘 캐치하지 못한 부분을 알려주셔서 좋았습니다.\n',33),(37,'2020-01-20 00:00:00.000000',5,'되게 도움되는 조언 많이해주셨고 따뜻하셨어요.',34),(38,'2020-01-13 00:00:00.000000',5,'내가 모르고 있던 나의 강점을 일깨워주셔서 자신감이 더욱 생겼어요 상담사님의 확신에 찬 상담이 남아있는 미련이나 불안감을 날려주셨어요',35),(39,'2020-01-11 00:00:00.000000',5,'음...저한테 자책하지 말라고 격려해주시고 용기 불어넣어주신거 정말 감사했어요.인간관계에 대해서 새로운 관점을 보게되기도 했어요.시간 지났는데도 끝까지 조언 마무리해주신 것도 되게 감사했어요 개인적으로 나중에 경제적인 여유만 된다면 또 상담받고 싶은 분이에요.',36),(40,'2020-01-11 00:00:00.000000',5,'엄청 복잡한 감정이었고 횡설수설 얘기하는데 잘들어주시고 질문을 해주시는데 그질문에 대한 대답을 생각하면서 