),(149,'2020-03-01 00:00:00.000000',5,'4주 간 상담을 받으며 제 마음 속이 단단해지는 걸 느꼈습니다. 주위에 하소연을 하거나 술을 마시면 그 순간은 가볍게 지나가지만 여전히 남아있는 마음의 짐은 무기력한 날들을 늘려갑니다. 저는 상담을 받으며 저를 돌아봤고 한 주 한 주 선생님이 정해주신 주제로 나를 돌아보는 것만으로도 큰 치유의 시간이 되었습니다. 선생님과 상담으로 제가 놓치고 있는 저의 모습을 알아 챌 수 있었고 제 마음 속에 있던 긍정적인 부분도 찾을 수 있었습니다. 저의 깊고 어두운 이야기를 잘 들어주시고 제가 놓친 부분을 찾아주신 류민경선생님께 감사말씀 드리고 싶습니다.',134),(150,'2020-02-29 00:00:00.000000',5,'강사합니다',110),(151,'2020-02-29 00:00:00.000000',5,'넘 감사합니다',110),(152,'2020-02-28 00:00:00.000000',5,'정말 정성스럽게 들어주시고 답변해주셨어요.. 돈을 위해서가 아니라 하나 하나 진심으로 신경써주시는 게 보여서 너무 감사했습니다. ',135),(153,'2020-02-24 00:00:00.000000',5,'위로가 되었어요\n',136),(154,'2020-02-20 00:00:00.000000',5,'마음을 털어놓을수있어 소중한시간이었습니다',137),(155,'2020-02-16 00:00:00.000000',4.5,'막연하게 느껴졌던 부분이 좀더 구체적으로 잡아갈수있던것이 좋앗습니다',138),(156,'2020-02-11 00:00:00.000000',5,'죄책감과 공허함에 사로잡혀 있는 기분이 많이 들었었는데 제 자신이나 주변 사람들에게 솔직해지는 게 잘못된 게 아니라고 말씀해주셔서 많이 힘이 되었습니다. 변화는 결국 자기 자신에게 달려 있는 것이지만 도움을 받고 싶은 분들에게 추천해요~',139),(157,'2020-02-09 00:00:00.000000',5,'텍스트 상담이라서 상담이 제대로 이루어질까 의구심도 있었는데, 전화상담과는 다른 장점도 있고(글이 남기때문에 힘들때 다시봐용!) 2회기에서 끝났지만 저에게는 좋은 상담이었다고 생각합니다.\n많이 공감도 해주시고, 단순히 공감에서 그치는것이 아니라\n저에게 필요한 관점도 제시해주셔서 저에게는 큰 힘이 되었어요. 뜻깊은 시간이었습니다~! 감사합니다!',140),(158,'2020-02-09 00:00:00.000000',5,'그냥 잘알려주시는게 좋았다\n힘이 났다\n\n',141),(159,'2020-02-08 00:00:00.000000',4,' 좋은 경험이었습니다~',142),(160,'2020-02-05 00:00:00.000000',4,'해결책을 찾는 객관적인 시선을 가진 분이라\n좋았습니다. 상담시간도 조율이 빨랐고요.\n감사드립니다.',143),(161,'2020-02-04 00:00:00.000000',5,'이야기 차분하게 들어주셔서 너무 감사했습니다ㅜ!! 머리가 너무 복잡했는데 정리가 좀 된 것 같아요. 진심을 다해서 조언 해주시고 제 마음을 알아주셔서 정말 따뚯한 시간이었습니다! 시간이 살짝 오바되었는데도 너무 잘 들어주셔서 감사합니다 너무 감사합니다!',131),(162,'2020-02-03 00:00:00.000000',5,'ㅎ.ㅎ 감사',144),(163,'2020-02-02 00:00:00.000000',5,'제 입장에서 생각해주시고 배려하시는 말투로 해주셔서 너무 좋았어요. 제가 처한 상황에 공감도 해주시면서 또 제가 필요로하는 해결책이랄까요 추천해주셔서 참 좋았던거같아요. 무엇보다 진심으로 대해주신다는 느낌이 얘기를 하는부분에있어서 더욱 편하게 느껴졌던것같아요. 한 번 스스로 노력해보고 힘든부분이 있을때 다시 신청할게요^^',145),(164,'2020-01-23 00:00:00.000000',5,'방법을 알려주셔서 너무 좋았어요\n혼자하기 힘들고 낯뜨거운데 상담시간을 통해\n해 볼 수있게 도와주셔서 도움이 된 거 같아요\n제 이야기를 하는게 무서운데 차근 차근 얘기를 꺼내보고싶게 만드시네요',146),(165,'2020-01-21 00:00:00.000000',5,'짧은 상담이었지만 제 이야기를 귀담아서 들어주셨고, 충분히 공감해주셨습니다. 사실 고민이나 우울감도 원인을 알고 있고, 해결방안도 머리로는 알고 있습니다. 고민에 대해서는 안심시켜주시고, 합리적인 해결방안도 같이 상각해주셔서 너무 도움이 되었고, 우울감도 충분히 그럴 수 있다고 오히려 공감해주셔서.. 지금은 상태가 많이 좋아졌습니다. 한 번의 상담으로 이 정도이니, 반복적으로 상담하면 더 좋은 효과가 있을거라 생각합니다. 혼자서 고민하지 말고 상담사님께 털어놓고 함께 고민하는 것은 어떨까요? 상담사님! 정말 감사합니다!! :)\n',147),(166,'2020-06-18 00:00:00.000000',5,'이야기를 잘 들어주세요 공감을 다 해주시고 저는 풀어서 길게 정리 못하고 말을 하는데, 상담사님 께서는 제가 하는 이야기들의 핵심을 바로바로 알아주세요',148),(167,'2020-06-11 00:00:00.000000',5,'중간 중간 격려해주시고 공감해주셔서 좋았습니다',149),(168,'2020-05-28 00:00:00.000000',5,'정말 후회 없는 선택이었습니다. \n마음을 위로받는 시간이었습니다. 다시금 열심히 살아보렵니다!  ',150),(169,'2020-05-23 00:00:00.000000',5,'편안하게 이야기하게 도와주시고 다른 사람들에게 털어놓거나 의논하기 힘든 부분들을 솔직하게 이야기 할 수 있어서 좋았어요. 50분이 생각보다 더 짧게 느껴졌어요. 한번도 상담 해본 적이 없었는데 쉽게 접근할수 있어서 상담에 대한 부담이 좀 덜어진 것 같아요. 기회가 되면 좀 더 많은 회기로 전체적인 상담을 받고 싶어졌습니다',151),(170,'2020-05-21 00:00:00.000000',5,'저도 몰랐던 부분들을 캐치해주시고 상황에 맞게 방법들을 알려주셔서 너무 도움이 되었습니다 :)',152),(171,'2020-05-18 00:00:00.000000',5,'잘 꺼내지 못하고 정리를 못했던 얘기를 꺼낼 수 있게 유도해주시고 더 구체적으로 파악할 수 있게끔 상담해주셔서 감사했습니다.',153),(172,'2020-05-18 00:00:00.000000',5,'감사합니다.',154),(173,'2020-05-14 00:00:00.000000',5,'상담을 받는동안 가장 크게 느꼈던것은..일단 선생님께서 남의 이야기를 굉장히 주의깊게.일고 계시고.. 또한 깊게.생각한다는 느낌을 받았어요. 그래서 선생님이 이런거 같다 저런거 같다 라고 할때 뭔가 딱 맞는다는 느낌이 들어서 선생님께 더욱 신뢰가 갔어요. 선생님이 남같지 않다라는 느낌이 강했습니다.\n또한 가장 크게 느꼈던 것중 하나는 이게 정말 한번에 끝나는 것이 아니라 시작이라는것을 느끼게 된것 같았습니다.',155),(174,'2020-05-10 00:00:00.000000',5,'상담사 선생님께서 공감을 잘 해 주셔서 너무 좋았습니다. 사실 결제하면서는 좀 가격이 세다고 생각했는데요, 상담 받고 난 뒤에는 정말 아깝지 않다는 생각이 들었습니다. 그리고 상담 시간에 최선을 다하시는 게 느껴져서 너무 좋았습니다. 상담받고 나서 마음이 정리되고 편안해졌습니다.',156),(175,'2020-05-10 00:00:00.000000',4,'ㅎㅎㅎㅎㅎ',157),(176,'2020-05-08 00:00:00.000000',5,'감사합니다',158),(177,'2020-04-27 00:00:00.000000',5,'심호흡이 안되고 눈물이 날 정도였는데 상담 후에 많이 안정되었어요 ',159),(178,'2020-04-20 00:00:00.000000',4,'잘모르겠어요.',160),(179,'2020-04-19 00:00:00.000000',5,'이야기를 잘 들어주셔서 감사합니다 ^^ \n멀씀해주신것부터 잘 실천해볼게요!!',161),(180,'2020-04-18 00:00:00.000000',5,'잘 공감해 주셔서 좋았습니다.',162),(181,'2020-04-11 00:00:00.000000',5,'네 좋았습니다',163),(182,'2020-04-09 00:00:00.000000',5,'이런저런 방안도 많이 제시해주시고 무엇보다 이해해주시고 공감해주십니당 .. \n맘이 진짜 힘들고 부정적이고 그랬는데 긍정적이고 좋은생각할수 있게끔 많이 이끌어주셨어요 \n힘드신분들은 꼭 한번 상담받아보시길 백번 추천드립니다',164),(183,'2020-04-08 00:00:00.000000',5,'어렸을 때 스스로의 감정을 과잉 억제했던 이유는 \n\n그때 나름의 생존방식이었을 것이라는 해석은\n\n저에게 충분히 유의미 했습니다\n\n감사합니다\n',165),(184,'2020-04-08 00:00:00.000000',5,'그냥 그저 그랬어요 통화음질이 너무 안좋아서 몰입이 힘들었어요',166),(185,'2020-03-13 00:00:00.000000',5,'goood',167),(186,'2020-03-06 00:00:00.000000',5,'감사합니다',154),(187,'2020-03-03 00:00:00.000000',5,'공감을 받아서 힘이나고 좋았습니다\n객관적인 관점도 들을 수 있어서 도움이되었고\n마무리까지 함께해주셔서 좋았습니다.\n',168),(188,'2020-02-26 00:00:00.000000',5,'감사합니다',169),(189,'2020-02-14 00:00:00.000000',5,'두서없이 나열한 이야기들 속에서도 핵심을 잘 짚어주시고, 더 나은 방향으로 생각할 수 있게 많은 조언을 해주셨어요. 생각지 못했던 부분까지 알게 해주셔서 의미있는 시간이었습니다. ',170),(190,'2020-01-16 00:00:00.000000',5,'공감도 해주시고 덕분에 많은 위로 얻었습니다. ',171),(191,'2020-01-15 00:00:00.000000',5,'지금 문제를 다루기에 충분히 도움받을 수 있는 선생님을 만나 정서적으로 안정을 되찾아갑니다. 따뜻하게 대해주시고, 꼭 필요한 질문들로 고민을 말할 수 있도록 도와주셔서 생각이 잘 정돈될 수 있었습니다.\n\n대화 내내 제가 하는 말에 경청해주시고 제 욕구를 빠르게 파악해 이해해주시니 영혼의 단짝을 만난 것 마냥 기분이 좋았습니다. 안전한 분위기 속에 터놓고 얘기할 수 있는 기회를 누린 것 자체로 어둡던 마음이 환해졌어요.\n\n선생님께서 해주신 조언 덕에 문제를 해결할 의지와 힘까지 얻어갑니다. 감사합니다.',172),(192,'2020-01-13 00:00:00.000000',3.5,'답답했던 고민거리를 조금이나마 해소할 수 있었습니다.\n고맙습니다.',173),(193,'2020-01-09 00:00:00.000000',5,'현실적인조언을해주셔서감사햇어요',174),(194,'2020-01-07 00:00:00.000000',5,'제 감정을 털어놓고 생각을 나눌 사람이 없었는데, \n제 이야기를 털어놓을 수 있는 공간이 있다는 자체가 위로가 되었던 거 같아요. 그 과정에서 상담사님께서 편하게 이야기할 수 있도록 신경 써주셔서 감사했구요\n\n가끔 이야기를 나누다보면\n내가 왜 이렇게 말하고 있나 돌이켜 생각해보면서\n제가 제 감정을 부정하거나 혹은 한쪽으로 치우쳐 생각하는 경우가 있더라구요 그런 걸 생각해 볼 수 있어서 좋았어요\n\n그리고 실질적인 계획도 세울 수 있게 도와주시고 \n격려해주시는 점도 좋았어요',175),(195,'2020-01-04 00:00:00.000000',5,'습관적으로 말하던 대화내용에서 제 상처가 무엇이고 무엇을 갈망하고잇는지를 알수있었어요',176),(196,'2019-12-29 00:00:00.000000',4,'말하고 나니 좀 더 마음이 편해졌어요',177),(197,'2019-12-24 00:00:00.000000',5,'다른 사람들에게 쉽게 말할수 없었던 마음속 이야기를 할수 있어 좋았습니다. 내 이야기에 공감해주시고 긍정적인 말로 격려해주셔서 위로와 힘을 얻었습니다. 감사합니다.',178),(198,'2019-12-22 00:00:00.000000',5,'감사합니다\n\n',179),(199,'2019-12-09 00:00:00.000000',3,'재밌게 상담했습니다.',180),(200,'2019-11-30 00:00:00.000000',5,'공감해주시려고 하고 실질적으로 도움이 될 방안에 대해서 고민하고 계시다는 생각이 들어 이야기 하기가 편한듯 합니다. 두 번밖에 상담을 진행하지 않아 제 상태가 나아졌는지에 대한 확신은 없지만 그래도 열심히 노력해볼게요 감사합니다 상담사님',181),(201,'2019-11-30 00:00:00.000000',4,'저의 문제의 근본을 짚어주셔서 상담에 효과를 보았습니다.\n그게 큰 수확입니다\n\n ',182),(202,'2019-11-28 00:00:00.000000',5,'저는 위로나 공감보다는, 이해와 분석, 나 자신에 대해 \'아는\' 것이 필요했어요. 병원을 다니면서도 받을 수 없었던 그런 것들을 알게 돼서 좋았어요. \n\n특히 상담 외 시간에 스스로 감정을 돌아보며 적을 수 있던 게 도움이 됐어요. 병원 가면 길어야 15분, 딱 그 순간의 기분만 털어놓게 되는데 여기서는 평소에 느낀 점, 순간순간들의 상태를 적고, 그걸 스스로 돌아볼 수 있던 점이 특히 도움이 됐습니다. \n',183),(203,'2019-11-22 00:00:00.000000',4.5,'잘 들어주시고 많이 응원해주셔서 감사합니다 \n',184),(204,'2019-11-15 00:00:00.000000',5,'감사합니다',154),(205,'2019-11-15 00:00:00.000000',3.5,'1회 상담으로는 아직 잘 모르겠어요\n\n',185),(206,'2019-11-11 00:00:00.000000',5,'감사합니다',154),(207,'2019-11-04 00:00:00.000000',5,' 갑자기 너무 힘들어서 말씀드렸는데\n위로와 위안\n자기자신을 온전히 이해하고 받아들이라고\n말씀해주셔서\n감사합니다.',186),(208,'2019-10-31 00:00:00.000000',5,'50분을 2번 전화 상담을 했습니다. 전화음질이 썩 좋지는 않았지만 상담사님께 얘기를 하면서 제 마음을 정리하는 시간을 가졌습니다. 저의 알지 못하던 부분을 알게 되었고 제가 지금 필요한 부분을 말씀해주셨습니다. 앞으로 또 상처받고 힘든 상황이 닥칠때 말씀해주신 부분을 기억하면서 잘 극복하고 싶습니다',187),(209,'2019-10-31 00:00:00.000000',5,'짧은 상담이라 해결책은 아직이지만 제 상황이 누가 봐도 힘든 상황이라는 것은 인지했어요. 선생님께서도 진심으로 들어주시고 해 보길 잘 했다고 생각합니다.',188),(210,'2019-10-30 00:00:00.000000',4,'자존감을 높이는 구체적인 방법에 대해서 물어봤는데 많이 도움이 된것같습니다 감사합니다~^^',189),(211,'2019-10-26 00:00:00.000000',5,'감사합니다 ^^',190),(212,'2019-10-23 00:00:00.000000',4,'어려울 수 있는 공감도 차분하게 잘 해주시고 해결책도 차분하게 제시해주셔서 감사했습니다',191),(213,'2019-10-17 00:00:00.000000',4,'첫 상담이라  횡설수설했는데 잘 들어주셨어요. 똑같은 상황이라도 다르게 볼수 있는 연습을 해봐야겠다는 생각이 들었습니다.\n',192),(214,'2019-10-17 00:00:00.000000',5,'성심성의껏 내 얘기를 들어주고, 공감해주는 점이 가장 좋았다. 상담 선생님 중 가장 내 얘기를 들어준다는 느낌이 드는 분이었다. 상담시간에 딱 맞게 야멸차게 끊지도 않으셨고, 평상시에 나의 감정을 기록하게끔 해주신 점도 너무 도움이 되었다. 감사합니다 :) \n',193),(215,'2019-10-11 00:00:00.000000',5,'스스로에 대해 더 잘 아는 기회가 되었습니다',194),(216,'2019-10-08 00:00:00.000000',5,'추천해요\n',195),(217,'2019-10-08 00:00:00.000000',5,'지금 당장 시도해볼 수 있는 작은 솔루션을 제시해주셔서 좋았습니다.',196),(218,'2019-10-07 00:00:00.000000',5,'어떤 방향으로 상담이 진행되길 원하는지 먼저 물어봐주셔서 처음부터 그것에 대해서 제가 주도적으로 결정할 수 있었어요. 공감도 잘 해주시고 격려와 지지도 잘 해주셔서 좋았어요 ',197),(219,'2019-10-06 00:00:00.000000',5,'처음 이용해봐서 잘 몰라서 1회권 끊었었는데요 \n다회권으로 꾸준히 상담 받고싶네요\n따뜻한 말씀과 응원 감사합니다! :)',198),(220,'2019-10-04 00:00:00.000000',5,'차분히 들어주셔서 좋았습니다.',199),(221,'2019-09-29 00:00:00.000000',5,'감사합니다.',154),(222,'2019-09-26 00:00:00.000000',5,'감사합니다',154),(223,'2019-09-20 00:00:00.000000',5,'감사합니다.',200),(224,'2019-09-18 00:00:00.000000',5,'작디 작은 마음들까지도 놓치지 않고 돌아봐주셔서 감사합니다. 덕분에 더 큰 감정(우울,불안 등)으로 번지기 전에 바로 잡을 수 있어서 마음을 다스리는데 많은 도움이 되었습니다. 반복되는 고민으로 힘들어 할 때 마다 기다려주시고, 들어주셔서 감사합니다..',201),(225,'2019-09-11 00:00:00.000000',5,'혼자서 늘 끙끙 앓고 참아왔는데. 상담을 통해 많은 위안을 받았습니다. 가장 좋았던 점은 그저 들어주기만 하는 것이 아닌 나아가야할 발향을 제안해 주신 점이 큰 도움이 되었습니다. 현재 상황을 개선하기 위해 상담을 시작한거니까요. 선생님께 감사드립니다.',202),(226,'2019-09-07 00:00:00.000000',5,'가까운 사람이더라도 꺼내기 어려운 얘기를 상담사분과 하니 물론, 2회만으로 좋아질수는 없겠지만 그 고민에 대해 다시 생각해보는 시간이여서 좋았습니다.\n',203),(227,'2019-09-03 00:00:00.000000',5,'감사합니다.',154),(228,'2019-09-01 00:00:00.000000',5,'상담을 통해 이야기를 많이 털어놓은 거 같아요..이야기를 털어놓는 것 만으로도 복잡했던 생각이 정리되는 듯한 느낌을 받았습니다\n\n상담을 처음 받거나 부담감을 느낄때 괜찮은거 같아요\n\n',204),(229,'2019-08-29 00:00:00.000000',5,'정리되지 않은 이야기 속에서도 핵심을 잘 집어주시고, 마지막 정리도 와닿았고, 생각할 거리를 남겨주셔서 좋았습니다. 전문가에게 털어놓음으로써 공감받고 싶은 부분이 있었는데 다소 해소되어 \'하길 잘 한 것 같다.\' 고 생각합니다. 감사합니다. ',205),(230,'2019-08-25 00:00:00.000000',5,'감사합니다.',154),(231,'2019-08-21 00:00:00.000000',5,'감사합니다.',206),(232,'2019-08-19 00:00:00.000000',5,'경청해주셔서 좋았어요.',207),(233,'2019-08-09 00:00:00.000000',5,'뒤죽박죽 얘기 했는데, 차분히 들어주셨습니다. 정말 감사했습니다!',208),(234,'2019-08-07 00:00:00.000000',5,'저는 그동안 제가 가진 심리적인 고통이 낮다고 생각하고 무관심했었는데, 상담을 통해 지금 제가 힘든것들이 제가 지금까지 무관심했었던 제 과거와 연결되어 있다는걸 알게되었습니다. 그동안 왜 제가 힘들었고 이유없이 불안했는가에 대한 답을 찾은 것 같습니다. 심리상담은 뭔가 시작하는것도 부담스럽고 걱정도 됐었는데 그런 걱정이 무색할 정도로 제 속 마음을 털어놓을 수 있었습니다. 상담선생님께서 이야기를 편하게 들어주시고 도움이 되는 자료와 말씀을 건네주셔서 가능했던 것 같습니다. 앞으로 제 인생을 다른 관점으로 보고 어머니를 이해하는데 도움을 주셔서 감사해요. 말씀주신 것처럼 꼭 좋은 경찰이 되겠습니다!',209),(235,'2019-08-06 00:00:00.000000',5,'친절하실 뿐 만 아니라 끝까지 제 이야기를 들어주시고 간단한 검사를 시작해서 앞으로 어떻게 해야할지 방향성까지 잡아주셨어요. 말을 꺼내는 것 만으로도 위로가 된다는걸 다시 깨닫네요.. 실제로 제 이야기에 공감도 많이 해 주시고 그 감정에 대해 설명까지 잘 해주셔서 한결 마음이 가벼워 졌습니다. 들어주셔서 감사합니다.\n',210),(236,'2019-08-05 00:00:00.000000',5,'좋았습니다.\n텍스트보다는 전화통화가 더 좋을 것 같다는 생각도 듭니다.',211),(237,'2019-08-03 00:00:00.000000',5,'제 얘기에 대한 공감을 해주시고\n제 생각을 토대로 어떤 방향을 토대로 나아가야할지\n조언을 들을수 있었습니다\n',212),(238,'2019-07-26 00:00:00.000000',5,'시간이 주어져 있지만 성의것 차근차근 답해주셔서 항상 고민해왔던 문제가 해결된거같아요.\n',211),(239,'2019-07-23 00:00:00.000000',3.5,'상담 잘 들어주셔서 감사합니다\n',213),(240,'2019-07-14 00:00:00.000000',5,'답답한 마음에 무작정 시작한 상담이라 두서없이 얘기했는데도 잘 들어주시고 이해해주시더라구요..\n사실 직접 대면해서 하는 상담이 아니라\n그냥 얼핏보고 대충 대답하시는거 아닌가 싶었는데\n중간중간 답변해주시는걸 보면 제얘기에 집중해주시고 공감해주시려고 하시는게 느껴지더라구요\n대면해서 하는 상담보다 훨씬 더 좋았던것같습니다~!!!\n감사합니다*^^*\n',214),(241,'2018-08-01 00:00:00.000000',4.5,'처음에는 제가 계속 이야기하고 다 들어준 다음에\n해결방안을 잘 정리해서 말씀해주셨어요. 짧은 시간 이였지만 도움이 많이 됐어요.\n\n',215),(242,'2018-03-01 00:00:00.000000',5,'  좋았던 점: 이야기를 잘 들어준다  아쉬운 점:시간이 짧다',216),(243,'2018-03-02 00:00:00.000000',4,'  좋았던 점: 계속 말을 할 수 있도록 질문을 던져주어 좋았어요. 위로도 말 해주시구요.  아쉬운 점:크게 없었어요. ',217),(244,'2018-08-09 00:00:00.000000',5,'제 마음과 감정들 기분들을\n계속 공감해주신 부분이 정말 별것아닌 것 같아도\n가장 큰 힘을 주었구요 \n\n맑은 시선으로 저 얘기를 들어주신 덕분에\n제가 더 많은 얘기를 꺼낼 수 있어서\n상담후 제 마음도 맑고 깨끗해졌습니다',218),(245,'2018-12-05 00:00:00.000000',4.5,'고민을 잘 들어주셔서 마음이 한결 나아졌어요.\n따듯한 말씀 너무 감사하고 힘이 되었습니다!!',219),(246,'2018-06-07 00:00:00.000000',5,'  좋았던 점: 잘들어주시고 공감, 이해해주시면서 현실적인 대처방안을 말씀해주시는게 와닿았습니다.   아쉬운 점:없습니다. ',220),(247,'2017-09-09 00:00:00.000000',4.5,'  좋았던 점: 제 마음을 이해해주시고, 정리해주셔서 좋았어요. 질문들도 좋았습니다.  아쉬운 점:없었습니다!',221),(248,'2017-11-18 00:00:00.000000',5,'  좋았던 점: 질문을 잘 던져주셨어요  아쉬운 점:없습니다',222),(249,'2017-11-18 00:00:00.000000',5,'  좋았던 점: 잘 정리해 주셨고 좀 복잡했는데 다시 객관적으로 바라보게 되네요   아쉬운 점:_',223),(250,'2017-09-12 00:00:00.000000',5,'  좋았던 점: 차분히 잘 이끌어주셔서 감사합니다.  아쉬운 점:없어요 ^^',224),(251,'2018-08-15 00:00:00.000000',5,'감사했습니다',225),(252,'2018-05-05 00:00:00.000000',4.5,'  좋았던 점: 본일 일 같이 고려해주시는 모습이 좋았습니다.  아쉬운 점:처음 2회정도는 크게 도움이 안되었어요. 근데 이건 상담들 자체가 원래 그런것같네요',226),(253,'2018-08-16 00:00:00.000000',4.5,'자신에 대해서 돌아볼 수 있는 계기가 되었고 누군가에게 자신에 대해서 솔직하게 털어놓는걸 어려워했던 저에게 상담사님과의 대화를 통해 좋은 연습을 할 수 있어서 타인에게 솔직하게 마음을 보이는것에 대해 조금 용기를 낼 자신이 생겼습니다. 일방적인 얘기였는데도 잘 들어주신것 같아 너무 감사하네요.\n',227),(254,'2018-12-10 00:00:00.000000',4,'좋은점 : 차분히 제 이야기를 할 수 있게 기다리며 경청하시고 핵심적인 질문을 하심. 그리고 제 안에 자원과 장점을 찾아주시고 진심으로 응원해주셔서 좋았습니다 \n텍스트 상담이 만족스러워서 다음에는 전화상담을 해보고 싶습니다. \n\n아쉬운 점 : 시스템 관련 보안점. 1. 내용을 주고 받는데 글이 밀리고 읽은 글인데 숫자 1이 지워지지 않는 경우가 있습니다. 2. 혹시 pc로 이용할 수는 없는지 핸드폰으로 채팅하기에는 오타문제 타자속도가 느려서 답답합니다. 상담사 선생님 빠르게 답장해주셔서 좋았습니다',228),(255,'2018-06-11 00:00:00.000000',5,'  좋았던 점: 다양한 방법을 시도해 주시면서 제가 지금 상담을 통해 하고있는 것이 무엇인지, 더 노력해야할 부분은 어디인지, 객관적이고 진실하게 잘 짚어주셨어요. 위로가 되는 따뜻한 말씀도 감사했고, 진심으로 응원해주신다는 느낌도 많이 받아서 힘이 많이 됐습니다.  아쉬운 점:상담의 종결이, 이 시간이 와버린게 아쉬워요.ㅠㅠ 그동안 정말 많이 애써주셔서 너무너무 감사했어요.',229),(256,'2017-09-13 00:00:00.000000',4.5,'  좋았던 점: 제가 던진 물음에 원하는 대답을 정확히 들려주셨고, 그 대답을 기준으로 삼아 앞으로 나아갈 수 있을것같아요.  아쉬운 점:이번 대화에서는 없네요.. 감사합니다.',230),(257,'2019-02-14 00:00:00.000000',5,'상담을 처음 받아보았는데  제가 사회생활을 해오면서 대인관계 때문에 스트레스를 많이  받았는데 덕분에 상담사님께서 좋은 말씀을 해주셔서  많은 도움이 되었어요  앞으로 또 고민있을때 박철우 상담사님  찾겠습니다  얘기 잘 들어주셔서 감사합니다^^',231),(258,'2017-11-06 00:00:00.000000',3,'  좋았던 점: 그냥 들어준다는 자체 만으로도 좋았고 제 문제가 워낙 난해해서 상담사님도 힘드셨을텐데 들어주시고 공감해주셔서 감사해요  아쉬운 점:가끔 튕김',232),(259,'2017-11-06 00:00:00.000000',5,'  좋았던 점: 머릿속이 혼란스러워서 횡설수설 했는데도 잘 상담해주셨어요.\n저는 아는데도 외면했거든요. 상담사님이 잘 짚어주셨어요.  아쉬운 점:아쉬운점없어요',233),(260,'2019-06-15 00:00:00.000000',4.5,'처음 받아보는 상담이었는데, 차분하게 들어주시고 이해받는 느낌이 들어서 좋았어요. 앞으로도 심리치료를 받으며 더 저에게 솔직해지고 불안함을 없애고 싶어요. 불안이 있다는 것을 자각한 후 더 불안해(?)졌었는데 조금은 희망적인 기분이 들어요!\n',234),(261,'2019-03-16 00:00:00.000000',5,'긴 이야기를 잘 들어 주셨고  심정을 이해해주셨고 \n담백한 답변을 해주셨다. 내게 필요한 것들을 솔직하게 제안해주셔서 복잡할 것 없이 그것들을 위해 노력해 보고 싶은 마음이 생겼다. ',235),(262,'2019-07-02 00:00:00.000000',4,'짦은 2회기의 텍스트 상담이라 어떨지 걱정을 했는데 생각지 못했던 데서 변화의 방향성을 잡을 수 있었습니다.',236),(263,'2019-02-16 00:00:00.000000',3,'잘 들어주시고 저를 잘 이해하려고 노력하신게 느껴졌어요. 다만 뭔가 해결책이 뚜렷하게 나오진 않은 것 같지만 어쨋든 제가 노력해야 할 부분이라고 생각합니다..',237),(264,'2017-11-07 00:00:00.000000',3,'  좋았던 점: 편한 시간에 상담해주신점, 제 말에 함께 공감해신 점  아쉬운 점:채팅을 통해서 깊이 있는 대화까지 진전되지 못한 점',238),(265,'2017-09-22 00:00:00.000000',5,'  좋았던 점: 인정하기 싫었지만 알고 싶었던 저의 모습을 만나게 해주셔서 감사합니다  아쉬운 점:크게 없어요\n',239),(266,'2017-09-22 00:00:00.000000',3,'  좋았던 점: 상담 피드백을 드렸을 때 유연하게 받아들이고 수용해주셔서 감사했습니다.   아쉬운 점:상담사님께 아쉬운 점은 크게 없는 것 같습니다. 채팅상담 30분이 생각보다 짧네요',240),(267,'2018-05-04 00:00:00.000000',5,'  좋았던 점: 친절하게 잘 들어주시고 정확하게 말씀해 주셨습니다.  아쉬운 점:없었습니다.',241),(268,'2018-03-13 00:00:00.000000',5,'  좋았던 점: 잘들어줘서 고마웠네요\n어찌보면 대화할 사람이 찾고싶었던걸지도.\n  아쉬운 점:텍스트 상담이라는것 자체로 무언가를 확실하게 얻기는 힘들다.',242),(269,'2018-01-17 00:00:00.000000',5,'  좋았던 점: 공감보단 현실적인 조언이 더 필요했는데 짧은 시간동안 공감과 조언 모두 성심성의껏 해주셨던 것 같아 깊이 감사합니다.   아쉬운 점:없습니다.',243),(270,'2018-03-13 00:00:00.000000',4,'  좋았던 점: 편해요~ ㅎㅎ\n  아쉬운 점:없어요~\n',244),(271,'2019-05-28 00:00:00.000000',5,'의지할 수 있는 분이 생긴것 같아 하루를 살아가는데 조금 위안이됐어요 감사합니다.',245),(272,'2017-11-23 00:00:00.000000',3.5,'  좋았던 점: 잘 들어주십니다  아쉬운 점:마무리 피드백이 느렸어요',246),(273,'2019-02-19 00:00:00.000000',4.5,'책으로는 해결되지 않던 제 심리에 대한 궁금증을 풀어주셨습니다. 텍스트로 주고 받는 상담이라 반신 반의 했는데 괜한 걱정 한 것 같습니다. 친절하고 따뜻하게 말씀해 주셨고, 시간이 너무 짧게 느껴지는 상담이었습니다.',247),(274,'2018-12-21 00:00:00.000000',5,'잘 들어주세요',248),(275,'2019-06-18 00:00:00.000000',5,'혼자 고민하는것보다 털어놓는게 도움되는것같아요',249),(276,'2018-05-07 00:00:00.000000',5,'  좋았던 점: 전문적인 상담경험과 나에게 지금 일어난일이 어느정도 심각한지, 대체방안 등 조언해주셔서 넘 감사했어요  아쉬운 점:충분할거라 생각했던 시간이 너무 짧았네요 ㅎㅎ 다음엔 한시간 신청해야겠어요',250),(277,'2018-05-09 00:00:00.000000',3,'  좋았던 점: 해결책을 제시해주었다  아쉬운 점:너무 내 이야기만 한것 같다. 적절한 조언과 빠른 피드백이 있으면 좋을것 같다.',251),(278,'2018-01-27 00:00:00.000000',5,'  좋았던 점: 핵심도 잘 정리해주시고 천천히 기다려주시고 친절하셨습니다.  아쉬운 점:없습니다',252),(279,'2019-01-06 00:00:00.000000',5,'제가 저 스스로 어떻게 느끼는지 둔감한 편인데\n그 부분을 정확히 알려주셨습니다\n짧은 시간동안 저의 이야기를 들어주시고 속 내용을 이끌어주셔서 너무 좋았습니다!\n덕분에 병원도 용기내서 가볼수 있었어요! 감사합니다!\n',253),(280,'2017-11-10 00:00:00.000000',4,'  좋았던 점: 제 말에 경청해주시고 신중하게 말씀하시려는게 좋았습니다!  아쉬운 점:시간이 짧아서 그런가ㅜㅜ너무 제 말만 많이해서 그냥저냥 하소연만 해버렸네용..아쉽',254),(281,'2018-07-01 00:00:00.000000',5,'누군가에게 마음을 털어놓는 일, 또 나에게 가장 솔직해 질 수 있었던 이 시간에 감사합니다.\n감정이나 생각을 있는 그대로 표현하고 위로 받을 수 있어서 감사했고, 제가 돌볼 수 없었던 어린아이의 저 또한 이해해주시고 공감해주셔서 따뜻했어요. 감사합니다',255),(282,'2018-10-23 00:00:00.000000',2.5,'이것저것 솔직하게 털어놓는게 어려웠는데 친절하게 끝까지 들어주시고 위로해주셔서 감사했습니다.. 공감해주시고 위로해주셔서 감사합니다 ',256),(283,'2017-12-03 00:00:00.000000',5,'  좋았던 점: 상황에 맞춰서 얘기를 해줘서 고마웠어요\n잘들어주시는 만큼 통찰력있는 질문도 좋았구요\n제가 모르는 나를 알아가게 도와주셨어요ㅎㅎ  아쉬운 점:아쉬운 점은 크게 없었어요ㅎㅎ\n고맙습니다ㅎ',257),(284,'2017-10-10 00:00:00.000000',3.5,'  좋았던 점: 제가 몰랐던 부분들에 대해서 말해주셔서 좋었습니다.  아쉬운 점:좀 더 제 내면을 파고드는 조언들과 말들을 해주셨으면 좋겠어요. 나중에 가서는 이런 말들이 많아져서 좋았지만, 처음 부분엔 알만한 내용들만 반복되다보니 조금 아쉽기도 했습니다 ',258),(285,'2019-01-10 00:00:00.000000',5,'세심하게 얘기를 잘 들어주셔서 상담내내 마음이 편안해지는걸 느꼈어요 \n너무 감사합니다 ',259),(286,'2018-05-13 00:00:00.000000',4,'  좋았던 점: 공감을 장 해주시는 면이 좋았습니다  아쉬운 점:잘 모르겠습니다',260),(287,'2019-04-05 00:00:00.000000',5,'텍스트 상담이라 아무래도 비언어적 의사소통의 어려움을 많이 우려했는데. 상담사님도 그런 부분을 걱정해서 구체적으로 소통하길 바라셨고. 그래서 더 집중해주시고 내담자를 더 이해하려는 태도가 좋았습니다. \n세심하고 배려해주시려는 마음에 많이 위로가 됐어요',261),(288,'2018-05-15 00:00:00.000000',5,'  좋았던 점: 신중하게 이야기를 들어주시고.. 필요한 조언도 따뜻하게 잘 해주셔서 너무너무 좋았고  무거웠던 마음이 조금은 가벼워졌어요...^^ 어떻게 방향을 잡아야 할지 알려주셔서 좋았어요  아쉬운 점:없었어요^^\n',262),(289,'2017-12-10 00:00:00.000000',5,'  좋았던 점: 저 스스로도 몰랐던 부분을 되돌아볼기회를주셔서 좋았어요  아쉬운 점:크게없는것같습니다',263),(290,'2018-05-16 00:00:00.000000',5,'  좋았던 점: 길고 두서없는 이야기였지만 끝까지 진지하게 이야기를 잘 들어주셨습니다. 해결이 어려운 문제였지만 제가 앞으로 버텨나가도록 힘을 북돋아주셔서 감사합니다.  아쉬운 점:없습니다. 감사합니다.',264),(291,'2018-03-29 00:00:00.000000',0.5,'  좋았던 점: 도움받은게 없습니다  아쉬운 점:내 얘기만 하고 조언은 없었음.\n상담이 이런건가?\n내 얘기만 하다 끝남',265),(292,'2017-11-13 00:00:00.000000',5,'  좋았던 점: 중요한 내용을 짚어주셔서 좋았습니다  아쉬운 점:시간이 모잘라서 아쉬웠습니다',266),(293,'2019-01-20 00:00:00.000000',5,'차분히 잘들어주시고, 적절한 질문과 사례, 비유로 많은 생각을 하게 해주셔서 감사합니다.',267),(294,'2018-04-01 00:00:00.000000',5,'  좋았던 점: 이야기를 편하게 유도해 주시고 그 중에서 제가 미처 깨닫지 못했지만 문제가 되는 부분, 개선이 필요한 부분을 예리하게  아쉬운 점:시간이 너무 금방 가서 아쉬웠어요ㅎㅎ 다른 아쉬운 점은 없었습니다!',229),(295,'2017-08-14 00:00:00.000000',5,'  좋았던 점: 어떤 쪽에서 이야기를 해주길 원하시는지 물어봐주셔서 감사했어요 \n친구처럼 편하게 해주셔서 감사합니당  아쉬운 점:없습니당\n',268),(296,'2019-04-18 00:00:00.000000',5,'감사합니다!',154),(297,'2017-11-14 00:00:00.000000',4,'  좋았던 점: 이야기를 잘 들어주십니다  아쉬운 점:상담사님 말고 시스템상인지 마지막 상담결론을 내주시는 부분 이전에 별점을 매겨야해서, 제대로 읽지못하고 평가해야하고 감사인사도 못드린것도 아쉽네요',269),(298,'2019-05-16 00:00:00.000000',5,'좋았는데요\n처음이라서 그런지 별다른 말 없이 동감만 해주는 기분이였습니다\n하지만 많은 도움 됐습니다\n',270),(299,'2018-04-07 00:00:00.000000',4,'  좋았던 점: 공감을 잘 해주시구, 실제 상담사님 이야기도 같이 해주셔서 그게 좋았어요. 서로의 이야기를 꺼낼때 조금 가까워진 느낌이 들면서 저도 더 제 이야기를 할 수 있게 된거 같아요. 두번 상담하고 상담사님이 저에 대한 생각을 정리해서 주신 것도 좋았어요.  아쉬운 점:얼굴보고 하는 대화가 아니라 서로 타이핑 하며 갖는 시간 공백이 아쉬웠어요. 특히나 제 문제는 감정 표현에 대한 거라, 얼굴 마주보고 대화로 했다면 더 빠르게 상황이 파악되었을거 같아요.\n네 번을 결제했는데 생각보다 부족하네요.',271),(300,'2017-12-15 00:00:00.000000',4,'  좋았던 점: 제 생각을 잘 정리해주셨고 불안한 마음을 잘 위로? 웅원해주셨어요.\n  아쉬운 점:타자판이라.. 오타나 타자속도? 같은게 아쉬웠어요ㅠ',272),(301,'2018-05-21 00:00:00.000000',5,'  좋았던 점: 주의깊게 들어주시고, 올바른 생각의 방향을 잡아주시려 노력해주셨습니다. 많이 나아진 것 같아요. 감사합니다.  아쉬운 점:들어주시고 응원해주시는 데에 초점이 맞춰진 상담이었던 것 같습니다.',273),(302,'2018-09-18 00:00:00.000000',5,'솔직히 텍스트로 얼마만큼 상담이 가능할까 의구심이 들었던 것도 사실이에요 그런데 생각보다 훨씬 더 도움을 많이 받았습니다. \n',274),(303,'2019-03-04 00:00:00.000000',4.5,'상담사님은 차분하시고, 임의적인 해결책을 제시하는게 아니라 상담 받는 사람이 처한 사람의 상황에 대한 디테일 하나하나를 신경써서 들어주시는 방향으로 상담을 진행해주셨습니다. 그래서 내담자로서도 굉장히 마음을 열고 겪고 있는 문제들을 상의하기 편했습니다',275),(304,'2017-12-16 00:00:00.000000',3,'  좋았던 점: 차분한 느낌  아쉬운 점:30분이란 시간은 상담으로써 큰 의미가없는것 같아 아쉽네요.',276),(305,'2019-06-05 00:00:00.000000',4,'직접적인 해결책 제시를 요구한거에 대한 해결책에 대해 잘 알려주셔서 도움이 되었습니다. 비슷한 케이스에 대해 물으면 좋을거같아요~\n글쎄요 공감위로는 해주신거같으나 문자여서 그런지 많이 와닿진않았어요 그래도 다른 해결책을 제시해주셔서 그건좋았습니다~ ',245),(306,'2017-12-17 00:00:00.000000',5,'  좋았던 점: 정말 이야기를 잘 들어주셨고, 상담 신청 하기를 잘 했다고 생각합니다.  아쉬운 점:없습니다',277),(307,'2018-11-09 00:00:00.000000',5,'처음엔 반신반의했지만 진심으로 저를 돕고 싶어하시는 선생님과 대화를 하며 고민하던 문제가 해소되었습니다 제가 모르던 무의식적인 부분도 살펴주시고 현실적인 조언도 해주셔서 참 도움이 많이 되었습니다 감사합니다 선생님과 함께할 수 있어서 다행이었습니다',278),(308,'2017-08-20 00:00:00.000000',5,'  좋았던 점:  신중하게 저의 말에 집중해주셔서 좋았습니다. 또한 제가 썼던 글에서 상황을 정리해서 알려주셔서 감사드립니다. 그리고 상황에 대해 적절한 판단을 해주셔서 지적해주시니 잘 수긍이 되는 것 같습니다.  아쉬운 점:없습니다.',279),(309,'2017-12-19 00:00:00.000000',4,'  좋았던 점: 제 생각을 잘 정리해주셨고 불안한 마음을 잘 위로? 웅원해주셨어요.\n  아쉬운 점:타자판이라.. 오타나 타자속도? 같은게 아쉬웠어요ㅠ',272),(310,'2017-12-19 00:00:00.000000',5,'  좋았던 점: 잘 들어주시네요  아쉬운 점:시간이  짧네요 결제를 부르는...',280),(311,'2018-04-11 00:00:00.000000',5,'  좋았던 점: 상담후 마음이 편해졌고 이겨낼수있는 희망이 생겼습니다  아쉬운 점:실제 면담이 아닌점이라 마음을 표현하기엔 어려웠지만 많이 전달된거 같아 만족스러웠습니다',281),(312,'2018-07-20 00:00:00.000000',5,'고장난 나침반 하나 쥐고 새카만 밤에 숲속에서 긿을 잃은 상태였어요. 다 내가 이상하고 감당안되는 나한테 지쳤었어요. 상담사님과 상담하며 내가 왜 그러는지,어떻게 해볼지를 알고 내 속의’나’를 보게 됐어요. 상담 정말 잘했어요.상담사님 정말감사드려요.',282),(313,'2019-06-26 00:00:00.000000',5,'정성껏 상담을 진행해주셨습니다.\n',283),(314,'2019-05-19 00:00:00.000000',5,'잘 듣고 대답해주셨다. 공감과 위로가 필요한 분들께 좋을 것 같다. 내가 원했던 객관적인 시선을 더해주셨고 어떻게할까요? 라는 질문에 구체적인 방법도 알려주셨다. \n',284),(315,'2019-06-26 00:00:00.000000',4,'잘 들어주고 공감해 주시며 무엇이 근본적인 원인인지 함께 찾아가려 노력하심',285),(316,'2018-05-27 00:00:00.000000',5,'  좋았던 점: 섣불리 상황을 속단하지않으시고 신중히 접근해주셔서 좋았습니다\n  아쉬운 점:상담시간이 부족하다고 느껴졌던게 되려 제가 아쉬웠습니다',286),(317,'2018-07-21 00:00:00.000000',5,'일상생활이 거의 불가능한 수준의 저에게 스스로를 직면할 수 있도록 많이 도와주셨습니다. 무엇보다도 제가 잘못한 것이 아니라는 것을 알게 되었고, 나 자신을 받아들일 수 있게 되었습니다. 또한 진심으로 대해주셨고, 불안감도 훨씬 가라앉고 편안해졌습니다.',287),(318,'2018-05-29 00:00:00.000000',3,'  좋았던 점: 신중히 답해주시는게 느껴졌습니다  아쉬운 점:딱히 없었습니다',288),(319,'2019-06-27 00:00:00.000000',5,'상담 받은지 시간이 좀 지났는데 그때 생각해 보면 짧은 시간이었어도 이야기를 잘 들어주시고 저를 위해 애써주셨다는 생각이 듭니다. 감사합니다.',289),(320,'2017-11-01 00:00:00.000000',5,'  좋았던 점: 제 말을 경청해준단 느낌이었어요. 신중하게 답해주시는 것같고요.\n걱정했는데 편하게 할말을 할수 있어서 좋아요.\n단회기라 시간이 부족해 아쉽지만 도움이 되었습니다^^  아쉬운 점:이번상담엔 딱히 없어요',290),(321,'2017-11-16 00:00:00.000000',5,'  좋았던 점: 속시원해요  아쉬운 점:크게없습니다',291),(322,'2017-12-23 00:00:00.000000',5,'  좋았던 점: 차분하게 잘 들어주셨고, 짧지만 제가 생각 못했던 것들을 물어봐주셔서 스스로 문제의 근원에 대해서 다시 생각해 볼 수 있었습니다. 짧은 시간이었는데 제 상황을 잘 정리해주셔서 좋았습니다.  아쉬운 점:-',292),(323,'2019-06-28 00:00:00.000000',5,'상담사님의 소개에 나온 ‘뚜렷한 이유가 없는데 불편감을 느껴온 사람’이 딱 저인 듯하여 마음이 움직였어요. 평소에는 사소한 결정도 신중한 편인데, 많이 고민하지 않고 시도해 보길 잘 했다는 생각이 듭니다. \n서두르지 않고 이야기를 하나 하나 풀어갈 수 있게 도와주신 덕분에 상담 전에는 알 수 없었던 저에 대한 많은 부분들을 바라 보게 되었습니다. 적절하게 상황을 읽어 내려갈 수 있도록 해주시면서도, 동시에 따뜻한 위로가 함께 하는 상담이었어요.',293),(324,'2017-11-06 00:00:00.000000',5,'  좋았던 점: 솔직해 질 수 있도록 포용해 주시지만 그만큼 솔직한 피드백을 받아서 많은걸 느끼고 빠른 시간 안에 큰 도움이 됐어요.  아쉬운 점:별로 없네요',294),(325,'2019-05-21 00:00:00.000000',5,'짧은 시간 이었지만 다시 한번 스스로를 되돌아 보게 되었습니다. 다시 한번 스스로 풀어야 하는 숙제를 안고 저는 다시 저의 삶으로 복귀 합니다! 상담사님 덕분에 저의 문제가 더 명확해 졌어요. 너무 감사 드립니다! 삶을 살아가다 다시 무너지면 찾아뵐게요.',295),(326,'2017-11-02 00:00:00.000000',4.5,'  좋았던 점: 제 이야기를 다 듣고 알지못했던 점, 생각하지 못했던 점을 알려주셔서 문제를 다르게 볼 수 있었던 것 같습니다.  아쉬운 점:딱히 없었던 것 같습니다.',296),(327,'2019-06-28 00:00:00.000000',5,'저는 처음들어와서 어떻게이야기를해야할지 모랐고  내가당한일들이꼬리처럼딸아오니까 힘들었는데 이제는 제가조금씩밖에나갈려고노력하는중이고친구들한테도이야기할려고노럭중입니다',297),(328,'2017-12-28 00:00:00.000000',5,'  좋았던 점: 잘 이끌어주셨어요  아쉬운 점:크게 없었습니다',298),(329,'2019-06-28 00:00:00.000000',5,'상담내내 무거운 얘기였음에도 잘들어주시고 제가 얘기하면서 중간중간 콕짚어서 물어봐주셔서 제 감정을 똑바로 볼수있게됐어요 아직 많이 자존감도 낮고 상처가 있지만 상담전에는 제상처가 수치스럽고 창피해서 무의식중에 깊이 묻어놓으면서 점점 곪아가고있었는데 상담을 하면서 점점 제상처와 마주할수있게된거같아요 감사합니다! 다음에 힘들때 또 상담할게요 ',299),(330,'2018-07-31 00:00:00.000000',5,'제 이야기를 끝까지 다 들어주시고 대화의 방향도 잘 잡아주셔서 생각이 정리되는 데에 도움이 많이 되었습니다.  부정적인 감정의 원인이 되는, 의식하지 않았던 부분들에 대해서 알 수 있었고 변화에 대한 격려도 아낌없이 받을 수 있어 좋았습니다. ',300),(331,'2019-05-21 00:00:00.000000',5,'오랜만에 정말 좋다고 느낀 상담이였어요\n강력추천 합니다 :) ',301),(332,'2018-04-21 00:00:00.000000',3,'  좋았던 점: 이야기를 잘 들어주셨어요.\n답이 정해져있지 않은 주제에 제가 스스로 말하면서 문제를 객관적으로 볼 수 있었어요.  아쉬운 점:시간이 짧아서 아쉬워요.\n',302),(333,'2018-11-27 00:00:00.000000',5,'이야기\n들어주셔서 한결 마음이 편안해지고\n생각정리하는데 도움이 크게 됐어요^^\n',303),(334,'2020-06-22 00:00:00.000000',5,'적절한 예시와 구체적인 해결 방안을 말씀해 주셔서 좋았어요. 제 상황을 객관적으로 볼 수 있게되어 정말 큰 도움이 되었습니다. 공감도 잘 해주셨구요. 또 큰 고민이 생긴다면 연락드릴게요. 감사합니다!',304),(335,'2020-06-21 00:00:00.000000',5,'좋았어요.',305),(336,'2020-06-20 00:00:00.000000',5,'얘기도 잘 들어주시고 공감해주시고, 도움이 될만한 요소들 많이 알려주셔서 감사했습니다.',306),(337,'2020-06-19 00:00:00.000000',5,'화가 나고 우울해서 감정이 너무 요동치는 가운데 응급처치 받은 기분입니다! 너무나 명쾌하고 현명하게 도움되는 조언을 주셔서 바로 실천해 볼 수 있을 것 같습니다. 상담 후 따뜻한 차 한잔 하면서 제 자신을 잘 다독여보겠습니다 정말 많은 도움이 되었습니다 추천합니다!♡♡♡♡',307),(338,'2020-06-18 00:00:00.000000',5,'덕분에 마음 많이 편해졌습니다 감사합니다:)\n',308),(339,'2020-06-18 00:00:00.000000',5,'고민에 대해 해결 