방안을 알려주셨습니다.저의 살아온 삶을 왜 그렇게 살수 밖에 없었는지를 정말 훤히 다 들여다 본듯 집어 주셨습니다.상담사님 말씀데로 실천하니 놀랍게도 제자신이 변화가 되었습니다.오랫동안 병원에서 약처방만 받았었는데 이제는 약도 줄이고 끊을수 있게 된것 같아요~다음에 어려우면 또 신청하고 지인들에게도 소개 시켜 줄려고 합니다.너무 감동을 많이 받았습니다.심지현 상담사님 너무 감사드립니다.',324),(356,'2020-06-02 00:00:00.000000',5,'늦은 시간 횡설수설 말씀드렸는데 정확히 파악하시고 \n객관적으로 상담해주셔서 알려주신 방법대로 \n제가 노력하면 방향 잡을 수 있을 것 같습니다. \n큰 도움되었습니다 감사합니다..! ',325),(357,'2020-06-02 00:00:00.000000',5,'어떤 마음가짐을 가져야하는지 조금은 깨닫게되어 편안해졌습니다',326),(358,'2020-06-01 00:00:00.000000',5,'정말 좋앗어요...처음에 숨이 텅막히고 너무 힘들엇지만 이겨낼 용기가 조금 생겼어요',327),(359,'2020-05-28 00:00:00.000000',5,'선생님! 정말 소진되고 힘든 마음에 물을 주셔서 감사합니다. 인생 선배님의 말을 들은 것 같아 마음이 뿌듯하고 좋네요. 감사합니다. 좋은 날들 가득하시길 바랄게요.',328),(360,'2020-05-27 00:00:00.000000',5,'이야기를 많이 들어주셔서 좋았습니다. 그동안 상담하며 뭔가 내 자신이나 상대방에 대한 감정을 깨닫거나 이해를 돕기위한 말씀보단 묵묵히 들어주시고 가볍게 정리해주셔서 답답한 마음이 나아졌습니다',329),(361,'2020-05-27 00:00:00.000000',5,'잘 들어주셔서 공감받는 느낌이였습니다',330),(362,'2020-05-27 00:00:00.000000',5,'네 일단 해결책주신것들을 실천해보려구요^^  감사합니다',331),(363,'2020-05-26 00:00:00.000000',5,'상담 전 걱정과 달리 편안하게 대화할 수 있었어요. ',332),(364,'2020-05-25 00:00:00.000000',5,'정말 의사같지도 않은 사람한테 정신과진료받으러 갔다가 가스라이팅당하고 엉엉 울고....진짜 어떻게 해야할 지 모를정도로 상태가 안좋았는데 선생님이랑 이야기하면서 화난거도 해소하고 나니까 진정이 되었어요.. 이후에는 이야기들어 주시면서 위로고 해주시는데 너무너무너무 감사했어요...어떻게 말해야 하루지 모르겠는데 마음이 조금은 든든해진 느낌이에요 정말 오늘 살려주셔서 감사합니다 ㅠㅠㅠ',333),(365,'2020-05-25 00:00:00.000000',5,'짧은시간에 저의 마음을 잘 아시고 실천방안도 말씀 해주시고 마음이 편안했어요.',334),(366,'2020-05-24 00:00:00.000000',5,'감사합니다. ^^ \n상담하고 나서 답답한마음이  편안해졌습니다. \n상담사님이 제안해주신 방법을 꼭 실행에 옮겨서 더욱더 편안해 질 수 있도록 하겠습니다.\n들어주셔서 너무 감사합니다.\n',335),(367,'2020-05-24 00:00:00.000000',5,'감사합니다\n일단 어디다도 말할수 없는것을 들어주셔서 감사드리고\n이제 제가 잘 풀어가야될 문제네요\n상담을 받을까말까 예전에도 고민 많이 했는데\n이번에 받길 정말 잘했다고 생각됩니다\n어디에다 얘기를 못해서 \n평소에도 늘 내가 문제아고 내가 잘못됬나 생각 되었는데 그 부분을 잘 잡아주셔서 감사드립니다\n',336),(368,'2020-05-23 00:00:00.000000',5,'상담사님께서 제 편이 되어주셔서 정말 감사했습니다. 위로받고 지지받을 수 있어서 정말 좋았던 시간이었습니다. ',337),(369,'2020-05-20 00:00:00.000000',5,'많이 혼란스럽고 지쳐서 너무 답답했는데 위로가 되었습니다\n상담센타의 대면 상담이 망설여졌는데 계속 망설이다 보니 문제가 커졌습니다\n\n답답하시다면 망설이지 말고 일단 푸세요\n음성상담은 말할때 힘드시다면\n텍스트상담은 정리가 되고 좋습니다\n\n그리고 궁금햇던\n명상상담센터에 대해 정보를 얻었습니다\n\n힘드신분들 극적 선택 마시고 제발 말씀하세요 ~',338),(370,'2020-05-19 00:00:00.000000',5,'감사합니다\n노력해볼게요',339),(371,'2020-05-19 00:00:00.000000',5,'짧은 시간동안 들어주시고 조언해주셔서 감사합니다. 힘이 되었어요 :)\n',340),(372,'2020-05-18 00:00:00.000000',5,'선생님께서는 제 자신을 돌아보고 위로 할 수 있는 솔루션을 많이 주셨어요. 선생님 말씀대로 꾸준히 실천하다보면 느리지만 변화하는 저를 보게 되어 정말 신기했습니다. 감서해요 선생님 :)',341),(373,'2020-05-18 00:00:00.000000',5,'진지하게 제 이야기를 들어 주시고 공감해주셨어요. 더불어 현실성 있는 조언 감사했습니다. 알려주신 방법으로 한번 제 자신을 돌아보도록 할게요~~!!! 다시 긍정적인 사람이 되도록 노력 할게요',342),(374,'2020-05-17 00:00:00.000000',5,'조언을 많이 해주셨어요! 노력해보겠습니다!\n',343),(375,'2020-05-16 00:00:00.000000',4,'제 고민을 짚어주시려고 노력하고, 또 실질적인 해결방안도 제시해주셨습니다. ',344),(376,'2020-05-14 00:00:00.000000',5,'자신이 생각하던 이야기도 전문가를 통해 다시 한번 확인을 하면 확신이 되고 용기에 물을부어주어 용기가 더욱 빨리 자라나게 하는것 같습니다. 상담사 선생님 덕분에 더욱 명확하게 정리가 되었고 마음의 불편함들이 해소되고 정리 되었습니다.\n앞으로는 더욱 올바른 결정들을 만들어가며 살아갈 제 인생이 기대됩니다.',345),(377,'2020-05-13 00:00:00.000000',5,'마음 잘 챙길 수 있도록 노력해볼게오 감사합니다',346),(378,'2020-05-12 00:00:00.000000',5,'감사합니다. ',347),(379,'2020-05-12 00:00:00.000000',5,'이제까지 가족만 생각하고 나를 돌아보지않아서 힘들었어요. 상담전에는 왜 힘든지 몰랐는데 나를 지키지않아서 힘들었던거였어요.\n상담을 통해 나를 돌아보는 시간이 되어서 마음이 한결 가벼워졌습니다. 감사해요',348),(380,'2020-05-12 00:00:00.000000',5,'요즘 매일 반복되는 일상들을 보내며 한없이 무기력해지고 우울함에 빠져있던 나를 돌아보게되는 소중한 시간이었다고 생각됩니다. 고민을 길게 작성하여도 하나씩 읽어보시고 조언도 해주시니 마음의 위로도 많이 받고가는거같습니다\n',349),(381,'2020-05-09 00:00:00.000000',5,'좋은 길을 찾게 해주셔서 감사합니다ㅎ',350),(382,'2020-05-07 00:00:00.000000',5,'감사합니다',351),(383,'2020-05-06 00:00:00.000000',5,'네 침착하게 저랑 말씀해주셔서 좋았어요. 현실적인 조언도 감사합니다. ',352),(384,'2020-05-06 00:00:00.000000',5,'상담을 받고 나니 생각정리하는데 도움이 되서 너무 좋은거같애요! ',352),(385,'2020-05-06 00:00:00.000000',5,'감사합니다',353),(386,'2020-05-05 00:00:00.000000',4,'좋았습니다',354),(387,'2020-05-05 00:00:00.000000',5,'강추합니다 정말 공감도 잘해주시고 도움되는 말씀을 많이 해주셨습니다 다음에 힘든일 있으면 꼭 다시 뵙고싶다는 생각을 했습니다.',355),(388,'2020-05-04 00:00:00.000000',5,'얘기를 나누며 내가 나를\n조금은 들여다볼수있었던거같아요\n내가 나의 마음을 들여다보는것만으로도\n답은 나도 알고있더라구요\n\n',356),(389,'2020-05-02 00:00:00.000000',5,'핵심적인 조언을 주셔서 감사드렸습니다.',357),(390,'2020-05-01 00:00:00.000000',5,'늦은시간이었지만\n정말 답답하고 힘들었거든여 \n용기가 조금 생겼어요\n\n고민이 해결된거같아서 마음도 편해졌구요\n\n감사합니다',358),(391,'2020-04-27 00:00:00.000000',5,'고민이 있었고 그것때문에 스트레스를 많이 받던 차에 선생님을 만나게 되었습니다. 제가 하는 말을 차분히 들어주시면서 제가 가지고 있었던 걱정을 하나하나 풀어주려 노력하셨고 제 생각의 방향을 다시 잡아주시고 해결이 될만한 조언들을 빠짐없이 해주셔서 선생님께 다시 한번 감사하다고 전하고 싶어요. 상담이 끝나는 시점까지 제가 주눅들거나 혼자 속상해하지말고 당당해졌으면 좋겠다고 신신당부(?)해주시는 걸 보면서 진심어린 선생님의 마음이 느껴져서 너무나 감사했습니다. 오늘 걱정했던 것의 결과가 있는 날이라, 사실 제 원래 생각은 그 결과와 함께 선생님께 감사한 마음을 상담후기에 전하려고 했는데요. 그 결과를 알기 전에 선생님과 상담했던 내용들을 다시 읽으며 제 마음을 다시 한번 환기시켜야겠다고 생각하고 지난 상담내역에 들어왔더니, 상담후기를 작성해야지만 선생님과 나누었던 상담내역을 볼 수 있나봐요. 오늘 저한테 좋은 결과가 있다면 감사 인사와 함께 좋은 결과까지 선생님께 전하고 싶었지만 그럴 수가 없어서 좀 아쉽긴 하지만, 어쨌든 선생님께 다시 한번 감사드린다는 말을 꼭 전하고 싶네요. 모쪼록 선생님께서 용기내라고 북돋아주신만큼 오늘의 저한테도 좋은 결과가 있길 바라구요. 선생님께 다시 한번 감사하다는 말씀드리고 싶습니다. 고맙습니다, 선생님!',359),(392,'2020-04-27 00:00:00.000000',5,'다음주에 뵈요 선생님 :)\n감사합니다\n',360),(393,'2020-04-24 00:00:00.000000',5,'실질적인 실천방안을 알려주셔서 도움됐어요.',361),(394,'2020-04-23 00:00:00.000000',5,'매우 만족스러웠습니다 감사합니다 ^^',351),(395,'2020-04-22 00:00:00.000000',5,'따듯한 상담 감사합니다!',362),(396,'2020-04-18 00:00:00.000000',5,'도움되었습니다',363),(397,'2020-04-18 00:00:00.000000',5,'상담진행중입니다. 답답함 마음ㅇ 조금 가라앉았어요',364),(398,'2020-04-18 00:00:00.000000',4,'저는 고민해결보다는 그냥 말할 사람이 없어서, 누구에게라도 털어놓고 싶어서 상담을 시작한거였습니다.\n고민을 들어주셔서 감사합니다.\n\n가끔 맞춤법이 틀리실 때마다 신뢰가 점점 줄어드는 점이 있으니 천천히 터이핑 하시더라도 맞춤법은 꼭 지켜주셨으면하는 개인적인 바램입니다.\n\n말하고있는데 다른 질문을 하면서 끊은 적이 있는데, 내담자가 답변을 다 하기전까지 기다림도 필요할 것 같습니다.\n\n그래도 열심히 답을 해주려고 노력하시는 모습에 감사했습니다.\n짧은 시간동안 고생많으셨습니다 감사합니다.\n\n수고하셨습니다.',365),(399,'2020-04-16 00:00:00.000000',5,'도움되었습니다',363),(400,'2020-04-14 00:00:00.000000',5,'나의  직업이  상담사라서 처음에는  걱정도  되고,  너무  어색하고,  어떻게  내말을  꺼내야  할지  몰라서  망설여지고, 불안함과  두려움도   많이  느껴졌는데...상담사님께서  편안한  분위기를  만들어주셔서   정말  편안하게  내  자신의  이야기를  하게  되었습니다.\n가르쳐  주신  방법대로  꼭  실천해보고,  힘들고  지치면  꼭  다시  찾아가겠습니다.\n',366),(401,'2020-04-13 00:00:00.000000',5,'감사합니다 제가 왜 힘들었는지 구체적으로 이유를 알게됐어요',367),(402,'2020-04-12 00:00:00.000000',5,'도움이되었어요',368),(403,'2020-04-08 00:00:00.000000',5,'차분하셔서 참 마음에 들었습니다! 가슴을 울리는 말한마디와 격려도 감사했습니다',369),(404,'2020-04-08 00:00:00.000000',4.5,'우울했던 마음이 많이 해소 되었습니다.감사합니다',370),(405,'2020-04-06 00:00:00.000000',5,'이야기를 잘 들어주시고 문제점도 잘 진단해주시고 \n제가 고민하고 있던 덩어리들을 잘 꺼내서 가루로 만들어주신 느낌이에요. 공감도 차분하게 잘 해주시고 생각지도 못한 부분까지 싹싹 긁어내주셨어요! 정말 상담 받길 잘했다는 생각이 들어요 여러분들도 고민하지마시고 일단 받아보세요 문자로는 표현이 안될 정도로 정말 만족했습니다. 제 이야기 잘 들어주셔서 감사하구요. 제가 생각하지 못했던 부분까지도 생각해볼 수 있게 해주셔서 감사합니다. \n',371),(406,'2020-04-05 00:00:00.000000',5,'언제까지 효과있을지는 아직 모르겠지만, 기대 이상의 마음의 안식을 얻었습니다. 감사합니다.',372),(407,'2020-04-03 00:00:00.000000',3.5,'괜찮다고 생각합니다\n',373),(408,'2020-04-03 00:00:00.000000',5,'좋았습니다. 감사합니다.',374),(409,'2020-04-02 00:00:00.000000',5,'마음이 많이 풀어졌습니다',375),(410,'2020-04-02 00:00:00.000000',5,'감사합니다',376),(411,'2020-04-02 00:00:00.000000',5,'어수선한 상황에 머리가 복잡했는데 전문가의 의견이 합리적인 해결을 목표로 할 수 있는 물꼬를 터 주시고 나를 탓하기보다 나의 자존감은 높이고 상대방의 그릇된 점은 분명히 직시하여 죄의식에서 벗어나게 도와주셨어요.\n정말 감사합니다. ',377),(412,'2020-04-01 00:00:00.000000',5,'선택이라는 새로운 관점을 알 수 있어서 좋았습니다. 이야기를 잘 들어주셔서 감사했습니다\n',378),(413,'2020-04-01 00:00:00.000000',5,'마음이 편해지고 도움이 정말 많이 되었습니다! 상담받길 잘했다는 생각이 들어요!! 감사합니다~~',379),(414,'2020-03-31 00:00:00.000000',5,'제마음을 읽어주시려고 노력해주셨고\n현실적인 조언이 들어가서 너무 좋았어요\n위로가 많이 되었어요,,,',380),(415,'2020-03-31 00:00:00.000000',5,'마음이 흔들릴때 공감과 지지를 받아 힘을 얻었어요 감사해요^^ ',381),(416,'2020-03-31 00:00:00.000000',5,'차분하게 얘기를 들어주시다가 상황을 객관적으로 볼 수 있게 해주셔서 좋았습니다 덕분에 저를 잘 돌아볼 수 있었어요',382),(417,'2020-03-30 00:00:00.000000',5,'죽을만큼 힘들고 감정에 갇혀서 아무것도 못하고 있었는데요... 상담하고 나서 조금은 괜찮아졌습니다.',383),(418,'2020-03-30 00:00:00.000000',5,'50분 한번인 전화상담으로 저의 오래 지속된 우울에 도움이 될까 하는 마음이 들었지만, 상담사 선생님께서 1분 1초 채워서 어떻게든 도움되어주시려고 하셔서 감명깊었습니다. 그래서 정말 알찬 50분이 된 것 같아요.\n\n제 이야기 듣고 공감해주시고, 실생활에 적용할수 있는 방법들을 많이 알려주시고 도움되는 말도 많이 해주셔서 좋았어요. 말씀해주신 방법 잘 적용해서 우울호수에 빠져서 허우적거리지 말고 위에서 여유롭게 배타고 노는 날이 왔으면 좋겠네요. 감사합니다. ',384),(419,'2020-03-30 00:00:00.000000',5,'말씀도 잘 들어주시고 그냥 힘내라 그럴수있다가아니라 상황별로 섬세하게 잘 얘기해주시고 엄마처럼 따뜻한 조언도 많이들었어요. 정말 감사합니다',385),(420,'2020-03-27 00:00:00.000000',5,'진심으로감사합니다',356),(421,'2020-03-27 00:00:00.000000',5,'공감도 해주시고 엄마처럼 이야기해주셔서 너무 좋았어요 ㅠㅠ\n\n그리고 무조건적인 공감이아니라 객관적으로 생각해 볼수있게 도와주셔서\n\n\n너무 감사해요♡♡♡♡\n\n\n힘들때 또 전화하고 싶네요 !!!+',386),(422,'2020-03-26 00:00:00.000000',5,'너무좋았어요~~',387),(423,'2020-03-24 00:00:00.000000',5,'제 고민을 잘 들어주셔서 고민이 잘 정리되었어요\n\n잘 들어주시는 것만으로도 도움이 많이 되었습니다.\n\n기회가 되면 또 다시 상담을 하면서 도움받고싶어요\n',388),(424,'2020-03-24 00:00:00.000000',5,'일단 따뜻한 말이 위로가 많이 되었어요\n또 위로에 그치지 않고 대안을 제시해주시는 모습이 참 좋았어요\n마음의 상처가 다 낫지는 않았지만\n좋은 길잡이가 되어주셨습니다',389),(425,'2020-03-23 00:00:00.000000',5,'큰틀에서 봐서 도움이 되었구요. 구체적으로 방법 까지 알려주어 고맙습니다. 차근히 잘들어주시고 제안해주시네요~',390),(426,'2020-03-22 00:00:00.000000',5,'한번도 내 문제에대해 가족외 친구나 남자친구한테 말하지못했었는데 다시한번 조언을 듣고 마음을 다 잡을수잌ㅅ는 기회였던거같당 ㅜㅜ  일시적으로 스트레스가 너무커서 신청했는데 한시간동안 다시한번 내 문제에대해 생각해보는시간이여서 도움이됬다 !',391),(427,'2020-03-21 00:00:00.000000',5,'너무 도움이 되었습니다 감사합니다',363),(428,'2020-03-21 00:00:00.000000',5,'문제점을 잘 파악하고 정리해 주셔서 좋았어요',392),(429,'2020-03-20 00:00:00.000000',4,'구체적인 해결방법을 말씀해주셔서 감사했어요. 몇몇 조언들은 실행에 옮기고도 싶구요. 그런데 제가 바로 상담을 신청할 정도로 있었던 답답함은 많이 풀리지 못했어요. 왜냐하면 저는 감정을 상담사님이 공감을 해주실줄알았거든요. 이 답답함을 공감을 통해 풀어야 해결의 단계로 넘어갈 수 있는데 그게 안되서 아쉬었어요. 그렇지만 상담을 통해 해결하기보다는 더 근본적이고 실질적인 해결책을 주고 싶으셔서 그렇게 말씀하신거라는것도 알아요. 한시간동안 저에게 집중해주셔서 정말 감사합니다.\n',393),(430,'2020-03-19 00:00:00.000000',5,'감사합니다 도움되었어요!',394),(431,'2020-03-19 00:00:00.000000',5,'감사합니다*',395),(432,'2020-03-17 00:00:00.000000',5,'제 이야기를 선입견을 가지지 않고 보아주셔서 감사합니다\n많은 도움이 되었고 또 한 번 상담해보고싶네용ㅎㅎ',396),(433,'2020-03-15 00:00:00.000000',5,'감사합니다. 이런 늦은 시간 약간 우울했던 고민을 털어놓고 피드백을 들을 수 있어 아주 만족스러웠습니다. 감사합니다. 좋은 어플이에요. 선생님이 조언해주신대로 잘 행동하도록 하겠습니다.',397),(434,'2020-03-11 00:00:00.000000',5,'너무 좋으시구 따뜻하게 도움주셔서 너무 감사하구 다음에 또 부탁드리고 싶어요',398),(435,'2020-03-10 00:00:00.000000',5,'생각이 정리되고 좋았습니다\n',399),(436,'2020-03-06 00:00:00.000000',5,'네 너무감사해요\n',400),(437,'2020-02-27 00:00:00.000000',5,'해결방안을알려주서서 참감사합니다',401),(438,'2020-02-25 00:00:00.000000',4.5,'오랫동안마음에담아놓고 힘든일을 이해해주셔서감사합니다. 그리고 방법을 알려주셔서 감사합니다. 노력해보고 말씀하신방법을 실천해보고 추천하신책도 읽고 더 노력할께요..^^',402),(439,'2020-02-20 00:00:00.000000',5,'저의 이야기를 잘 들어주셔서 좋았고, 제가 하는 질문에 성심성의껏 대답해주셔서 만족스러웠습니다',403),(440,'2020-02-04 00:00:00.000000',5,'감사합니디',404),(441,'2020-06-19 00:00:00.000000',5,' 감사합니다 선생님\n 마음이 힘들 때 내 얘기를 진심으로 귀기울여 들어주시는 분이 있는 것만으로도 너무 큰 도움이 된다는걸 상담받으며 이제야 알게되었어요. 그동안은 이런 고민들 말해봐야 소용없다고 생각하며 혼자 감당해야한다고 저를 다그쳐왔던 것 같아요. \n\n  그리고 제 고민을 객관적으로 짚어주셔서 감사해요. 저 혼자만 생각을 곱씹으며 오히려 그 상황에 갇혀있었는데,  선생님 얘기를 들으며 시야가 더 넓어지는 것 같아요.\n\n 지금까지 2회 상담을 받았는데, 매번 내 마음이 너무 힘든 상황에 닥쳐서야 내가 나를 돌아보는 시간을 갖았다는 것도 알게 됐어요.\n이제부터는 미리 나를 점검하는 시간을 갖아야겠다는 생각도 지금 처음 하게 되네요. \n  그동안은 극단적인 생각과 마음상태로 스스로를 괴롭혀왔다는 걸 알게되었으니 이제는 어떤 이유에서 그렇게 생각을 하게되었는지 천천히 생각해보려고 해요.\n 1회차 상담에서 ‘우리는 지금 좋은 삶을 가는 길의 중간에 있는 거니까, 지금 당장 내가 생각하기에 완벽하지 않다고 해서 괴로워하지 말라’는 얘기 해주신게 떠올라요. 그 얘기처럼 이제는 서두르지 않고 차분히 나를 위한 시간 갖으려고 합니다. 감사해요!\n ',405),(442,'2020-06-15 00:00:00.000000',5,'두번째 상담인데요\n이번 상담도 너무 만족스러웠고\n감사했습니다',406),(443,'2020-06-08 00:00:00.000000',5,'좋았습니다',407),(444,'2020-06-02 00:00:00.000000',5,'제 이야가를 공감해주시고 자세히 들어주셔서 감사합니다. 지금까지 노력해온 것들을 칭찬해주시고 격려해주셨어요. 공감하고 지지해주시는 말씀에 괴로움을 덜 수 있었어요. \n',405),(445,'2020-05-26 00:00:00.000000',5,'상담사님의 진심어린 공감과 조언 감사드립니다\n제가 마냥 나약한 사람인줄만 알았는데\n힘이 있는 사람이라고 해주셔서 우울증을 물리칠 수 있을 것 같은 용기가 나네요\n',406),(446,'2020-05-24 00:00:00.000000',5,'정말 바뀔 수 없을거라 생각했는데\n선생님 덕분에 달라진 저를 보게되었어요\n별로 도움 안될거라 생각했고\n그냥 한번 해보자하는 마음에 상담 신청했는데\n정말 많이 바뀌었어요 제 자신이\n선생님 께 너무 감사드리고\n제가 드릴 수 있는게 없어서 죄송할 따름입니다\n',408),(447,'2020-05-17 00:00:00.000000',5,'몸이 아프면 병원을 가듯이, ‘마음이 아프고 고민이 많다면 상담 받아보셨으면 하는 바램’입니다💕\n\n상담 받게 된 계기는 가족, 대인관계의 어려움이에요.\n왜 상처받고 힘든 사람이 상담받아야할까 억울함도 있었는데, 너무 힘들고 슬퍼서 내가 사라지면 다 행복하겠지라는 생각들이 나를 휩싸였어요.\n제 마음속 쌓여진 고민들, 내가 소중해, 나를 지켜볼래라는 생각으러 먹고 싶은 음식 먹기가 아닌, 진정한 나를 위한 선물🎁이야라며 시작했어요:)\n\n나는 내가 가장 ‘소중하고 아껴주는 존재’라는 사실은 변하지 않았는데 힘들어서 몰랐어요.\n\n신기하게도 내 상황, 그때 내 마음들을 들어주시는데 너무 속시원하고 좋았어요.\n\n미션을 매주 주셨는데 다 하지 않았어도 하나하나씩 해가는것, 미션 알림을 통해 상담선생님께서 나를 온전히 바라봐주시자나 생각하면서 힘든일, 부정적인 감정들이 나한테 올때마다 이야기는 나중에 나누면 괜찮아 했어요. 물론 그래도 떠오르는 게 힘들었고 그런 감정들 다 나누면서 공감해주시고 때로는 친언니처럼, 때로는 선생님처럼 해주셔서 내 ‘편’이 있다는 것에 좋았어요.\n\n상담하면서 바뀐 좋은 점들은 너무나 많지만,\n내가 느끼는 감정도 그 순간의 나이고, 수많은 순간들이 \n모여 만들어진 나를 가장 소중하고 우선순위로 생각해야 한다는 거에요. \n\n너무 힘들고 고통스러운 부정적인 감정과 생각들을 없애고 싶어 시작했던 상담이지만, 지금은 내가 먼저야. 나는 소중한 존재란걸 잊지 않고 있습니다❣️\n\n그동안 내가 했던 것들, 나 나름대로 노력한 것을 애썼다고 토닥여주셔 너무 감사했어요~\n\n✨ 나를 온전히 생각하고 받아들여주시고 나를 위해 공감하고 마음을 달래주시는 상담이였습니다.\n상담을 통해서 많은 것들을 하나하나 헤쳐나가는 중입니다! \n',409),(448,'2020-05-17 00:00:00.000000',5,'스트레스성 위염으로 인해서 상담을 받아볼까해서 전지은선생님께 1회만 결제해보았는데, 한번만에 복통이 절반으로 사라졌어요! 텍스트로만 만나뵙는거지만 이야기도 잘들어주시고, 스스로의 생각에\n 갇혀있었던 것들을 꺼내어 새로운 시각으로 볼수 있게끔 도와주셔서 좋았어요! 힘든시기에 매주 도움을 주셔서 감사합니다 마음속 불안감을 극복하고 더 편해지기 위해서 추가로 상담을 진행해보기로 했어요',410),(449,'2020-05-16 00:00:00.000000',5,'처음에는 정말 무기력하고 삶이 너무 힘들었는데 상담을 통해 무기력함이 정말 나아지고 내가 나를 존중하고 사랑하는 법을 많이 배우고 많이 좋아졌어요 이제는 나를 더 생각하고 나를 더 아까는 사람이 되어서 선생님에게 너무 감사드려요ㅎㅎ',411),(450,'2020-05-15 00:00:00.000000',4,'공감을 잘해주시고 자신의 얘기들도 함께 말씀해주셔서 좋았어요!',412),(451,'2020-05-13 00:00:00.000000',5,'처음에 힘들어했던 모습들과 마음들이 상담을받으면서 진전되는것을 느꼈고 한달정도되었을때는 정말 진전이되어 제 자신이 신기할정도였어요!! 마음이힘드신분들 꼭 한번 상담받아보시는 걸 추천합니다!\n',413),(452,'2020-05-05 00:00:00.000000',5,'3번의 상담을 했는데 차근차근 얘기하면서 저의 능력, 저의 장점을 발견할 수 있었어요. 앞으로 이걸통해 저를 발전시킬수 있을거에요. 감사합니다.',414),(453,'2020-05-02 00:00:00.000000',4,'나긋나긋하게 얘기를 해주시네요 \n얘기하다보니 시간이 금방갔는게 좋은대화 나눈것같습니다. \n회복하는건 제몫이지만요 ㅎㅎ',415),(454,'2020-05-02 00:00:00.000000',5,'고민을 나누는건 친구와도 할수 있지만 확실히 상담은 느낌부터가 다르네요. 저는 제 스스로 더이상 뭘 어떻게 해야할지 모르겠고 막막할때 상담을 받았습니다. 제가 그동안 생각하던 것들, 상담하면서 생각나는 것들, 말하고싶지 않은 것들 전부 꺼내놓았습니다. 모르겠으면 모르겠다고  창피하면 창피하다고 솔직히 말했고 상담사님도 잘 헤아려주셨습니다. 사실 나아지려면 제가 적극적으로 생각하고 말하는게 가장 중요하겠지만 상담사님이 그 생각의 방향을 잘 잡아주신 것 같아요. 오랜시간 힘들어하던 문제를 해결할 수 있었습니다. 제가 힘들때 아무도 저를 안도와줄거라고 했을때 언제든지 오라고 말해주신게 기억에 남네요. 물론 상담이지만 그래도 힘들때 기댈 곳이 생긴 것 같아요. 상담사님 다시 한번 감사드립니다. ',416),(455,'2020-05-01 00:00:00.000000',5,'진정됐어요',414),(456,'2020-04-27 00:00:00.000000',5,'상담사님께서 제 이야기를 경청해주시고 공감해주시는것부터 위로가 되었는데 저 혼자선 생각할수 없었던 질문을 해주셨어요 질문을받고 눈물이나고 문제해결에만 집중하고있던 나를 내자신을 보게해주셔서 감사했어요 감사합니다 ',417),(457,'2020-04-23 00:00:00.000000',5,'억지로 편안하게 하시려는게 아니라 상담사분께 나오는 편안함덕분에 상담 하는동안 편안하게 진행할 수 있었고 현실적인 조언과 강동적인 위로도 완벽했던 상담이였어요ㅠ^ㅠ 지은 상담사님 강추해요🥕',418),(458,'2020-04-23 00:00:00.000000',5,'선생님 없었으면 정말 생각의 지옥에서 빠져나오지 못했을거예요 감사합니다'