서 더 상담의 효과가 크지 않았나 생각합니다. 다음에 또 상담받을 일이 생긴다면 망설임 없이 다시 이분께 상담요청을 드릴 정도로 좋았습니다. 혹시 이전의 저처럼 상담을 받을지 말지 고민하시는 분들 계신다면 망설임 없이 상담신청 하시라 추천드리고 싶습니다.',501),(549,'2019-12-31 00:00:00.000000',5,'겹쳐있는 생각을 뚜렸한 답을 낼수있게 질문을 던져주셔서 좋았어요!',502),(550,'2019-12-31 00:00:00.000000',5,'속에 담아놨던 이야기 풀어내니 지금은 좀 후련해졌어요. 늦은시간까지 감사합니다ㅠㅠ 곧 또 찾아뵐게요..',503),(551,'2019-12-30 00:00:00.000000',5,'잘 들어주시고, 마음에 힘이 가는 얘기를 많이 해주셔서 감사했습니다! ',504),(552,'2019-12-27 00:00:00.000000',5,'미경쌤과 상담하면서 혼란스러웠던 제생각들이\n조금씩 진정이되고 ㅠ ㅠ생각이부정적이고 핑계만댓던 제가 노력하게끔 생각할수있게 해주시고\n마음이아파서 힘들고 지칠때  잘 다독여주시고 경청해주서서 너무감사드리고 또 상담한다면 그게 더좋은 모습이되길 바라고있고 ㅠ ㅠ너무감사하고 ..선생님같은 분이 \n세상에많았으면좋겠어요  고마워요 ',505),(553,'2019-12-26 00:00:00.000000',5,'너무 감사하다는 말씀드립니다\n어플과 텍스트의 불편함은 있었지만, 선생님과의 상담은 너무 좋았습니다\n제가 상담이 필요한가에 대해 모호한 상태에서 시작한 상담이었는데, 많은 도움이 되었습니다\n고민하고 계신 분들은 일단 시작해보시는 걸 추천해드립니다 저처럼요:)',506),(554,'2019-12-24 00:00:00.000000',5,'감사합니다.\n지금까지 인간관계 맺으며 너무 힘들었는데\n2번째 상담만에 저의 유년시절에 상처까지 찾아주셨어요.\n한번에 바뀌지는 못하겠지만.  \n차츰 더 변화해가겠습니다 너무 감사합니나',507),(555,'2019-12-24 00:00:00.000000',5,'처음 약속을 제가 까먹고 늦게 시작했는데 상담사님이 너무 친절하게 해주시고 저에대해 이것저것 챙겨주시려고 하는게 보여서 좋았습니다. 어떠한일에 있어서 고민하던 부분도 콕 찝어서 알려주시고 더 명쾌해진 느낌입니다^^',508),(556,'2019-12-21 00:00:00.000000',5,'불과 4주만에 달라진 제 모습이 너무 놀라워요.\n차근차근 상담을 잘 진행해주셨고, 무엇보다 제 심정을\n잘 이해해주신다는 게 너무 감사했어요.\n어플을 통해서 진행하는 상담이지만 정말 상담을\n잘 해주시려고 하는 것 같아서 좋았어요.\n앞으로 경제적으로 여유가 있다면 계속 상담을\n진행할 예정이에요!!^^',509),(557,'2019-12-20 00:00:00.000000',4,'문자로 하다보니 전달이 잘 안되는것 같아 아쉽더라고요\n통화하는게 나을것 같아요\n\n스트레스 받았던 사건을 이야기하고 나니 속이 좀 풀렸어요\n\n노력하겠습니다!',510),(558,'2019-12-10 00:00:00.000000',5,'트로스트 세번째 경험인데 가장 도움 됐어요 정말 감사합니다\n',511),(559,'2019-12-07 00:00:00.000000',5,'긍정적인 마음이 생겼습니다!',492),(560,'2019-12-06 00:00:00.000000',5,'이해받고 조언들어서 좋아요\n',512),(561,'2019-12-04 00:00:00.000000',5,'제 마음을 이해해 주시고 얘기도 잘 들어주시고\n좋은 말씀도 해주셔서 도움이 많이 됐어요.\n시간이 짧은 걸로 구매해서 아쉬웠지만,\n지쳐있는 제 마음에 힘이 되주셨어요.\n다시 너무 힘들어진다면 못다한 얘기 다시 나누고싶어요.',513),(562,'2019-12-02 00:00:00.000000',5,'감사합니다',514),(563,'2019-11-30 00:00:00.000000',5,'원래부터 자존감이 많이 낮았고\n최근들어서 제 감정 기복이 많이 심하다고 생각했는데 원인을 몰랐어요 그런데 선생님께서 그런 제 기분을 캐치하시고 스스로를 사랑하지않기 때문이라고 명쾌하게 말씀해주셔서 제 문제에 대해서 깨달을 수 있었습니다.\n눈앞에 안개가 자욱한 기분이었는데 지금은 앞이 좀 보여요. 나 자신을 칭찬해주고 사랑해주라고 선생님과 약속했는데 그 약속 실천해서 자존감도 높이고 저에대한 애정을 키우겠습니다. 상담 정말 감사합니다.',515),(564,'2019-11-29 00:00:00.000000',4.5,'완벽주의, 두려움, 트라우마 등 상담하는 날마다 이야기하고 싶었던 주제를 가지고 대화를 나누었는데 심도 깊은 대화를 통해 내 자신을 받아들이는 법, 나에게 일어나는 모든 감정들을 숨김없이 인정하는 법을 배웠습니다. 종교적인면까지 상담해주실 수 있는 상담 선생님을 만나서 더욱이 위로를 많이 얻었습니다. 항우울제를 먹고 있는데 제 몸상태와 정신건강 컨디션 체크만 해주실 수 밖에 없는 의사선생님보다 상담 선생님의 역할이 크다고 역시 느꼈습니다. 우울증 약을 드시고 계시다면 꼭 상담과 약물치료를 함께 하시기를 추천드려요. ',516),(565,'2019-11-25 00:00:00.000000',5,'감사합니다\n',517),(566,'2019-11-18 00:00:00.000000',5,'선생님이랑 상담하기 전에는 \'그냥 다 포기하고 죽을까\' 라고 생각할 정도로 우울했는게 지금은 많이 좋아졌어요. 정말 감사하고 전화 상담하는 날이 기다려져요!!',518),(567,'2019-11-16 00:00:00.000000',5,'제 마음의 상담만 하는게 아니라 다른 것들도 많이 알려주셔서 감사했습니다.',519),(568,'2019-11-13 00:00:00.000000',5,'감사합니다',520),(569,'2019-11-12 00:00:00.000000',5,'주변 사람에게는 쉽게 말할 수 없는 고민, 트라우마들은 전문가와 상담을 통해 그 감정의 무게를 조금씩 내려놓는게 중요한 것 같아요. 여태껏 이 사실을 모르고 심리상담을 하지 않았었는데 4회기의 상담을 통해서 깨닫게 되었습니다. 상담을 진행한다고 해서 드라마틱하게 행복해지는 효과가 있지는 않아요. 하지만 내 우울감의 원인과 그것이 어떻게 지속되었냐에 대해 상담을 통해서 직면하게 되고 위로받는 과정을 가져서 좋았습니다. ',521),(570,'2019-11-07 00:00:00.000000',5,'감사합니다 ^^',522),(571,'2019-11-07 00:00:00.000000',5,'감사합니다. 아무데서도 알려주지 않았던 이야기를 해주셔서 큰 도움이 \n 되었습니다.',523),(572,'2019-11-06 00:00:00.000000',5,'이야기를 잘 들어주시고 공감해주시고, 또 위로도 감사했습니다 : )',524),(573,'2019-11-03 00:00:00.000000',5,'살아가면서 때로는 누구에게도 말하기 힘든 상황에 직면했을때 진심어린 조언과 따뜻한 만남이 다시 힘을 얻고 나아가게 하는 것 같습니다. 다시 상담 할 일이 생긴다면 같은 분께 하고 싶네요~ 감사합니다',525),(574,'2019-10-29 00:00:00.000000',5,'나름 조언해주셨습니다',526),(575,'2019-10-29 00:00:00.000000',5,'다정하시고 제가못느끼던 저의 마음을 이해해주세요  \n난 사실 이런생각으로 이렇게행동했던거고 그런부분을 잘짚어주시는거같아요',527),(576,'2019-10-28 00:00:00.000000',5,'만족합니다',528),(577,'2019-10-26 00:00:00.000000',5,'상담을 하는 내내 저는 좋은 사람이라는 걸 강조하면서 말씀을 해주시더라고요 최근에 이런 소리를 들은 적이 없어서 그런 건지, 뭔지 잘 모르겠는데 계속 듣다보니깐 난 진짜 좋은 사람인 거 같다는 생각이 머리속에 박히게 되고 낮아졌던 자존감도 오르게 되는 거 같더라고요 상담 하기 전엔 체한 것 처럼 속이 답답하고 우울했는데 상담을 끝내고 나니 답답했던 속도 풀리고 답이 없는 거 같았던 제 삶에 해결책을 주신 거 같아서 