하게 말씀해주시고 따로 지적하지 않으셔서 그냥 온전히 제가 받아들여진다는 느낌이 들어요. ',593),(652,'2020-02-15 00:00:00.000000',5,'일단 선생님의 차분한 목소리와 태도가 내담자에게 안정감을 줍니다.  정서적 지지 뿐만 아니라 현실적인 조언을 주신다는 점에서 깊이 감사드립니다. 제가 미처 생각하지 못한 부분을 꼼꼼하게 짚어주셔서 왜곡된 사고를 바로잡는 데 정말 큰 도움을 받았습니다. 선생님과의 상담을 통해서 제가 변화할 수 있다는 믿음을 가지게 됐습니다. 물론 그 변화가 쉽게 찾아오지는 않겠지만 선생님과 함께 꾸준히 노력하고자 합니다. 감사합니다.',578),(653,'2020-02-14 00:00:00.000000',5,'상담사님 항상 감사드려요 ',594),(654,'2020-02-01 00:00:00.000000',5,'생각이 잘 정리되지 않아서 횡성수설이었는데 대화 잘 이끌어주셔서 좋았어요!',595),(655,'2020-01-31 00:00:00.000000',5,'감사합니다. ',596),(656,'2020-01-28 00:00:00.000000',5,'구체적으로 어떤게 불안한지 물어봐주셧구 오늘 처음상담인데 잘들어주고 정말 전문적이신것같아서 너무 좋앗어요 다음에도 또 신청해서 받으려구요!\n\n',597),(657,'2020-01-20 00:00:00.000000',5,'감사드립니다',593),(658,'2020-01-20 00:00:00.000000',5,'지금까지 병원을 다니면서도 차마 몰랐던 제 마음을 이야기를 통해 천천히 깨닫게 해주셔서 객관적인 관점으로 제가 어느부분에서 문제가 있는지 알 수 있게 됐어요.\n이야기를 끝까지 들어주시고 해결방안까지 알려주셔서 병원에서 상담받을때보다 훨씬 후련하고 생각정리가 되는 기분이에요. 나중에 또 힘들거나 내가 어떤 상황에 처한건지 객관적인 판단이 필요할때 다시 찾고싶어요. 감사합니다:)♥',598),(659,'2020-01-05 00:00:00.000000',5,'매주 금요일 밤 시간에 채팅상담을 진행하면서 제 속에 쌓아두었던 고민을 잘 들어주셨습니다. 제가 생각치 못한 점을 짚어주시기도 하셨고 공감과 격려를 많이 보내주셔서 감사했습니다.',599),(660,'2019-12-31 00:00:00.000000',5,'상담사님이 차분하신 것 같아요. 차분한 분위기를 전달해주셔서 감사해요.',593),(661,'2019-12-14 00:00:00.000000',5,'텍스트로 날 변화시킬 수 있을까 의심 반 기대 반으로 시작한 상담이였어요 상담사님은 이성적이고도 감정을 알아주신답니다 다른분들도 위로받고 나쁜 습관은 개선하고 가세요. 저의 큰 고민은 관계였는데 점점 달라지고 있어요. 제 자신이 너무 버겁고도 버거울때 만났어요 지금은 다시 -에서 제로로 왔습니다 감사해요 \n\n',600),(662,'2019-12-09 00:00:00.000000',5,'상담사님과의 상담 후 정말 좋은 시간을 보냈다는 생각이 들었습니다. 그리고 한 마디, 한 마디 신중히 답변해주시는 것 같아 인상적이었습니다. 목록에 노출된 상담사님들의 수가 너무 많아서 어떻게 선택을 해야할지.. 정말 고민 많이 했었는데, 이렇게 인연이 된 상담사님을 만나게 되어 기쁩니다. ',593),(663,'2019-12-06 00:00:00.000000',5,'꽤 오랫동안 상담을 받으러 다녔는데 가장 잘 맞는 선생님을 만나게 되어 반갑고 고맙습니다 ㅠㅠ 많이 위로가 되었고, 스스로 답을 찾아낼 수 있는 도움이 되었어요. 감사해요.',601),(664,'2019-12-01 00:00:00.000000',5,'좋았어요.',588),(665,'2019-11-28 00:00:00.000000',5,'털어놓을곳이 있어서 좀 괜찮아졌어요.',588),(666,'2019-11-27 00:00:00.000000',5,'선생님 정말 따뜻하시고 신중하셔서 좋습니다. 전문적임은 말할 필요도 없고요. 장기적으로 큰 도움 받고 있어요. 항상 감사합니다!',602),(667,'2019-11-18 00:00:00.000000',4,'사무총장과 여러 가지 문제로 근무시간이 줄어든 뒤로 계속 모니터링만 나가서 마상을 자주 당하던 중 김쌤을 만났어요\n제가 청소년을 생각보다 많이 사랑하는구나, 사소한 습관이 작게나마 변화를 이끌 수 있구나라는 걸 스스로에게 생각을 하게 해서 결론을 이끌 게 되는것 같아요\n무엇보다도 삶에 대한 지지를 원하신다면 진솔한 이야길 나누기 원하신다면 추천드려요 공손함 한 스푼도 덤이셔요!\n원인 분석부터 생각을 달리한 솔루션까지..!\n적극 추천드려요!\n',603),(668,'2019-11-07 00:00:00.000000',5,'이야기도 잘 들어주시면서 제가 생각하지 못하는 관점에서도 이해할 수 있도록 잘 얘기해주시고 좋은 대안들을 제안해주셔서 정말 큰 도움이 됐습니다. 제가 가지고 있는 고민과 문제점들에 대해서 저 혼자서는 알아차리지 못할 수 있는 부분을 캐치를 해주시는 것이 가장 큰 도움이 되었어요. 덕분에 저도 저의 문제를 해결하기 위해 여러가지 방면으로 생각해볼 수 있었습니다.',604),(669,'2019-11-01 00:00:00.000000',5,'심리적 응급 키트 같습니다!\n\n처음에는 막연하던 문제들의 원인을 잡아주시고,\n\n그에 대한 제 의견을 정리 할 수 있게 해주셨어요.\n\n이러한 과정 덕분에 막연히 불안하고 힘들었던 문제를\n\n이성적으로 분석 할 수 있게 됐습니다.\n\n그리고 어떻게 해야하는지 실천적인 방법도 제공해주셔서\n\n더 제가 원하는 모습으로 바뀌어 갔습니다.\n\n2주라는 짧은 기간동안 막연한 불안해서 꺼내주셔서 감사합니다.',605),(670,'2019-10-21 00:00:00.000000',3.5,'모르던 부분을 잡아내 주시는 것이 좋았다.\n상담 진행 속도가 비교적 느려 많은 얘기를 나누지 못한 것 같아 아쉬움이 남는다.',606),(671,'2019-10-21 00:00:00.000000',5,'직접적인 해결책을 제시하신다기 보다는? 제 감정을 스스로 돌아볼 수 있게 해주는 것같아 좋았어요.',607),(672,'2019-10-18 00:00:00.000000',5,'짧은 상담이었지만, 누구에게도 말 못하고 혼자 끙끙거리던 이야기를 할 수 있어서 조금 마음이 가벼워졌어요. 이야기도 잘 들어주시고 너무 감사해요:)',608),(673,'2019-10-17 00:00:00.000000',5,'이야기 잘 들어주시고 구체적인 실천방안을 제시해 주셔서 도움이 많이 되었습니다^^ 이런 얘기 누구한테 하기에도 뭐하고 한 것들을 털어놓을 수 있어서 좋은 시간이었습니다.',609),(674,'2019-10-16 00:00:00.000000',5,'친절하고 공감형 상담이 좋았습니다 :)\n\n',610),(675,'2019-10-09 00:00:00.000000',5,'단회상담이었는데 제가 느끼는 감정이 무엇인지 알게 되었어요. \n그 감정을 마주하는 게 씁쓸하지만 이해받는 기분이었어요.\n앞으로의 과제도 알게 되었는데 혼자 노력해보다가 어려움이 있을 때 또 신청하려고 해요.',611),(676,'2019-10-08 00:00:00.000000',5,'전화상담 4회기 받고 또 4회기 진행합니다. 선생님 좋으세요^_^\n',612),(677,'2019-10-02 00:00:00.000000',5,'첫 상담이라 많이 걱정했어요\n짧은 상담이었지만 이야기 할수록 편해지고\n내가 어떤부분을 간과하고 있었는지 알게 되었어요\n이야기도 잘 들어주시고 너무 감사했습니다\n상담 지속적으로 받아보고 싶어요',613),(678,'2019-10-01 00:00:00.000000',5,'우선 상담을 준비하면서 제 자신을 돌아보는 계기가 됐습니다. 상담사님의 말씀를 듣다보니 마음이 편안해졌습니다. 결국 내가 내 자신을 제일 잘 아는 존재이고 챙겨야 한다는 생각이 들어서 좀 더 차분하게 너에게 시간을 주고 싶어졌습니다. 감사합니다',614),(679,'2019-09-23 00:00:00.000000',5,'상담이 처음이라서 어떻게 해야하는지 모르겠었는데 상담사님과 이야기 하니 모든 이야기들이 술술 나왔어요. 이야기하면서 스스로도 그 상황과 문제들에 대해서 한번 더 생각 해 볼 수있었고, 상담사님이 제 이야기들을 꺼내기 위해서 질문해주시는게 좋았어요! \n',615),(680,'2019-09-21 00:00:00.000000',5,'막연했던 감정을 상담사님의 구체적인 질문을 통해 차근차근 짚어가니 내가 몰랐던 부분을 깨달을 수 있었습니다. ',616),(681,'2019-09-12 00:00:00.000000',5,'사실 지금 크게 감정적으로 힘든 일이 없는 상태라\n최근에 있었던 갈등에대해 이야기했는데\n상담을 하다보니까 제가 가장 힘들어하고\n항상 생각했던 문제가 들어나더라구요 ㅠㅠㅠ\n그냥 제 이야기 털어놓는것 만으로도 좋았는데\n마지막에 해결방안까지 내 주셔서\n50분이 진짜 알찼던것 같습니다.\n시간 지나도 끝까지 들어주셔서 감사해요.\n이야기 하다보니 시간이 금새 가더라구요!\n다음에 또 힘든 일 있으면 찾아 뵐 예정입니다.\n감사합니다~~',617),(682,'2019-09-10 00:00:00.000000',3,'일단은 상담을 처음 받아보는 입장에서 제 마음을 풀어 쓰게 된점이 가장 좋았습니다. 좋은 계기가 된거같아요. 조금 더 선생님이 저에게 이야기를 잘 할수있게 도와주셨어도 좋았을거같지만 전반적으로 만족합니다. 정말 좋은 앱 같아요!',618),(683,'2019-09-05 00:00:00.000000',3.5,'이런저런 핑계를 대며 마음을 제대로 돌아본 적이 없었어요. 심리 상담을 받고 싶다가도 병원을 찾고 찾아가는 일이 번거롭다는 생각과, 내가 상담을 받을 자격이 있나 싶기도 했네요. 네가 뭐가 힘드냐는 가족의 말에 오랜 시간 마음을 방치해뒀어요. \n\n그러다 오늘 상담을 받으면서 처음으로 남에게 예전의 힘들었던 기억과 감정을 털어놓았습니다. 내 말을 들어주고 다독여주는 누군가가 있다는 게 큰 위안이 되었어요. \n\n아쉬웠던 게 있다면 시간입니다. 오래 전 얘기를 털어놓고 상담을 받기에 50분이란 시간은 확실히 짧긴 했어요. 그래도 마음은 이전과 달리 한결 편안해졌기에 저처럼 오프라인 심리 상담을 망설이는 분들에게 추천하고 싶습니다. ',619),(684,'2019-08-31 00:00:00.000000',5,'4주동안 좋았어요. 많이 불안하고 힘들고 확신을 못가지고 있었는데 일련의 사건들도 있었지만 저 자신에 대한 확신과 긍정적인 마음이 잘 다져진거같아요. 잘 들어주시고 공감해주셔서 감사합니다. ',620),(685,'2019-08-26 00:00:00.000000',5,'깊은 애정결핍과 외로움 때문에 고민을 했는데 선생님과 이야기하고 지지를 받고 마음에 힘이 되었습니다. 또한 심리학적인 이야기도 도움이 되었고 실질적으로 도움이 되는 조언도 들을수 있어 50분이었지만 정말 알찼어요. 상담하기전 말하고 싶은걸 정리해두었던게 도움이 되었던것 같구요. 대인관계에 대해서 고민이 있으신분에게 도움이 많이  될것 같습니다. 상담사샘의 조언대로 해보고 연습해본뒤에 한달뒤쯤 다시 보고(?) 상담해보려구요^^',621),(686,'2019-08-23 00:00:00.000000',5,'친구랑 얘기나누듯이 이야기를 했는데 \n그속의 저의 감정과 상황들을 콕콕 집어주셨어요! \n내가 왜 이런감정을 느끼게 되었는지 \n어떤 마음가짐으로 극복해야하는지\n조곤조곤 잘 말씀해주셔서 좋았습니다~\n빨리 다음상담도 하고싶어요!',622),(687,'2019-08-22 00:00:00.000000',5,'제답의 확신을 주셔서 감사해요. 오랫동안 행복하셨으면 좋겠어요',623),(688,'2019-08-22 00:00:00.000000',5,'고민을 공유할사람이 없었어요. 나는 너무 힘든데 가득 쌓아두기만 하는거같아서 혹시하는 맘에 상담받았는데 어느정도 맘에 무게를 덜어낸거같아요',624),(689,'2019-08-19 00:00:00.000000',5,'일단 정말 제 밑바닦감정까지 이렇게나 쉽게 터놓을수 있어서 너무 좋았습니다. 상담사님께서도 50분이라는 짧은 시간동안 그래도 생각보다 빠르게 파악을 해주신것 같아서 굉장히 좋았습니다\n',625),(690,'2019-08-14 00:00:00.000000',5,'속얘기를 해서 후련했고 시간이 짧아서 많은 얘긴 못했지만 제 행동에 있어서 왜그러는지 이유를 조금이라도 알게 된거같아요',626),(691,'2019-08-14 00:00:00.000000',5,'내가 힘든 이유를 혼자 찾는 것 보다 훨씬 좋았어요 생각지도 못한 그런 말씀으로 마음이 더 편안해 졌어요 \n앞으로 조금만 더 상담하면 전보다 비교도 안될만큼 좋아질거같아요 \n\n\n\n\n',627),(692,'2019-08-13 00:00:00.000000',5,'제가 생각지도 못한 부분을 건드려주셔서 당황스럽기도 했지만 그렇기 때문에 제 문제를 바로 볼 수 있었어요 \n\n그동안 스스로 두려움을 직시하는 사람이라고 생각했는데 저를 바로 보고 있진 않았던것 같아요 제가 필요한 걸 알았고 그건 바깥으로부터 오는게 아니고 스스로 충족시키는 것이고 또 건강한 관계를 맺는것이라는 걸 확인할 수 있었어요 \n\n이제 문제에 초점을 맞추기 보단 상담 내용을 길잡이 삼아 해결할 수 있는 방법을 찾으려합니다. 그리고 나를 제대로 보도록 노력하겠습니다 깨우쳐주신 김효린 상담사님께 감사드려요!',628),(693,'2019-08-13 00:00:00.000000',5,'담담하고 객관적으로 상태를 풀어서 서술하시고 분석해주셔서 도움이 됐어요. 따뜻한 상담사님이신 것 같아요.\n',629),(694,'2019-08-10 00:00:00.000000',5,'좋았네요. 의외의 점도 발견해보고 되돌아보게 됐어요\n더 괜찮은 나로 변했으면 좋겠습니다',630),(695,'2019-08-09 00:00:00.000000',5,'김효린 상담사님과 2회 상담동안 많은 도움을 얻었습니다. \n\n제가 겪고 있는 상황에서 제가 느끼는 감정에 공감해주시고 이를 해결 할 수 있도록 스스로 답을 찾도록 여러 질문으로 도와주셨어요. 일방적인 해답 제시가 아니라 제가 그 답을 찾을 수 있도록 도와주셔서 더욱 의미 있는 시간이었습니다.\n\n혼자서 꽁꽁 싸매고 해결해 보려고 고군분투 했을 때보다 훨씬 더 명쾌하게 정리되는 기분이었어요. 훌훌 털어버리고 다시 방향을 잡아 나아갈 수 있는 힘을 얻은 것 같아요.\n\n앞으로도 혼자보다는 상담을 통해 답을 찾는 과정을 함께 해야 겠다는 생각이 듭니다. 적절한 조언과 공감에 감사드립니다. ^^',631),(696,'2019-08-08 00:00:00.000000',5,'정리를 엄청 잘해주셔서 제가 두서없이 말해도 잘 정리해주시더라고요! 덕분에 저 스스로에 대해서 더 많이 알아가게 되었습니다, 감사합니다 :) ',632),(697,'2019-08-07 00:00:00.000000',5,'제가 생각하지 못했던 방향을 제시해주신 것이 신기한 경험이었습니다. \n\n',630),(698,'2019-07-30 00:00:00.000000',5,'1년 동안 쌓아왔던 감정들에 대해 위로를 받을 수 있어서 좋았아요. 지난 1년 동안 자책한 시간이 많았는데 그러기보단 오히려 나 자신을 아껴줬어야 했다는 생각이 들어요. 꽉 막혀있고 흐려있던 마음속이 많이 풀어진 것 같아요. 무엇보다 제가 하고싶었던 말들을 다 할 수 있게 해주시고 묵묵히 들어주신 것만으로도 감사했어요. 상담 받기 정말 잘한 것 같아요! 해주신 좋은 말씀들 적어두고 싶었는데 얘기하느라 바빠서 그러진 못해 아쉬워요ㅠ.ㅠ상담 시간 패키지가 조금만 더 길었으면 하는 맘도 있네요ㅠㅠ감사합니다!',633),(699,'2019-07-23 00:00:00.000000',5,'감사합니다!!',634),(700,'2019-07-21 00:00:00.000000',5,'생각보다 좋았어요!\n제가 생각해보지 못한 저에 대해 생각할 수 있는 기회가 되었어요. 좀 더 긍정적인 사람이 되기 위해 노력하려구요\n감사합니다 :)',635),(701,'2017-11-03 00:00:00.000000',4,'  좋았던 점: 제가 두서없이 얘기해도 잘 정리해주시고, 몰랐던 제 자신에 대해 인지할 수 있도록 도와주셨습니다. 그로인해 저를 알게되고 수용하게 되어서 자존감을 찾았습니다. 다시 한 번 감사드립니다.  아쉬운 점:채팅으로 하는 상담이라서 그런지 답변이 좀 늦어지면 궁금하고 갑갑했습니다. 그것 말곤 딱히 없습니다.',636),(702,'2017-10-06 00:00:00.000000',4.5,'  좋았던 점: 제가 생각하지 못한 점을 솔직하게 야기해주셔서 좋아요\n  아쉬운 점:느려요',637),(703,'2017-07-17 00:00:00.000000',2.5,'  좋았던 점: 저번 상담의 연속성  아쉬운 점:제 말만 일방적으로 쏟은 기분이었어요.',638),(704,'2017-07-23 00:00:00.000000',2.5,'  좋았던 점: 잘 모르겠어요  아쉬운 점:많이 피곤하신 것 같았습니다',639),(705,'2019-03-12 00:00:00.000000',5,'두서없이 쏟아낼수 있게 잘 들어주고 계셔서 쏟아내는것만으로도 후련했구요 때로는 같이 느껴주시고 때로는 질책같은 한마디가 아~라는 느낌을 주기도 했구요  뭔가 인지하지못했던것들을  알게 해주시고 내안에만 파묻혀 보지못한것들을 보게해주셨어요  대면상담은 저의말을 끝까지 하지못할때도 있고 때로는 하지못하는말도 있죠. 부끄러워서요. 대면이 아니다보니 다 쏟아낼수 있었고 그때마다 저의 감정이 어떤지를 물으시며 저에게 저의 감정을 순간순간 느끼는것을  깨우쳐주셨네요.4주간 저의 마음이 많이 편안해졌어요.',640),(706,'2017-10-07 00:00:00.000000',5,'  좋았던 점: 굉장히 중요한 질문을 잘 던져 주세요.   아쉬운 점:시스템 오류가 너무 많이 떠서 ㅠㅠㅠ 힘들었어요.',641),(707,'2017-07-18 00:00:00.000000',4.5,'  좋았던 점: 제가 말하는것에 대해 재질문을 계속 하셨는데 딱히 설명한적 없었던 제 고민을 말로 표현할수 있게 하는 과정이 상담이라는것을 알게되었고 제가 느끼는 감정을 조금 더 잘 알게되어서 해결을 위해 어떻게 다가가야 할지 약간은 앞이 트인 느낌이예요  아쉬운 점:이런 상담을 해본적이 없어서 잘모르겠지만 해결책을 준다라기 보다는 같이 생각해주는 사람이 있다는것에 만족을 해야하는것 같아요.',642),(708,'2018-08-05 00:00:00.000000',3.5,'내가 나아지고 있다는걸 스스로 알게끔 계속 주지시켜주시는 점이 좋았습니다.',643),(709,'2019-05-23 00:00:00.000000',5,'부끄럽고 숨기고싶은 고민이였는데\n공감,이해해주셔서 너무 마음이 놓였어요.\n주변 눈치때문에 터놓기 힘든 제 속마음이였거든요..\n희망을 잃지않게 조언해주셔서 감사하고, 힘들지만 계속 제 생활패턴 이어갈수있게 다독여주셔서 감사해요..\n다시 힘든일을 마주할때 또 상담받으려고요..\n이렇게 집에서 채팅식으로 상담하니까 병원 가서 기다리고 의사샘 눈치보면서 대답하고 길게 대화도 못하고 고생하다 집에 오는것보다 훨씬 좋네요..물론.. 가끔  약처방이 필요한 급성기에는 용기내서 병원 가야겠지만요.어플유용했어요^^',644),(710,'2017-07-20 00:00:00.000000',4,'  좋았던 점: 질문을 많이 해주시고 이야기를 많이 들어주셔서 좋았어요. 상담시간이 조금 오바되더라도 정성스럽게 끝맺음 해주시는 마음도 너무 감사했습니다. 완벽한 해결책은 아니지만 스스로 고민하게해서 답을 이끌어내주셔서 좋았던 것 같아요.  아쉬운 점:텍스트 상담은 상담 시간을 조금 더 길게 할 필요가 있는 것 같아요. 말로하는게 아니라 글로 하다보니 글을 작성할때 신중한 편인 경우 상담 시간이 짧게 느껴질 수도 있을 것 같아요.',645),(711,'2017-07-21 00:00:00.000000',3.5,'  좋았던 점: 핵심을 잘 짚어주시고 근본적인 문제를 들여다 볼 수 있게 해주십니다.\n  아쉬운 점:시간이 짧아서 그랬는지 요점에 딱 이르기 힘들었습니다.',646),(712,'2018-12-07 00:00:00.000000',3.5,'피상담자를 파악하려고 노력하시는 것이 보여서 좋았어요! 대답이 느리다는 분들도 계시는데 타이핑 상담 특성상 어쩔 수 없는 부분이기도 하고 저는 오히려 조금 더 고민하고 말씀하시는 것 같아서 좋았습니다.',647),(713,'2017-07-21 00:00:00.000000',4,'  좋았던 점: 미처 알아채지 못했던 감정들을 깨닫고 정리할 수 있도록 도와주셔서 좋았습니다.   아쉬운 점:채팅속도가 좀 느리고, 연결이 종종 끊겨서 상담시간을 잡아먹는 것이 아쉬웠습니다. ',648),(714,'2019-05-24 00:00:00.000000',5,'혼자 막연히 느낀 감정을 주절주절 떠들면\n선생님이 명확하게 한 마디로 정리해주는 게 좋았어요.\n내가 그런 상태구나를 직관적으로 알 수 있어서요.\n\n보통 혼자 고민할 때는 나름 긍정적인 결론을 끌어내는 게 고작인데 선생님과는 앞으로의 방향성까지 얘기할 수 있어서 좋았어요. 조금 더 나은 내가 되어가는 기분!\n어떻게하면 좀 더 효과적일 수 있는지, 사고의 흐름을 터주는 느낌이 들었습니다.\n',649),(715,'2017-11-18 00:00:00.000000',4,'  좋았던 점: 말에 두서가 없었는데 제대로 짚어 주셔서 좋았습니다  아쉬운 점:너무 짧아서.....',650),(716,'2019-07-01 00:00:00.000000',5,'이야기 하면서 제가 몰랐던 \n저의 문제점도 알 수 있었어요. \n차분히 이야기 들어주시고 적절한 질문을 통해서 문제를 다른 시선으로 보게 해주셔서 좋았구요.\n\n상담사님의 조언을 통해서 조금 더 앞으로 나아간 것 같아서 만족스럽습니다.\n\n감사합니다.',651),(717,'2018-01-06 00:00:00.000000',5,'  좋았던 점: 어떠한 주제든 잘 들어주시고. 제일 좋았던것은 저 스스로를 생각하게 해주십니자.  아쉬운 점:없습니다 ',652),(718,'2018-10-07 00:00:00.000000',4,'얘기를 들어주시는 부분이 좋았습니다. 답변하실 때도 고민하시다가 답변을 주셔서 좀 더 믿음이 갔습니다.',653),(719,'2017-07-21 00:00:00.000000',4,'  좋았던 점: 미처 알아채지 못했던 감정들을 깨닫게 도와 주셔서 뭔가 복잡했던 부분들이 정리가 조금씩 되가고 있는 것 같습니다.  아쉬운 점:상담중 연결 상태가 좋지 않을때가 종종 있어서 상담이 마끄럽게 진행되지 못할때가 있습니다.\n\n',648),(720,'2018-10-08 00:00:00.000000',5,'저의 이야기를 트로스트에서 털어 놓는 것이 처음이었는데요, 상담사님은 객관적이시면서도, 제 편에 계시다는 안도감을 주세요. 제가 느낀 고통을 인정해주시고, 담담하게 앞으로 나아갈 방향을 정리해주셨어요. 상담 이후에 저를 자책하는 부정적 감정이 즉각적으로 상당 부분 사라졌습니다. 저는 이제 일상으로 돌아가 심리적 안정을 찾도록 나름 노력하겠지만, 가끔 트라우마가 저를 또 괴롭히면 상담사님께 도움을 구할 것입니다. 상담사님의 말씀은 인생의 나침반 같아요. 소중한 상담 감사 드립니다.',654),(721,'2018-10-09 00:00:00.000000',5,'정말 진지하게 들어주시는 느낌이 들어서 너무 감사했어요^^',655),(722,'2017-07-23 00:00:00.000000',4.5,'  좋았던 점: 잘 들어주시고 중심을 잘 잡아주셔서 문제를 마주볼수 있도록 도와주신것이 참 감사했습니다  아쉬운 점:크게 없습니다',656),(723,'2018-05-22 00:00:00.000000',4.5,'  좋았던 점: 잘 들어주시고 중심을 잘 잡아주셔서 문제를 마주볼수 있도록 도와주신것이 참 감사했습니다  아쉬운 점:크게 없습니다',656),(724,'2018-06-16 00:00:00.000000',4,'선생님과 이야기를 나누면서 제 생각을 조금 더 체계적으로 정리할 수 있게 되었어요.\n단순히 힘들다는 생각에서 발전하여 무엇이 나를 힘들게 하고 그 요인을 제거할 수 있는 방향에 대해서 스스로 생각할 수 있도록 부드럽게 이야기를 진행해주셨습니다.',657),(725,'2019-05-26 00:00:00.000000',5,'나의 심리 상태에 대해 조금 더 스스로 생각해 볼 수 있는 계기가 되었다.  상담사의 말씀처럼 나를 조금 더 안아주고 배려하기 위해 노력중이다. ',658),(726,'2019-06-15 00:00:00.000000',5,'잘들어주십니다',659),(727,'2017-07-24 00:00:00.000000',5,'  좋았던 점: ㅇ  아쉬운 점:ㅇ',660),(728,'2017-11-07 00:00:00.000000',4.5,'  좋았던 점: 잘 들어주셔서.. 저로 하여금 생각을 많이 하게 해주셨습니다.  아쉬운 점:크게 없습니다.',661),(729,'2018-08-23 00:00:00.000000',4,'김효린 상담사님과 상담을 해봤는데요. 많이 생각하신 뒤에 골라서 말씀해주시는 느낌을 강하게 받았어요. 신중하신 면이 인상깊었어요. 두번 진행을 했는데 두번째 상담에서 제 마음이 많이 차분해졌던거 같아요. 감사하구요. 저처럼 갑자기 많이 힘드실때 찾아와서 도움 받아보면 좋을거 같아요. 급한 불 끄고 다른 방법을 찾아보든 계속하든 좋은거 선택 할 수 있도록 하는게 좋은거 같아요. 감사합니다. ',662),(730,'2017-09-20 00:00:00.000000',5,'  좋았던 점: 상담사님을 통해 저에 대한 객관적인 이야기를 들을 수 있어서, 제 문제에 대해 받아들이기가 수월했어요  아쉬운 점:없습니다.',663),(731,'2019-05-04 00:00:00.000000',5,'\n두서없이 말했는데도 얘기를 잘 들어주시고 \n핵심을 콕 찝어 조언해주셔서 좋았습니다. \n답답한 마음이 많이 풀렸어요 ^_^',664),(732,'2017-07-26 00:00:00.000000',2.5,'  좋았던 점: 솔직하고 진소솔하게들어주신점 마음속얘기를 할수있었어요  아쉬운 점:채팅속도가 조금느리고 항상 먼저 말읗 걸어야 상담이 시작되었어요 여러범 시감을 바꾸시기도 하구요 뭔가 채팅에 집중하고 있기보단 다른일을 하멷서 하시는 듯힌 느낌은 조금 많이 아쉽네요',665),(733,'2018-10-13 00:00:00.000000',4,'상담사님께 말씀 듣고서 여러가지 생각해보게 되었네요. 친구나 가족한테서 듣는 말과 상담사님께 듣는 말이 이렇게나 느낌이 다르다는걸 새삼깨달아요. 조곤조곤 말씀해주셔서 감사해요\n그렇지만 타자가 조금 느리신것 같았어요!ㅠㅠ\n',666),(734,'2017-11-22 00:00:00.000000',5,'  좋았던 점: 처음이라 잘 모르겠는데 진행이 차분했던것 같아요.\n어떤 질문을 던져주셨는데 그 질문 덕분에 항상 하던 생각이라도 가치가 확 바뀌게 돼서 좋았습니다. 상담소로 직접 찾아가는건 어렵지만 상담의 거리를 이런식으로 좁히는것. 정말 좋은거같아요.  아쉬운 점:시간이 없는게 아쉽네요.',667),(735,'2017-11-08 00:00:00.000000',4,'  좋았던 점: 차분하게 응대해준신것이 좋았습니다  아쉬운 점:없습니다',668),(736,'2019-05-06 00:00:00.000000',4,'제 불안한 마음을 완벽하게는 해소시켜주지 못했지만 상담사님 말처럼 차근차근 처음부터 해보겠습니다. \n\n',669),(737,'2018-05-06 00:00:00.000000',4,'  좋았던 점: 제 이야기를 이끌어내 주시려고 하는 것 같아서 좋았습니다   아쉬운 점:별로 없었어요',670),(738,'2018-12-23 00:00:00.000000',5,'제가 스트레스를 받고 흥분한 상황에서도 침착함을 유지하셔서 좋았습니다. 또 긍정적인 말 가운데서도 현실적인 조언을 해주셔서 큰 의지가 되었습니다.',671),(739,'2019-06-18 00:00:00.000000',5,'어렸을때부터 고민이었던 부분들이 상담해나가며 생각보다 쉽게 풀려나갔습니다...! 짧은 기간이었지만 상담을들으며 저에게 많은 위로가 돼었고 스스로의 자존감도 많이 높아진것같습니다. 감사합니다!',672),(740,'2017-07-29 00:00:00.000000',4,'  좋았던 점: 제가 텍스트로 해보는 상담이 처음이어서 말이 좀 두서가 없었는데요. 그래도 계속 질문 해주시면서 이해하려고 하셨어요! 감사합니다  아쉬운 점:크게 없습니다~',673),(741,'2017-07-31 00:00:00.000000',5,'  좋았던 점: 말못한고민 대화해서좋아요  아쉬운 점:없어요',674),(742,'2018-10-17 00:00:00.000000',5,'제 자신이 회피하고 있던 부분을 정확하게 짚고 넘어가서 제 자신을 똑바로 보게 되는 계기가 된 것 같아요!! ',675),(743,'2017-07-31 00:00:00.000000',5,'  좋았던 점: 핵심을잘아시고 피드백해주셔서좋앗어요  아쉬운 점:크게없습니다',676),(744,'2018-01-24 00:00:00.000000',2.5,'  좋았던 점: 던져주시는 질문을 받고 예상치 못한 곳에서 저를 돌이켜 볼 수 있는 게 좋았어요.   아쉬운 점:서로간의 정서적 교류가 상담에서 정말 중요하다고 생각하는데 솔직히 말하면 많이 실망스러웠습니다. 시간 약속도 자주 바꾸시고 제시간에 시작하기도 어려웠구요.. 온전하게 상담을 한다기보다는 다른 할일을 하면서 나랑 이야기하나? 하는 느낌을 받았습니다.',677),(745,'2018-05-09 00:00:00.000000',3,'  좋았던 점: 바로 제 감정을 확실하게 해주시는게 좋았어요. 마지막까지 따뜻하셔서 위로가 되었어요.  아쉬운 점:저랑 생각이 다른 부분이 있었던 것 같아요. ',678),(746,'2018-10-20 00:00:00.000000',5,'제상황을이해해주시려고노력해주셔서감사했어요진심으로해결책을찾아주시려고노력해주셨어요',679),(747,'2017-11-10 00:00:00.000000',4,'  좋았던 점: 얘기를 잘 들어주셨어요 편하게 얘기할 수 있기 해주셨어요  아쉬운 점:없습니다',680),(748,'2019-04-12 00:00:00.000000',4.5,'차분하게 들어주시고 위로도 해주시고\n말하다보니 스스로 생각도 정리가 되고\n도움도 많이 받았습니다 감사합니다❤️',681),(749,'2018-10-21 00:00:00.000000',4,'계속 제가 생각할 수 있도록 끌어주신다는 느낌을 받았습니다. 조금 느리다고 느껴지긴 하네요ㅠㅠ',682),(750,'2019-01-07 00:00:00.000000',4,'친한언니에게 고민상담하는 기분이 들었어요.\n첫 상담이었지만 잘 해결해보고 노력해보려고 합니다.',683),(751,'2019-04-12 00:00:00.000000',4,'차분하게 생각을 정리하도록 도와주셨습니다.',684),(752,'2017-08-05 00:00:00.000000',3.5,'  좋았던 점: 묵묵히 잔잔히 잘 들어주시네요^^  아쉬운 점:좀더 이야기를 나누고싶엇어요',685),(753,'2018-07-02 00:00:00.000000',3,'얘기 잘 들어주시고\n옛날에 상처받었던 점에대해\n잘 이끌어내 주십니다\n\n',686),(754,'2017-12-07 00:00:00.000000',4.5,'  좋았던 점: 해본적없는얘기를해서좋았습니다  아쉬운 점:채팅속도가느려서 답변을 많이 못받아서 아쉬웠어요',687),(755,'2018-05-14 00:00:00.000000',5,'  좋았던 점: 실질적으로 해결책을 얻을수 읬어숴 좋았어요 덤으로 용기두요  아쉬운 점:없습니다!!!',688),(756,'2018-05-28 00:00:00.000000',5,'  좋았던 점: 정말 따뜻하시고 필요한 말씀을 해주셔서 너무 좋았어요  아쉬운 점:없었어요^^',689),(757,'2019-06-22 00:00:00.000000',5,'첫상담 이라 어떻게 해야할지 몰라서\n그냥 주절주절 떠든 이야기도 잘 들어주시고,\n그동안 꺼내지 못했던 속마음 들을 편하게 \n말할 수 있도록 만들어주시고 지금 내가 어떤 상황이고 \n왜 그런 생각이 들고 하는지 같이 말을 나누다 보니까 내가 왜 그랬는지 이해도 되고 문제가 생겼을 때 해야할 방법들을 차근차근 설명해주시고 .. 정말  갈 곳을 잃은 저에게 길을 터주신 것만 같아요 마음이 한결 편안 해졌어요 정말 감사합니다\n\n ',690),(758,'2018-07-06 00:00:00.000000',3.5,'스스로 생각할 수 있는 기회를 주셔서 좋았다.',691),(759,'2019-05-13 00:00:00.000000',5,'제가 부족한 점이 많았는데 잘 알려주셔서 감사합니다. 업무적으로 부족한 부분들도 구체적으로 논의를 할 수 있어서 너무 좋았습니다. 직장상사에게도 못할 말을 나눌 수 있어서 너무 좋습니다ㅜㅜ응원 잔뜩 받고 가는 기분이예요ㅠㅜ고맙습니다..',692),(760,'2017-11-13 00:00:00.000000',3,'  좋았던 점: 제 문제를 질문을 통해 점점 구체적으로 짚어주셔서 좋았어요!  아쉬운 점:아무래도 50분은 문제를 해결까지 하기엔 조금 짧은 시간이었던 것 같아요!ㅠㅠ',693),(761,'2017-08-08 00:00:00.000000',5,'  좋았던 점: 상담사님을 통해 저에 대한 객관적인 이야기를 들을 수 있어서, 제 문제에 대해 받아들이기가 수월했어요  아쉬운 점:없습니다.',663),(762,'2019-05-14 00:00:00.000000',5,'좋았어요 ㅎㅎ 감사합니다 정말',694),(763,'2017-12-14 00:00:00.000000',4.5,'  좋았던 점: 늦은시간에도 최선을다하셔서 얘기를들어주고 공감해주시고 그에따른 해결책도 내주시는 모습이 너무 좋았습니다  아쉬운 점:없습니다^^',695),(764,'2017-12-11 00:00:00.000000',5,'  좋았던 점: 제가 생각해보지 않았던 저의 모습을 떠올려볼 수 있도록 도와주셔서 감사했습니다. 또 제가 알지 못한 저의 모습을 그대로 알게 되었구요.   아쉬운 점:상담 회기가 적다보니, 제가 갖은 문제를 모두 해결하기에 짧은 시간이었을 수도 있겠다 생각이 들었습니다.',696),(765,'2017-11-13 00:00:00.000000',5,'  좋았던 점: 객관적으로 차분히 말씀해주셔서 좋았어요  아쉬운 점:없습니다\n\n',697),(766,'2017-11-14 00:00:00.000000',5,'  좋았던 점: 목표를 잘 잡아주십니다  아쉬운 점:채팅속도가 느리셨습니다ㅜㅜ',698),(767,'2018-07-10 00:00:00.000000',4,'상담을 하며 나의 얘기를 그냥 듣고 마는 게 아니라 나의 얘기를 들어준다는 생각이 들어서 그 자체가 위로였다\n나를 혼내지 않아서 가르치려 하지 않아서 좋았다\n상담하는 동안은 꼭 내 편이 생긴 것 같았다 위로됐다',699),(768,'2019-03-03 00:00:00.000000',5,'첫 상담이라 횡설수설 말씀 드렸는데도\n침착하게 제 이야기를 들어주셔서\n편한 상담이 가능했구요~!\n상담 받은지 몇일이나 지났는데\n그 후부터 전혀 걱정없는 날들을 보내고 있어서\n그때마다 트로스트앱을 생각하면\n감사할 따름입니다!!\n',700),(769,'2018-11-03 00:00:00.000000',4.5,'얘기를 잘들어주셔서 좋았습니다.\n알고는 있었으나 말로 표현하지 못하는 것들을 찝어 주셨어요\n',701),(770,'2018-11-04 00:00:00.000000',3.5,'일단 어디에도 하지 못할 내 이야기를 들어주는 것만으로도 홀가분한 기분이 든다. 내 문제점과 개선점을 찾는데는 시간이 걸리겠지만 그래도 좀더 빨리 해결책을 찾을수 있도록 도와주고 노력해 주시는 것 같다. ',702),(771,'2017-08-17 00:00:00.000000',4,'  좋았던 점: 이야기를 많이 하도록 이끌어주시면서도 생각을 정리하고 객관적으로 조망할 수 있게 하신 점이 좋았습니다.   아쉬운 점:딱히 없습니다.',703),(772,'2019-06-05 00:00:00.000000',5,'네, 대화를 하면서 솔직하게 말하고 나니 다시 그 우울한 생각을 하는 일이 많이 줄어들었습니다. ',704),(773,'2019-01-30 00:00:00.000000',5,'차분하게 제 이야기를 들어주셔서 감사합니다. 보채거나 닦달하는 느낌없이 맘편히 이야기한 게 오랜만이라서 50분이 너무 짧게 느껴졌어요. 갇혀 있는 제 생각을 다른 방식으로 생각할 수 있게 유도해주시는 부분도 너무 좋았습니다. 선생님도 행복하세요..',705),(774,'2017-12-19 00:00:00.000000',5,'  좋았던 점: 질문 잘 주신점, 생각지못한점을 얘기해주신점..  아쉬운 점:다 좋았어요',706),(775,'2018-04-12 00:00:00.000000',4.5,'  좋았던 점: 잘 정리해서 말씀해주시는 거 같습니다  아쉬운 점:시간이 짧다는게 확실히 느껴질 정도로 얘기만 하다가 마무리 한거 같아요ㅜㅜ',707),(776,'2019-04-21 00:00:00.000000',4,'스스로에 대해 조금 더 생각해보는 시간을 가질 수 있었습니다. \n',708),(777,'2019-05-20 00:00:00.000000',5,'내 마음속에 있는 이야기를 자연스럽게 꺼낼수있게 도와주시고 내 생각을 정리해주셔서 참좋았어요',709),(778,'2018-04-13 00:00:00.000000',4.5,'  좋았던 점: 제가 생각하지 못한 부분을 깊게 생각하셔서 답을 해주겨서 좋았습니다  아쉬운 점:생각을 많이 하셔서 그런지 채팅이 느려서 대화느낌이 안들었어요',637),(779,'2017-12-21 00:00:00.000000',5,'  좋았던 점: 말에 두서가 없었는데 제대로 짚어 주셔서 좋았습니다  아쉬운 점:채팅속도가 조금 느린점이 없진 않지만 아쉬웠던 점이 거의 없다고 봐야해요',650),(780,'2019-04-22 00:00:00.000000',5,'감사합니다',710),(781,'2019-03-08 00:00:00.000000',5,'잘 들어주시고 그리고 요점과 필요한 부분을 잘 찔러서 솔루션을 제시해주셨어요 감사합니다',711),(782,'2019-06-27 00:00:00.000000',5,'네! 감사합니다! :)',712),(783,'2017-12-24 00:00:00.000000',4,'  좋았던 점: 제 상황을 잘 이해하고 조언 해주셨어요  아쉬운 점:크게없습니다',713),(784,'2017-08-28 00:00:00.000000',1,'  좋았던 점: 솔직히 아직은 잘 모르겠지만 저 스스로를 성찰할 수 있는 부분들의 질문들을 해주신거같아요. 나는 피해자라고 무의식적으로 크게 외치고 있던거 같은데, 내가 보지 못했던 미묘한 부분들을 시각화해보란 말씀을 해주셨어요.  아쉬운 점:채팅속도가 조금 느리시고 중간중간에 질문만 하기보단 이런저런 파악을 좀 더 해주셨으면 하는 마음이 있었어요. 그래도 감사합니다.',714),(785,'2017-12-26 00:00:00.000000',2.5,'  좋았던 점: 저의이야기를들어준다는자체가좋았다  아쉬운 점:없는거같아요',715),(786,'2018-11-23 00:00:00.000000',4,'제 감정에만 치우친 생각이 아니라 상황 자체를 객관적으로 생각해볼 여지를 주셨고 공감해주시고 조언도 해주셔서 감사했어요 적게 일하고 많이 버세요 상담사님 ㅠ ㅠ',716),(787,'2018-11-24 00:00:00.000000',5,'제 얘기를 하고 제 자신에 대해서 생각해볼 수 있어서 좋았습니다.',717),(788,'2019-04-02 00:00:00.000000',3,'\n몰랐던 원인을 짚어주시는 편이세요 잘못된(?) 심리 상태 행동도 파악해주시구오 만약 이유를 아는 것만으로도 훨씬 나아질 것 같다고 느끼시는 분들이 있으면 추천드려요 잘 다독여주시기도 하고\n다만 구체적인 행동이나 생각방식 제시는 아쉬웠어요 \n',718),(789,'2017-11-03 00:00:00.000000',4,'  좋았던 점: 마음이 편안해지는 상담이었습니다!!!   아쉬운 점:답을 주고받는 속도가 좀 느려서 50분이 아쉬웠어요!\n',719),(790,'2018-08-01 00:00:00.000000',5,'벌써 4번째 상담이네요, 구체적