이 웃었던 것 같아요\n아직도 많은 시간이 필요하겠지만 저에겐 정말 필요했던 상담이었어요 좋은 시간 보낼 수 있어서 정말 감사했습니다\n\n',757),(833,'2020-04-22 00:00:00.000000',4,'혼자하고 있던 고민을 상담때 얘기하니 답답했던기분이 좀 나아졌어요. \n상상으로 상대가 앞에 있다 생각하고 이야기해보라고 했던건 좋았어요. \n하고나니 속이 좀 시원했어요. \n저는 4번은 부족하네요 \n상담 더 해야할것같아요.\n감사합니다.\n',758),(834,'2020-04-22 00:00:00.000000',5,'위로해 주시고 걱정해 주셔서 너무 감사했어요\n',759),(835,'2020-04-20 00:00:00.000000',5,'마음을 다잡아보려고 합니다... 처음 상담이라서  아직은 상담이 더 필요 할거 같습니다\n',760),(836,'2020-04-20 00:00:00.000000',5,'제안의상처를찾아보도록할게요',761),(837,'2020-04-18 00:00:00.000000',4.5,'상담 마무리 하면서 마지막말이 전달이 안될까봐 \n좀 초조한거 빼고는 좋았어요~\n반응도 잘해주시고\n깊은 내면을 봐주시는거 같아서\n좋았어요~^^ \n다음에 다시 또 뵐것같아요~',762),(838,'2020-04-17 00:00:00.000000',5,'선생님이 친절하시고 잘 기다려 주셔서 좋았어요. \n',763),(839,'2020-04-13 00:00:00.000000',5,'항상 스스로 나약하다고 생각해왔고 그런 제가 창피했어요. 그래서 진짜 모습을 숨겨왔는데...솔직하게 제 모습을 보인 것도 처음이고 그래도 괜찮다고 들은 것도 처음이에요.\n지금 제가 괜찮은 사람인 것처럼 느껴져요. ',764),(840,'2020-04-12 00:00:00.000000',5,'따듯하고 좋았습니다.\n다음에 또 올게요\n',761),(841,'2020-04-12 00:00:00.000000',5,'문자로 상담을 받은지가 꽤 지났는데 후기를 이제서야 남기게 되었네요. 저는 스스로를 미워하고 계속해서 몰아붙이는 상황이었어요. 그러다 번아웃이 왔고 특정 상황에서 숨이 가빠지고 감정조절에 큰 어려움을 겪게 되면서 심리상담을 받아야겠다고 다짐하게 되었습니다.\n처음에는 대면상담도 아닌 텍스트상담으로 과연 나아질수있을까 확신이 없는 상황이었지만 지푸라기라도 잡는 심정으로 상담을 시작했어요. 상담을 하면서 텍스트 상담을 선택한건 신의 한수였다는 생각을 했습니다. 글로 상황을 설명하고 제 감정을 적으면서 정리도 되고 침착하게 생각할수 있었던것같아요. 그리고 무엇보다 상담사님이 정말 집중해서 제 이야기를 들어주신다는 느낌을 받았습니다. 제가 하는 이야기를 공감하며 들어주시다가 적절한 부분에서 몇 가지 질문을 해주셨는데 그 질문에 대해 스스로 답을 하면서 많은 걸 깨달을 수 있었어요. \n저처럼 감정조절이 어렵고 나의 문제가 무엇이고 어떻게 해결해야할지 명확하게 모르겠다 하시는 분들은 김애경 상담사님과 상담해보시길 추천드려요. 정말 이야기 잘 들어주시고 따뜻하게 공감해주시는 분이세요. \n저는 상담이 끝난지 조금 지난 상태인데요. 몇 번의 위기가 왔었지만 상담을 통해 깨달았던 것들을 사용하면서 잘 이겨내고 있답니다. \n감사드려요 선생님.♥️\n',765),(842,'2020-04-07 00:00:00.000000',5,'잘 들어주시고 차근차근 정리해주셔서 좋았습니다. 스스로 자각 못했던 것들을 자연스럽게 알려주셔서 상처없이 큰 도움이 됐어요.',766),(843,'2020-03-31 00:00:00.000000',5,'너무 행복한 나날들이었습니다 \n모두 제가 한일이라고 제가 다 견뎌내고 이겨내고 알아낸것이라고 격려를 아끼지 않으셨어요 무기력과 우울증 공황장애로 너무 힘들었는데 이제는 다가오는 봄을 즐길수 있을것같은 자신감이 듭니다 ㅋ \n10번정도 햇을까요? 매회 새로운 주제로 한없이 제가 생각지 못한 생각을 하나하나 정리해 주시는 쌤 덕에 저는 제 스스로가 너무 대견하고 이쁘고 세상 행복한 요즘입니다 앞으로 10번은 더 선생님과 함께 저를 또다른 모습을 칮아내고 싶어요 :) 쌤 감사하고 또 감사합니다 ',767),(844,'2020-03-31 00:00:00.000000',5,'10번정도 했나요 쌤과..\n쌤과 정말 이야기를 나눌때마다 너무 좋는 기운을 받고 \n매주매주 달라지는 모습과 생각의 전환을 만들어주는 쌤에게 정말 감사하다는 말 밖에는 할말이 없습니다 \n정말 우울증 무기력증 공황장애로 3년을 힘들게 살았는데 선생님과의 몇달동안 저는 너무 행복한 사람으로 다시 태어나는 느낌입니다 \n앞으로 10번정도 더 하고 싶어요 앞으로 10번 더 선생님과 함께 찾아갈 저의 새로운 모습이 벌써\n기대가 됩니다! 정말 감사합니다 정말 진심어린 한말씀 한말씀 자주 되돌아 보면 새기고 새기겠습니다 \n다음주에 뵈어오 ^^',767),(845,'2020-03-16 00:00:00.000000',5,'항상 감사합니다.',768),(846,'2020-03-03 00:00:00.000000',5,'격려와 응원 덕에 힘이 됩니다..',769),(847,'2020-03-03 00:00:00.000000',5,'제가 바라보던 관점과는 다른 관점을 찾아주셔서 놀랍고 인상적이였습니다.. ',769),(848,'2020-03-01 00:00:00.000000',5,'좋은 조언 현실적인 조언 해주셔서 너무 좋았고\n방향을 잘 잡아주셔서 정말 감사합니다',756),(849,'2020-02-29 00:00:00.000000',5,'그동안 스스로를 알아주는걸 너무 멀리했던것같습니다. 그걸 상담사선생님이 도와주신것같습니다. 힘들었던 감정을 내가 아닌 밖으로 시선을 돌려 헤메고만 있었는데, 내안을 들여다볼수있도록 이끌어주셨습니다. 그리고 혼란스러웠던 감정이 차분하게 가라앉은것같습니다.',770),(850,'2020-02-28 00:00:00.000000',5,'넘 감사합니다',771),(851,'2020-02-20 00:00:00.000000',5,'선생님과 만나 꽤 이야기를 한것같습니다 \n사실 어떻게 보면 몇 시간도 아닌시간에 \n정말 많은것들을 배우고 느낀것같습니다 :) \n\n아직도 선생님과 함께 할수 있다는것에\n매우다행으로 여기고 \n생각할수 있는여유와 저스스로를 사랑하고 대견해한마음을 가질수 있게 해주신 선생님께 너무 감사한 마음을 느끼고 있습니다 \n\n한없이 무기력하고 힘들때 선생님을 만나 \n감사하고 또 감사드립니다 :) ',767),(852,'2020-02-13 00:00:00.000000',5,'스스로 생각할 수 있는 힘을 길러주셔서 감사합니다',768),(853,'2020-02-02 00:00:00.000000',5,'감사합니다',771),(854,'2020-01-09 00:00:00.000000',5,'좀더 상담사님의 말씀을 들었으면 좋겠는데\n제가 너무 말을 많이했어요~\n기본적으로 너무 잘들어주셔서 스스로 정리가 됐어요\n좀더 규칙적으로 상담 받고 싶습니다^^',752),(855,'2020-01-04 00:00:00.000000',5,'선생님. 항상 저에게 사랑스럽다고 해주셔서 감사드려요. 문자로 하는 상담이지만 선생님의 따듯한 마음이 제가 저를 더 사랑하고 제 마음을 알아볼 수 있게 이끌어 주신거같아요. 선생님도 힘드신 일 많으시겠지만 항상 힘내시길 바라구요. 저도 혼자서 다시 힘든때가 오면 또 뵈러올게요. 감사합니다.',772),(856,'2019-12-28 00:00:00.000000',5,'오늘 한번 받아서 후기를 쓰기도 그렇지만\n누구든 뭐든 얘기할수 있는 사람이 있는건\n진짜 큰 힘이 되는거 같아요\n그냥 그걸로도만\n',773),(857,'2019-11-22 00:00:00.000000',5,'김애경 상담사님과 첫 상담을 하고 나서 이 분이라면 나를 확실하게 더 나은 사람, 지금보다 행복한 사람으로 변화 시켜 줄 수 있는 분이라는 어떤 확신을 느꼈습니다.\n\n10회차의 상담 동안 제가 제 안에 있는 외로움과 불안함에 휩쓸려서 살고 있다는 것을 알게 되었고 이제는 외로움이 찾아왔을때 어떻게 해야할지 불안함이 나를 끌고 갈때 어떻게 해야할지 제 마음을 잘 들여다보게 되었습니다. \n\n좋은 상담사를 만나면 자신을 좀 더 알 수 있게 되고 아픔을 치유 하게 됩니다. 김애경상담사님 짱..ㅎㅎ\n\n',772),(858,'2020-06-19 00:00:00.000000',5,'마음 속에 무거운 짐을 내려놓고 나를 돌아볼 수 있는 시간이었어요~ 선생님 감사합니다. 조만간 또 상담요청 드릴게요',774),(859,'2020-06-15 00:00:00.000000',5,'감사합니다.',775),(860,'2020-06-14 00:00:00.000000',5,'50분 텍스트 테라피 1회 였구요\n지금 제가 처한 상황을 정리할 수 있었어요',776),(861,'2020-06-03 00:00:00.000000',5,'상담 자체를 처음 받아봤습니다. 경청해주시는 가운데 저 스스로 상황을 객관적으로 바라볼 수 있도록 자연스럽게 유도해주시는 것이 정말 인상 깊었습니다. 구체적인 팁들도 주셔서 한동안 다시 스스로 잘 헤쳐나갈 수 있을 것 같습니다. 정말 감사합니다!',777),(862,'2020-05-31 00:00:00.000000',5,'감사합니다 ',775),(863,'2020-05-25 00:00:00.000000',5,'감사합니다.',775),(864,'2020-05-17 00:00:00.000000',4,'감사합니다.',775),(865,'2020-05-08 00:00:00.000000',4,'상담하면서 제 상황을 객관적으로 볼 수 있는 것 같았습니다. 감사합니다.',775),(866,'2020-04-23 00:00:00.000000',5,'감사합니다🙇',778),(867,'2020-02-10 00:00:00.000000',5,'1회 상담때 스스로 직면하기 싫어서 계속 피하는 문제들에 대해서 다양한 각도로 스스로 바라볼 수 있게 해주시는 점이 좋아서 10회를 진행했습니다. 계속 진행하면서 스스로에 대해서 솔찍하게 이야기를 하면서 저 자신과 마주볼 수 있어서 좋았습니다. 아직 나아지는 과정중에 있다보니 추가로 상담을 진행할 예정입니다. 감사합니다.',779),(868,'2020-02-02 00:00:00.000000',5,'세 번째 상담을 받았습니다.\n제 이야기를 잘 들어주시고, 방향을 잘 제시해주십니다.\n앞으로 변화 할 수 있을 것이라는 희망을 갖게 됩니다\n',780),(869,'2020-01-27 00:00:00.000000',5,'최고의 상담이였습니다\n',780),(870,'2019-11-13 00:00:00.000000',5,'감사드려요.\n',781),(871,'2019-11-07 00:00:00.000000',5,'감사합니다\n\n',781),(872,'2019-11-03 00:00:00.000000',5,'감사합니다. 한고비 또 넘어선 기분이 듭니다.',782),(873,'2019-10-29 00:00:00.000000',5,'생각보다 내 상황을 잘 이해하고 상담해주셨어요 주저하지 말고 신청해보세요~ 생각정리도 되고 새로운 관점도 얻게 됩니다',783),(874,'2019-10-10 00:00:00.000000',5,'신중하게 대답해주셔서 좋았어요\n마지막 회차에 털어놓은 이야길\n처음에 털어 놓았으면 좋았을걸 싶지만\n그래도 내가 그때의 나에게 해주고 싶은 말이 뭔지 알게되었어요\n무서워하지않고 자신있고 당당하게 살도록\n노력할게요\n\n제 많은 얘기 들어주셔서 너무 감사합니다\n',784),(875,'2019-10-04 00:00:00.000000',5,'네.. 화가 많이 났고 어디에도 말할수 없는 이야기를 나눌 수 있어서 좋았습니다 \n 대처방안을 제가 찾도록 안내해주셔서 자꾸 더 생각해보게 되었어요 또한 마음도 잘 헤아려주시고 극단적인 방법을 더 생각해 볼 수 있도록 해주셔서 좋았습니다~~\n.정말 충격이 커서 마음이 많이 진정되서 다시 또 돌어봐야할거 같어요~ 감사합니다 ',785),(876,'2019-09-27 00:00:00.000000',5,'텍스트 한 타임이라 깊은 대화를 하진 못했지만, 말씀주신 부분에 대해 더 고민해보려 합니다. 장기적으로 해보면 더 좋을거같아요!',786),(877,'2019-09-23 00:00:00.000000',5,'여기에서 몇 분한테 상담을 받은 경험이 있는데. 변명숙 선생님만큼 도움을 현실적으로 그리고 이해하기 쉽게 풀어주신 분은 없는거 같아요. 상담 같은걸 꺼려했던 사람인데 다음 상담을 꼭 받고싶고 기다려지게 됩니다. 감사합니다',787),(878,'2019-08-09 00:00:00.000000',5,'문제에 따라 다르겠지만 저는 4회 상담으로 많은 도움을 받았습니다. 상담사님 프로필을 다 보고 저의 상황을 잘 이해하실 만한 분으로 선택했습니다. 상담 중에 저를 존중해주시고 공감해주시고 적절한 조언을 해주셔서 감사했습니다. 앞으로 같은 상담사님께 추가로 상담을 더 받을 생각입니다. ',788),(879,'2019-07-12 00:00:00.000000',5,'네. 많은도움이 되었습니다.\n\n',789),(880,'2018-06-04 00:00:00.000000',2.5,'  좋았던 점: 이야기를 잘 들어주심  아쉬운 점:상담이 조금 더뎌서 마무리가 힘들었습니다',790),(881,'2018-06-04 00:00:00.000000',4,'  좋았던 점: 친절합니다  아쉬운 점:괜찮습니다',790),(882,'2017-07-18 00:00:00.000000',5,'  좋았던 점: 적극적으로 도움 주시려하시고. 핵심을 잘파악하셔서 너무 감사했어요. 제마음의 방향과. 왜 그런마음들이 생겼는지 알게되었습니다. 감사합니다^^  아쉬운 점:크게 없습니다^^',791),(883,'2017-08-01 00:00:00.000000',5,'  좋았던 점: 적극적으로 도움 주시려하시고. 핵심을 잘파악하셔서 너무 감사했어요. 제마음의 방향과. 왜 그런마음들이 생겼는지 알게되었습니다. 감사합니다^^  아쉬운 점:크게 없습니다^^',791),(884,'2017-11-05 00:00:00.000000',3,'  좋았던 점: 질문을잘던져주심  아쉬운 점:크게없엇습니다.',792),(885,'2018-06-11 00:00:00.000000',5,'  좋았던 점: 정말 훌륭한 선생님 이세요  아쉬운 점:특별히 없어요 ',793),(886,'2017-09-19 00:00:00.000000',5,'  좋았던 점: 제마음을아신거같아요^^  아쉬운 점:감사합니다^^',794),(887,'2017-11-22 00:00:00.000000',5,'  좋았던 점: 진심어린 상담자로서의 태도그리고 편안하게 내 내면의 소리를 이끌어내주는 마음  아쉬운 점:채팅속도가 느릴때도있지만 텍스트테라피 상담상 한계인것같습니다.. 다른점은 특별히 없었습니다',795),(888,'2017-11-07 00:00:00.000000',5,'  좋았던 점: 제가 생각해보지않았던 것을 해보라하셔서\n못미더웠었는데 해보니까 정말로 마음이 개운하고 한결 편해진거같아요 감사합니다  아쉬운 점:없어요',796),(889,'2017-07-25 00:00:00.000000',4,'  좋았던 점: 나이속의 연륜이 느껴져서 좋았습니다  아쉬운 점:딱히 아쉬웠던 점은 없고 시간이 많았으면 좋겠습니다',797),(890,'2018-08-27 00:00:00.000000',3,'경험과 연륜이 느껴졌습니다\n타자가 느리신편이지만, \n쉽게 말을 꺼내지 않고 고민해보고 말하시는거 같아\n저는 좋았습니다. 몇번 더 해볼 생각입니다',798),(891,'2018-06-27 00:00:00.000000',4.5,'여러 측면에서 도움이 되었습니다',781),(892,'2017-11-28 00:00:00.000000',5,'  좋았던 점: 그동안 몰랐던 저의 좋은 모습들..그리고 상처를 이겨낼 수 있는 힘이 생기게 됐달까요! 예전 기억에서 조금은 자유로워 졌어요.  아쉬운 점:빠른 시간으로 쫌더 아픈곳을 더 보고 싶었는데..시간이 아쉽네요..^^\n',799),(893,'2017-11-10 00:00:00.000000',5,'  좋았던 점: 생각이 다시 돌아오던 부분을 딱 잡아주셨습니다. 마음의 정리는 된 것 같습니다.   아쉬운 점:상담 시간이 너무 금방 지나가버려서... 추가결제 하려고 했는데, 타이밍이 안맞아서 다음 예약을 잡아야 하는게 아쉽네용 ',800),(894,'2018-10-12 00:00:00.000000',5,'많은 도움이 되었습니다\n\n',781),(895,'2018-07-02 00:00:00.000000',5,'지지도 잘 해주시면서 객관적이고 현실적인 대처방안을 구체적으로 알려주셔서 편했습니다. \n스스로 알고 있는 부분이어도 잘 되지 않았는데 다시 노력해볼 기회였던 것 같습니다. \n또 뵙고 싶습니다.\n감사합니다.',801),(896,'2017-08-06 00:00:00.000000',3,'  좋았던 점: 어떤 얘기든 잘 들어주셔서 좋았습니다. 상담할때 이것저것 두서없이 말한거 같은데 잘 들어주셨어요.  아쉬운 점:채팅 속도가 좀 느린것 같습니다. 핸드폰으로 할때는 핸드폰이라 그런줄 알았는데, 피씨에서 해도 마찬가지네요-!',802),(897,'2017-11-12 00:00:00.000000',1.5,'  좋았던 점: 흠..  아쉬운 점:흠..',803),(898,'2018-07-04 00:00:00.000000',5,'많은 도움을 받았습니다',781),(899,'2018-04-01 00:00:00.000000',5,'  좋았던 점: 통찰력이 뛰어나세요  아쉬운 점:시간이 아쉽네요 \n\n\n',793),(900,'2019-03-26 00:00:00.000000',4,'중간중간에 선생님이 해주신 이야기들에서 이런저런 깨달음이 있었습니다. 깨달음을 안고 살아보려고 합니다. 감사해요!',804),(901,'2019-04-19 00:00:00.000000',4,'대답하시기 어려운 내용인데도 성의껏 말씀해주셔서 감사합니다 \n',805),(902,'2019-03-05 00:00:00.000000',5,'저를 있는그대로 봐주시면서 객관적인 조언도 해주십니다. 지금 내가 왜이런지 모를때 현실적인 자각을 할 수 있었어요. 감사합니다.\n',806),(903,'2018-04-09 00:00:00.000000',4,'  좋았던 점: 신뢰를 가지게 해주십니다  아쉬운 점:없습니다 ',793),(904,'2018-07-17 00:00:00.000000',5,'답이 없는 문제를 답정너처럼 묻긴했는데요. 100프로의 정답을 원한건 아니지만 너무 맑은 물에는 물고기가 살지 못한다는 얘기는 다같이 흙탕물이되자는 말인데 그런 얘기를 하시는건 도덕적 윤리적으로 옳지 않고 본인이 흙탕물이나 다름없다고 하시는거와 같죠\n',807),(905,'2017-12-18 00:00:00.000000',3.5,'  좋았던 점: 익명으로 상담 할 수 있다는 점과 좀 더 마음을 정리해서 말 할 수 있다는 점이 좋았고\n제가 생각하지 못했던 제 마음을 알 수 있었습니다  아쉬운 점:몇 번 하지않았기에 아쉽다고 말 할 부분이 없다고 생각됩니다.',808),(906,'2017-10-31 00:00:00.000000',3,'  좋았던 점: 편하게 하소연 할수있었엉ㄴㆍㄷ  아쉬운 점:조금 더 길었으면요',809),(907,'2018-02-19 00:00:00.000000',2.5,'  좋았던 점: 공감을 잘해주셨습니다.  아쉬운 점:답변 속도가 늦으셨습니다.',810),(908,'2017-11-16 00:00:00.000000',5,'  좋았던 점: 잘물어봐주셔서 감사햇고. 객관적인 이야기들을 해주셔서 좋앗다  아쉬운 점:채팅이 조금 느리신것같아요',811),(909,'2020-06-15 00:00:00.000000',5,'자세히 말씀해주셔서 좋았어요:) 감사합니다!',812),(910,'2020-06-14 00:00:00.000000',5,'상담사 분께서 제가 가지고 있는 문제에 대해 잘 파악하시고 해결책을 제시해 주셨습니다. ',813),(911,'2020-05-21 00:00:00.000000',5,'많은 고민끝에 상담을 하게되었습니다.\n어떤 말을 어디서부터 해야할지 몰랐는데\n걱정과 다르게 대화도 잘 이끌어 주시고\n짧은시간 이였지만 도움 많이 받았습니다!\n다음번에도 상담사님께 도움요청드리겠습니다~',814),(912,'2020-05-14 00:00:00.000000',5,'감사합니다',815),(913,'2020-04-23 00:00:00.000000',5,'현실적인 답변이 도움이 많이 되었습니다 :) 감사해요\n',816),(914,'2020-04-21 00:00:00.000000',5,'모르겠어요..',817),(915,'2020-04-11 00:00:00.000000',5,'해결할 방법을 찾고 싶어요 조언 감사해요',818),(916,'2020-03-31 00:00:00.000000',5,'제가 처한 상황에서 좀더 다른 방면으로 고민해볼 수있는 상담을 해주셨습니다. ',819),(917,'2020-03-13 00:00:00.000000',5,'타자 치는 속도에 따라 꺼낼 수 있는 얘기의 양이 한정되게 되네요. 그래도 상담 자체가 처음이신 분들이나, 직접 상담사를 만나러 가기까지의 용기가 잘 안나시는 분들이 상담이 어떤 것인지 맛보기로 체험하기엔 좋은 것 같아요.',820),(918,'2020-02-27 00:00:00.000000',5,'친절한 답변에 늘 위로가 되었습니다. ',821),(919,'2020-02-26 00:00:00.000000',5,'저는 해결점을 찾고 싶은데 해결방법을 잘 짚어주셨어요 ',818),(920,'2020-02-21 00:00:00.000000',5,'선생님을 믿어요  늘 감사합니다\n표현하기 힘든 마음들을 알아주셔서 좋아요 감사합니다\n',822),(921,'2020-01-30 00:00:00.000000',5,'처음 상담이라 제가 어색해 했는데 자연스럽게 질문도 먼저 하시고 진행을 해주셔서 수월하게(?) 상담했습니다. \n',823),(922,'2020-01-27 00:00:00.000000',5,'늘 감사합니다.\n감정적이기 보다는 현실적인 조언을 해주셔서 좋아요\n전 그런 게 정말 필요했거든요',824),(923,'2020-01-27 00:00:00.000000',5,'요즘 상태에서 치료가 필요할까에 대해 의문점이 들어 신청하였습니다. 깔끔하게 정리 해주셔서 좋았습니다. 감사합니다.',825),(924,'2020-01-20 00:00:00.000000',5,'이야기를 차분하게 들어주시면서도 잘 이끌어 나가 주십니다.\n덕분에 마음에 쌓아둔것이 많이 해소됐습니다\n처음이라면 고민하지말고 상담받아보세요',826),(925,'2020-01-07 00:00:00.000000',5,'10대 발생했던 우울증. 진단받고 상담 및 약물치료를 하다 그만두고 20대 조울증 진단을 받고 상담치료를 진행하다 조증이 계속되던 어느날 상담은 필요없다 생각해 그만두고 해외에 나와 살게되었습니다. 약 6년 여간 조울증으로 힘들었고 외국이라 상담은 커녕 적절한 약물치료를 받지못하고 힘든나날이 지속되었습니다. 충동적인 자살에 대한 생각이 커지고 일상생활이 어려워지던 때 마지막이라 생각하고 인터넷에 검색하여 찾은 트로스트. 그중 권효석상담사님의 소개 등 내역을 보고 이분이다! 라는 느낌이 들었습니다.  남자분이라 살짝 불편할까 고민도했었지만 다른상담사분들보다 나에게 맞는 분이라는 생각을 떨칠 수 앖아 바로 결제 후 총 4회의 전화상담을 진행했습니다. \n편안하고 부드럽게 제가 느낀감정을 거부하지않고 ‘그렇군요’라고 인정해주시는 목소리에 타인에게도 이렇게 안정감을 느낄 수 있구나 처음 깨달았습니다. 그러나 단순히 푸념이나 한풀이가 아닌 내가 느낀 감정이 무엇인지, 내가 본질적으로 원하는것이 무엇인지 이후 내가 이것들을 건강하고 이성적으로 바라볼 수 있도록 제시해주셨어요. 선생님 말씀처럼 우리가 심호흡처럼 누구나 할 수 있는건데 누구나 잊고있는 가장 기본적이면서 효과적인 방법들을 제시해주셔서 어렵지 않게 시도해보고 긍정적인 변화들을 몸소 체감하고 있습니다. 이후 기회가 된다면 권효석 상담가님과 다시 상담을 꼭 다시 하려고 합니다. \n이글 보시는분들 권효석상담가님 추천드리고 힘내시길 바래요!',827),(926,