 방향으로 나아가게 되었어요 감사합니다 ',845),(947,'2019-08-26 00:00:00.000000',5,'일단 말 못할 사정에 대해 용기내서 털어 놓았더니, 제 생각의 잘못된 시각, 지나친 것 등에 대해 간단하면서도 확실하게 잡아주는 기분이었습니다. 한전의 상담 만으로 이 기분과 모든게 다 괜찮아 지겠냐만 첫발을 들여 놓았다는 것 만큼은 부정 못하겠네요. 뭔가 꽉 막혀있던 인생길에\n길 하나 놓은 것 같았어요. 감사합니다.\n ',846),(948,'2019-08-21 00:00:00.000000',5,'현실적인 조언들이 도움이 되었어요! 감사합니다.',847),(949,'2019-08-19 00:00:00.000000',5,'좋았습니다.',848),(950,'2019-08-19 00:00:00.000000',5,'감시합니다~',849),(951,'2019-08-18 00:00:00.000000',4,'정확하게 저의 생각을 알아주셨어요 해결법도 많은 도움이 됐습니다 그런데 조금만 말투가 친절하셨으면 더 좋을 것 같아요!\n\n\n',850),(952,'2019-08-18 00:00:00.000000',4,'우울감의 원인이 궁금했었는데 분석을 속시원하게 해주셨어요. 도움이 되는 조언 감사합니다',851),(953,'2019-08-16 00:00:00.000000',5,'차분하게 생각을 정리할수 있는 시간이였습니다. 감사합니다',849),(954,'2019-08-14 00:00:00.000000',5,'내가 알지 못했던걸 객관적으로 알 수 있어서 후련했어요 용기도 주셨고 상담이 편했습니다 ',852),(955,'2019-08-11 00:00:00.000000',4,'제가 생각하지 못했던 해결방안을 알려주셔서 좋았고, 실제로 그 방법이 도움이 되었습니다. :) \n\n',853),(956,'2019-08-09 00:00:00.000000',5,'감사합니다 앞으로도 노력해볼게요\n',854),(957,'2019-08-06 00:00:00.000000',5,'좋습니다.\n해외에 거주하면 상담을 받기가 어려운데 메세지로 편하게 진행할 수 있어서 좋았습니다.',855),(958,'2019-08-06 00:00:00.000000',5,'문제해결에 초점을 맞추시는거 같아 좋습니다 계속해보려고요',856),(959,'2019-08-05 00:00:00.000000',5,'인지하기 싫었던 부분을 명확하게 짚어주셨습니다',857),(960,'2019-07-31 00:00:00.000000',5,'제 얘기를 경청해주셔서 감사합니다.\n좋은 상담자 선생님인거 같아요.\n전화가 많이 끊겨서요. 그 부분이 해결 됐으면 좋겠어요.\n상담 감사합니다.',858),(961,'2019-07-28 00:00:00.000000',5,'짧은 시간에 뭔가 필요했던 부분을 딱 짚어주시니까 헤쳐나갈 힘이 다시 반짝하고 생기는 것 같아요. 더 길게하고 싶었는데 좀 아쉽고, 헤쳐나가다가 지칠때 또 연락드리고 싶은 상담이었어요. 감사합니다 선생님!',859),(962,'2019-07-22 00:00:00.000000',5,'아직 한 번 받았는데, 잘 한 것 같아요. 학생이라 돈도 부족하고 이런 상담은 한 번도 해본적이 없어서 돈이 저한테는 작은 금액이 아니라서 상담시작 직전까지 취소할까 말까 했었어요. 예전에 메일 한통보내서 고민상담 하는 거 8천원 정도에 한 적있었는데 별로여서 혹시 그런건 아닐까, 걱정했는데 진짜 전문적인 상담이었어요. \n제 문제가 진짜 오래된 거고 좀 오랜 기간 상담이 필요하지만 계속 상담받으면 나아질 것 같다는 느낌이 들었던게, 제가 무슨 생각을 했는지, 이걸 어떻기 해야할지를 다 말을 할수가 있고 제가 한 생각이 뭐가 잘못됐는지, 어떻게 해야할지를 알려주시는 거였어요. \n앞으로 자주는 못하더라도 꾸준히 받아보려구요. 감사합니다',860),(963,'2019-07-17 00:00:00.000000',5,'현실적인 조언과 방향이 많은 도움이 되었습니다. 제가 생각지 못한 부분을 집어주셔서 사고가 전환되는 계기였던 것 같아요.\n',861),(964,'2019-07-15 00:00:00.000000',5,'늘 알 수 없는 불안감을 느꼈습니다.\n지속되는 불안감 속에서 무기력해지고 , 우울해졌죠.\n우울은 계속 증폭되고 우울이 나인지 , 내가 우울인지의 경계도 희미했습니다 .\n그러다 늘 쉽게 긍정적이되고 , 밝아지는 성격이기에 상담은 받지 않아도 된다 생각했어요 .\n우울하다가도 늘 다시 포커스를 잡으니까요.\n이렇게 방치한지 일이년 .\n이제는 우울이 우울인지도 모르고 지냈습니다\n예민해지고 , 눈물도 너무 쉽게 나고 , 감정조절이 잘 되지않았어요 . \n그렇게 소중한 이들과 멀어지고 나니 무언가 잘못된것 같다는 의구심이 들었고 상담을 시작했습니다 .\n2019년 최고의 선택이었습니다.\n다음 상담도 잘 부탁드려요',862),(965,'2019-07-13 00:00:00.000000',5,'링겔 맞은 느낌이에요. 짧은 시간에 뭔가 필요했던 부분을 딱 짚어주시니까 헤쳐나갈 힘이 다시 반짝하고 생기는 것 같아요. 더 길게하고 싶었는데 좀 아쉽고, 헤쳐나가다가 지칠때 또 연락드리고 싶은 상담이었어요. 감사합니다 선생님.',859),(966,'2017-11-17 00:00:00.000000',5,'  좋았던 점: 처음이라 걱정 많이했는데 굉장히 인간적으로 말씀해주셔서 되게 편하게 받아들일수 있었어요 한문장 한문장 이해가 잘되게 얘기해주셔서 감사했습니다~  아쉬운 점:크게 없습니다',863),(967,'2017-12-30 00:00:00.000000',4,'  좋았던 점: 총체적 접근  아쉬운 점:공감받는 느낌이 많이 들진 않았음.',864),(968,'2019-02-08 00:00:00.000000',5,'간결하게 핵심적인 내용 짚어주신 것 같아 감사했습니다.',865),(969,'2019-06-30 00:00:00.000000',5,'긴 안목으로 지금 상황을 볼 수 있게 도와준 값진 경험이었습니다. 감사합니다!',866),(970,'2018-03-01 00:00:00.000000',0.5,'  좋았던 점: 답장이 빨랏습니다  아쉬운 점:현실적 조언이 없고 대화가 겉도는 느낌을 받았습니다\n ',867),(971,'2018-11-30 00:00:00.000000',4.5,'상담시간이 짧아서 아쉬웠지만 그래도 조금이라도 다른시각에서 저를 볼수있는 시간이라서 좋았어요. 저도 제문제에서 한번도 생각해보지 않은 방향으로 볼수 있게되서 근본원인과 조금은 가까워질수 있겠다 하는 희망이 있어요',868),(972,'2017-11-03 00:00:00.000000',5,'  좋았던 점: 짧은 시간에도 어떻게든 답을 주시려 한 점 감사합니다  아쉬운 점:앱이 자주 멈추네요',869),(973,'2018-01-02 00:00:00.000000',5,'  좋았던 점: 공감과 질문을 적절하게 해주시며.. 특히 짧은 시간 내에 제게 필요한 통찰을 이끌어 내주셨어요. 정서적으로 위안은 물론이고 새로운 생각을 갖게 되어 속이 후련하고 에너지가 회복되었습니다! 정말 감사합니다!  아쉬운 점:없습니다',870),(974,'2017-09-07 00:00:00.000000',4,'  좋았던 점: 단순한 고객이 아닌 진정으로 상담을 해주시려는 태도가 굉장히 진정성 있었습니다. 저를 진심으로 걱정해주신다는 느낌을 받았어요. 존중받는 기분이었습니다.  아쉬운 점:말을 쉽게 하지 못하는 사람에게는 조금 더 대화를 이끌어주셔도 좋을 것 같습니다.',871),(975,'2017-11-17 00:00:00.000000',5,'  좋았던 점: 제 이야기에 공감을 잘해주셔서 너무 감사했어요\n정말 감사합니다  아쉬운 점:없습니다',872),(976,'2019-06-12 00:00:00.000000',4,'무조건적인 공감보다는 현실적인 조언을 해주셔서 감사했습니다~ 도움 많이 되었습니다.',873),(977,'2018-06-06 00:00:00.000000',3,'  좋았던 점: 솔직하고 치료를 위해 적극적으로 임해 주시는 점  아쉬운 점:조금 구체적으로 알려주셨우면',874),(978,'2019-06-12 00:00:00.000000',4,'처음이라 제얘기만 많이한것같고 50분이 어떻게 지나갔는지 모르겠어요. 좋았던점은 제가 왜 그런행동을 하는지 원인분석을 해주셔서 좋았고 제자신을 좀 돌아볼 수 있는 기회가 됐어요',875),(979,'2017-11-04 00:00:00.000000',4,'  좋았던 점: 잘 들어주서고 다른 말로 표현해주셨어요  아쉬운 점:더 구체적인 답변이 필요해요 추상적인 답 말고',876),(980,'2019-06-12 00:00:00.000000',4,'내 문제를 다른 관점에서 볼 수 있는 시간이었어요. 재미있는 상담이었습니다ㅎㅎ',877),(981,'2018-03-05 00:00:00.000000',5,'  좋았던 점: 계속해서 질문을 해주셔서 좋았습니다.\n나도 알던 답이여도 다른 사람이 말해주는 것 자체만으로도 좋아요.  아쉬운 점:없었습니다.',878),(982,'2018-03-05 00:00:00.000000',3,'  좋았던 점: 제 문제파악을 개념화시켜주셨어요  아쉬운 점:위로를 받고싶었는데 문제가 무엇인지 파악하는거같아서... 취조? 당하는듯한 느낌이 조금있었어요',879),(983,'2018-03-05 00:00:00.000000',4.5,'  좋았던 점: 현실적이어서 좋았습니다.  아쉬운 점:딱히 없습니다.',880),(984,'2018-08-14 00:00:00.000000',3.5,'혼자서 생각하지 못했던 인생의 중요한 가치에 대한 물음부터 고민할 수 있게 질문 유도를 잘 해주신 것 같습니다.\n단순한 공감이 아닌, 적절한 질문과 현실적인 판단에 입각한 답변이 상담사님의 큰 장점이라고 생각합니다.\n',881),(985,'2018-01-05 00:00:00.000000',4,'  좋았던 점:  명확하게 보아주셔서 조금더 생각을 정리할 수있었습니디.  아쉬운 점:조금 더 말씀을 많이 해주셨으면했습니다..',882),(986,'2018-01-05 00:00:00.000000',4.5,'  좋았던 점: 제 편을 들어주셔서 마음이 편하고 든든했어요  아쉬운 점:없어요~ ',883),(987,'2017-11-18 00:00:00.000000',3,'  좋았던 점: 아직 잘 모르겠어요  아쉬운 점:아직 잘 모르겠어요',884),(988,'2017-09-18 00:00:00.000000',2.5,'  좋았던 점: 잘 들어주셔서 좋았음  아쉬운 점:첫 상담이어서',885),(989,'2018-12-10 00:00:00.000000',3.5,'잘들어주십니다\n',886),(990,'2017-11-05 00:00:00.000000',5,'  좋았던 점: 제 말을 하나하나 잘들어주셔서 감사합니다  아쉬운 점:없었어요',887),(991,'2018-01-08 00:00:00.000000',3.5,'  좋았던 점: 제가 생각해보지 못한 부분을 알게되었어요.   아쉬운 점:크게없습니다',888),(992,'2018-05-12 00:00:00.000000',4,'  좋았던 점: 방안 제시 현실적인 조언 따뜻한 위로   아쉬운 점:너무 현실적인 답변과 조언',889),(993,'2018-03-08 00:00:00.000000',5,'  좋았던 점: 이야기에 공감해주셔서 감사한 시간이었고 아무에게도 하지 못햏던 이야기를 꺼낼 수 있게 해주셔서 의미 있는 시간이었습니다.  아쉬운 점:없습니다^^',890),(994,'2018-08-20 00:00:00.000000',3.5,'차분하게 상담해주신 점이 좋았습니다’',891),(995,'2018-06-13 00:00:00.000000',0.5,'  좋았던 점: 간결한 상담내용.  아쉬운 점:상담자가 맞으신가 싶을정도로, 상담을 받은 느낌은 안들었습니다.\n',892),(996,'2017-07-24 00:00:00.000000',1.5,'  좋았던 점: 자세히 물어보는 것  아쉬운 점:채팅속도가 느려요',893),(997,'2017-11-06 00:00:00.000000',4,'  좋았던 점: 사고전환 해주기 위해 생각해볼수있도록 질문 많이 해