.\n정말 행복한 상담 시간 이었습니다.  아쉬운 점:없었어요. 감사했습니다.',906),(1011,'2017-09-22 00:00:00.000000',5,'  좋았던 점: 갑자기 상담이 종료됐다고 떠요ㅠㅠㅠㅠㅠ  아쉬운 점:갑자기 상담이 종료됐다고 떠요ㅠㅠㅠㅠㅠ',900),(1012,'2019-06-16 00:00:00.000000',5,'너무 감사합니다. 저의 불안이 어디에서 시작되었는지 \n자책할필요가 없다는것도 조금 인지하게되었어요',907),(1013,'2018-01-15 00:00:00.000000',5,'  좋았던 점: 질문도 유도해주시고.. 차근차근 문제점과 해결 방안과 상담햇으몀하는 방향을 제시해주셔서 좋앗습니다  아쉬운 점:없습니다',908),(1014,'2017-11-22 00:00:00.000000',2.5,'  좋았던 점: 적극적으로 경청해주셔서좋았습니다  아쉬운 점:크게 없는 것 같습니다',909),(1015,'2019-03-10 00:00:00.000000',5,'선생님께서 해결방법을 알려주셔서 좋았어요.\n다음번에도 선생님께 여쭤보려고요.\n',910),(1016,'2017-09-24 00:00:00.000000',4,'  좋았던 점: 제가 생각지도 못한 것들까지 파고들면서 왜 그렇게 행동했나..를 찾아주시고..답을 찾아주시기보다는 혼자 스스로 생각해서 깨닫게 해주시는게 좋았어요...물론 조금 직설적이셔서 상처받아시지만요ㅜ  아쉬운 점:텍스트라 조금 느려서 시간이 조금 아까웠어요..차라리 음성으로 상담하는 게 더 나았을 거 같네요..',911),(1017,'2018-03-13 00:00:00.000000',5,'  좋았던 점: 심리상담을 받는다는게 처음이어서 걱정반 기대반으로 일단 텍스트 30분을 트라이해보았는데, 선생님의 리드에 장기적으로 솔루션을 찾을수 있을것 같은 예감이 들어 안심이 되었어요.  아쉬운 점:없는 것 같아요\n',912),(1018,'2018-03-13 00:00:00.000000',4,'  좋았던 점: 감사합니다  아쉬운 점:시간이 더 있었더라면',913),(1019,'2019-07-04 00:00:00.000000',5,'경청해주셔서 감사합니다',914),(1020,'2018-05-07 00:00:00.000000',3,'  좋았던 점: 상황을 객관적으로 보도록 도와주십니다  아쉬운 점:목표달성을 위한 해결방법까지 조언받기에는 시간이 많이 부족한 것 같습니다',915),(1021,'2018-01-22 00:00:00.000000',5,'  좋았던 점: 약 두달간 함께 해주셔서 감사합니다. 핵심  아쉬운 점:.',916),(1022,'2019-04-12 00:00:00.000000',4.5,'차분하시고 현실적인 조언 좋았습니다 ',917),(1023,'2017-09-30 00:00:00.000000',5,'  좋았던 점: 제가 처한 상황이나 저의 상태를 비유를 들어 잘 설명해주셔서 명쾌하게 이해가 되었습니다. 객관적이고 냉철한 현재상태에 대한 해설 덕분에 제 자신에 대해 인지하게 되었고 그에 맞는 솔루션으로 지속적인 노력을 할 수 있었습니다.  아쉬운 점:크게 없었던 것 같습니다.',918),(1024,'2017-10-14 00:00:00.000000',5,'  좋았던 점: ^^  아쉬운 점:^^',919),(1025,'2017-10-01 00:00:00.000000',4.5,'  좋았던 점: 제가 핵심을 짚고 있지 못할 때 통찰력있게 메세지를 던져주셔서 좋았습니다.  아쉬운 점:크게 없습니다.',920),(1026,'2018-01-24 00:00:00.000000',5,'  좋았던 점: 심리치료 완료시 적겠습니다   아쉬운 점:심리치료 완료시 적겠습니다',921),(1027,'2017-10-01 00:00:00.000000',4,'  좋았던 점: 근본 원인을 찾아 주신 것 같습니다.  아쉬운 점:감사합니다.',922),(1028,'2018-06-28 00:00:00.000000',5,'머리가 맑아지고 해결할  수 있겠다는 희망이 생겼습니다.횡설수설했는데 단어로 정리해주셔서 감사해요.',923),(1029,'2017-08-02 00:00:00.000000',4,'  좋았던 점: 편하게 대화를 이끌어주시고 잘 들어주셔서 감사했어요. 차분히 들어주시고 공감해주시니 위로받는 기분이 들었습니다. 아직 해답도, 희망도 보이진 않지만 상담을 조금 더 하면 가능하지 않을까 바래봅니다.   아쉬운 점:시간이 정해져있어 아쉽네요. ',924),(1030,'2017-10-03 00:00:00.000000',4.5,'  좋았던 점: 비유적으로 잘 설명해주셔서 감사드립니다  아쉬운 점:시간이조금 부족했던것같아요',925),(1031,'2017-10-31 00:00:00.000000',3.5,'  좋았던 점: 객관적으로 이야기를 잘 듣고 판단해서 조언해주신점이 좋았습니다.  아쉬운 점:좀 더 적극적인 개입과 첨언을 해주셨음 더 좋았을듯해요',926),(1032,'2018-03-19 00:00:00.000000',5,'  좋았던 점: 지금 현재 잘못 생각하고 있었던 상황을  잘 정리해 주시고 ,원인이 뭔지 알 수 있어서 좋았고, 해결점에 있어서 방향성 제시와  선택하는데에 있어 객관적인  의견을  들을 수 있어 좋았습니다.  아쉬운 점:없습니다.',927),(1033,'2018-01-29 00:00:00.000000',5,'  좋았던 점: 집중해서 차분히 잘 들어주셔서 복잡해서 말하기 힘들었던 내용도까지도 이야기 하기 쉬웠고 차분한 모습으로 상담해주셔서 너무 좋았습니다   아쉬운 점:텍스트로 하니까 타자에 한계가 있어서 다음번엔 전화신청을 할 예정입니다 ^^',928),(1034,'2018-05-12 00:00:00.000000',4.5,'  좋았던 점: 친절하시고, 마음 편하게 대화 할 수 있었다는 점이 가장 좋았습니다. 조언도 많이 도움이 되었구요. 감사합니다.  아쉬운 점:상담 시간이 너무 빨리 지나가는 것 같아 아쉬운 것 빼고는 없습니다.',929),(1035,'2017-12-01 00:00:00.000000',5,'  좋았던 점: 말하기 힘든 고민을 편안하게 말할 수 있는 분위기에서 받을 수 있어서 감사했습니다   아쉬운 점:딱히 없습니다',930),(1036,'2018-07-01 00:00:00.000000',3,'시간이 좀 짧아서 얘기를 다 못했네요 시간이 좀 짧아서 얘기를 다 못했네요 시간이 좀 짧아서 얘기를 다 못했네요 시간이 좀 짧아서 얘기를 다 못했네요 ',931),(1037,'2019-03-22 00:00:00.000000',5,'털어놓을 수 있었어요.\n과거까지 흘러가서..\n다시 한번 상담받고싶네요.',932),(1038,'2017-11-11 00:00:00.000000',3.5,'  좋았던 점: 처음이라 어려웠는데 질문을 잘해 주셨어요  아쉬운 점:제가 타이핑이 느리다 보니 시간이 부족해서 아쉬웠어요',933),(1039,'2017-12-04 00:00:00.000000',4,'  좋았던 점: 누군가에게 할수 없던 이야기를 할수 있게되어 마음이 조금이나마 가벼워 졌습니다. 앞으로 나아가는 방향을 잡아주시기 보다는 제가 스스로 방향을 잡아 나갈수 있는 방법을 알려주셔서 좋았습니다. 목소리다 차분하고 따듯하셔서 상담통화시 힐링이 됬습니다.  아쉬운 점:상담시간 30분이 조금 많이 짧게 느껴지는것 빼고는 없었습니다.',934),(1040,'2018-10-25 00:00:00.000000',2.5,'현실적인 조언 감사합니다 :)\n\n',935),(1041,'2017-12-05 00:00:00.000000',3.5,'  좋았던 점: 핵심을 짚어주신것같아요\n  아쉬운 점:컴퓨터에선 로딩이 좀 더걸려서 엇갈릴때가 있었네요\n',904),(1042,'2017-12-06 00:00:00.000000',3.5,'  좋았던 점: 제가 겪은일을 이성적으로 바라보게 정리해주셔서 좋았어요. 너무 감정적이었는데 한걸음 뒤로물러나서 이성적으로 대처할 방안을 찾게된것 같아요  아쉬운 점:30분이 생각보다 짧네요 ..',936),(1043,'2018-04-02 00:00:00.000000',4.5,'  좋았던 점: 차분하게 잘 듣고 조언 감사요  아쉬운 점:특별히 없었어요',937),(1044,'2017-10-13 00:00:00.000000',4.5,'  좋았던 점: 제가 이야기 했던 내용들을 잘 정리해 주시고 해결방법을 찾아가며 적극적으로 도움을 주시려는 부분이 좋았어요  아쉬운 점:크게 없습니다.',938),(1045,'2018-05-16 00:00:00.000000',5,'  좋았던 점: 정확한 질문을 던져주시고, 쉽게 판단하거나 어림짐작 하지 않으시고 끈기있게 상담을 이어나가신다는 느낌이 들었어요.  아쉬운 점:없습니다!',939),(1046,'2019-05-13 00:00:00.000000',5,'제 문제를 감정적인 위로뿐만 아니라 이성적으로 생각해볼수있어서 좋았습니다. 그리고 문제의 핵심에 다가가서 이야기를 할 수 있어서 현재의 삶과 생각을 개선하는데 도움이 많이 됐어요. \n',940),(1047,'2019-07-09 00:00:00.000000',5,'도움이 되는 조언을 많이 해주셨어요\n',941),(1048,'2019-06-02 00:00:00.000000',5,'일방적인 저의 얘기에도 집중해서 들어주시고 나의\n고민이 당연하다는 말씀에 조금은 안정감을 느껴요 감사합니다',942),(1049,'2018-05-18 00:00:00.000000',3.5,'  좋았던 점: 침착하시고 딱부러지게 설명해주셨어요.  아쉬운 점:좀 바쁘신 느낌 이였어요',943),(1050,'2019-03-26 00:00:00.000000',5,'제가 생각하지 못했던 부분들을 언급해 주셔서 여러가지로 생각해보고 정리해볼수 있었습니다. 처음 텍스트 상담이었는데 상담사님이 친절하셔서 좋았습니다. 감사합니다.',944),(1051,'2018-05-19 00:00:00.000000',5,'  좋았던 점: 해결방안을 이성적으로 알려주시는거 같아 좋았습니다.  아쉬운 점:없었습니다.',945),(1052,'2019-04-17 00:00:00.000000',5,'작년에 상담사님과 상담을 진행했던 적이 있어서 반갑게 4회 텍스트 상담을 신청 했습니다. 확실히 직접 만나서 하는 것 보다는 대화 내용에 한계가 있지만 최근에 많이 고민하고 있었던 부분에 대해서 크게 도움을 받았고, 덕분에 지금보다 더 우울해지지 않도록 붙잡을 수 있었던 것 같아요. 저는 싫으면 금방 도망가는 스타일인데, 상담사님은 항상 차분하게 강요하지 않고 이야기를 잘 이끌어내주시는 분이라서 항상 감사하게 생각합니다.',946),(1053,'2017-08-12 00:00:00.000000',2,'  좋았던 점: 상담전 제시해 주신 1)-13) 까지 상담받고싶은 내용을 쓰는 접수지 작성하는 것으로  스스로 이 일을 더 직시할 수 있게 만들어 주어서 좋았다.  아쉬운 점:내담자의 주장을 다소 믿지 못하는 것 처럼 느껴질 때가 있었다., 현실적인 충고를 많이 해 주시려고 하셨으나 본질적으로 내담자가 도움을 받고자 하는 핵심에 대한 파악에 약하다고 생각되었다., 상담지식전문가라기보다는 일반주변어른과 대화하는 것 같았다',947),(1054,'2018-09-14 00:00:00.000000',3.5,'거울을 보여주는것같은 느낌을 받았어요..저한테 짧은상담보다는 단계별로 전화나 화상으로 상담받아보고도 싶네요 짧은시간이였지만 해주신 말씀 많이 도움되었어요 깨닫게 해줘서 감사합니다...그런데 주관적으로 조금 상담스타일이 딱딱하고 차갑게 느껴지긴 했네요',948),(1055,'2018-07-10 00:00:00.000000',4,'나름대로 제 문제의 원인을 파악하려고 애써왔는데 상담사님 덕분에 새로운 시각으로 문제를 보게되었습니다 시간이 참 짧다 싶었어요 유익한 시간이었습니다\n',949),(1056,'2019-06-03 00:00:00.000000',5,'\n현재 문제상황에서 근복적인 문제가 뭔지를 깨달을 수 있는 상담이었고 그 과정에서 스스로 깨우치도록 유도해주셔서 많은 도움이 되었습니다.\n더불어 해결책도 제시해주셔서 열심히 노력해보려고 합니다.\n\n감정적에 치우쳐 이야기를 했는데 상담이 끝나니 이성적으로 생각이 정리되네요.\n\n또 힘이들때 찾아뵙고싶습니다-\n\n\n',950),(1057,'2018-02-06 00:00:00.000000',3.5,'  좋았던 점: 제 문제점을 콕 찝어서 가감없이 말씀해주시는 게 좋았어요.  아쉬운 점:채팅 속도가 느려서 답답했어요.. ',951),(1058,'2018-05-20 00:00:00.000000',5,'  좋았던 점: 차근차근 생각할 수 있게 도와주셔서 좋았습니다  아쉬운 점:딱히 없었습니다.',952),(1059,'2018-05-20 00:00:00.000000',1,'  좋았던 점: 직접적은 해법제시  아쉬운 점:제 입장을 공감해주시진 않는듯',953),(1060,'2019-01-24 00:00:00.000000',3.5,'추상적인 다짐에 대해 다각도로 살펴 주시고, 현실적이고 구체적인 방법론적인 접근이 좋았습니다. ',954),(1061,'2017-11-14 00:00:00.000000',4,'  좋았던 점: 문제 파악 후에는 문제해결을 위해 적극적으로 물어봐둔게 가장 좋았습니다\n  아쉬운 점:중점적인 내용 파악하는데 시간파악이 좀 오래 걸렸던거 같습니다',955),(1062,'2018-05-21 00:00:00.000000',5,'  좋았던 점: 핵심 간결, 정확.\n저야 늘 길게 상황설명을 하는 버릇이 안 고쳐졌지만\n눈에 딱 들어오게 정확히 답변만.  아쉬운 점:아니요.\n.',898),(1063,'2017-10-21 00:00:00.000000',4,'  좋았던 점: 알지만 외면하고 있는 것을 짚어주셨어요. 침착하게 문자를 보고 이야기를 던져주셨어요.   아쉬운 점:채팅이고 초기상담이라 \n제대로 드러낼 수 없어서 저를 파악하기 힘드셨을 것 같아요. 이건 시스템의 아쉬운 점일 것 같아요. ',956),(1064,'2017-11-14 00:00:00.000000',4,'  좋았던 점: 위로의 말씀과 객관적인 분석이 좋았습니다.  아쉬운 점:단회권이다 보니 깊이있는 대화가 이루어지지 않아 아쉽습니다',957),(1065,'2018-05-22 00:00:00.000000',5,'  좋았던 점: 팩트를 알 수 있었어요   아쉬운 점:팩트만 있다보니  다른 생각으로 이어지는게 아니라 \n끝나버리는 느낌이었어요 ',958),(1066,'2017-11-15 00:00:00.000000',5,'  좋았던 점: 어떤 선택이 좋은 선택인지 모르는 상황에서 객과적으로 결론을 내주셨어요 걱정하는 바가 뭐인지 그것에대해 걱정을 덜어주셨어요   아쉬운 점:채팅속도가 느린게 아쉬웠어요\n그게 아니면 더 많은 이야기를 했을건데 아쉽네요',959),(1067,'2018-11-09 00:00:00.000000',5,'후회와 죄책감의 감정에서 벗어나지 못하고 있는데\n충분한 위로 뿐만 아니라\n제가 후회의 감정에서 자유로워질 수 있는\n좋은 말씀들을 많이 해주십니다..\n실제로 제가 또 다시 죄책감에 시달릴 때\n상담사님 말씀을 떠올리면 정신이 들어요 :)',960),(1068,'2017-10-29 00:00:00.000000',4,'  좋았던 점: 말씀 잘 귀기울여주시구요 심리적 안정이나 도움도 좋지만 저처럼 구체적인 도움을 구해보고싶을때는 상담신청하세요~어떤생각을 하면 좋을지, 가능한방법들도 알려주셧습니다  아쉬운 점:크게 없습니다!',961),(1069,'2017-11-15 00:00:00.000000',2.5,'  좋았던 점: 핵심을 정리해주셔서 고마웠습니다  아쉬운 점:냉정하게 평가해주시는것같습니다',962),(1070,'2017-10-30 00:00:00.000000',4,'  좋았던 점: 제가 회피하고 지내던 것들을 짚어주셔서 좋았습니다. 생각치 못했던 제 아픔을 일깨워주셔서 감사합니다. 앞으로 어떤 변화를 노력해야 할 지 방향 또한 제시해주셔서 좋았습니다.  아쉬운 점:처음에 채팅 속도가 느리다 생각했는데, 생각하시느라 그런 것 같습니다. 주욱 말씀해주실때는 느리지 않았습니다. 아쉬운 점 별로 없습니다.',963),(1071,'2017-11-15 00:00:00.000000',5,'  좋았던 점: 현실적이고 구체적인 조언,   아쉬운 점:크게 없는 것 같습니다. ',964),(1072,'2018-02-17 00:00:00.000000',4.5,'  좋았던 점: 이야기를 잘 들어주셨고 이런 저런 질문들로 문제의 핵심을 이끌러 내주셨습니다.   아쉬운 점:앱의 전산적 문제로 두번째 상담 시 피씨버전이 작동되지 않았습니다. \n',965),(1073,'2018-02-15 00:00:00.000000',5,'  좋았던 점: 따뜻하게 경청을 해주셔서 마음이 아주 편했고 이해받고 위로받는 느낌이었습니다. 평상시 궁금했던 질문들에 정말 전문적인 답변도 해주셔서 궁금했던 점도 충족되었던 시간이었습니다  아쉬운 점:없습니다~!',966),(1074,'2017-08-27 00:00:00.000000',5,'  좋았던 점: 늦은 시간에도 친절하게 상담해주시고  상담시간이 아닌 시간에도 제가 불안정하니 시간을 내주어 상담해주셨습니다. 너무나 친절하셨고 문제점울 콕콕 집어 주셔서 제가 좀 더 빨리 정신 차릴 수 있었습니다:)  아쉬운 점:없습니다',967),(1075,'2019-03-31 00:00:00.000000',4,'절망적인 기분을 느낀 경험을 하고 상담을 받게되었습니다. 상담사님께서 상황에 대해 객관적으로 말씀해주시고, 제가 보지 못했던 부분에 대해 짚어주셔서 문제를 파악하는데 도움이 되었어요. 상담을 통해, 전보다 마음이 안정된 것을 느낍니다. 감사합니다. ',968),(1076,'2019-02-03 00:00:00.000000',3.5,'정신과에서는 약처방만 줄곧 받아왔습니다 하지만 실질적으로 대안책을 주셔서 감사했습니다 ',969),(1077,'2018-02-18 00:00:00.000000',5,'  좋았던 점: 짧은 시간동안에도 저의 감정에 포커스를 맞춰 잘 다스리는 법을 알려주셨습니다.  아쉬운 점:없습니다 :)',970),(1078,'2018-04-16 00:00:00.000000',3,'  좋았던 점: N/A  아쉬운 점:채팅속도 느림. \n첫 상담이라 그럴 수있다지만 얻은 조언이 장기적,정기적인 상담이 필요하다는 것과 전화상담이 낫다는 것뿐.\n\n\n',971),(1079,'2017-11-02 00:00:00.000000',5,'  좋았던 점: 저에게 있어서 중요한것이 무었인지 잘 알려주시고 대처법이나 제가 개선할수 있는 부분을 잘 알려 주셨습니다. 용기도 많이 북돋아 주셨어요.   아쉬운 점:정말 하나도 없었구요 진짜 너무 감사한 시간이였습니다.',972),(1080,'2017-12-23 00:00:00.000000',5,'  좋았던 점: 제가 이해하기쉽게 설명을 잘 해주셨고, 저의 문제점이나 제가 나아갈 방향에 대해 함께 고민해주셔서 좋았습니다.  아쉬운 점:없습니다.',973),(1081,'2018-05-30 00:00:00.000000',5,'  좋았던 점: 감사합니다!  아쉬운 점:아니요.\n.',898),(1082,'2019-03-08 00:00:00.000000',3,'이야기를 잘 들어주시고, 잘 정리해주십니다. 깔끔하고 담백한 상담이라는 생각입니다 \n',974),(1083,'2017-08-31 00:00:00.000000',4,'  좋았던 점: 좋았어요  아쉬운 점:감사합니다.',922),(1084,'2018-04-18 00:00:00.000000',5,'  좋았던 점: 저의 유년시절 얘기를 들으시더니 제가 원하는 이상형이 왜 그렇게된건지 원인을 바로 집어내시네요~ 울컥했어요.. 앞으로 변화할 수 있는 희망이 보이는것같습니다..  아쉬운 점:30분짜리를 구매햇더니 시간이 짧았어요\n재결제를 통해서 변화방법을 알아봐야겠습니다',975),(1085,'2018-02-27 00:00:00.000000',5,'  좋았던 점: 제가 질문하는것에대해서 알기쉽게 설명해주셔서 좋았어요  아쉬운 점:없습니다',921),(1086,'2017-11-16 00:00:00.000000',5,'  좋았던 점: 막연한 충고가 아닌 현실적으로 가능한 방향을 제시해주시고 위안이 되엇네요  아쉬운 점:크게 없었습니다\n\n',976),(1087,'2019-03-10 00:00:00.000000',5,'저를많이깨닫게해주셔서 정말감사드리게되었습니다',977),(1088,'2017-08-30 00:00:00.000000',5,'  좋았던 점: 생각치도 못한 부분들에 대해 말씀해주셔서 좋았습니다. 마음이 조금 편해졌어요. ㅠㅠ  아쉬운 점:채팅으로는 한계가 있어서 전화로 할걸 싶었슴다',978),(1089,'2018-02-23 00:00:00.000000',5,'  좋았던 점: 자연스럽게 스스로 알게 해줘서 좋았어요\n제 스스로가 놓친 점이 있을때 생각하서 알게 하고 예시를 들어주셔서 이해하기 편했습니다 \n  아쉬운 점:크게 없습니다',979),(1090,'2017-09-02 00:00:00.000000',5,'  좋았던 점: 늘, 좋았습니다:) 필요한 부분 정확히 짚어 주시고 많은 도움이 되었습니다. 정확한 문제 파악과 그에 따른 해결 제시안까지 완벽했습니다:)  아쉬운 점:없습니다',980),(1091,'2017-11-16 00:00:00.000000',5,'  좋았던 점: 전문가적인 조언에 신뢰가 생겼고, 실질적으로 바로 실천할 수 있는 방향을 잡아주셔서 좋았습니다. 유머도 있으시고요~  아쉬운 점:없습니다~!',981),(1092,'2019-04-02 00:00:00.000000',4.5,'상담사님께서 제가 어떤식으로 해결해가야하는지 방향을 제시해주셨습니다. 익숙하지 않아 어려워 말을 버벅일때에도 먼저 말씀해주시면서 이야기 이끌어나가주셨고요. 제 자신을 더 비난하지 않도록 방법을 배운것 같습니다. 감사합니다.',982),(1093,'2019-04-02 00:00:00.000000',3.5,'좋습니다\n\n',983),(1094,'2019-06-10 00:00:00.000000',3.5,'아직 첫날이라 잘 모르겠지만 어느정도 제 마음에 대해 정리할 수 있은 시간이었습니다. ',984),(1095,'2020-06-21 00:00:00.000000',5,'따뜻한 격려와 도움 감사합니다!',985),(1096,'2020-06-08 00:00:00.000000',5,'차분하게  생각을 정리할 수 있었습니다.',986),(1097,'2020-06-06 00:00:00.000000',5,'진심어린 경청과 더불어 변화를 위한 미션을 주셔서 나아질수 있을거란 생각이 드는 상담이었습니다. 감사합니다',987),(1098,'2020-05-28 00:00:00.000000',5,'오늘도 감사합니다.',988),(1099,'2020-03-31 00:00:00.000000',5,'상담을 할때, 저는 정보가 필요했는데.. 구체적인 방법과 정보제공등 일상생활 에서 할수있는 것들을 알려주셨습니다. \n\n그리고, 진로에 대해 고민중 이시거나 차후 무엇을 할지 고민중이신 분들은 선생님께 상담 받아보시길 바랄게요. \n\n매번 내담자가 알수있게, 오늘 상담을 정리 해주셔서 좋았습니다.',988),(1100,'2020-02-27 00:00:00.000000',5,'감사하고 또  감사합니다',989),(1101,'2020-02-21 00:00:00.000000',5,'감사합니다.  ㅜㅡ',989),(1102,'2020-06-23 00:00:00.000000',5,'인지•행동적 치료에 관심이 있으시다면, 이승호 상담사님을 추천드립니다. \n\n저는 기질적으로 불안을 타고나서, 일상생활에서 패닉에 빠지는 경우가 꽤 많습니다. 계속 반복되다보니 \'이대론 안되겠다.\' 싶어서 이승호 상담사님께 상담을 받게 되었습니다. \n\n\"참을 수 없이 불안한 상황에서도 스스로를 다스릴 수 있는 방법을 알고 싶다.\"고 말씀 드리니, 호흡법을 기반으로 한 마음챙김 방법을 알려주셨습니다. 직접 호흡법을 시도해보고, 호흡을 하며 든 생각, 느낌 그리고 기분을 생각해 볼 시간을 주셨습니다. \n\n실제로 선생님이 알려주신 방법을 적용하니 마음이 편안해지고, 시끄러웠던 머리 속이 조용해지는 경험을 했습니다. 제가 생각해보지 못한 각도로 제 고민에 접근하신 것 역시 신기했고 도움이 많이 되었습니다. 유익하고 좋은 상담 진행해주셔서 감사합니다 :)',990),(1103,'2020-06-14 00:00:00.000000',5,'불안에 대해 깊게 생각할수있었어요\n제가 고민하는 부분이나\n걱정하던 부분에 대해 깊게 생각하며\n제가 불편해하는것이 어떤건지 알수있었어요\n지난주부터의 주어진 미션을 통해 자존감에 도움을 받을수있었습니다 ',991),(1104,'2020-06-13 00:00:00.000000',5,'따뜻한 말씀 감사드립니다. ',992),(1105,'2020-06-04 00:00:00.000000',5,'목소리에서 편안함을 느꼈고 짧은 시간이긴 했지만 솔루션을 주시고 제가 알고싶던 제 문제를 알게되어서 좋은 시간이였습니다~\n',993),(1106,'2020-06-02 00:00:00.000000',5,'따뜻하게 말씀해주시고 \n제가 필요한 해결방법도 제시해주셨습니다.\n삶에 도움도 되고 상처 치유도 되는 상담이었습니다.\n',994),(1107,'2020-05-19 00:00:00.000000',5,'공감을 해주시고, 해결방안을 말씀해 주시며 마음을 편안하게 해주셔서 너무 좋았습니다 : ) 감사합니다\n',995),(1108,'2020-05-16 00:00:00.000000',5,'목소리,말투, 반응 모두 내담자에게 가장 안정을 줄 수 있는 분이신 것 같아요. 전화지만 제 이야기를 귀기울여 들어주시고 하나하나 잘 공감해주셔서 참 감사했어요. 스스로 답을 찾을수있도록 편하게 이끌어주셨구요. 뭐라 표현하기 어렵지만 트로스트  말고도 다른 상담포함 지금까지 상담받았던 각기 다른 상담사분들이 계셨는데, 다시 상담을 받는다면 이 분께 찾아갈것같아요. 대화의 페이스를 내담자에 게 맞춰주시고, 편안하고 많은것을 얻어갈수있는 상담을 진행해주셨어요.',996),(1109,'2020-05-14 00:00:00.000000',5,'아무한테도 말할수없고 말할곳도 없는데~상담사 선생님한테   얘기하고나서 조금씩 정리된 내생각과 내감정~그리고 마음도 조금씩 편해지는거 같애요~\n마음이 괴로워서 억울해서 몸도 너무 아프고 지치고 숨이 안쉬일정도 였는데~지금 조금씩 숨이 쉬어져요~조금 살것같아요~\n젤중요한거는 비용도 크게 부담안되서 더 좋아요~\n선생님~감사합니다~\n',997),(1110,'2020-05-07 00:00:00.000000',5,'제 내면에 힘을 알아주시고 좋은 미래까지 그려볼수있도록 이끌어주셔서 감사합니다 기대했던 것보다 훨씬 의미있고 가치있는 시간이었어요 감사합니다',998),(1111,'2020-04-22 00:00:00.000000',5,'감사합니다',999),(1112,'2020-04-19 00:00:00.000000',5,'괴로운 마음이 진정됐어요. 감사합니다\n',1000),(1113,'2020-04-18 00:00:00.000000',5,'제가 왜 그랬는지에 대한 행동을 알 것 같아서 좋았습니다.',1001),(1114,'2020-04-16 00:00:00.000000',5,'네 감사합니다 ',1002),(1115,'2020-04-12 00:00:00.000000',5,'숨을 편하게 쉬는거 처음 해봤어요 감사합니다',1003),(1116,'2020-04-11 00:00:00.000000',5,'좋았습니다ㅎㅎ',1004),(1117,'2020-04-09 00:00:00.000000',5,'공감과 저에게 필요한 말씀을 해주셔서 감사했습니다.',1005),(1118,'2020-06-22 00:00:00.000000',5,'방향을 제시해주고 제 맘을 객관적으로 들여다볼숬게 도와주셨어요 감사한 마음이 크고 다음에 또 힘든 일이 있을때 연락드리기로 했습니다\n',1006),(1119,'2020-06-19 00:00:00.000000',5,'혼자만의 생각안에 갇혀 있었는데, 나부터 다시 돌아보자 생각하게 되었고 마음이 한결 가벼워졌습니다. 변화를 위해 노력해보겠습니다.',1007),(1120,'2020-06-19 00:00:00.000000',4,'앞섬 3주간의 상담에서는 제가 계속 마음 속 주변의 것들만 말하게 되고 속의 것을 말하지 못하여 답답했어요. 그런데 오늘 마지막 상담에서 그 속을 들여다보고 제 안의 저를 마주하게 되어서 고구마 맥힌 목에 물 한모금 넣어준 느낌이예요. 오늘 이렇게 마무리되어서 다행이란 생각이예요. 선생님이 말씀하신 것처럼 어릴 적 상처받은 내가 나올 때마다 인지하고 토닥이고 성인으로써 앞으로 나아갈꺼예요. 감사합니다.',1008),(1121,'2020-06-16 00:00:00.000000',5,'다시한번 제 감정을 인지 하는데 도움이 되었고, 친구같이 편안하게 들어주시다가도 제가 정확하게 표현하지 못하는 깊은 내면을 깨달을 수 있도록 날카롭게 질문해주시는 점이 좋았습니다. 시간이 좀 더 있었다면 적절한 조언과 공감, 긍정적인 지지를 더 해주실 수 있지 않았을까 하는 생각이 듭니다. 앞으로의 상담이 기대가 됩니다. ',1009),(1122,'2020-06-11 00:00:00.000000',4,'기분이 풀렸습니다 ',1010),(1123,'2020-06-10 00:00:00.000000',5,'상담을 통해 머리속에 얽힌 복잡한 매듭들을 하나하나 풀수 있게 된거 같습니다. 감사합니다.',1011),(1124,'2020-06-08 00:00:00.000000',5,'감사합니다',1012),(1125,'2020-06-03 00:00:00.000000',5,'늘 마음 깊이 숨겨둔 아픈기억이 제가 힘들때 올라와서 저를 더 부정적으로 끌어내리고 스스로를 괴롭혔었는데  상담선생님과 상담을 몇차레 진행하고 난 뒤 , 아픈 그날의 기억을 떠올려도 이제는 아프지 않아요 신기할정도로요 .. 그 기억을 없애버리는것만이 답이라 생각해서 더 힘들었는데 없애지않고도 이렇게 마음이 시원하고 가벼워질수있다니 너무 감사한 마음입니다 .. 아무에게도 말하지못한 꽁꽁숨겨둔 저만의 아픈기억들  귀기울여 들어주시고 공감해주셔서 정말 감사했습니다 \n알려주신 방법들 통해서 용기내서 하나씩 노력해볼게요  ^^.. ',1013),(1126,'2020-06-01 00:00:00.000000',5,'처음에는 별 기대하지 않았었는데 후기가 좋아서 하게 되었습니다. 잊고 싶은 안 좋은 기억들 때문에 너무 괴롭고 공황증상도 있어서 상담을 받게 되었는데 그 이유들에 대해서 객관적으로 알 수 있게 해주시고\n\n제 부족한 것들을 이해해주시고 위로해주셔서 좋았습니다. 상담시간이 더 길었다면 좋았을 정도로 힘이 되었던 시간이었습니다. 무엇보다 직접 대면하는 게 아니라 부담도 덜 되고 나눴던 대화 내용도 나중에 볼 수 있어서 좋은 것 같아요.\n\n가족이나 친구, 연인에게 힘든 걸 털어놓는 것도 좋지만 전문적인 상담사님을 만나는게 현실적으로는 더 도움이 되는 것 같습니다.',1014),(1127,'2020-05-30 00:00:00.000000',5,'다른상담도 받아봣지만 이번 상담사님과 진행한거는 \n도움이 많이 되엇습니다 ! \n어떻게 대처해야하는지도 알려주시고 저한테 꼭 맞는 상담이엇던것 같습니다 ! \n',1015),(1128,'2020-05-25 00:00:00.000000',5,'감사합니다. 다음이 봽겠습니다!\n',1016),(1129,'2020-05-21 00:00:00.000000',5,'여러 고민 끝에 전화상담을 받았습니다. 좀 더 일찍... 갈등이 생긴 초반부터 상담을 했다면 어땠을까.. 지금 상황이 이렇게까지 오진 않지 않았을까 싶어서 아쉬웠어요. 그래도 앞으로라도 나아질 수 있겠다는 희망을 가질 수 있어서 좋았습니다. 첫 상담 선생님이 천세경 상담사님이어서 정말 감사했어요. 계속 꾸준히 상담 받을 생각입니다.',1017),(1130,'2020-05-19 00:00:00.000000',5,'짧은 시간이라 엄청난 소득은 없지만 그래도 제 이야기를 잘 들어주시고 공감해주셔서 너무 감사했습니다.',1018),(1131,'2020-05-19 00:00:00.000000',5,'제가 생각하지 못 했던 부분들에 대해 질문해주시고 제가 놓치고 있던 부분들을 스스로 이해할 수 있게 도와주셔서 정말 도움이 많이 됐습니다. 그저 제 상황을 듣고 반응해주시는 것이 아니라 사람 심리에 대해서도 가르쳐주시는 게 많아 너무 좋아요. 죄책감이나 불안이 많이 심했는데 세 번 상담 후 마음이 훨씬 가벼워졌습니다. 앞으로도 조금씩 해결해나가면 될 것 같다는 희망이 보이구요. 오늘 상담 끝나고 10주 프로그램 신청했으니 앞으로도 잘 부탁드리겠습니다!',1019),(1132,'2020-05-19 00:00:00.000000',5,'어떤 부분을 좀 더 고민해봐야할지 가닥을 잡아가는거같아요',1020),(1133,'2020-05-18 00:00:00.000000',5,'오래전 상담에 실패 경험이 있어 두렵기도 했어요 .. 비대면 상담이라 괜찮을까 .. 결정을 하기까지 너무 오랜 시간이 걸렸는데 왜 이제서야 용기낸걸까 하는 마음이 드는 상담이였습니다 더 일찍 해보았더라면 고통의 시간이 줄어들수있었는데 말이죠 .. 시작이 반이라는 말을 제가 좋아하는데 오늘 첫 상담을 통해 저는 절반 온거같아요 .. 이제 계속 꾸준히 저를 치유할 생각이에요 ..  상담사님 통해서 얻은 방법들로 다음 상담까지 저를 수련해보려해요 .. 정말 감사합니다 많은 분들이 용기내어 홀가분해지셨으면 좋겠네요 .. \n\n',1021),(1134,'2020-05-15 00:00:00.000000',5,'상담사님이 제 얘기를 끝까지 들어주고 적절한 조언을 해주셨어요. 기댈 수 있어서 너무 좋았어요. 정말 감사해요 선생님. ',1022),(1135,'2020-05-14 00:00:00.000000',5,'제 감정을 잘 이해할 수있었어요',1023),(1136,'2020-05-12 00:00:00.000000',4,'첨이라 잘 모르겟어요',1024),(1137,'2020-05-10 00:00:00.000000',5,'우선 감사합니다 선생님\n짧았던 시간만큼 많은 대화를 할 수는 없었지만 복잡했던 제 머리속을 정리할 수 있었던 시간이었습니다.\n다른 말 필요 없이 정리 되는대로 다시 찾아뵐 수 있도록 하겠습니다\n다시 한번 감사했습니다 선생님',1025),(1138,'2020-04-24 00:00:00.000000',5,'얘기 들어주셔서 감사합니다',1026),(1139,'2020-04-24 00:00:00.000000',5,'제 얘기를 차분하게 잘 들어주시고 객관적으로 상황 정리 및 조언 해주셔서 \n도움이 되었습니다 목소리도 편안하고 너무 좋았습니다 많은 힘을 얻었어요 감사합니다!',1027),(1140,'2020-04-23 00:00:00.000000',5,'이야기하는 것만으로도 조금은 시원해졌어요',1028),(1141,'2020-04-23 00:00:00.000000',4,'제 말에 당황하지 않고 잘들어주셔서 감사합니다.',1029),(1142,'2020-04-17 00:00:00.000000',5,'나 자신도 몰랐던 부분을 생각할 수 있게 된 것 같습니다',1030),(1143,'2020-04-17 00:00:00.000000',5,'질문 해주시는 흐름에 따라 생각을 하니 방향을 잡을 수 있었습니다. 50분이라는 시간이 길다고 생각했는데 하다보니 너무 짧은 시간이었고 스스로 상담이 필요하다고 느꼈습니다. 감사합니다',1028),(1144,'2020-04-14 00:00:00.000000',5,'반신반의하는 마음으로 시작한 심리상담이었지만 덕분에 제 감정의 원인을 들여다보고 풀어나갈 방향을 찾을 수 있는 시간이 된 것 같습니다. 힘들때 주변 사람들에게 넋두리하듯 하는 말들은 한계가 있을 수 밖에 없는데 상담사님에게는 더 깊은 감정이나 생각들을 털어놓을 수 있어서 응어리진 마음을 비워내는 기분이 들어 좋았습니다. 공감하고 이해해주시는 말들이 많은 위로가 되었구요. 감사합니다.',1031),(1145,'2020-04-10 00:00:00.000000',5,'선생님 감사합니다\n조금더힘을얻었습니다\n엄마의딸로서가아닌 저를더이뻐하고\n제힘으로 살아가는사람이될께요',1032),(1146,'2020-04-08 00:00:00.000000',5,'감사합니다 마음