5,'시간이 부족했지만\n상담사님께서 제가 원하던 부분인 \n제 생각을 명료화해주셔서 정말 도움이 많이 되었고\n뒤죽박죽하던 제 머릿속이 한번으로도 이렇게 정리가 되니 감사합니다.\n확실히 받아보니까 좋았습니다!',1045),(1160,'2020-02-08 00:00:00.000000',5,'저는 다른 사람을 이해하려고 했지 \n그런 상황에 속에서 나의 모습이나 반응을 돌아보거나 하지는 않았던 것 같아요.\n아 내가 이런 사람이구나 이런걸 알아서 좋았어요. \n현실적인 조언도 도움이 많이된 것 같아요.\n50분의 짧은 시간 안에 많은 고민들이 정리정돈된 느낌이라 후련해요. 감사합니다.\n가능하다면 계속 상담받고 싶어요. \n',1046),(1161,'2020-02-07 00:00:00.000000',5,'기밀유지가 괜히 걱정됐는데 당연히 지켜주신다고 안심시켜주셔서 편하게 얘기했어요. 기술적 문제인지 전화가 연결이 잘 안됐는데 잘 기다려주셨습니다. 짧게 이야기 했는데 정말 마음이 편해졌어요. 감사합니다 :)',1047),(1162,'2020-02-04 00:00:00.000000',5,'제가 평생 보지 못한 부분을 집어주셔서 너무 놀라웠고 감사한 경험이었습니다. 너무 많은 도움이 되었어요!',1044),(1163,'2020-01-28 00:00:00.000000',5,'좋아요ᆢ생각이정리되고위로받아서요',1048),(1164,'2020-01-26 00:00:00.000000',5,'감사합니다 ',1049),(1165,'2020-01-23 00:00:00.000000',5,'감사합니다 들어주시고 정곡을찔러주셔서',1048),(1166,'2020-01-21 00:00:00.000000',5,'50분이 긴 시간인데요. 문자로 대화를 나누는데는 짧은 시간이라 여겼어여. 그런데 생각을 다시 정리 할 수 있어서 이것도 괜찮은 것 같아요. 그리고 고민 해결이 되요. 달리 전문인인가 싶어요. 선생님의 한마디로 저에 고민이 가벼워 지네요.  ',1050),(1167,'2020-01-18 00:00:00.000000',5,'감정이 엉켜있어서 미처발견하지못했던 해결의 핵심포인트를 발견했고 좀더 넓은시야에서 바라바고 방향을 잡을수있었습니다.\n',1051),(1168,'2020-01-07 00:00:00.000000',5,'만족스러웠습니다\n차분하게 들어주셨구요\n2차상담도 진행할 예정입니다\n\n',1052),(1169,'2020-01-06 00:00:00.000000',5,'스스로를 긍정적으로 바라볼 수 있는 힘이 생겼어요. 감사합니다. ',1053),(1170,'2020-01-06 00:00:00.000000',5,'감사합니다 :)\n',1054),(1171,'2019-12-30 00:00:00.000000',5,'세심하게 저의 마음과 상태를 들어주셔서\n 마음다잡는데 한결 편안해졌습니다.\n제 문제와 자녀문제를 분리하지 못해서 벌어진\n갈등상황들과 고민을 깨닫게 되었습니다.\n마음놓고 말할 수 있는 든든한 곳이 생겨서 좋았습니다.\n갱년기로 저 자신을 돌봐야겠다고 시작했는데\n상담 후 뜻밖에 더 힘든 상황이 생겨서 저의 불안이 더 커졌습니다. 이런 상황에 도움받을 수 있어서 다행이라고 생각합니다. 좀더 상담받고 싶습니다',1055),(1172,'2019-12-24 00:00:00.000000',5,'이야기를 잘 들어주시고 위로해주셔서 마음이 편안해졌습니다',1056),(1173,'2019-12-21 00:00:00.000000',5,'이해받고 있다는 느낌이 들어서 좋았어요! 그리고 객관적인 시각에서 현재 상황을 어떻게 풀어나가야할지도 이야기해주셔서 도움이 되었습니다',1057),(1174,'2019-12-11 00:00:00.000000',5,'저는 사람을 못믿었는데\n조금 믿어보려는 노력을 하게됐어요.\n\n내가 생각하는 이유가 아닐수있다는 걸 \n알게됐거든요.\n\n그런 변화가 가장큰 소득인거 같습니다!!\n\n\n다시\n마음이\n힘든일이 있다면\n상담을 요청하고 싶어요!!\n\n좋은 시간이었습니다!\n\n트로스트 안에서도 되게 이상적인 상담사님같아요!',1058),(1175,'2019-12-11 00:00:00.000000',4,'상담을 시작할 때엔, 아무것도 정리되지않은 엉망진창인 마음이었습니다. 상담사님이 공감을 해주시고,  지난 일을 얘기하면서 마음도 정리하고 일상도 회복할 수 있었던 것 같습니다. 일상이 너무 바빠서 마지막 상담일을 깜빡하고 놓쳐버려 감사인사를 전하지 못했네요. 힘든 시간을 딛고 일상을 보낼 수 있게해주셔서 감사합니다.',1059),(1176,'2019-12-01 00:00:00.000000',4,'좋았어요.\n일단 마음을 열고 시작했어요\n상담받는 거니까\n\n저는 자기성찰을 잘하는 편인데\n그래도 두려운 감정들은 \n피하게 되더라구요.\n\n상담사님이랑\n상담을 하면서는\n두려운 감정들에도 도달할 수 있게 되어\n좋았습니다\n\n힘이 됐어요',1060),(1177,'2019-11-17 00:00:00.000000',4,'가슴깊이 불안에 떨고 있는 어릴적 제 자신을 끌어내 주셔서 도움이 되었고 새로운 방향도 제시해 주셨습니다',1061),(1178,'2019-10-31 00:00:00.000000',4,'공감해주시고 다른 시각에서 좋은말씀도 해주셔서 감사했습니다. 우울증은 현실에서 할수 없는것을 바랄때 나타난다고 생각을 잘 정리해서 결정하라고 해주셨어요.',1062),(1179,'2019-10-30 00:00:00.000000',5,'전문가의 공감과 제안이 큰 힘이 되었습니다.\n변화되지 않더라도 나를 위해서 감정을 표현하는 것이 우울감에서 벗어날 수 있다는것을 알게되었고,\n또 우울감을 조장하는 상대로부터 나를 분리하는 것이 중요한것도 배워갑니다.\n감사합니다.',1063),(1180,'2019-10-26 00:00:00.000000',5,'좋아용ㅇㅇㅇㅇ',1064),(1181,'2019-10-24 00:00:00.000000',4,'잘 들어주시고 잘 공감해주시고 좋았어요',1065),(1182,'2019-10-18 00:00:00.000000',5,'별 큰일없이 괜찮다고 살아왔는데, 제가 지금 불편하게 느끼는 감정의 원인들이 과거의 경험들에서 나오고 있더군요. 잊고있던 기억너머의 사건들을 모조리 끄집어내서 원인을 찾아내, 방어보단 자연스런 반응을 할 수 있게 변화하고 싶어졌습니다.',1066),(1183,'2019-10-16 00:00:00.000000',5,'감사합니다. 앞으러 어떻게 변화할지 도움이 되었어요',1067),(1184,'2019-10-14 00:00:00.000000',5,'항상 잘 받고 응원받고있습니다.',1064),(1185,'2019-10-13 00:00:00.000000',4.5,'변화할 수있는 공식 같은걸 알려주셔서 이해하기 쉬웠네요 얘기 친절하게 잘들어 주셔서 감사드립니다\n도움이됬어요! \n',1068),(1186,'2019-10-09 00:00:00.000000',5,'계속받고있어요',1064),(1187,'2019-10-09 00:00:00.000000',3.5,'처음이라 아직 잘 모르겠지밀 따뜻하게 상담해주셨습니다\n\n',1069),(1188,'2019-10-07 00:00:00.000000',4,'머릿속에서만 굴리던 생각을 상담사님과 함께 정리해보아 조금 마음에 가벼워진 것 같습니다.',1070),(1189,'2019-10-04 00:00:00.000000',5,'나의 문제점을 객관적으로 바라보는 시선과\n어떻게 감정을 조절해야할지, 많이노력한것같아요\n근본적인 문제와 핵심을 잘 해주시고\n잘 들어주시고  앞으로 계속 할 생각이예요',1071),(1190,'2019-09-30 00:00:00.000000',5,'이야기를 들어주시고 그에대한 해결책을 내주셔서 감사합니다.',1072),(1191,'2019-09-20 00:00:00.000000',5,'차분하게해주시고 문제에대해 잘이야기해주시고\n부드럽게 잘들어주셔서 감사해요.\n해결책 알려주신거 실천 해 보고\n꼭 노력하고 다시상담하고싶어요',1071),(1192,'2019-09-20 00:00:00.000000',5,'이야기 들어주시고 공감과 위로를 잘 해주셔서 감사했어요\n이렇게해라 저렇게 해라보다는 제가 해결점을 잘 찾을 수 있게 끌어주시고\n잘 못찾을때는 같이 고민하고 생각해주시면서 제 힘으로 나아갈 수 있게 옆에서 도와주셔서 감사했어요\n',1073),(1193,'2019-09-12 00:00:00.000000',5,'4번의 상담을 하는 동안 저 자신에 대해 조금 더 살펴볼 수 있는 좋은 시간이었습니다. \n\n\n지금 제 자신이 불안감을 느끼는 상황이 어떤 생각 때문인지 그 생각은 어디에서 왔는지 저의 자라 온 환경이나 경험을 통해 함께 살펴봐 주시고 앞으로 어떤 생각으로 바꿔 가야하는지 알려주셨습니다. \n\n\n상담을 통해 제가 갖고 있는 완벽하려는 생각, 다른 사람을 통제하고 싶다는 생각, 자기 비난, 자기 혐오적 생각들이 얼마나 저를 괴롭히고 있었는지 알게되었고 스스로를 아끼고 사랑하기 위해 생각을 알아차리고 바꿔 가야 겠다는 생각을 했습니다. \n\n\n제가 미처 잘 알아차리지 못한 부분에 대해 짚어주시면서 대화를 이끌어가 주셔서 자신에 대한 이해에 도움 많이 받았습니다. \n\n\n앞으로도 선생님께서 제시해주신 시각처럼 저의 내면을 살펴볼 수 있으면 좋겠습니다.\n\n',1074),(1194,'2019-09-09 00:00:00.000000',4,'나를 돌아볼 수 좋은 기회였어요.',1075),(1195,'2019-09-03 00:00:00.000000',5,'마음의 답답함이 해소되었어요',1076),(1196,'2019-08-28 00:00:00.000000',5,'털어놓는것 만으로도 후련하고 좋네용:)',1077),(1197,'2019-08-27 00:00:00.000000',5,'친절하고 좋았습니다\n\n',1078),(1198,'2019-08-25 00:00:00.000000',5,'상담사님 덕분에 마음의 짐이 조금은 내려 놓아지네요 ^^\n시간이 얼마나 더 걸릴지 모르겠지만 시간이 더 지나면 더 괜찮아 질것 같아요 마음이란에 좋았다 나빳다 반복이고 이것 또한 받아 들이려구요 혹시 또 도움이 필요할때 신청 또 하겠습니다',1079),(1199,'2019-08-19 00:00:00.000000',5,'감사합니다',1080),(1200,'2019-08-16 00:00:00.000000',5,'마음속에 있는 하기힘든얘기를 할수있어서 좋아습니다. 힘들다고 말하고 싶은데 누구에게 해야할지 많이 망설였는데 얘기를 들어주셔서 감사합니다. ',1081),(1201,'2019-08-15 00:00:00.000000',5,'후련해요!!!!!',1082),(1202,'2019-07-26 00:00:00.000000',5,'답답할 때마다 제 마음을 털어놓고나면 특별한 해결책이 생긴 것도 아닌데 신기하게도 마음이 풀리는 것을 느낍니다. 그래서 상담후엔 되려 제가 감사한 마음이 들어요. ',1083),(1203,'2019-07-24 00:00:00.000000',5,'좀더 다른 시각으로 문제를 바라보게 된 것 같아요\n\n',1084),(1204,'2019-07-16 00:00:00.000000',5,'대면하지 않고하는 상담이 효과가 있을까?라고 생각했던 저지만 지금 상담 이전보다 생각이 정리가 되었어요. 제가 하고있던 걱정을 들어주시고 그것에 대해 객관적으로 판단을 내려주시니 막연히 걱정하던게 명확해지는 느낌이 들었어요. 또 과거의 기억으로 인해 힘들었는데 속후련히 이야기하니 이전보다 그 생각이 덜 나는 것도 신기했구요. 상담을  처음 접했지만 좋은 기억뿐이네요! 마음이 힘들어지면 또 해보고싶어요~!',1085),(1205,'2019-07-14 00:00:00.000000',5,'선생님 덕분에 많은 용기를 얻어 갑니다. 많은 배움두요^^',1086),(1206,'2019-07-14 00:00:00.000000',5,'이별의 아픔 후 그 사람을 떠내보내는것.\n일에대한 스트레스 등\n여러가지 주제에대해 선생님과 상담했던 시간이 짧게만 느껴지는 것 같아요.\n상담을 통해서 난 꽤 괜찮은 사람이구나. 행복한 사람이구나를 깨닫고 갑니다.\n선생님께서 해주신 말씀 잊지않고 힘들때 사용해보고, 또 힘든시기가 오면 상담을 받아보고 싶어요. 사람의 마음은 말로 상처를 받기도하지만 말로 치유될수도 있구나를 느낍니다.',1087),(1207,'2019-07-13 00:00:00.000000',3,'시간이 짧아서 아쉬웟지만 전문적인 느낌이라 좋았다\n',1088),(1208,'2017-08-31 00:00:00.000000',4.5,'  좋았던 점: 핵심적인 질문을 던지셔서 스스로에 대해 몰랐던 부분을 짧은 시간 안에 알게되었다.   아쉬운 점:별로 없습니다~ ',1089),(1209,'2018-11-27 00:00:00.000000',5,'고민을 얘기하면서 제가 듣고 싶었던 얘기, 하고 싶었던 얘기들을 해주시면서 공감해주셔서 정말 큰 위로가 되었고 당장 바뀔 수는 없는 상황이라도 저의 태도부터 바꿔보려는 힘이 생겼어요. 정말로 감사드립니다.',1090),(1210,'2017-07-17 00:00:00.000000',5,'  좋았던 점: 잘 알아들으심  아쉬운 점:상담시간이 짧아서 아쉬움',1091),(1211,'2017-11-17 00:00:00.000000',5,'  좋았던 점: 편안하게 얘기 할 수 있게 분위기를 만들어 주셨어요. 공감도 많이 해주시고요.. \n감사합니다.  아쉬운 점:없습니다.',1092),(1212,'2018-06-10 00:00:00.000000',4,'  좋았던 점: 객관적으로 제가 직면했던 상황에 대해서 얘기해줘서 좋았습니다.  아쉬운 점:상담의 목표외에도 저의 전반적인 정신이 정상적인지가 궁금합니다',1093),(1213,'2019-06-30 00:00:00.000000',5,'크게 도움이됐어요',1094),(1214,'2018-12-05 00:00:00.000000',4,'생각하지 못했던 관점으로 문제를 보게 된 것 같습니다. ',1095),(1215,'2017-09-08 00:00:00.000000',4.5,'  좋았던 점: 텍스트 테라피였지만 제 말을 신중하게 들어주시는 느낌을 받았어요. 아직 못다한 얘기가 많아 재결제할거에요!  아쉬운 점:50분 너무 짧아요!',1096),(1216,'2019-02-11 00:00:00.000000',4.5,'문제 해결을 위해 먼저 제 자신을 분석할 수 있도록 도움을 주셨어요. 선생님과의 상담 내용을 떠올리며 생각을 정리해보겠습니다.',1097),(1217,'2019-03-13 00:00:00.000000',3,'저에 대해서 객관적으로 알 수 있었어요 ',1098),(1218,'2019-04-28 00:00:00.000000',5,'정말 따뜻하게 말씀해주셨어요. 제가 생각하지 못한 부분도 상담을 통해 보게되었고요. 무엇보다 상담을 통해 확실한 해답을 찾을수 있어서 좋습니다.',1099),(1219,'2019-05-23 00:00:00.000000',5,'감정이 어디쯤에 있는지, 상황은 어떤지, 해결방안은 어떤것이 있을지에 대해 함께 해주셔서 늘 감사하고 한결 가벼운 마음을 만들어주셔서 고맙습니다 천세경 상담사님. \n\n',1100),(1220,'2019-06-12 00:00:00.000000',5,'저의 분노를 하나하나 뜯어서 살펴보는 기회가 되어서 참 좋았습니다. 화는 단순히 화 가 아니라 그 안에 각기 다른 뿌리를 두고 있다는 것도 알게 되었구요 고민된다면 일.단. 질러보는걸 추천드려요 사랑하는 나를 위해. 지치고 다친 나를 위해. ',1101),(1221,'2018-06-09 00:00:00.000000',5,'  좋았던 점: 제얘기를 잘들어주셔서 감사했어요.  아쉬운 점:없어요,..',1102),(1222,'2018-04-27 00:00:00.000000',5,'  좋았던 점: 잘 들어주십니다  아쉬운 점:없습니다. 만족했습니다. \n',1103),(1223,'2018-12-08 00:00:00.000000',4.5,'정말 좋았어요!! 감사합니다\n',1104),(1224,'2019-05-24 00:00:00.000000',3.5,'상황 설명한다고 시간이 가벼러서 아쉬웠어요.\n조언해주신 솔루션 참고하겠습니다',1105),(1225,'2018-01-07 00:00:00.000000',5,'  좋았던 점: 이해해 주시고 이야기를 잘 들어 주셨어요. 누구에게도 하지 못한 이야기인데 차분하고 또 따뜻한 마음으로 들어 주셔서 많은 위로가 되었습니다. 감사해요.  아쉬운 점:아쉬웠던 점은 없었어요~\n',1106),(1226,'2017-09-13 00:00:00.000000',5,'  좋았던 점: 차분하게 잘 들어주셨어요. 어루만져주시는 느낌이 좋았어요.  아쉬운 점:채팅속도가 조금 늦으세요. 그래도 그걸 커버하실 정도의 상담내용이라 좋았어요.',1107),(1227,'2019-05-25 00:00:00.000000',5,'저를 이해하는 계기가 됐어요\n이유업이 맘이 답답한줄 알앗는데 \n다 이유가 있더라구요\n어디 말하고 불편한 이야기 다 하고 나니 \n너무 맘이 편해요\n\n',1108),(1228,'2017-09-15 00:00:00.000000',5,'  좋았던 점: 상담중에 저도 모르게 눈물이 나왔어요. 직접 마주보고하는 상담이 아닌 텍스트테라피인데도 이렇게 제 마음이 움직인다는 것이 신기합니다.   아쉬운 점:50분 여전히 너무 짧아요!',1096),(1229,'2017-09-15 00:00:00.000000',5,'  좋았던 점: 제 마음의 불편한 감정을 정확하게 짚어주셨어요. 그리고 지지와 위로가 많은 도움이 되었습니다. 텍스트로 이야기를 나눌뿐인데 눈물이 앞을 가렸어요. 많이 외로웠는데 마음이 한결 가볍고 충만해지네요  아쉬운 점:텍스트 상담이라 채팅속도나 버퍼링이 있긴 했지만 상담 내용은 만족 스러웠어요. 다음엔 전화상담을 받아보고 싶네요',1109),(1230,'2017-11-06 00:00:00.000000',3,'  좋았던 점: 아직 잘 모르겠습니다. 잘 들어주십니다.  아쉬운 점:없습니다.',1110),(1231,'2017-11-20 00:00:00.000000',2.5,'  좋았던 점: 횡설수설 말했는데 요점만 딱짚어서 질문해주셔서 감사합니다  아쉬운 점:없습니다',1111),(1232,'2019-06-15 00:00:00.000000',5,'차분히 이야기 들어주셔서 감사합니다\n위로가 많이 되었어요',1089),(1233,'2018-06-17 00:00:00.000000',4,'저를 되돌아볼수있는 \n좋은시간이였습니다',1112),(1234,'2019-04-08 00:00:00.000000',5,'다른 사람에게 나누기 힘든 이야기를 속시원히 할 수 있어서 좋았어요. 이야기에 공감해주셔서 감사합니다. 제가 느끼고 있는 이런저런 감정에 대해서도 생각해보는 기회가 되었어요. ',1113),(1235,'2018-10-12 00:00:00.000000',5,'쌓인 말들이 너무 많고 말 주변도 없다보니 2회차에 되어서야 가장 중요한 문제점을 찾게 되었어요. 그런데 그 문제점들이 1회차에 생각치도 않고 연관 없을 것 같던 고민들과 연결 되더라구요. 방향을 잡았으니 노력해보고 안되면 또 찾아올 생각입니다ㅎㅎ',1114),(1236,'2017-11-07 00:00:00.000000',5,'  좋았던 점: 마음을 잘 읽으세요. 맘이 좋습니도  아쉬운 점:없어요',1115),(1237,'2018-10-13 00:00:00.000000',5,'제 문제의 근본이 되는 부분을 잘 짚어주시고 앞으로 개선할 수 있는 방법을 알려주셔서 좋았습니다',1116),(1238,'2019-07-03 00:00:00.000000',5,'제 얘기를 객관적으로 잘 들어주시고 때로는 공감으로 때로는 조언으로 도와주시려는 마음이 많이 느껴졌어요. 제가 어디로 향할지 방향을 못잡고 있었는데 상담사님을 통해서 어느정도 갈피를 잡은 느낌입니다. 힘든 도중에 많은 도움이 되어 감사드립니다^^ \n',1117),(1239,'2018-12-20 00:00:00.000000',5,'공감해주시고 \n어떻게든 풀어주려고 하시는 마음이 감사합니다. ',1118),(1240,'2019-07-03 00:00:00.000000',5,'두번이라 짧은 상담이 였지만 평소에 그냥 지나쳤었던 일들도 차분하게 짚어서 말해주셨습니다. 덕분에 내가 그부분은 그랬었구나 하고 알게되었습니다. 말하는 것만으로도 풀어지는 부분이 있음을 알게된 감사한 상담이였습니다. ',1119),(1241,'2018-03-14 00:00:00.000000',5,'  좋았던 점: 질문을 통해 저에 대해 생각해볼 수 있어서 좋았습니다 이해한다는 말이 위로가 되었어요\n  아쉬운 점:아쉬웠던 점은 없습니다\n',1120),(1242,'2017-07-27 00:00:00.000000',3,'  좋았던 점: 조금씩 방향이 잡히는게 좋았던거 같아요.  아쉬운 점:핸드폰보다는 온라인으로 채팅할수있음 더 편리할꺼같아요. 폰챗이다보니 속도가 넘느리네요.',1121),(1243,'2018-10-15 00:00:00.000000',5,'이야기를 잘 들어주시고 제가 깨닫지 못했던 부분을 짚어주셔서 알아차릴 수 있도록 도와주셨습니다\n많은 것을 깨닫고 느낄 수 있었던 좋은 상담이었습니다\n감사합니다 ',1122),(1244,'2017-09-27 00:00:00.000000',5,'  좋았던 점: 혼자서는 뭘 어떻게 해야 내 상황이 개선될지 알지 못해서 끙끙 앓았는데, 상담받으며 어떤 부분에 집중해야 할지 실마리가 보여서 좋았어요. 실제로 제가 집중해서 해결하려 하면 응원해주시고 북돋아주셔서 좋았습니다.  아쉬운 점:없었습니다. ',1123),(1245,'2018-01-22 00:00:00.000000',5,'  좋았던 점: 진지한상담  아쉬운 점:속도느림',1124),(1246,'2017-09-27 00:00:00.000000',5,'  좋았던 점: 제 단답식의 대화에도 대화를 이끌어가려고 해주신 점 감사합니다. 평소에 하고 있던 고민들을 잘 정리해서 돌아볼 수 있었습니다.   아쉬운 점:딱히 없습니다',1125),(1247,'2017-11-24 00:00:00.000000',5,'  좋았던 점: 저에게 계속해서 당시 기분이 어땠냐고 물어봐주셨던 것이 가장 좋았습니다. 설명하는 과정에서 더 상황에 대해 다르게 생각할 수 있었습니다. 또한 제가 느끼는 어려움에 대해 상담사님께서 구체적인 조언을 해주셔서 정말 알찬 상담이 되었습니다  아쉬운 점:아쉬운 점은 없습니다 :)  ',1126),(1248,'2018-03-14 00:00:00.000000',1,'  좋았던 점: 진지하게 임하셨어요  아쉬운 점:네',1127),(1249,'2017-11-24 00:00:00.000000',5,'  좋았던 점: \n.  아쉬운 점:.',1126),(1250,'2018-08-30 00:00:00.000000',4,'제가 생각 못했던 저에대해 조금 생각해보게 되었습니다. 말씀 감사합니다. 제가 좋아하는 일을 하고 있는데, 잘하는 일을 원하고 있다는 생각도 미처 하지 못했어요. 장녀 스트레스 부분도. 짚어주신 부분은 저 나름대로 한번 더 생각해보려구요. 감사합니다.',1128),(1251,'2019-05-06 00:00:00.000000',5,'이제 어느정도 감정 정리가 되었습니다.',1129),(1252,'2017-11-24 00:00:00.000000',1,'  좋았던 점: ㅣ  아쉬운 점:상당히 형식적인 . 내담자를 전혀 이해하지못하고 \n구체적인 해결방안을 제시하지 못했고 . 모바일 이라는 \n특성상 짧은시간안에 커뮤니케이션이 이루어지고 \n내담자에게 만족감과 방향성을 제시해줘야 이 어플에대한\n사용만족도가 있지. 전혀 없었음. ',1130),(1253,'2018-01-22 00:00:00.000000',5,'  좋았던 점: 내가 현재 처한 고민이 무엇인지 알게 해주었고 마음의 위안을 주었습니다. 주치의처럼 정확하게 문제를 집어주고 해결하려고 도움을 주셨습ㄴㄱ다  아쉬운 점:시간이 너무 촉박했어요',1131),(1254,'2018-01-24 00:00:00.000000',4,'  좋았던 점: 포커스를 잘 잡아주어서 좋았어요  아쉬운 점:컴퓨터로 하니 시간이 금방가서 아쉬워요',1132),(1255,'2017-11-10 00:00:00.000000',4,'  좋았던 점: 말을 편히 할수있도록 먼저 잘 이끌어주셔서 좋았습니다.먼저 공감해주시고 속마음을 헤아려주셔서 좋았습니다.차분히 힘들었던 상황을 되짚어볼 수 있어서 좋았습니다  아쉬운 점:조언이 짧았던게 아쉽습니다',1133),(1256,'2018-10-19 00:00:00.000000',4.5,'이야기를 잘 들어주시고 금방 원인을 파악해주셔서 큰 도움이 되었습니다.',1134),(1257,'2017-11-29 00:00:00.000000',3.5,'  좋았던 점: 원인에 대해서 파악해주려고 하셔서 좋았습니다.\n그리고 공감해주시는 모습또한 좋았습니다   아쉬운 점:채팅속도가 조금 느린 것 같습니다.',1135),(1258,'2017-11-29 00:00:00.000000',3.5,'  좋았던 점: 질문을 잘던져주셔서 좋았습니다  아쉬운 점:채팅속도가 조금 느린것같습니다',1135),(1259,'2018-01-26 00:00:00.000000',5,'  좋았던 점: 공감받고 위로받는다는 것이 무엇인지 알게 해주셨습니다. 항상 가슴을 거쳐나오는 말들은 저에게 온화하고 밝은 기운을 주었습니다 진심으로 저를 받아들여 다독이시고 포용해 주셨으며 그로인해 불안했던 제 자신을 올바르고 건강하게 수용하는 방법을 배웠습니다.   아쉬운 점:없습니다. ',1136),(1260,'2017-11-10 00:00:00.000000',4,'  좋았던 점: 현실적인 상담 감사하요  아쉬운 점:감사합키다',1137),(1261,'2018-10-20 00:00:00.000000',4,'털어놓을 수 있어서 후련했어요. 아무한테나 말할 수 없는 주제지만 사실 되게 쏟아내고싶은 얘기였으니까. 들어주시고 질문해주셔서 감사해요. ',1138),(1262,'2018-05-11 00:00:00.000000',1,'  좋았던 점: 공감해주려고 노력함  아쉬운 점:시간이 짧았다',1139),(1263,'2017-11-10 00:00:00.000000',5,'  좋았던 점: 책을 한권 권해주셨는데 큰 도움이 됐습니다\n  아쉬운 점:채팅속도 ㅎ',1140),(1264,'2017-12-01 00:00:00.000000',5,'  좋았던 점: 믿고 상담받는 천세경 상담사님~ :) 타지 유학 생활에서 힘들고 혼란스러운 시기가 올때마다 상담사님과 이야기하면서 제가 점점 강하고 단단해지는 걸 느낍니다.   아쉬운 점:없어요~ ',1141),(1265,'2018-09-04 00:00:00.000000',3,'얘기를 잘 이끌어주십니다\n',1142),(1266,'2019-07-07 00:00:00.000000',5,'저는 오프라인 상담도 10회 정도 받았는데 비용과 시간 등의 문제로 더 하지는 못했어요. 그러다가 가볍게 한 번 해보고 싶어서 했는데 결과적으로는 만족스럽네요.\n\n우선 무슨 이야기를 나눴는지 기록이 남아서 좋구요, 다른 사람과 얼굴을 마주보는 부담도 줄일 수 있어서 좋았어요. 주말 저녁에 할 수 있다는 점도 그렇구요.\n\n글로 쓰다보니 저도 제가 무슨 문제를 겪는지 정리할 수 있었고, 이 문제의 근본적인 원인이 무엇인지 잠깐 볼 수 있었어요. 1회차지만 만족합니다.\n',1143),(1267,'2019-05-10 00:00:00.000000',5,'제 얘기를 잘 들어주시면서\n상대방을 이해할 수 있도록 상담해주셨어요\n가감하지 않고 제 얘기를 털어놓으니 너무 좋아요\n다음에는 저에 대한 상담을 받을까 해요\n\n',1144),(1268,'2017-10-09 00:00:00.000000',5,'  좋았던 점: 제 얘기를 너무 잘 들어주세요  아쉬운 점:없습니다',1145),(1269,'2017-12-02 00:00:00.000000',5,'  좋았던 점: 질문이 좋았어요  아쉬운 점:없어요',1042),(1270,'2017-08-05 00:00:00.000000',4,'  좋았던 점: 잘 들어주셨어요  아쉬운 점:크게 없습니다',1146),(1271,'2018-10-23 00:00:00.000000',5,'상담을 마치며 의미있는 말씀들을 해주셔서 감사합니다.\n저의 고민에 적극적으로 같이 고민해주셔서 큰 힘이 됐습니다',1147),(1272,'2018-01-31 00:00:00.000000',5,'  좋았던 점: 제가 뭉뚱그려 말씀드린 것도 객관적인 눈으로 옳은 것과 아닌 것으로 나눌 수 있는 상담사님이 좋았습니다  아쉬운 점:시간이 짧아 아쉬웠습니다.',1148),(1273,'2018-10-25 00:00:00.000000',2.5,'좋은 점 : 생각하지 못한 점이 저의 행동에 영향을 준 것은 아닐지 알게되었습니다.\n아쉬운 점: 계속 같은 얘기의 반복같아서 아쉬웠습니다. 고민만 얘기하고 그에 대한 해결점이나 분석같은 것을 듣기엔 시간이 부족했습니다.',1149),(1274,'2019-01-11 00:00:00.000000',4.5,'다정하셨어요.. \n감사합니다\n',1150),(1275,'2017-08-07 00:00:00.000000',4,'  좋았던 점: 저의 아픈 부분을 위로할 수 있게끔 잘 이야기해주셔서 너무 감사했어요. 저를 위로하면서 눈물이 왈칵 나버렸네요.. 정말 감사드립니다.   아쉬운 점:제가 채팅으로 상담한게 처음이여서 그랬는지는 몰라도 즉각적으로 답이 빨리 나오질않아서 답답했지만 그래도 친절하게 말씀해주셔서 좋았어요~ ',1151),(1276,'2017-12-06 00:00:00.000000',4.5,'  좋았던 점: 편했어요  아쉬운 점:없어요\n\n',1152),(1277,'2017-08-07 00:00:00.000000',5,'  좋았던 점: 핵심이 되는 질문들을 해주셔서 스스로 깨닫게 하는 질문들이 좋았던 것 같습니다  아쉬운 점:인터넷 상담의 한계가 있어서 아쉽고 시간이 충분하지 않은게 아쉬웠어요',1153),(1278,'2019-01-16 00:00:00.000000',4.5,'친절하게 잘 들어주시고 공감해 주셔서 감사합니다. 특히 과거에 어떤 사건에 대해서 제가 느꼈던 감정을 물어봐 주셔서 감사해요. 힘든일이 있을때 부정적인 감정을 억제하고 숨기기에 바빴던 제게 그 감정을 꺼내어 어루만져 볼수 있는 기회가 되었어요.',1154),(1279,'2019-06-22 00:00:00.000000',5,'상황에 공감을 많이 해주시고 따뜻하게 말해주셔서 위로가 많이 됐습니다. 제가 필요한 방법도 알게 되었습니다. 다음에 또 상담 받을 것 같아요',1155),(1280,'2017-10-13 00:00:00.000000',5,'  좋았던 점: 어떤 해결책을 제시해주신다기보다는 잘 들어주십니다. 텍스트로 진행이 되더라도 상대 경청해주고 있다는 것은 얼마든지 느낄 수 있습니다. 내 속마음을 들어줄 누군가가 있다는 것만으로도 큰 힘이 됩니다.  아쉬운 점:없습니다.',1096),(1281,'2018-02-01 00:00:00.000000',4,'  좋았던 점: 호응을 해주시고 스스로 답을 찾게 도와주셨어요  아쉬운 점:시간이 좀 빨리가서 아쉬웠네요',1156),(1282,'2018-10-28 00:00:00.000000',5,'상담 해준다 그래놓고 가치판단을 하는 작자들이 많더라구요. 종교가 있으신거 같아서 더 걱정했는데 전혀 문제 되지 않더라구요. 전문 상담사인데는 이유가 있는거 같습니다. 듣는 태도 저도 본받고싶네요.',1157),(1283,'2018-10-28 00:00:00.000000',5,'정말 많이 힘들었는데 단기간에 도움이 많이 되었어요 털어놓을 곳이 없고 상처가 많아 남한테 신뢰를 잘 받지 못하는 편이었는데 제가 편하게 얘기할 수 있게끔 이끌어주시고 제 마음을 이해해주시고 따뜻한 조언을 해주셔서 너무 좋았어요',1158),(1284,'2018-03-28 00:00:00.000000',5,'  좋았던 점: 한 시간동안 무얼 얘기해야하나 부담스러운 경우가 있었는데 어느새 한 시간이 훌쩍 지나더라구요. 편히 얘기 할 수 있어 좋았습니다.  아쉬운 점:딱히 생각나는게 없네요',1159),(1285,'2018-09-10 00:00:00.000000',5,'문제해결에 대한 방향성이 느껴져서 매우 좋았음\n1회 결제라 시간이 짧아 구체적인 피드백은 어려울 수도 있다고 생각했는데 굉장히 명쾌하게 말씀해주셨음. \n스스로를 돌아보는 데에 많이 도움이 되었음 ',1160),(1286,'2018-05-17 00:00:00.000000',4,'  좋았던 점: 친절하게 끝까지 잘들어주시고 조언을 해주셔서 너무 감사합니다.\n다음에 상담을 받게되면 말씀해주신 부준에서 상담받고자하니요  아쉬운 점:50분이란 시간이 너무 짧네요 ㅠㅠ',1161),(1287,'2019-03-25 00:00:00.000000',5,'제가 하는 생각이 어떤 생각인지, 어느 부분이 오류인지 짚어주셔서 후련했어요. 평소에 스스로를 많이 돌아보는 편인데 또 다른 시각을 가질 수 있었던 것 같아요. 내주시는 과제, 해주시는 말씀들이 제가 앞으로 나아갈 방향을 그려주신 것 같아 감사합니다!',1162),(1288,'2018-05-18 00:00:00.000000',5,'  좋았던 점: 편하게 해주셨어요  아쉬운 점:시간이 부족했읊뿐요',1163),(1289,'2019-05-14 00:00:00.000000',3.5,'처음에는 텍스트로 하는 상담에 반신반의했어요 저만 혼자 말하고 있다는 기분이 들어서 조급했고 좀 오글거리기도 했구요 그런데 조금 난해할 수도 있는 제 고민을 끝까지 들어주시며 같이 해답을 찾으려고 고민해주셨어요 중간 중간 제가 상처 받았던 순간들에 공감하며 위로해주기도 하셨구요 저도 어렴풋이 알고 있었던 저의 문제를 다시금 짚어주시며 더 건강한 마음으로 지낼 수 있도록 많이 도와주셨어요 정말 감사합니다\n',1164),(1290,'2018-02-10 00:00:00.000000',5,'  좋았던 점: 공감능력도 좋으시고 너무 맘이 편해졌습니다.  아쉬운 점:없음',1165),(1291,'2018-05-19 00:00:00.000000',4,'  좋았던 점: 자유롭게 나자신을 드러낼 수 있는 기회가 되어서 좋았습니다.  아쉬운 점:좀 더 표현을 많이 했으면 어땠을까 하는 아쉬움이 남네요.',1166),(1292,'2019-06-23 00:00:00.000000',5,'좀더 다른 시각으로 문제를 바라보게 된 것 같아요\n\n',1167),(1293,'2018-04-02 00:00:00.000000',4,'  좋았던 점: 말을 부드럽게 하세요  아쉬운 점:시간이 짧게 느껴져요',1168),(1294,'2018-02-06 00:00:00.000000',5,'  좋았던 점: 들어주셔서 감사합니다.  아쉬운 점:없습니다.',1169),(1295,'2019-05-15 00:00:00.000000',5,'심리상담에 관심이 많았고 받고 싶었는데\n시간이나 비용문제\n알아보는데까지도 번거로운 게 있어서\n쉽게 접할 수 없었어요\n제 마음에 대해 정리해보는\n기회도 갖게 되고 하니\n마음이 후련하네요^~^♡\n힘들 때 또 도움받을 수 있겠구나하는\n든든함도 느낍니다\n상담 감사합니다♡',1170),(1296,'2019-06-03 00:00:00.000000',5,'조금 더 ..4회가지고는 모자란듯 ...\n나를 알듯말듯...생각지도 못했던 나를..\n알아가고 자존감이 뭔지 왜 우울한지 정확하게 찝어준다.\n마음에 위안을 주며 인정해주면서 안정감을준다\n조금더 상담을 받아보고싶어졌다\n나란 사람에 대해 나도 모르는 날 알려주기도 한다\n계속해서 넋두리를 늘어놓은것같은데 그 속에서 나를 찾아주는 ...',1105),(1297,'2019-01-23 00:00:00.000000',4.5,'이야기를 차분히 들어주시고 정리해주셔서\n기본적인 그 방법만으로도 생각이 정리되는 것을\n느낄수있었습니다.\n',1171),(1298,'2018-02-07 00:00:00.000000',5,'  좋았던 점: 따뜻하게 잘 대해주셨습니다  아쉬운 점:없습니다',1172),(1299,'2018-09-17 00:00:00.000000',4,'차분하게 천천히 다 들어주셔서 너무 감사했습니다! 제가 말 정리를 너무 잘 못 했는데도 조금씩 정리해주시며 제 생각에 대해 잘 답해주셨어요. 상담 너무 감사합니다!',1173),(1300,'2017-08-14 00:00:00.000000',4.5,'  좋았던 점: 제 마음을 잘 이해해주시는거 같았어요. 제3자의 입장에서 객관적으로 봐주시고 좋은말도 많이해주셨어요. 이야기도 잘들어주시고ㅎㅎ  아쉬운 점:좀더 현실적으로 조언을...^^',1174),(1301,'2017-10-20 00:00:00.000000',3,'  좋았던 점: 편안하게 공감해주고 방안을 제시해주셧습니다  아쉬운 점:아직은 딱히',1175),(1302,'2017-10-20 00:00:00.000000',4.5,'  좋았던 점: 핵심적인 질문을 던져주시고, 공감과 통찰력에 기반한 조언을 주셔서 좋았습니다   아쉬운 점:별로 없어요~~ ',1141),(1303,'2017-10-21 00:00:00.000000',5,'  좋았던 점: ^^  아쉬운 점:아니요~',1176),(1304,'2018-02-09 00:00:00.000000',4,'  좋았던 점: 깊은 얘기를 나눌수 있도록 질문해주시고 리드해주셔서 좋았어요. 제 얘기에 공감하시려고 노력해주셔서 감사했어요.   아쉬운 점:아니요ㅎㅎ ',1177),(1305,'2018-05-22 00:00:00.000000',5,'  좋았던 점: 이야기를 맥락있게 잘 이끌어주셨어요  아쉬운 점:역시 시간이 부족했읊뿐요',1178),(1306,'2018-11-08 00:00:00.000000',5,'선생님과의 상담으로 인해 감정이나 원인해결을 정말 많이 했어요.. 항상 해결도 잘해주시고 제가 말하는것들에 공감도 많이 해주세요ㅠㅠ 그 공감이라는게 변화의 가장 큰 이유인거같아요..! 정말 감사했습니다ㅠㅠ ',1179),(1307,'2018-09-20 00:00:00.000000',4,'기본적으로 공감대 형성을 잘하셔서 편하게 이야기할 수 있었습니다. 상담 경험이 많으셔서인지 사례들을 제시해주시는 게 좋았고 구체적으로 어떤 방법을 써볼 수 있을지 안내해주셔서 도움이 되었습니다. \n',1180),(1308,'2017-11-15 00:00:00.000000',5,'  좋았던 점: 제 문제의 근본적인 부분을 잘 짚어주시는 것 같아서 좋았습니다  아쉬운 점:없습니다',1181),(1309,'2018-11-10 00:00:00.000000',5,'너무너무 도움이 많이 되었어요.\n할까말까 고민많이했었는데 하길 정말 잘했습니다. 따뜻하지만 냉철하게 상황판단하시네요. 제가 인지하지 못했던 제 모습을 말씀해주셨어요. 조언해주신대로 앞으로 잘해나갈수 있기를 빌어요. 상담기간동안 감사했습니다 :)',1182),(1310,'2018-07-19 00:00:00.000000',5,'제 문제를 직면해 볼 수 있었어요 차분히\n객관적으로 또 따뜻하게 들어주셔서 감사합니다\n',1183),(1311,'2019-03-05 00:00:00.000000',3,'제가 원하던 상담내용이 아니였지만 상담사선생님은 괜찮았어요!!',1184),(1312,'2017-11-15 00:00:00.000000',0.5,'  좋았던 점: 좋은점은 없었습니다.  아쉬운 점:문제 해결에 대해 함께 실마리를 찾아가는 과정이라며 질문을 했는데 대답한 부분에 대해서 반복 질문을 하길래 질문만 하다 끝나는거 아니냐 하니 당황스럽다며 상담을 이어가지 않았습니다. 덕분에 트로스트에 엄청난 신뢰를 잃었습니다.',1185),(1313,'2018-04-11 00:00:00.000000',5,'  좋았던 점: 좋앗어요...\n\n  아쉬운 점:시간이짧앗어요',1186),(1314,'2018-11-13 00:00:00.000000',5,'제 말을 잘 들어주셔서 너무 좋았어요!\n콕 찝어 말할순 없지만 너무 좋은 느낌을 받아서..\n정말 감사합니다!',1187),(1315,'2018-09-22 00:00:00.000000',5,'4주간 텍스트 상담을 했는데, 상담하면서 저 스스로에 대해 좀더 객괸적으로 알개 되었습니다. 대인관계나 부부관계, 저 스스로에 대한 모습에 고민이 있었는데 상당부분 앞으로의 방향을 알게되었네요',1188),(1316,'2017-11-01 00:00:00.000000',5,'  좋았던 점: 제 얘기를 너무 잘 들어주세요  아쉬운 점:없습니다',1145),(1317,'2017-11-01 00:00:00.000000',5,'  좋았던 점: 차분하고 적극적인 태도로 질문해주시고 방향도 제시해 주셔서 좋았습니다. 다음에도 하게 된다면 같은 분과 이야기하고 싶습니다.  아쉬운 점:없습니다.',1042),(1318,'2018-02-18 00:00:00.000000',3,'  좋았던 점: 이야기를 할수있도록 잘 들어주시고 기다려줘서 좋았습니다. 이야기를 공감해줘서 이해받는 느낌을 받았습니다\n현실적으로 얘기해준것 좋았습니다.  아쉬운 점:다정한 위로가 좀 아쉽습니디 ',1189),(1319,'2017-11-22 00:00:00.000000',5,'  좋았던 점: 제애길 희망적으로 봐주시는게 참고마웠습니다~^^  아쉬운 점:글로 쓰니  아무래도 상담받는 느낌이  덜하네요',1111),(1320,'2018-02-18 00:00:00.000000',5,'  좋았던 점: 외부로 향하기 보다는 내 내면에 집중하면서 나를 따뜻하게 바라보고 용서할 수있도록 도와주셨어요. 실수를 통해서 나의 숨겨진 욕구와 필요들을 볼 수 있었네요! 아픔을 통해 오히려 성장한것 같아서 기뻐요!  아쉬운 점:좋았습니다!',1190),(1321,'2018-05-30 00:00:00.000000',2.5,'  좋았던 점: 잘들어주셨어요  아쉬운 점:결제한 시간이 짧아서 더 긴 답변을 못들은게 아쉬워요',1191),(1322,'2019-05-20 00:00:00.000000',3.5,'우선은 차분히 들어주시고 성향에 대한 파악이 이루어져서 조금 더 생각할수있는 좋은기회가 된거같아요!',1192),(1323,'2018-05-31 00:00:00.000000',4,'  좋았던 점: 저도 모르는 저를 꺼내주시도록 해주시는 것 같아 좋았습니다.   아쉬운 점:시간이 짧았던 게 아쉬워요. \n',1193),(1324,'2017-12-27 00:00:00.000000',4,'  좋았던 점: 분노가 결국 두려움이라는..제 안의 두려움에 대해 생각할 수 있도록 도와주셨습니다. 화가 결국 \'내가 맞고 니가 틀려\'에서 비롯된 것이라는... 단순하지만... 잊고 있는 것들을 돌아볼 수 있었습니다.  아쉬운 점:음..다만, 기계적으로 말씀하시는 것 같은 느낌이 들때 서운했습니다. 차라리 그런 제스쳐 없이 하는 것이 더 진솔하게 느껴질 것 같아요.',1194),(1325,'2017-11-02 00:00:00.000000',3,'  좋았던 점: 제 이야기를 듣고 공감해주시고 현실적인 해결방법을 알려셔서 좋았습니다.  아쉬운 점:처음이라 완벽하게 해결이되거나 마음이 가벼워지지는 못한거같아요',1195),(1326,'2018-07-30 00:00:00.000000',5,'종교적인 이야기도 함께  나눌 수 있어서 좋았고 공감해주신점이 가장 좋았습니다. 그리고  판단력이 흐려질 수 있는 부분에서 객관적으로 말씀해주신 점, 그리고 위로해 주신 것도 좋았어요. ',1196),(1327,'2018-11-23 00:00:00.000000',4,'마음이 많이 후련해졌습니다\n혼자서 생각하는것보다 상담을 받는게 더 확신이 생기고 좋다고 생각합니다\n',1197),(1328,'2018-07-31 00:00:00.000000',5,'차분하게 얘기도 잘 들어주시고 대화도중 저를 잘 유도해주셔 제 자신에 대해 알수 있었습니다. 처음에 상담하는거에 대해 마음 꺼려 했었는데, 잘 해냈다는 생각 밖에 안드네요. 감사합니다 선생님.',1198),(1329,'2017-11-16 00:00:00.000000',4.5,'  좋았던 점: 주저리 떠들었던말도 지나치지 않고 세세하게 상담에 활용?해주셔서 도움이 많이 되었어요 뜻밖에 위로가 되고 위안이 되는부분들도 좋았급니다   아쉬운 점:시스템이 안정화가 잘 안되는것 같아요 인터넷 연결이 잘 안된다 자꾸 떠써 썻었던게 지워지고 그러네요',1199),(1330,'2018-04-21 00:00:00.000000',5,'  좋았던 점: 저 자신을 돌아볼 수 있게 도와주셔서 좋았습니다.   아쉬운 점:없습니다. ',1141),(1331,'2019-06-10 00:00:00.000000',5,'제가 한 말들을 기반으로 전문가의 시선에서 저를 봐주셔서 너무 감사했어요. 아직은 막막하지만... 계속해서 선생님과 이야기 나누고 싶은 마음이 들었어요.',1200),(1332,'2017-07-17 00:00:00.000000',5,'  좋았던 점: 선생님이 핵심을 짚어주십니다  아쉬운 점:가격이 조금 비싼거같아요',1201),(1333,'2020-01-16 00:00:00.000000',5,'제가 생각하지 못한 관점의 이야기를 들을 수 있어서 좋았습니다',1202),(1334,'2019-12-13 00:00:00.000000',5,'털어놓고나니 마음이 조금은 후련해지는 것 같아요 ',1203),(1335,'2019-10-29 00:00:00.000000',5,'다른사람들이 정해주는 답이 아닌,나 자신에게서 답을 찾을수 있도록 도와주셨어요. 상담을 좀 더 진행 할 예정이라 아직은 내가 바라던 나의 모습은 아니지만, 내가 느끼는 나의 문제의 뿌리부터 서서히 치료해나가는 과정이라고 느껴졌어요.감사합니다!!',1204),(1336,'2019-10-08 00:00:00.000000',4.5,'따듯한 말씀과 배려가 많이 도움되었습니다.\n따듯한 마음처럼 따듯한 차도 알게해주셨구요!\n그동안 혼자서만 앓았던 이야기들을 폭풍처럼 쏟아낼 수 있어서 후련했습니다^^\n감사합니다~*^^*',1205),(1337,'2019-09-20 00:00:00.000000',5,'상담사분의 질문과 제가 대답하면서 자연스럽게 저의 상태가 어떤지 객관적으로 알게 된거같아요. 제가 확인못한 문제점까지도요. \n\n감사합니다ㅎㅎ',1206),(1338,'2019-09-10 00:00:00.000000',5,'상담은 처음이고 텍스트 상담은 더 성의없을 것 같았는데 정말 큰 도움을 얻었어요! ',1207),(1339,'2019-08-25 00:00:00.000000',5,'제 불안의 원인이나 우울함의 원인을 알수 있어서 좋았어요. 친절하게 상담해주셔서 감사합니다',1208),(1340,'2019-03-14 00:00:00.000000',5,'오랜 시간 동안 상담한 내용으로 마음을 다독이고 있었어요. 나에 대해 알고있지만 또 잘 모르는 부분들을 잘 집어주셔서 맘이 편안해지는 느낌입니다.',1209),(1341,'2018-04-22 00:00:00.000000',5,'  좋았던 점: 고민들을 말하다보니 이전에는 그냥 \'이런 상황이 싫다/힘들다\' 라고 생각했다면 상담을 하면 구체적으로 어느 부분때문에 제가 힘들고 싫은지 알게 되었습니다.  제 탓으로만 생각하는 습관을 어떻게 교정해야할 지 순차적으로 알려주셔서 좋았습니다.  아쉬운 점:아무래도 짧은 상담시간동안 고민을 100% 해결하기는 힘든 것 같습니다. 좀더 구체적이고 명확하게 해결하고 싶다면 지속적인 상담을 해야할 듯 합니다.',1210),(1342,'2018-08-01 00:00:00.000000',5,'신기하게도 정말 듣고 싶었던 이야기들을 해주셨어요. 상담 내내 제 이야기에 귀기울여 주신다는게 느껴졌고 용기도 생긴 것 같습니다. 계속 뵙고 이야기 나누고 싶어요.\n',1211),(1343,'2018-08-02 00:00:00.000000',5,'도움을 줄려고 노력하고 좋은 말씀 마니 해주셨어여 감사합니다\n',1212),(1344,'2017-11-03 00:00:00.000000',5,'  좋았던 점: 제 말을 잘 들어주시고 저에게 나름 현실적인 대답을 주신것 같아요. 또 중요한 부분에선 단호하게 대답하셔서 좋았어요ㅡ 워낙 자세히 설명드리기엔 짧은 시간이여서, 문제에 대해서 거의 돌려말하실까 싶었는데 나름 주어진 시간안에 어느정도 위로도 받았습니다.  아쉬운 점:아쉬운건 없었던것 같습니다. 경제적 여유만 된다면 상담을 더 받고싶어요. ',1213),(1345,'2018-04-23 00:00:00.000000',5,'  좋았던 점: 친절하게 잘 들어주시려고 하는 모습이 좋았고, 진정성이 느껴졌습니다. 덕분에 생각이 정리되고 되돌아볼 수 있었어요.  아쉬운 점:특별히 없습니다. 지금처럼만 초심잃지 마시고 진심으로 피상담자를 대해주세요!',1214),(1346,'2017-11-17 00:00:00.000000',5,'  좋았던 점: 친절하게 대해주시고 말을 편하게 할 수 있도록 해주셨습니다. 또한 제 얘기에 공감해주시면서 그와 같이 해결방안도 제시해 주셔서 좋았습니다.  아쉬운 점:없습니다.',1215),(1347,'2018-08-07 00:00:00.000000',5,'처음 상담을 받아보는데, 놀라울 정도로 제가 하고 있던 생각을 잘 짚어내 주셨어요. 정말 놀랍고 신기했어요. 어떻게 해야할지 말씀해주셔서 고맙습니다. 이야기를 하고 나니 한결 마음이 가벼워졌어요.',1216),(1348,'2017-11-04 00:00:00.000000',5,'  좋았던 점: 제 이야기를 들어주셨습니다  아쉬운 점:특별히 없습니다',1217),(1349,'2017-11-04 00:00:00.000000',4,'  좋았던 점: 저의 이야기를  잘 들려 주시고 공감도 해주시면서  방법에 대해서도  차분히  말씀을 해주셨어요  아쉬운 점:시간이 짧아서  아쉬웠어요',1218),(1350,'2018-10-06 00:00:00.000000',5,'텍스트로도 충분히 마음의 위로를 얻을수 있다는걸 느꼈어요. 공감해주시고 지금의 힘든 나를 위로해주시는게 잘 느껴 졌어요. 너무 감사합니다. 나를 더 아끼는법 잊지않고 실천해볼게요.',1219),(1351,'2019-02-15 00:00:00.000000',4.5,'내가 한 이야기들을 들으시면서 현재의 나의 감정과 상태를 스스로 생각해보게 해주셨다 \n그리고 나의 고민에 시작점에 있는 나의 문제점을 찾는데 큰 도움을 주셨다. 앞으로 문제를 해결해나가는데 좋은 방향을 제시해주셔서 실질적으로 도움을 받은 기분이었다. 많이 응원해주시고 격려해주셔서 힘을 낼 수 있었다.\n',1220),(1352,'2018-10-15 00:00:00.000000',3.5,'차분하게 얘기를 들어주시고 지금 당장 나에게 필요한 게 무엇인지 전문가적인 조언을 해주셨습니다\n단순한 위로가 아니고 상황을 정리할 수 있는 구체적인 방법을 알려주셔서 좋았어요',1221),(1353,'2018-08-25 00:00:00.000000',3.5,'중간에 그만둬서 잘 모르겠네요 죄송합니다 좋은 사람인것같아요 ',1222),(1354,'2017-11-07 00:00:00.000000',5,'  좋았던 점: 정말 제가 원하는 부분만 쏙쏙 해결해주셨어요.\n다음에도 또 이용하면 꼭 조윤경상담사님께 받고 싶어요.  아쉬운 점:대화 더 나누고싮은데 시간이 부족해요ㅠㅠ',1223),(1355,'2018-06-21 00:00:00.000000',5,'생각보다 시간이 많이 짧았습니다.\n늦은 시간임에도 차분히 얘기 들어주시고\n공감해주시고 위로해주셔서 큰 도움이 되었습니다.\n',1224),(1356,'2018-05-06 00:00:00.000000',5,'  좋았던 점: 친절하게 들어주시고 공감해주셔서 마음에 위로가 됩니다. 감사합니다..  아쉬운 점:없습니다~',1225),(1357,'2019-03-20 00:00:00.000000',5,'잘 들어주시고 해결덤 잘 찾아주시고 앞으로 어떻게 하면 좋을지도 말해주셔서 도움이 많이 뎄습니다 감사합니다',1226),(1358,'2018-10-17 00:00:00.000000',5,'내담자를 존중하시고 있는그대로 인정해주셔서 편안한 상담이 되었습니다. 감사합니다.',1227),(1359,'2018-10-17 00:00:00.000000',5,'많은 부분을 배려해주신 부분에 감사드려요.\n생각이 많았는데 정리하는데 조언도 받아서 생각을 편하게 정리할수있었어요.\n몇번 못해서 아쉬운것같아요.\n',1228),(1360,'2019-01-02 00:00:00.000000',5,'텍스트상담도 전화상담처럼 마음이 편안하고 생각이 정리된다는 것을 느꼈습니다. 쌤이 잘 들어주셔요. ',1229),(1361,'2018-05-10 00:00:00.000000',5,'  좋았던 점: 깊이있는 대화를 이끌어가주시고 제 고민의 본질을 잊지 않으시고 집중적으로 짚어주셨어요  아쉬운 점:없습니다 ',1230),(1362,'2018-05-11 00:00:00.000000',5,'  좋았던 점: 너무나 감사했습니다. 상담 전부터 긴글을 받아주셔서 제한된 시간에 노력하는 모습이 보였습니다. 짧은 시간이지만 저를 제대로 알아봐주시고 지지를 보내주셔서 큰 힘이 되었습니다  아쉬운 점:없습니다\n',1231),(1363,'2019-01-05 00:00:00.000000',4.5,'차분히 저의 이야기를 들어주시고 제상황에 맞는 상담을 해주어서 좋았습니다\n늦은시간에도 배려해주셔서 감사합니다\n ',1232),(1364,'2018-07-02 00:00:00.000000',5,'좋았어요\n\n',1233),(1365,'2018-02-04 00:00:00.000000',3,'  좋았던 점: 질문 유도를 해주셔서 좋았어요  아쉬운 점:좀 빨리 마무리 지으려고 하니 좀 그랬어요',1234),(1366,'2018-10-29 00:00:00.000000',5,'스스로에게 답할수 있게 질문을해주셔서 저에대해 다시한번 생각해볼수 있는 시간이여서 너무좋았어요 감사합니다',1235),(1367,'2018-09-11 00:00:00.000000',5,'충분히 고민을 들어주고 짧은 시간임에도 최선을 다해서 상담을 해주시는 모습이 너무 고마웠습니다',1236),(1368,'2018-07-11 00:00:00.000000',5,'공감해주시는 말을 해주시고 방법을 제시하려고 노력해주셔서 감사합니다. 실제로 제시한 방법 중에서 도움 되는 것도 있었고 대화 후에 다행히 상황이 더 나아졌습니다. 상담하는 동안 제 말을 들어주는 사람이 있다는 것에 마음이 편했습니다. ',1237),(1369,'2018-07-11 00:00:00.000000',5,'상담하는 시간동안 긍정적인 힘을 많이 심어주셨어요!!! \n대화 이끌면서 공감도 해주시고 해결책도 제시해주시고\n오랜만에 칭찬을 많이 들어서 자신감도 생긴것 같구요\n상담시간 끝났는데도 좋은 말씀 계속 해주셔서 감동이였어요\n시간이 너무 빨리간것 같아요',1238),(1370,'2017-12-03 00:00:00.000000',3.5,'  좋았던 점: 얘기를 잘 들어줘서 좋았음  아쉬운 점:아니요\n',1239),(1371,'2018-02-09 00:00:00.000000',4,'  좋았던 점: 되게 긴 상담글을 보냈는데도 정확히 문제를 짚어주셔서 감사했어요  아쉬운 점:위로의 말은 되게 많았는데 결론이 오프라인의 심리상담센터를 찾아가라 라서 조금 아쉬웠어요...',1240),(1372,'2019-01-28 00:00:00.000000',3,'솔직한답변 감사했습니다!\n스스로 뭔가 결정하기 힘들었는데 ,, 상담 후 많이 차분해진거같아요! 좀 아쉬운게 있다면 시간약속이 좀 ,, \n많이 급하신(?) 분이라면 조금 안절부절할수있을거 같아요 ^^;;',1241),(1373,'2018-05-23 00:00:00.000000',5,'  좋았던 점: 짧은시간내에 계속 귀기울여주시고 그냥 공감 위로 뿐만아니라 해결책을 제시해주려고 하셔서 너무 감사했습니다.마지막에 요약정리까지 해주셔서 근본적인 원인을 알게해주셨어요  아쉬운 점:아쉬운건 짧은시간뿐..',1242),(1374,'2017-11-01 00:00:00.000000',5,'  좋았던 점: 생각해볼 화두를 던져 주셔서 좋았습니다 전체적으로 따뜻함이 느껴졌습니다  아쉬운 점:없습니다',1243),(1375,'2017-11-02 00:00:00.000000',4,'  좋았던 점: 천천히 잘 들어주셨어요  아쉬운 점:크게 없는것 같습니다',1244),(1376,'2017-10-24 00:00:00.000000',5,'  좋았던 점: 따듯한 말씀 감사했습니다. 짧은 시간이지만 도움 받고 가요.  아쉬운 점:없습니다.',1245),(1377,'2018-11-20 00:00:00.000000',5,'제 이야기를 잘 들어주시고 부정적인 생각을 전환할 수 있도록 도와주셨습니다. 짧지만 많은 생각을 하게 되었던 상담이었습니다. ',1246),(1378,'2018-04-19 00:00:00.000000',5,'  좋았던 점: 정말 진심을 다해서 상담해주시는것 같아서 좋았어요  아쉬운 점:제가 시간을 짧게 해서 아쉬웠어요',1247),(1379,'2018-05-03 00:00:00.000000',5,'  좋았던 점: 마음을 많이 써주신것같아서 따뜻해졌어요  아쉬운 점:제가 시간을 짧게 했다는 점이죠',1247),(1380,'2018-06-01 00:00:00.000000',5,'  좋았던 점: 한발짝 물러서서 하나씩 짚어주시는 점이 좋았어요  아쉬운 점:아쉬웠던점은 10회기가 끝났다는것 뿐이네요 ㅎㅎ ',1248),(1381,'2018-02-27 00:00:00.000000',1,'  좋았던 점: 글쎄요 음 그래도 많이들어주시려고하는부분이요  아쉬운 점:솔직히제가얘길다해서 너무답답해서 처음상담받았지만 제가생각햇던만큼의 상담은아니엇ㄷ던거같네요',1249),(1382,'2018-01-01 00:00:00.000000',5,'  좋았던 점: 어떤 고민이든 차별과 편견 없이 경중을 재지 않고 받아들여주시는 모습이 좋았습니다.  아쉬운 점:딱히 없습니다.',1250),(1383,'2018-03-02 00:00:00.000000',3.5,'  좋았던 점: 변화할 수 있다는 용기를 북돋아 주셨습니다.  아쉬운 점:초반에 질문을 많이 안해주셔서 혼자 얘기를 꺼내기가 좀 힘들었습니다.',1251),(1384,'2017-11-04 00:00:00.000000',2.5,'  좋았던 점: 좋았어요  아쉬운 점:없습니다',1252),(1385,'2017-11-11 00:00:00.000000',5,'  좋았던 점: 핵심을 짚어주려하십니다~   아쉬운 점:전혀없었어요~~',1253),(1386,'2018-03-05 00:00:00.000000',5,'  좋았던 점: 너무 갑작스럽게 겪은 일에 반복적인 이야기와 계속되는 호소를 끝까지 잘 들어주셨고, 공감해주시면서도 스스로 생각해볼 수 일는 질문을 주셔서 좋았습니다.  아쉬운 점:크게 없습니다.',1254),(1387,'2018-04-28 00:00:00.000000',5,'  좋았던 점: 공감을 잘해주고 \n긍정적인 단어들을 많이 사용해주셔서\n좋았어요.\n특히, 제 상황을 정말로 느껴주시려는게\n느껴졌어요. \n답 오는 속도도 정말 매우 빠르셨고요!   아쉬운 점:없습니다.\n',1255),(1388,'2018-04-29 00:00:00.000000',0.5,'  좋았던 점: 얘기는 잘 들어주세요  아쉬운 점:공감보다는 얘기를 들어주고 제 고민에 대한 해결을 위해 질문을 해주셨으면 좋겠는데 제가 제 얘기만 계속하고 공감만 해줘서 친구에게도 충분히 얘기할수 있었던거 같아요..좀 돈아깝네요친구한테 커피한잔 하면서 얘기할걸..',1256),(1389,'2018-05-03 00:00:00.000000',4,'  좋았던 점: 제 예전 모습들을 꺼내주시고 지금의 문제와 연결되는 지점을 찾아주셔서 감사했어요! 도움이 많이 됬습니다.  아쉬운 점:딱히 없었습니다.! \n',1257),(1390,'2018-05-05 00:00:00.000000',5,'  좋았던 점: 이야기를 잘 들어주시고 무엇보다 공감을 정말 잘 해주세요. 정말 생각지도 못한 신선한 방향으로 생각을 바꾸어 주시기도 하셔서 많은 도움이 되었습니다.  아쉬운 점:없습니다^♡^',1258),(1391,'2017-11-26 00:00:00.000000',0.5,'  좋았던 점: 상담을못함  아쉬운 점:답장이늦어 까먹고있다 상담을못함 계속이것만보고있을순없자나요......',1259),(1392,'2018-05-14 00:00:00.000000',5,'  좋았던 점: 한마디한마디에 깊은뜻이있어서 깊게 생각할수있는 부분을 주셔서 좋았습니다 감사합니다  아쉬운 점:없어요\n없어요\n\n',1260),(1393,'2018-03-29 00:00:00.000000',4.5,'  좋았던 점: 질문을던져서  제가 다시 생각할수있는 계기가됫어요  아쉬운 점:장기적으로 한번 해봐야겟어요',1261),(1394,'2018-04-10 00:00:00.000000',4,'  좋았던 점: 두서 없이 말했는데 들어주셔서 감사합니다  아쉬운 점:시간이 빨리 지나가 아쉬었어요',1262),(1395,'2017-10-20 00:00:00.000000',5,'  좋았던 점: 마음이 많이 편해질 수 있었어요.  아쉬운 점:크게 없는 것 같습니다.',1263),(1396,'2018-04-19 00:00:00.000000',3,'  좋았던 점: 제 생각을 정리해주는것  아쉬운 점:시간이 짧기도 했지만 답이 느려서 아쉬웠다',1257),(1397,'2017-11-03 00:00:00.000000',3.5,'  좋았던 점: 차분하게 잘 들어주시는 것 같다  아쉬운 점:크게 없는 것 같아요\n',1264),(1398,'2017-11-03 00:00:00.000000',0.5,'  좋았던 점: 차분함  아쉬운 점:상담받는 사람이 마음을 열고 이야기 하는 만큼\n내담자도 상담사님께 어떤 생각을 가지고 계신지\n질문 할수 있다고 생각합니다 질문에 잘 대답을 안해주시고\n믿음은 언제 생길것 같은지 아마 끝이 안날꺼라는 말씀이 참 아쉽네요. 질문에 답변하셨으면 믿음이 생기',1265),(1399,'2020-06-22 00:00:00.000000',4,'감사합니다 ',1266),(1400,'2020-06-18 00:00:00.000000',5,'.\n\n\n다음 번 상담도 기대됩니다.\n',1267),(1401,'2020-06-12 00:00:00.000000',5,'아무한테도 말할 수 없었던 부분을 상담하고 나니 마음이 많이 편해졌어요. 잘 들어주시고 공감해주시고 제 잘못이 없다고 말해주셔서 괴로움이 줄었어요.',1268),(1402,'2020-06-07 00:00:00.000000',5,'감사합니다. 저는 나쁜사람인데 제탓이 아니라고. 말해주셔서 죄송했습니다.',1269),(1403,'2020-06-06 00:00:00.000000',5,'선생님~~따뜻한말투와\n말을길게안써도 다상황과 그런것들을이해하시고말씀해주셔서좋았습니다^^\n\n건강한미래와삶그려가고싶습니다감사드립니다\n다음주에도뵈어요!',1270),(1404,'2020-06-05 00:00:00.000000',5,'감사합니다 선생님 애기가 자다 깨서 마지막인사를 제대로 못드렸네요ㅜ\n',1271),(1405,'2020-05-31 00:00:00.000000',5,'공감대가 많앗어욜',1272),(1406,'2020-05-23 00:00:00.000000',5,'일단 후련하네요\n제 스스로 정리되지 않았던 부분\n잘 짚어주셔서\n정리를 시작하는 마음이 들었고\n겉으로는 멀쩡해 보이는 내 마음이\n알고보니 엄청 곪았구나\n괜찮은척 하는게 너무 힘들구나\n깨달았던 시간이었어요\n내 스스로 변화해야하는게 너무 힘들어서\n상담을 원했는데\n방향을 잡아주신거 같아 감사합니다\n',1273),(1407,'2020-05-12 00:00:00.000000',5,'오랫동안 상담 받았고 늘 도움 받는 부분이 있습니다 감사합니다',1274),(1408,'2020-04-16 00:00:00.000000',5,'매회 상담을 통해서 새로운 관점으로 스스로를 돌아볼 수 있어서 많은 도움이 됩니다.\n그동안 많은 부분들을 찾아낼 수 있었고 차분하게 상담 진행 전 과정에 케어받는 기분 그리고 이해받는 기분이 들어서 존중받는 마음이 들어 만족스럽습니다.\n',1267),(1409,'2020-03-24 00:00:00.000000',5,'제 고민을 잘 들어주셔서 고민이 잘 정리되었어요\n\n잘 들어주시는 것만으로도 도움이 많이 되었습니다.\n\n기회가 되면 또 다시 상담을 하면서 도움받고싶어요\n',1275),(1410,'2020-02-08 00:00:00.000000',5,'마음 정리하는데 많은 도움을 주신 선생님입니다.\n얼굴도 못뵌분이지만 제 현재 상황을 제일 잘 짚어주시고 현명한 조언도 해주셔서 감사하게 생각하고 있습니다.\n\n',1267),(1411,'2020-02-08 00:00:00.000000',5,'\n마음 정리하고 감정 되돌아보는 과정에 도움을 많이 받았습니다.\n',1267),(1412,'2020-01-06 00:00:00.000000',5,'늘 믿고 상담 받습니다 고맙습니다\n',1274),(1413,'2019-12-23 00:00:00.000000',5,'공감과 위로를 받아서 좋았습니다\n',1274),(1414,'2019-12-23 00:00:00.000000',5,'저의 마음을 알아주셔서 감사해요\n계속 상담 하고 있습니다 ',1276),(1415,'2019-10-24 00:00:00.000000',4,'마지막에 나눴던 대화 내용을 한번 정리해주시는게 좋았어요. 하고 싶은 말을 막 하다보면 무슨 말을 했는지 잘 모르거든요. 그래서 매 상담마다 무언가 한 가지는 꼭 얻어가는 것 같은 기분입니다^^',1277),(1416,'2019-10-02 00:00:00.000000',0.5,'마음이 힘든 상황에서 후기들보고 기대했는데 특별히 위로나 현실적인 조언인지도 모르겠고 그래도 첫회기니 그랬으려니 했는데 다음회기 약속시간마저 잊어버리는 모습에 더 상처받았습니다.',1278),(1417,'2019-09-27 00:00:00.000000',5,'답답한 마음에 용기내서 트로스트에 가입하고, 최해나 선생님과 상담하길 너무 잘 했습니다. 어려운 이야기를 편견없이 차근차근 들어주셔서, 편안했습니다. 표면적으로 보이는 사안 이상으로, 그 뿌리까지 생각해볼 수 있는 기회를 주셨습니다. 막막한 상황에서, 방향을 잡도록 현실적인 조언해주셔서 감사했습니다. 앞으로도 선생님과 상담 받아볼 의향 있습니다. ',1279),(1418,'2019-09-16 00:00:00.000000',4,'내가 다 알고 있다고 생각했는데 또 다른 새로운 시선으로 볼 수 있다는 게 좋았다.\n상담은 최소 4회 이상으로 진행되어야 내 상태를 점검하고 문제를 파악하고 해결하는 데 도움이 될 것 같다.',1280),(1419,'2019-09-16 00:00:00.000000',5,'그동안의 상담을 거치면서 생각이 좋게 발전할 수 있었어요 .\n감사합니다 ! \n\n\n',1276),(1420,'2019-09-05 00:00:00.000000',5,'최해나 선생님은 제 삶의 위기 상황에서 제가 차분하게 상황과 저 자신을 돌아보고 결정할 수 있도록 저를 이끌어주신 분입니다. 또 크리스찬으로서 하나님의 말씀에 따라 저 자신을 반영해 보고, 변화시켜 나가는데 큰 도움을 주셨습니다. 제가 올바른 결정을 하고 저 자신을 계속해서 발전해 나갈 수 있도록 격려해 주시고, 저의 연약한 부분애 대해 감싸주시고 장점 또한 발견해 주셔서 감사합니다. ',1281),(1421,'2019-09-04 00:00:00.000000',5,'시간 차에도 불구하고 소중한 시간과 함께 현재 힘들어 하고있는 부분에 있어서 전문적으로 이해해주시고 문제들을 명확하게 파악하여 그에 맞는 권유를 해주신 부분에 큰 도움이 되었습니다. 만약 상담받기를 고민하실 때 우선적으로 뵙는 것이 많은 도움이 될 것 같습니다.',1282),(1422,'2019-08-22 00:00:00.000000',5,'제가 지금 당면한 상황적 특수성이라는 맥락을 이해해주는 분이어서 더욱 상담에 도움이 되었습니다.\n\n상담시 두서없는 말들을 뽑아내더라도 계속 스스로 생각해서 말로 꺼내도록 독려해 주셨고 나중에 잘 정리해서 새로운 시각을 가질 수 있도록 해주어 좋았습니다.\n',1267),(1423,'2019-07-26 00:00:00.000000',5,'예전보다 저에대한 정확한 진단을 스스로 내릴수있었고 용기와 자신감도 많아진것같아요 차분하게 제 얘기를 들어주셔서 너무 감사했습니다',1283),(1424,'2019-07-18 00:00:00.000000',5,'저는 계속 상담을 받을 거에요. \n정확한 진단과 피드백이 나를 살리는 결정을 할 수 있도록 도와주었어요. ',1284),(1425,'2018-08-04 00:00:00.000000',5,'최고의 상담사세요 따뜻한 공감도 해 주시고 현실적이고 필요한 솔루션도 제공해 주세요 다음 상담도 최해나 상담사님과 하고 싶어요',1285),(1426,'2019-05-24 00:00:00.000000',5,'제 입장에서 생각하고 이해해주시면서\n진실되고 현실적인 조언 많은 도움이 되고 있어요\n한시간하는 상담으로 일주일의 제 생활이 달라지고 \n힘을내고 있어요 감사합니다.',1286),(1427,'2018-04-30 00:00:00.000000',5,'  좋았던 점: 제 스스로만든 결정이 옳은 결정이라고 믿을수 있게 도와주셔서 좋았어요.   아쉬운 점:아쉬운점 없어요 ',1287),(1428,'2019-02-14 00:00:00.000000',5,'늘 상담 잘 받고 있습니다 믿고 도와주십니다 감사해요\n\n',1274),(1429,'2019-06-15 00:00:00.000000',5,'텍스트로만 진행되니 그부분에 답답한 면도 있지만 차분하게 얘기들어주시고 그냥 위로만으로 끝나는게 아니라 해결방식을 주시려고 노력하시는 부분들이 좋았습니다. 장점을 지지하고 격려해주시고 문제점을 같이 찾아 해결하시려고 해주시는 모습이 감사합니다. 위로와 공감만을 원하시는 분들보다 본인이 처한 상황에서 한발자국씩 나오고 싶은 분들께 추천 드립니다. 저는 계속적으로 받을 생각입니다.',1282),(1430,'2018-06-19 00:00:00.000000',4.5,'현재 상황이 대해 객관적으로 볼 수 있는 힘과 위로를 얻을 수 있는 시간이었습니다.\n\n',1288),(1431,'2018-09-03 00:00:00.000000',5,'늘 상담 잘 받고 있습니다 믿고 도와주십니다 감사해요\n\n',1274),(1432,'2017-11-09 00:00:00.000000',5,'  좋았던 점: 공감표현과 정확한 조언이 좋았습니다.  아쉬운 점:크게 없습니다.',1289),(1433,'2019-02-25 00:00:00.000000',4.5,'어떤 글도 진심어린시선으로 봐주시고 대화해주시고 저의 마음상태를 가장중요하게 생각해주시면서 대화를 이끌어주시고 좋은 방향으로 제시해주셔서 저에게 안보였던 기회를 만들수있게 도와주신것같아 너무 감사하고, 지금 이 순간 가장 큰 힘이 되어주셔서 감사합니다',1290),(1434,'2018-07-02 00:00:00.000000',3,'단도직입적으로 말해주셔서 좋았어요. 말씀이 많은 편은 아니신데 뭔가 자신감 있게 말해주시는 게 좋았어요. 50분짜리 했는데 좀 더 많이 말해주시면 좋을 거 같아요. 타이핑 하는게 시간이 걸려서 그거 기다리는 게 좀 그렇긴 해요.',1274),(1435,'2019-03-22 00:00:00.000000',5,'제 이야기에 공감해주시고, 해결점에 포커스를 맞춰 차분하게 말씀해주는 부분이 좋았습니다.\n4주상담이였지만, 텍스트로 주고받는 1시간이라는 시간은 하고싶은 말을 온전히 담아내기엔 부족한 것 같단 느낌이들어요.\n다음번에 또 상담을 진행한다면, 전화나 대면상담을 하고 싶다는 생각이 듭니다. 상담의 처음 경험을 좋게 남길 수 있어 좋았습니다.\n감사해요.',1291),(1436,'2019-03-25 00:00:00.000000',4,'다른 상담사분들과 달리 제 이야기를 중점적으로 들어주고 제 말을 중시해주셔서 좋았어요. 제 얘기에 대한 말을 엄청 해주시기 보다는 은근하게 해결책을 제시해주시는게 좋았어요. 문제에 대한 해결중심이란 점이 저는 좋았어요. 얘기도 잘 들어주시고 감사합니다',1292),(1437,'2019-04-16 00:00:00.000000',5,'고민과 문제들을 잘 들어주시고 또 얘기하는 그 상황, 상황에 대해 바르게 인지할 수 있도록 도와주십니다^^\n저는 개인적으로 오래도록 힘들었던 마음의 짐을 올바르게 덜 수 있도록 해주셨고 그 점에서 정말 감사합니다.\n',1291),(1438,'2019-01-19 00:00:00.000000',4.5,'짧은 시간에도 명확한 팁을 주셔서 마음의 안정은 기본이고 실천해보고싶은 자신감을 심어주셔서 너무 감사합니다. 또 찾아뵐거같아요!\n',1293),(1439,'2019-04-17 00:00:00.000000',4,'말을 잘 들어주시고 방향을 잘 제시해주셨어요.\n필요한 정보도 주시구요.\n좀 혼란스러웠던 상태를 정리하는데 도움이 되었습니다. ',1294),(1440,'2019-04-18 00:00:00.000000',5,'제얘기를끝까지 잘들어주고 해결점을찾아주어서감사했습니다^^\n마음의안정도됐고 해결할수있게되어서 좋았습니다\n기회가된다면 또상담받고싶습니다.\n\n',1295),(1441,'2017-11-15 00:00:00.000000',5,'  좋았던 점: 간단하고 명료하게 문제점을 이야기해주셔셔 좋았습니다. 제 얘기 다 들어주시고 그 중 핵심만을 정확하게 짚어내주시는 것도요. 저는 다정한 위로의 말보다 이런 현실적인 조언 및 판단이 필요했던 상황이라 만족스럽고 좋았습니다.   아쉬운 점:없었습니다',1296),(1442,'2019-03-07 00:00:00.000000',5,'늘 상담 잘 받고 있습니다 믿고 도와주십니다 감사해요\n\n',1274),(1443,'2018-09-28 00:00:00.000000',3.5,'공감을 잘 해주셨고 마음이 편안해지게 상담해주셨습니다. 감사합니다 ',1297),(1444,'2017-10-22 00:00:00.000000',5,'  좋았던 점: 내 감정을 털어 놓는 시간을 보낼 수 있어 좋았습니다. 이를 잘 이끌어주신 상담사님께도 감사드립니다.  아쉬운 점:조금 더 진행해야 알 것 같습니다.',1298),(1445,'2019-11-05 00:00:00.000000',4,'네 진심어린 공감 감사합니다',1299),(1446,'2017-11-03 00:00:00.000000',3,'  좋았던 점:  저 자신을 긍정적으로 생각할수 있게 해주신 말씀들이 기억에 남네요..  아쉬운 점:채팅 속도가 조금 느리신 것 같습니다. 통화가 괜찮으신분들은 전화상담받아보시면 좋을것 같아요. 저는 텍스트가 편해서...',1300),(1447,'2017-09-05 00:00:00.000000',2.5,'  좋았던 점: 기술문제때문에 연결이 안되는데도 재차 시도해주셔서 감사했습니다.  아쉬운 점:채팅이 느린건지 전송이 느린건지 잘 모르겠는데 반응속도가 서로 달라서 불편했습니다.',1301),(1448,'2018-06-06 00:00:00.000000',3,'  좋았던 점: 얘기를 잘 들어주신 점 좋았습니다.  아쉬운 점:아쉬운 점 보단 아무래도 텍스트라 그런지 진짜 사람이랑 대화하는 느낌보다 심심이랑 대화한 느낌이 들었어요.',1302),(1449,'2018-06-07 00:00:00.000000',2,'  좋았던 점: 잘 들어주세요 말씀도 성의있게 해주시고요  아쉬운 점:......',1303),(1450,'2018-06-08 00:00:00.000000',4,'  좋았던 점: 이해를 해주고 공감을 해주시려고 해주셨던 부분이 개인적으로 정말 좋았습니다. 늦은 시간에 감정적으로 글을 남긴 것도 있었는데, 그 마저도 편안하게 안아주시는 느낌이었어요. 정말 감사합니다.  아쉬운 점:초반에 공감하고 이해해주시려다 보니 조금 루즈한 면이 있었어요. 그렇지만 끝까지 들어주시고, 중요한 키 포인트가 되는 말도 챙겨주셔서 더 뜻깊었던 것 같고, 상담하길 잘했다, 다음에 또 뵙고 싶다고 생각했습니다. 정말 편안하게 해주셔서 감사해요.',1304),(1451,'2018-08-14 00:00:00.000000',3,'얘기를 잘 들어주셨어요.',1305),(1452,'2018-05-01 00:00:00.000000',5,'  좋았던 점: 제얘기를 잘 들어주시고 위로되고 해주신말씀도 좋았어요  아쉬운 점:없엇어요 ㅎㅎㅎ',1306),(1453,'2019-07-03 00:00:00.000000',5,'선생님께서 얘기 들어주시면서 좋은 말씀 해주셔서 불안함이 많이 가셨어요 :)\n',1307),(1454,'2018-06-25 0