336),(1590,'2020-03-10 00:00:00.000000',5,'공감과 따뜻한 조언이 좋았어요.\n첫 상담이라 조금 떨렸는데 편하게 말할 수 있도록 해주셔서 좋았습니다. 실현할 수 있을만한 구체적인 행동 지침을 주셔서 좋았어요.',1403),(1591,'2020-03-05 00:00:00.000000',4,'처음 상담 받아본건데요 확실히 상담받고 나니 제 상태와 앞으로 똑같은 두려움이 다가올때 어떻게 이겨내나갈 수 있는지에 대한 방안을 제시해주셔서 도움이 많이 됐습니다! 고민하고계신분들 한번 해보세요!!',1404),(1592,'2020-03-04 00:00:00.000000',5,'좋아요^^',1387),(1593,'2020-03-04 00:00:00.000000',5,'야심한 밤에 상담할수 있는 선생님이 계쇼 너무 좋았습니다. 제가 두려워하는 것이 비합리적이라 두려워할 필요가 없다고 알려주셨습니다. 뒤로 물러나 선생님과 함께 객관적인 시선으로 제 삶을 들여다보니 뭔가 분명히 보이는 것이 생겼습니다.',1405),(1594,'2020-03-03 00:00:00.000000',5,'처음으로는 아직 마음을 다 보여드린거 같지 않아서 다시 상담했어요 많은 위로 되었어요',1406),(1595,'2020-03-02 00:00:00.000000',5,'헝크러진 마음이 정리 되가고 있어요 3자 입장에서 조언받으니 냉정해 질 수 있네요',1406),(1596,'2020-03-02 00:00:00.000000',5,'감사합니다 ㅠㅠ',1336),(1597,'2020-03-01 00:00:00.000000',5,'저의 몰랐던 부분을 알게 되서 좋았어요',1386),(1598,'2020-03-01 00:00:00.000000',5,'적절한 공감과 답변 너무 좋았습니다. 어지럽던 생각이 정리되고 위로가 되었습니다.',1407),(1599,'2020-02-29 00:00:00.000000',5,'친절하고 어른스러운 상담 정말 잘 들었습니다. 갑갑하고 우울해서 울어버릴 것만 같았는데 마음이 정말 잘 풀어졌어요. 제가 잘 모르는 것들도 짚어주시고, 상황을 객관적으로 잘 풀어주셔서 감사했어요.',1408),(1600,'2020-02-26 00:00:00.000000',5,'고생많으셨어요\n열정적으로 상담해주시고 해결해주시려고 노력해주시네요',1409),(1601,'2020-02-26 00:00:00.000000',5,'감사합니다',1410),(1602,'2020-02-25 00:00:00.000000',5,'돈이 아깝지않네요. 남편과의 갈등 이후 고민하고있던부분에 대해서 해결점을 찾았네요. 상담사님은 차분하고 꼼꼼히 이야기를 들어주십니다. 그리고 오랜 상담공부를 통해서 제가 생각지 못한 부분을 짚어주시네요. 군인의 자녀들이 보통 감정을 억압해서 분노가 있다는 점이나 화는 자신에게 억압된것이 있을때 생긴다는것 등은 새로운 발견이었습니다. 왜 저는 어른이고 남편은 아이일수밖에 없는지에 대해서는 추가적인 상담이 필요할것같지만 꼼꼼히 들어주셔서 감사합니다.',1407),(1603,'2020-02-25 00:00:00.000000',5,'감사합니다',1411),(1604,'2020-02-23 00:00:00.000000',5,'첫 상담이었는데 굉장히 마음이 편해졌구요.\n무엇보다 지금 제 상황에서 할 수 있는\n가능한 조언을 해주셔서 좋았어요.\n전 제 말을 마냥 들어주기보다는 \n현실적인 조언을 해주신게 더 많은\n도움이 되었던 것 같아요.\n그리고 제가 스스로 정리가 안되었던 마음을\n잘 정리해주셔서 말씀해주시는게 굉장히 좋았어요.\n제가 모르고 하는 행동들 있잖아요?\n그게 왜 그런건지 같은 것들요.\n감사해요 선생님\n다음주에 뵐게요!',1412),(1605,'2020-02-21 00:00:00.000000',3.5,'감사합니다!',1413),(1606,'2020-02-19 00:00:00.000000',5,'가려운 부분을 긁어 주시고 재밌게 진행해주셔서 좋았습니다. 추천드려요!',1414),(1607,'2020-02-19 00:00:00.000000',5,'저는 이런저런 걱정을 하다보니 오랫동안 상담을 받아볼 생각을 못했는데, 오늘 선생님과 용기를 내서 상담을 받았고 정말 잘 했다는 생각이 들어요. \n오늘 선생님께 너무 많은 공감과 위로를 받았어요. 처음에 제 감정에 너무 빠져서 엄청 울면서 말씀드렸는데 다 들어주시고 상담해주셔서 감사해요... 혹시 제가 또 상담이 필요하면 선생님이랑 상담하고 싶어요~',1415),(1608,'2020-02-19 00:00:00.000000',5,'전에 상담했던 내용을 기억해주셔서 이어갈 수 있단게 좋았다. 그리고 무조건적인 공감보다는 나의 문제점도 찝어주시는게 도움이 되었다.',1416),(1609,'2020-02-18 00:00:00.000000',5,'막막하고 한없이 답답한때에\n갈피를 잡을 수 있게 제 스스로 변화할 수 있게, 생각을 올곧게 할 수 있도록 도와주셨어요 \n가장 어려운 한발자국을 떼고 용기낸 기분이에요 앞으로 나아가기 위해 노력할거에요 감사합니다',1417),(1610,'2020-02-18 00:00:00.000000',5,'상담을 통해서 지금내가 중요한 점과 나를 너무 학대 했다는 생각을 가졌었습니다.',1418),(1611,'2020-02-18 00:00:00.000000',5,'위로와 공감 격려와 지지보다는 현실적인 조언이 필요한 분들게 추천드려요',1419),(1612,'2020-02-15 00:00:00.000000',5,'현  상황을 잘 분석하고 이해해주시고 앞으로 나아갈 방향까지 정말 잘 제시해주셨습니다. 걱정하고 불안해하던 문제에 대한 희망이 생겼습니다^^!! 감사합니다:))',1410),(1613,'2020-02-15 00:00:00.000000',5,'첫 상담이라 내 얘기만 하다가 끝나는 거 아닌가 싶었는데\n다 들어주시고 마지막에 큰 깨달음 안겨주셨네요\n\n숙제를 주시니 해야 할 일에 대한 의욕이 생깁니다\n\n상담시간이 넘어가서 뜸들이고 있었는데 편하게 말하도록 유도해주셔서 감사합니다 \n\n상담은 처음이라 두려운 마음이 컸는데\n앞으로 꾸준히 상담받고 싶어요',1420),(1614,'2020-02-14 00:00:00.000000',5,'또 상담을 받고 싶은 생각이 생겼어요',1416),(1615,'2020-02-11 00:00:00.000000',5,'감사합니다 ',1336),(1616,'2020-02-11 00:00:00.000000',5,'감사합니다 :)',1336),(1617,'2020-02-10 00:00:00.000000',5,'별 기대없이 신청했었습니다. 그냥 위로의 말이나 해주겠지라고 생각했었는데 생각보다 선생님께서 지식이 엄청 넓으셨습니다. 저는 제 업무에관한 솔루션을 주실줄은 상상도 못했습니다. 선생님께서 저에게 조언해주신것들이 제가 영감을 얻는데 엄청난 도움을 주셨습니다. 저 혼자선 넘을수없는 벽을 선생님께서 같이 도와주신덕에 넘을수 있을것같습니다. 나혼자선 \'이게 과연 될까\' 라고 생가했던문제를 선생님께서 해주신 조언덕분에 \'아 되겠다\'라는 확신을 갖게됐습니다. 선생님 정말 감사합니다. 다음 또 난관에 봉착했을때 또 상담하고싶습니다',1421),(1618,'2020-02-09 00:00:00.000000',5,'감사합니다 :)',1336),(1619,'2020-02-09 00:00:00.000000',5,'솔직히 상담이란게 두려운 사람 중 한사람이었습니다 이야기 시작을 제 고민이 아닌 보험으로 시작했을 정도이니까요 근대 어느새 자연스럽게 제가 편한 마음으로 제 얘기를 하고 있었어요 가족을 위해는 주저없이 돈을 쓰지만 저를 위해서 돈을 쓰는 건 주저해요 근대 돈을 잘썼다는 생각이 들어요 앞으로도 저를 위해 돈을 잘써야겠어요 이봉재 상담사님 감사드립니다 저가 제 자신 기분을 생각하는 마음을 가지게 해주시고 제가 한걸음 때게 해주셔서요',1422),(1620,'2020-02-09 00:00:00.000000',5,'고민을 잘 들어주시고 걱정과 위로를 받았습니다. 감사합니다.',1423),(1621,'2020-02-09 00:00:0