 수 있을거라는 희망이 생겼어요!!\n텍스트테라피가 시간이 너무 짧게 느껴지지 않을까 싶었는데 시간 안배도 적절하게 해주셔서 고민도 들어주시고 정리도 해주시고 어떻게 변화해나가면 좋을지도 말씀해주셔서 딱 좋았어요ㅠㅠㅠ 정말 감사합니다!!! 다음 상담도 해서 제 불안의 근원을 뿌리 뽑으려구요!! 상담사님 감사합니다!!!♥️',1455),(1678,'2019-11-13 00:00:00.000000',5,'감사했습니다',1411),(1679,'2019-11-13 00:00:00.000000',4,'도움 많이 받고 있어요. 힘들때마다 긍정적인 생각을 하게 도와주셔서 이거저거 도전해볼 수 있게 변하고 있습니다.\n',1452),(1680,'2019-11-11 00:00:00.000000',5,'감사합니다',1336),(1681,'2019-11-10 00:00:00.000000',5,'상담을 워낙 많이 받아봐서 좀 회의적이었는데 \n오늘 상담하고 실제로 도움이 많이 됐습니다.\n마음이 짓눌린 기분이었는데 시원하네요.\n적극적인 치료를 시작하려고 합니다.\n스스로에게 잘 해줄 생각이 드네요.',1456),(1682,'2019-11-09 00:00:00.000000',5,'제가 생각하지 못 했던 부분에 대해 잘 정리해주셨어요.\n여러 솔루션을 제시해주신 부분도 감동이었고요.\n진심을 담아 다양한 상황 고려해주신 것도요.\n1회 단기로 생각했다 다음회기도 신청합니다~',1457),(1683,'2019-11-09 00:00:00.000000',5,'되게 길게 까지 답해주시고 차분하게 정리해주시구... 정말 좋은분... 감사합니다 선생님',1458),(1684,'2019-11-07 00:00:00.000000',5,'상담내용을 다시보고 싶은데 안되나요? 좋으신 말씀을 다시보고 참고로하고 싶어서요. ',1459),(1685,'2019-11-06 00:00:00.000000',5,'감사합니다',1336),(1686,'2019-11-01 00:00:00.000000',5,'제가원하는 것과 현실적 절충안을 잘 찾아 상담해주셨습니다\n기회가있을때 또 상담받고싶습니다\n선생님덕분입니다',1460),(1687,'2019-11-01 00:00:00.000000',3.5,'긍정적인 생각 하게 도움이 되는 거 같아요.\n우울하고 힘든 얘기 터놓는거만으로도 맘이 편하네요',1452),(1688,'2019-10-29 00:00:00.000000',5,'처음에는 좀 딱딱하고 무미건조한 느낌을 받았으나 점차 제가 이야기를 쏟아내면서 그 안에서 핵심을 정리하고 계셨다는 느낌을 받았습니다. 마지막에 저의 행동 정리 및 조언까지 해주셨는데 너무 정곡을 찔러서 계속 눈물을 흘리면서 상담했네요. 생각의 정리가 잘 되었고 1회 상담만 갑자기 했는데 도움이 정말 많이 되었습니다! ',1461),(1689,'2019-10-28 00:00:00.000000',5,'차분히 들어주시고 이야기를 이끌어내주셔서 저도 모르게 가슴의 응어리들을 막 풀어낼 수 있었던 것 같아요. 한 번 더 받아보고 싶습니다. 감사해요',1461),(1690,'2019-10-28 00:00:00.000000',5,'원인분석 및 해결방법을 늦은시간에도 성실히 답변해주셔서 감사드립니다! ㅎㅎ',1462),(1691,'2019-10-27 00:00:00.000000',5,'두서없이 이야기했는데 잘 정리해주시고 좋은 조언 해주셔서 감사합니다. 말씀하신 대로 앞으로 잘 지내보도록 하겠습니다',1455),(1692,'2019-10-25 00:00:00.000000',5,'공감도 잘해주시고 친근하셔서 고민 털어놓기가 좋았어요.\n 산전수전 다 겪고 있는 저에게 여러가지 조언과 공감이 와닿네요. 긍정적인 생각도 상담하면서 배워가고 있습니다. 아직 갈길이 멀지만 상담 받기 전보단 조금 더 긍정적으로 변할려고 노력하게 되구요. 이런저런 도전에도 좀 더 적극적으로 변하는거 같아요. 여유될때마다 상담 신청해서 계속 이어나가 볼려구요. 서럽거나 힘든 이야기들도 털어놓고 나니 조금은 후련해지네요. 스트레스 관리법이나 부정적인 생각이 들때 어떻게 해야하는지 긍정적인 습관 들이는 방법도 알려주셔서 도움이 많이 되었습니다.아직은 익숙하지 않아서 어색하지만 꾸준히 실천해볼려구요.오랜 우울증으로 지친 저에게 조금은 미래에 대한 희망에 대해서도 믿어보게 되네요. 상담을 받고 나면 텍스트라 다시 읽어 보면서 이런저런 생각 해보기에도 좋구요. 텍스트 상담이 신중하게 할말 할 수 있어서 저는 더 편했어요. 대면상담이 부담스럽기도 하고 비용도 비싸고 따로 일정 시간을 빼서 가기가 어려워서 신청한거였는데 만족해요. 그리고 상담 경험이 많으신 분이라 그런지 신뢰감도 있구요. 어린시절 상처를 터놓으면서도 위로를 많이 받았어요. 그리고 지금의 나와 그 어린시절 나는 같은 선상에 있지 않다는것도 깨달았어요. 나에 대해 잘못 생각하고 있는 점을 바로 잡을 수 있어서 감사했습니다. ',1452),(1693,'2019-10-23 00:00:00.000000',5,'내가 하고 있던 생각을 정확히 맞추신게 정말 신기했다. 흡연을 시작하고 싶은 욕구가 가장 큰 표면적인 문제였는데 그 내면에 있는 잘못된 신념을 간파해주셨다. 내 스스로도 이렇지 않을까~ 라고 생각은 하고 있었는데 상담사님의 객관적인 말로 정확히 지적이 되니까 확실해졌다. 두루뭉술하게 계속 떠다니는 것 같던 흡연과 음주에 대한 욕구가 싹 사라진게 정말 좋았다. 어정쩡한 위로가 아니라 전문가의 내공이 느껴지는 상담이었다. ',1463),(1694,'2019-10-23 00:00:00.000000',5,'오전에 정신과 예약을 하고, 마음의 병을 얻었다 느끼는 내자신이 비참해져 병원을 가지 않고 거리를 방황하던중 우연히 이곳을 알게 되었습니다.\n\n어디하나 내맘 터놀 곳이 없어\n신세한탄이나 하려고 상담신청을 했는데\n제 안의 상처와 문제점을 짚어보는 계기가 된것 같습니다..\n\n암흑같은 내 상황이\n맑아질수 있을거란 희망을 갖게 되었습니다.\n\n진심으로 감사 드립니다.\n',1464),(1695,'2019-10-19 00:00:00.000000',5,'ㅇ좋습니다',1465),(1696,'2019-10-15 00:00:00.000000',5,'감사했어요:)',1466),(1697,'2019-10-15 00:00:00.000000',5,'미쳐 생각하지 못했던 부분을 생각해볼수 있도록 도와주셔서 만족스럽습니다.\n',1387),(1698,'2019-10-13 00:00:00.000000',5,'감사합니다\n',1438),(1699,'2019-10-13 00:00:00.000000',5,'늦은시간까지 감사했어요 용기내서 노력해보겠습니다 ',1467),(1700,'2019-10-08 00:00:00.000000',5,'감사합니다 :)',1336),(1701,'2019-10-05 00:00:00.000000',5,'제 행동의 원인에 대해서 전문가의 입장에서 설명해주시고 많은 조언을 해주셔서 스스로 돌아보게 된 계기가 되었어요',1468),(1702,'2019-10-04 00:00:00.000000',3.5,'문제를 객관적으로 바라볼 수 있게 되었습니다',1469),(1703,'2019-10-03 00:00:00.000000',5,'지난 일들을 어떻게 해결하고 앞으로 나아갈 수 있을지 제시해 주셔서 도움이 많이 되었어요~\n',1470),(1704,'2019-10-02 00:00:00.000000',5,'이봉재 상담사 선생님과 오랜만에 다시 상담을 하였습니다. 선생님께 많은 현실적인 조언과 심리적 지원을 받았고, 이 후 잘 지내고 간간히 작은 마음의 힘듦을 도움 받고 있습니다. \n무엇보다 가끔 연락을 드려도 언제나 기억해 주시고, 심리적 지원과 함께 직관적이고 현실적으로 도움이 되는 조언을 주시는 점 너무 감사드립니다. \n\n감사합니다. \n',1471),(1705,'2019-10-02 00:00:00.000000',5,'끝까지 들어주시고 저의 어두운 과거 이야기를 듣는 내네 경청을 해주셨습니다. 가장 인상적인건,  게임이야기를 빗대어 제 상황을 설명해주신점이 좋았습니다.\n많은 고민이 있다는건 결국 내제된 불안요인에서 비롯되었다는 사실을 오늘 상담으로 알 수 있었네요.\n마지막 한발, 제가 말했지만 그 한발한발 소중히 사용하겠습니다.\n상담 감사드립니다.',1472),(1706,'2019-10-01 00:00:00.000000',5,'그냥단순히 우울하다고만생각햇는데 자존감과 상실감에서 비롯된것이라는부분을 알게되어좋았어요. ',1473),(1707,'2019-09-29 00:00:00.000000',5,'편하게 고민을 이야기 할 수 있었고 부정적인 생각이 들때 어떻게 해야할지 알려주셔서 좋았구요. 당장 일어나지 않을 수많은 걱정거리를 없애야 한다는거도 알게 됐어요. 상담 하면서 어린시절 상처를 지금까지 가져오지 말아야한다는것도 알게 되었구요. 기회가 되면 더 상담 해보고 싶어요.',1452),(1708,'2019-09-29 00:00:00.000000',5,'갑작스런상담에도 늘 진지하게 임해주셔서 감사드립니다\n텍스트임에도 집중해주시는게 느껴져요\n',1474),(1709,'2019-09-29 00:00:00.000000',5,'세상에서 오직 제 편인것처럼 상담해주셔서 감사했습니다\n사실 고민이란게 머리로는 정답을 알지만\n마음이 인정을 못하는거란걸 알고있어요\n주변인들에게 털어놔도 중립적인 대답이나 머리가 아는\n답만줄 뿐인데 상담사님은 마음이 정답을 이해하도록\n도와주시네요\n마인드 솔로몬이세요^^\n감사합니다 ',1475),(1710,'2019-09-27 00:00:00.000000',5,'단순하지만 나의 내면을 토닥어주는것이 정말 중요한것 같아요. 앞으로 저에게 위로해주고 쉴때 제대로 쉬고 싶어요~!',1458),(1711,'2019-09-27 00:00:00.000000',5,'좋은 말씀 감사합니다ㅜㅜ',1476),(1712,'2019-09-19 00:00:00.000000',5,'어렸을때 얘기부터 쭉 할수있게 도와주셨고 조금은 마음이 후련해진거같기도해요. 매일 셀프 칭찬하기를 아끼지말아야겠어요. 처음이라 어렵지만 상담해주신 내용대로 한번 두번씩 해볼께요! 감사합니다! 많이 위로가 되었어요\n',1477),(1713,'2019-09-18 00:00:00.000000',5,'초반에 상처관련얘기할때 말하고있는데 자꾸 통화가 강제로 끊겨서 의도하지않게 상처에 대해 여러번 자세히 반복해서 말하게되어 가슴이 더 아프고 눈물나고 더욱 힘들면서도 시스템 불안한게 불편했습니다\n\n그런데 상담사님이 신경써서 끝까지 들어주시고\n조언많이해주시고 분석도 잘 해주시고\n방향 잘 잡아주시고 더불어 따뜻하게 마무리해주셔서 \n너무 감사했습니다\n\n상처가 자꾸 건들여져서 마음이 심하게 아픈 하루였지만, 더불어 그 상처에 대한 방향성을 잡아주신것 같았습니다\n\n내일 또다시 흔들리겠지만, 언급해주신 것들 잘 새기며 \n행동해보겠습니다',1438),(1714,'2019-09-17 00:00:00.000000',5,'제 고민을 자세히 들어주시고 좋았던 것 같습니다. 감사합니다.',1477),(1715,'2019-09-15 00:00:00.000000',5,'이야기를.잘 정리해주시고\n격려해주셔서 많은 도움이 되었어요.\n\n너무 힘든 순간이었는데.\n상담이.크게 도움되었습니다.',1478),(1716,'2019-09-14 00:00:00.000000',5,'상담을 받기 전에 명절을 맞아 만난 친척과 가족에게 막연한 불안감과 두려움을 가지고 있었어요. 그런 마음을 외면하려 했는데 상담 받으면서 다 꺼내서 마주하고 나니 오히려 힘이 나서 불안감이 사그라들었어요. \n 원래 상담 시간이 50분 정도였는데 중간에 잠시 끊긴 전화를 다시 걸어서 더 이야기해주시고 상담해주셔서 도움 많이 받았어요. 감사합니다.\n',1479),(1717,'2019-09-13 00:00:00.000000',5,'막연한 기분으로 상담을 신청했습니다. 너무 답답한 마음에\n전화상담을 하였는데... 긴 시간동안의 응어리가 조금이나마 풀린 느낌이였습니다. 심리적인 문제뿐만 아니라 현실적은 방안들도 알려주셔서 정말 너무 감사합니다. 인생의 큰 변환점이 찾아온것같아요. 시간이 훌쩍 넘었는데도 상담해주셨어요. 이젠 저를 다독여주면서 살아갈 수 있을것같습니다.',1480),(1718,'2019-09-09 00:00:00.000000',4.5,'상담사님 감사합니다',1481),(1719,'2019-09-09 00:00:00.000000',5,'좋았습니다',1482),(1720,'2019-09-06 00:00:00.000000',5,'털어놓으니 한결 편해졌어요. 제가 제자신을 갉아먹고있었던거같아요. \n자존감 높이고 불면증도 극복해볼게요',1462),(1721,'2019-09-05 00:00:00.000000',5,'네 감사합니다',1481),(1722,'2019-09-04 00:00:00.000000',5,'오랜 시간을 할애하며 공감해주시고 격려도 해주셔서 \n감사합나다. ',1336),(1723,'2019-09-03 00:00:00.000000',5,'감사합니다\n도움되었습니다\n',1483),(1724,'2019-08-28 00:00:00.000000',3.5,'제 편이 생긴 것 같은 느낌이 들어서 좋았습니다. 해결 방안은 이미 스스로 알고 있었지만, 제가 털어놓는 고민에 경청해주고 공감해주고 응원해줄 사람이 너무 필요했는데, 확실히 상담 전보다 기운이 더 생깁니다.',1484),(1725,'2019-08-28 00:00:00.000000',5,'늦은시간에 성심성의껏 상담해주셨습니다\n',1485),(1726,'2019-08-28 00:00:00.000000',5,'저는 사실 오프라인 상담도 여러번 받은 적 있고, 고민거리가 있을 때 심리상담이 도움이 되는 것은 알지만 텍스트 상담의 효과에 대해서 반의반의했어요.\n그런데 이봉재상담사님을 만나고, 제가 상담받았던 어떤 선생님보다 많은 도움을 받았습니다. \n텍스트로 기간을 두고 상담을 했음에도 선생님께서 자기 일처럼 들어주시고, 제가 문의드렸던 제가 기억 못하는 내용까지 기억해 주셨어요. 제가 상담 받지 않았던 기간 동안도, 걱정해주시고 지난상담에 대해서도 세심하게 보살펴 주셨습니다. 무엇보다 선생님의 정성스러운 마음이 느껴서, 상담 받는 내내 위로가 많이 되었어요.\n\n그리고 제가 다른 상담선생님들께 들어보지 못한 현실적이 조언과 할 수 있다는 무의식의 변화까지, 이봉재선생님과 상담 받기 전에 할 수 있을까,라고 생각하던 많은 일 들이 할 수 있겠다,가 되는 놀라운 경험도 하였습니다. \n\n\n무엇보다도 그냥 들어주시는 위로가 아닌 근본적이고 현실적인 방법을 심리적 변화를 통해 가능하게 도와주셔서, 삶을 근본적으로 변화시킬 수 있어서 너무 좋았습니다. \n사실 들어주시는 것도 도움은 되지만, 근본적이고 현실적인 조언으로 상황이 나아지다보니, 걱정을 주는 상황도 모두 변화가 되니까요. 당연히 답답한 마음은 사라질 수 밖에 없고요. \n\n저처럼 고민이 있으신 분들도 이봉재선생님께 상담받으시고, 근원적인 원인을 수정하셔서, 스트레스 상황 자체를 아래 제거 하는 도움 받으시길 바랍니다.\n\n선생님을 뵙고 인사드리지 못해서 죄송한 마음이 들 정도로 마음을 많이 써주셔서 진심으로 감사드립니다. ^^',1471),(1727,'2019-08-27 00:00:00.000000',5,'친절하게 늦게까지 들어 주셔서 감사했어요\n',1452),(1728,'2019-08-27 00:00:00.000000',5,'좋은말씅감사했어요~',1486),(1729,'2019-08-25 00:00:00.000000',4,' 속 시원하게 말할수 있어서 좋았다\n주변사람들에게. 편하게 말할수 없는데\n내편이 되어 \n조금 더 말씀 해 주셔서 좋았습니다',1487),(1730,'2019-08-04 00:00:00.000000',5,'명확히 정리해주시고 해답을 주셔서 정말감사합니다',1488),(1731,'2019-08-03 00:00:00.000000',5,'남들한테 하지못했던 얘기를 하게되서 그나마 속이 좀 후련해졌고 늦은시간에도 대화를 나누어주셔서 감사했어요 종료시간 넘어갔는데도 길게 조언해주셔서 그나마 희망을 얻었습니다! 선생님 말씀처럼 걱정에 집중하기보다 지금 내가 집중해야할것들에 집중해볼게요',1489),(1732,'2019-07-27 00:00:00.000000',5,'두번째 상담이었습니다 ~ \n좋은 이야기를 많이 해주셨습니다\n편안함이 좋은 상담사 쌤이라고 생각듭니다ㅎㅎ',1490),(1733,'2019-07-26 00:00:00.000000',5,'늦은시간까지 열정적으로 상담해주시는 모습에 너무 감동했습니다\n질문도 꾸준히 해주시면서 저의 상태를 파악하시려는 모습과 공감해주시는 부분이 좋았습니다\n상담 감사드립니다\n',1491),(1734,'2019-07-24 00:00:00.000000',5,'감사합니다ㅠㅠ\n마음의 위로를 정말 많이 해주셨어요ㅠㅠ... ',1490),(1735,'2019-07-18 00:00:00.000000',5,'아주 늦은 시간에 전화연결도 원활하지 않았는데도\n정성스럽게 상담해주셔서 감사했어요. 솔직히 별 기대안했었는데 많은 위로가 됐습니다. 선생님께서 제 고민을 잘 들어주시고 따뜻한 조언들을 차근차근 말씀해주시니 마음의 까스라미가 다 가라앉는 기분이네요.\n감사합니다♥♥',1492),(1736,'2019-07-14 00:00:00.000000',5,'밤 늦은 시간임에도 불구하고 바로 상담 해주셔서 감사합니다.\n차분히 잘 들어주셔서 많은 얘기를 꺼내놓을 수 있었고, 따뜻한 격려에 마음이 편안해졌습니다\n진심으로 대해주셨다는 걸 느낄 수 있었던 상담이었습니다.\n\n\n\n',1493),(1737,'2019-07-05 00:00:00.000000',5,'정말로 다시 일어설수 있을까?\n비난하지않고 이해하려고 노력해주는 누군가가 있다는것만으로도 위로가된다\n그리고 다시 일어날 힘을 얻는것같다',1494),(1738,'2019-06-21 00:00:00.000000',3.5,'격려해주셔서 감사합니다',1495),(1739,'2020-06-18 00:00:00.000000',5,'상담을 한번도 받아본적이 없었는데\n왜 이제껏 받아보지 않았을까 싶네요\n아직 생각이 정리가 되질 않아 제대로 후기를 작성하지 못하는 아쉬움이 있지만 좋은 상담사분입니다\n회차를 더 끊어 제 자신을 더 돌보는 계기가 됐으면 좋겠네요',1496),(1740,'2020-06-10 00:00:00.000000',5,'상담사 선생님 정말 너무 감사했습니다. 말씀하나하나 신경써서해주시는 것 같았고 정말 도움이 많이된 상담이었습니다. 나를 알수있는 첫발을 내딛은 느낌이었습니다.',1497),(1741,'2020-05-26 00:00:00.000000',5,'정수형 상담사는 내담자의 이야기로부터 문제의 본질을 신속히 파악합니다. 보여지는 것 이면의 부분까지도 읽어내기 때문에 답변 내용에 신뢰가 갑니다. \n\n상담심리학 중에서도 정신분석에 근거한 객관적인 해결 방법을 제시합니다. 저처럼 역사가 오래되어 만성화된 심리문제를 가진 분이라면 문제 해결에 필요한 전문 정보와 지식, 그리고 정서적 지지를 얻을 수 있을 거라 생각합니다. ',1498),(1742,'2020-05-03 00:00:00.000000',5,'너무 감사합니다\n너무 복잡했던 저를 조금이나마 어떻게해야할지 방향을잡아주셔서 노력해보려합니다\n시간이 다되었는데도 진심으로 계속 상담을 이어가주시고 조언해주셔서 더더 감사합니다 ',1499),(1743,'2020-05-01 00:00:00.000000',5,'평소에 제 얘기를 주변인들에게 잘 하지 않아서 속으로 혼자 끙끙댈 때가 많았는데 이렇게 익명으로나마 상담을 받으니까 속마음을 숨김없이 얘기할 수 있어서 좋았고, 상담사님이 공감해주고 그 상황에 힘들어했을 나를 위로해주는 기분이 들어서 넘 좋았습니다. 다음에도 이런 고민들이 있을 때, 해결하기 힘들 때가 있으면 또 다시 상담사님을 찾으러 오지 않을까 싶습니다..!\n',1500),(1744,'2020-04-23 00:00:00.000000',5,'섬세하고 따뜻한 상담이었어요 실수로 마지막 회차를 날려버려서 너무 아쉽네요 ',1501),(1745,'2020-04-19 00:00:00.000000',5,'깨닫지 못하던 저 자신의 감