여유를 찾아가고 있습니다 앞으로 좀더 시간을 투자해서 상담 받아야하겠지만 그동안 흘려보냈던 나의 시간을 나만을 위해 사용하는거니까 충분히 의미가 있고 날위해 좋을거라고 생각이 들어요 ',1559),(1807,'2019-08-28 00:00:00.000000',5,'마음이 좀 편해지네요',1558),(1808,'2019-08-21 00:00:00.000000',5,'도움이 많이 됬어요. 감사합니다\n\n\n',1560),(1809,'2019-08-10 00:00:00.000000',5,'아직 초기 단계라 자세히 얘기할 수 없지만, 누구에게도 얘기할 수 없었던 이야기를 할 수 있는 것만으로도 저에게 많은 위로가 되었습니다. 차분하게 이야기를 들어주시고 질문을 던져주시면서 제 얘기를 끌어내주시는 모습 덕분에 얘기할때 편안함을 느꼈습니다. 앞으로의 상담도 많은 기대가 됩니다.',1561),(1810,'2019-08-05 00:00:00.000000',5,'상황이 바뀌지 않지만 제 마음은 변할수 있었어다. 상담이 상황을 변화시킬 수는 없는 경우도 많겠죠 그래도 상담사님이  오롯이 집중해서 제 감정에 공감해주시고 적절한 타이밍에 적절한 온도와 적절한 언어로 위로해주셔서 좋았어요. 이런 위로들을 받으며 오늘도 지나갈 것이고 슬픔도 끝날 것이다  그런 생각을 하며 버텨나가야한다 그렇게 다짐하게 되어요 처음부터 상황이 나아질거다 생각하고 시작한게 아니었어요 그래도 덕분에 저는 조금 덜 괴롭게 지낼것 같아요. 감사했습니다.',1562),(1811,'2019-08-01 00:00:00.000000',5,'나 대화법을 알게 되었어요',1563),(1812,'2019-07-18 00:00:00.000000',5,'감사합니다. 제얘기만 하느라 많은 조언을 듣진 못했네요 감사합니다 \n',1564),(1813,'2019-07-17 00:00:00.000000',5,'제가 이해할수없는 여러가지 스스로의 행동들이나 \n기억들이 유년시절이나 , \n인지하지못하는 부분에서 비롯된것이란걸 알려주셔서 \n좀더 명확하게 해야할일을 알게된것 같아요 ..\n감사해요 ^^',1565),(1814,'2019-07-16 00:00:00.000000',5,'부부관계가 너무 안 좋고 이혼을 결심하면서도 혹여 내 잘못인가. 지금 내가 잘하고 있는건다 많이 걱정이 됬어요. 상담사님이랑 상담하면서 흔들리던 마음도 결정하게 되었고 나도 몰랐던 부분도 꼭꼭 찝어서 말씀해주셔서 맞아 내가 하고 싶었던 말이었어, 내 마음이 그랬어 하고 엄청 공감했어요. 그리고 상담하는 내내 실컷 울고 실컷 미소도 지어보고.. 얼마만에 후련하게 그랬는지 몰라요. 솔직히 상담사님들에 편견 이런 것도 있었는데, 우와.. 오프라인으로 진행하던 부부상담을 상담사님께 돌려서 상담하고 싶을 정도였습니다. 간절한 마음으로 찾았던 상담이 오히려 힘들고 아팠는데 가벼운 마음으로 임한 온라인 상담이  더 편안하고 제 마음을 정리했습니다. 너무 감사드려요. 편안하게 임하고 퍈안하게 울수 있도록 해주셔서 너무 감사합니다!^^♡\n',1566),(1815,'2019-07-12 00:00:00.000000',5,'너무너무 좋았어요 50분이 짧게 느껴질만큼!\n제 마음을 이해해주셔서 정말 감사했어요.\n',1567),(1816,'2019-06-11 00:00:00.000000',4,'말한다는 거 자체로 위안이 됬어요 감사합니다.',1568),(1817,'2017-11-17 00:00:00.000000',4,'  좋았던 점: 편안하게 말하게 해주셨어요   아쉬운 점:없습닏',1569),(1818,'2019-06-11 00:00:00.000000',4,'어떤것이 문제인지를 잘 알게 해주신것같아요 \n공감해 주시고 이해해주셔서 감사했어요 \n그냥 어떡하지 하고만 있었는데.. 저를 되돌아 보게끔 해주신거같습니다',1570),(1819,'2018-07-03 00:00:00.000000',4.5,'이야기를 듣고 충분히 공감하여 주시는 부분이 정말 좋았어요. 제 이야기에 반응해주셔서 마음속에 쌓긴 감정들이 많이 풀렸습니다. ^^',1571),(1820,'2019-06-12 00:00:00.000000',5,'공감 잘해주셔서 좋았어요',1572),(1821,'2019-05-22 00:00:00.000000',5,'어려운 이야기였지만 조심스럽게 접근해주시고 공감과 깊은위로해주신점 너무 좋았습니다. 다음상담도 기대됩니다',1573),(1822,'2019-04-26 00:00:00.000000',5,'제 말을 진심으로 잘 들어주셨어요:)\n편하게말을 할수있었어요~!\n제가 과거얘기를 하면서 울게될지는 몰랐어요..ㅎ\n\n',1574),(1823,'2019-03-12 00:00:00.000000',5,'오늘 처음 상담을 해봤는데 정말 마음이 편안해진거 같아서 다행이예요 다음에 또 상담 부탁드려요 감사합니다',1575),(1824,'2019-06-30 00:00:00.000000',5,'편하게 제 감정을 이야기할 수 있기 해주셔서 만족스러운 상담을 이어갈 수 있었습니다. 어린 시절의 트라우마로부터 조금씩 벗어날 수 있는 계기가 되었습니다. 감사합니다:)',1576),(1825,'2019-06-12 00:00:00.000000',5,'누구에게도 털어놓지 못했던 속얘기를  풀어놓구 공감받으니 좋았어요~속이 후련해지고 제 상태에 대해 더욱 알게 됐어요..',1577),(1826,'2018-04-27 00:00:00.000000',4,'  좋았던 점: 얘기를 잘 들어주셨어요  아쉬운 점:딱히 없었어요',1578),(1827,'2017-11-05 00:00:00.000000',5,'  좋았던 점: 저한테 가장필요한 공감과 조언해주셔서 감사드려요  아쉬운 점:딱히없었는데 . 채팅속도가 끝날때쯤 느리다는거요',1579),(1828,'2019-04-04 00:00:00.000000',5,'좋은 말씀 들을 수 있어서 많이 도움됐어요',1580),(1829,'2017-09-12 00:00:00.000000',3.5,'  좋았던 점: 아직은 상담 도중이라 결론 난건 없지만 속마음 털어놓는것만 해도 좀 후련하네요.  아쉬운 점:아직까지는 상담사님 말씀이 적으시지만 제가 저에대해 설명중이라 그렇다 생각합니다..',1581),(1830,'2017-11-19 00:00:00.000000',5,'  좋았던 점: 공감을 잘해주셨습니다. 신중한태도를보이셔서 제가 존중받고있다는 느낌이 들었습니다.   아쉬운 점:조금 더말을많이 해주셨음합니다.',1582),(1831,'2017-11-19 00:00:00.000000',4,'  좋았던 점: 텍스트 넘어서 저를 이해해주는 마음이 전해져 감사했습니다  아쉬운 점:없습니다',1583),(1832,'2017-11-19 00:00:00.000000',4,'  좋았던 점: 상담 전 요구드렸던 (공감보단 조언) 것을 잘 이해하시고 인도해주셨습니다.   아쉬운 점:소프트웨어 때문인지 채팅을 주고받는 속도가 더딥니다\n',1584),(1833,'2019-02-14 00:00:00.000000',4,'좋아요\n\n',1585),(1834,'2019-05-26 00:00:00.000000',5,'출구가 표시 된 지도를 얻은 기분이에요\n이젠 출구를 향해 열심히 나아갈 수 있겠다는 생각이 들어요',1586),(1835,'2018-01-12 00:00:00.000000',5,'  좋았던 점: 질문을 잘 던져주셔서 속마음을 이야기 하기 편했고 이야기 하는 도중에 핵심을 잘 짚어주시고 조언도 해주셔서 너무 좋았습니다  아쉬운 점:없습니다',1587),(1836,'2017-11-07 00:00:00.000000',5,'  좋았던 점: 잘들어주셨어이. 너무 털어놓은것만도 위로가 됐어요  아쉬운 점:아뇨. 없었어요',1588),(1837,'2017-07-25 00:00:00.000000',5,'  좋았던 점: 마음을 잘 공감해주시고, 잘 들어주시고, 방향에 대해서 함께 고민해주신다는 점에서 좋았습니다.  아쉬운 점:없어요^^',1589),(1838,'2019-03-17 00:00:00.000000',5,'얘기를 잘 들어주셨어요\n마음에 공감과 지지 넘 힘이되었습니다 \n감사해요 김유리선생님',1590),(1839,'2019-06-16 00:00:00.000000',5,'조곤조곤 들어주셨어요\n\n',1591),(1840,'2019-06-16 00:00:00.000000',5,'기분이 나아졌어요',1592),(1841,'2019-05-05 00:00:00.000000',5,'저는 생각 보다 많이 도움이 된것같아요. \n지지를 보내주셔서 감사합니다. 제가 몰랐던 감정들을 이렇게 꺼내봤어요.  한결 맘이편해 졌고 괜찮다는 생각이 들었어요 감사합니다. \n시험이 끝나고 더 본격적으로 상담받고싶습니다ㅡ\n다음에 다시 만나요',1593),(1842,'2019-03-18 00:00:00.000000',5,'진솔한 상담 감사합니다.\n절 위로해주고 아파해준 선생님에게감동을 느낍니다\n',1594),(1843,'2018-05-06 00:00:00.000000',4,'  좋았던 점: 편안하게 잘 들어주시고 공감해주셔서 좋았습니다.제 스스로가 편안해질수 있는 방법을 찾을 수 있도록 말씀해주셔서 고맙습니다.  아쉬운 점:없었습니다',1595),(1844,'2019-02-20 00:00:00.000000',5,'제가 놓치고 있던 걸 캐치하시고 조언해주셨어요. 너무 많은 도움이 되었어요 다음에 또 상담할게요',1596),(1845,'2019-05-28 00:00:00.000000',4,'상담 정말 좋았습니다^^\n\n',1597),(1846,'2018-12-22 00:00:00.000000',5,'마지막에 사람은 모두 실수 할 수 있다. 라는 말을 해주셨을 때 많이 와닿아고 눈물이 핑 돌더라구요ㅠㅠ 감사합니다....또 도움받고 싶어요',1598),(1847,'2017-09-30 00:00:00.000000',5,'  좋았던 점: 제 얘기를 주의깊게 잘 들어주시고 차분하게 대화를 할 수 있게 해주셔서 좋았어요. 제 말에 공감해주시고, 생각을 알아차릴 수 있게 도와주시고, 다르게 생각할 수 있도록 도와주셔서 제 삶도 달라지고 있어요. 정말 많은 도움이 되었습니다.  아쉬운 점:크게 없는거 같아요',1599),(1848,'2017-11-26 00:00:00.000000',4,'  좋았던 점: 질문을 유도해주셔서 스스로 생각해볼수 있었습니다. 위로도 잘 해주시고 공감해주셔서 고생하셨습니다  아쉬운 점:없어요',1600),(1849,'2017-08-01 00:00:00.000000',5,'  좋았던 점: 사건이 일어난 시점을 되집어 볼 수 있어서 좋았구 그 누구한테도 못한 속내를 조금이나마 털어 놓을 수 있어서 좋았어요. 그리고 아기때문에 상담하는 시간 조율도 잘 해 주셔서 감사했습니다.  아쉬운 점:시간이 모질라서 아쉽네요..담에 상담권 더 끊어서 얘기해 보렵니다.',1601),(1850,'2018-12-27 00:00:00.000000',5,'마음을 잘 보듬어 주십니다 저를 글자로만 보셨는게 어릴때부터 다 본 분처럼 이해해주세요 ',1602),(1851,'2017-08-01 00:00:00.000000',4,'  좋았던 점: 포괄적인부분인데도짧은시간에빨리캐치해주시고상담해주셔서감사해요  아쉬운 점:아무래도 부부문제를한쪽방향만듣고상담해주기가쉽지않았지요',1603),(1852,'2017-11-10 00:00:00.000000',4,'  좋았던 점: 제 강점이 무엇인지 알려주시고 나 자신을 믿게 해주셨어요.  아쉬운 점:크게 없는 거 같아요.',1604),(1853,'2018-03-19 00:00:00.000000',5,'  좋았던 점: 제 감정&속얘기 등을 잘 이끌어내 주셨어요  아쉬운 점:개인적인건데, 상담시간이 넘 빨리 지나갔어요ㅎㅎ',1605),(1854,'2018-05-10 00:00:00.000000',5,'  좋았던 점: 진중하게 제 얘기 들어주셔서 너무 감사했고 아무에게도 할수없었던 가족애기와  제 마음속애 있던 아픔까지 얘기해서 풀수있었던 시간이였던거 같아요 ㅎㅎ  아쉬운 점:아쉬웠던점은 제가 30분짜리로 상담을 했던게 너무 아쉬워요 ㅜㅜㅜ 다음번엔 시간을 더 긴거로 상담 신청할게요!!ㅠ ',1606),(1855,'2019-04-12 00:00:00.000000',5,'차분히 처음부터 끝까지 이야기를 경청해주시고 적절한 조언으로 이끌어주세요. 다른 사람을 신경 쓰기 보다는 저의 감정에 집중할 수 있게 도와주세요. 많은 도움을 받았고 많은 정리를 할 수 있었습니다. 감사합니다.',1607),(1856,'2019-02-23 00:00:00.000000',4.5,'마지막까지 조언을 잡아주실려고 하는게 좋았어요.\n특히나 경험이 많으셔서 그런지 확신있게 말씀해주셔서 좋았습니다\n',1608),(1857,'2019-01-04 00:00:00.000000',4,'많은 공감도 해주시고\n저의 성향에대해서도 파악해주셔서\n제 스스로에 대해 알게됐던 시간입니다\n감사합니다',1609),(1858,'2019-07-06 00:00:00.000000',5,'위로도받고 이해도받고 지원도받을수있다는것을 알게되어\n더좋았고 상담사님도 마음을 이해해주시고 헤아려주시고 \n알려주셔서 감사합니다  다음에는 또 하고싶네요...',1610),(1859,'2019-05-30 00:00:00.000000',4.5,'처음 해보는 상담에 처음에는 부담스러웠지만 저를 알아갈수있는 좋은 상담이였던거 같아요! \n혼자 끙끙대지말고 전문상담사와 이렇게 상담하는 방법도 너무 좋다고 느꼈습니다\n',1611),(1860,'2019-02-24 00:00:00.000000',4.5,'많이 위로가 돼서 상담을 하면서 많이 울었고 나 자신도 잘 몰랐던 감정을 인지하고 받아들이는 데 많은 도움이 되었어요. 우울과 불안에 대처하는 방법도 배웠고 실질적인 조언도 많이 해주셨어요 바뀌고 싶고 그 방향성을 잡고 싶을 때 도움이 될 거 같아요',1612),(1861,'2019-04-13 00:00:00.000000',4.5,'저는 저의 감정을 잘 몰랐어요. 상담사님과 대화를 하면서 제가 잘못된 것이 아니라 두려웠다는 것을 알 수 있었습니다. 두려웠던 시절을 잘 보다듬어 주셨습니다. 낯선 사람을 두려워하는데 텍스트로 따뜻하게 소통해주셔서 편안한 얘기를 나눌 수 있었습니다.!',1613),(1862,'2018-07-02 00:00:00.000000',4,'이야기를 잘 들어주셔서 좋았습니다.\n현실적인 해결방안이 없으면 도움이 안될거라 생각햇었는데, 적절히 조언해주셔서 위로가 되고 좋았습니다.',1614),(1863,'2017-08-07 00:00:00.000000',5,'  좋았던 점: 사건이 일어난 시점을 되집어 볼 수 있어서 좋았구 그 누구한테도 못한 속내를 조금이나마 털어 놓을 수 있어서 좋았어요. 그리고 아기때문에 상담하는 시간 조율도 잘 해 주셔서 감사했습니다.  아쉬운 점:시간이 모질라서 아쉽네요..담에 상담권 더 끊어서 얘기해 보렵니다.',1601),(1864,'2017-11-12 00:00:00.000000',5,'  좋았던 점: 편하고 필요한 부분을 중점으로 이야기를 할 수 있어서 좋았습니다  아쉬운 점:여러가지 다른 이야기로의 발전이 있었으면 합니다',1615),(1865,'2018-05-14 00:00:00.000000',5,'  좋았던 점: 저의 상처들을 진심으로 들어주시고 위로해주셨습니다.\n힘이 되었어요. 감사합니다\n  아쉬운 점:없습니다\n',1616),(1866,'2019-06-22 00:00:00.000000',5,'좋았다고생각해요. 하고싶은말 할수있었어요.',1617),(1867,'2019-01-16 00:00:00.000000',5,'짧은 시간이어서 많은 이야기는 못했지만 좋았어요. ',1618),(1868,'2019-07-09 00:00:00.000000',3.5,'말하는것만으로도 생각정리가 되어 큰 힘을 얻을수있었습니다',1619),(1869,'2019-02-28 00:00:00.000000',5,'처음에는 무슨 도움이 되겠어 싶어서 시작했습니다. 하지만 김유리 상담사님이 말을 먼저 꺼내 주시고 이끌어 주시니 저도 모르게 제 마음 속 이야길 다 꺼내게 되었습니다. 내 부모, 친구 등 주변에 있는 사람들에게 완전히 말하지 못한 이야기를 다 꺼낸다는 것 자체가 위로가 된다는 것을 알았습니다. \n사실 한 두 번 상담을 한다고 내가 엄청 바뀌는 것은 아니었지만 온갖 부정적인 감정만 있던 내가 상담 후 긍정적인 일에 조금 더 신경을 쓰는 것을 보게된것 같습니다.',1620),(1870,'2019-07-09 00:00:00.000000',5,'약간 자포자기한 상태에서 상담을 신청했는데 첫 톡이 생각보다 일찍 따뜻하게 와서 거기서부터 위안을 얻었습니다. 성심성의껏 질문해주시고, 거기서 생각지 못한 부분을 알아챌 수 있던 것도 좋았습니다. 특히 위로와 지지를 많이 받아서 힘이 많이 됐습니다.',1621),(1871,'2017-12-11 00:00:00.000000',4,'  좋았던 점: 혼자 생각해볼 수 있는 조언을 해주셔서 좋았습니다.  아쉬운 점:상담을 서둘러 끝내려는 느낌이 들었습니다.',1622),(1872,'2018-02-06 00:00:00.000000',4,'  좋았던 점: 적극적인 위로가 좋았습니다 아무도한테 할수 없는 말을 할수있어서 좋았습니다  아쉬운 점:현실적인 조언을 더 해주셨으면 좋겠습니다\n',1623),(1873,'2019-03-02 00:00:00.000000',5,'기다려주시고 이야기도 잘 들어주시고 그걸 통해 제가 무슨 생각을 했고 무슨 마음이었는지 말해주셔서 알게되었습니다. 제게 필요했던 다정한 위로가 만족스럽습니다.',1624),(1874,'2019-05-15 00:00:00.000000',5,'인터넷 정보의 홍수 속에서 많은 정보를 접하고 그 틀에만 맞춰서 생각을 하다보니 괴로웠습니다. 하지만 상담을 하고 나서 사람마다 저마다 차이가 있듯이 꼭 그 정보들을 따라서 하는 것이 아닌 저만의 방법에 대해서 이해해주시고 새로운 의견도 내주셔서 너무 감사했습니다.\n',1625),(1875,'2019-03-03 00:00:00.000000',4,'질문을 많이 해주셔서 생각해볼 여지가 많았습니다 중간중간 공감을 많이 해주셔서 수월했구요 다만 채팅이 조금 느리신 편이라 이야기는 많이 나누었지만 텍스트 상담이 짧게 느껴졌어요 ',1626),(1876,'2019-05-15 00:00:00.000000',4,'차분하게 제 생각을 정리하게 해주셔서 감사했습니다. \n주로 제 얘기를 최대한 많이 이끌어내셨는데\n피드백이 조금 더 많았으면 좋았겠다는 생각이 들어요. \n문자 50분 상담은... 시간이 좀 아쉽다는 느낌입니다. \n고생 많으셨습니다!\n',1627),(1877,'2018-02-06 00:00:00.000000',5,'  좋았던 점: 질문을 잘 던져주셔서 좋네요  아쉬운 점:시간이 빨리가는거같아요 ',1628),(1878,'2019-01-23 00:00:00.000000',5,'나도 모르는 나를 어루만져주시고 용기를 주십니다\n비관적으로만 생각하고 희망도 가지지 않았는데 제게 늘 희망을 주셨어요\n할 수 없을거라는 생각에서 할 수 있을지도 모르겠다는 생각이 들게 해주셔서 감사합니다',1629),(1879,'2019-05-15 00:00:00.000000',4,'방향이 잡힌것 같아요\n내가 어떤 상태인지 어떻게 살아야하는지\n어떻게 사는게 좋은지 어떻게 살면 안될지\n방향을 잡아서 해나가는건 내 노력이 필요로하지만\n내가 내얘기를 통해 나를 더 알았고 그래서 \n내 방향이 더 단단해진 느낌이에요\n',1630),(1880,'2019-06-24 00:00:00.000000',5,'덕분에 실질적인 문제 해결에 한 발 내딛을 수 있었어요 ',1631),(1881,'2018-04-05 00:00:00.000000',5,'  좋았던 점: 속에 있던 얘기를 해서 좋았고 또 잘 이해해주시고 공감해 주시는 부분이 좋았어요. 한번에 변할 거라고 생각하진 않지만 문제점을 직면하고 어떤 방향으로 나아가야 하겠다는 생각을 할 수 있었어요  아쉬운 점:딱히 없었어요. 내 얘기를 할 수 있는 편한 시간이었던 것 같아요',1632),(1882,'2019-03-26 00:00:00.000000',4,'그때그때 적절한질문들을 해주시며 위로도 따듯하게 받아서 큰힘이되었어요.. \n감사합니다 ..!',1633),(1883,'2018-04-05 00:00:00.000000',5,'  좋았던 점: 차분하게 과거를 되돌아보는 기분이었어요\n상담을 받고나니까 기분이 훨씬 나아졌어요 ㅎㅎ\n어떻게 나아갈지 방향을 제시해주셔서 좋았어요  아쉬운 점:업서용',1634),(1884,'2018-04-05 00:00:00.000000',4.5,'  좋았던 점: 중구난방이었던 생각들을 하나씩 정리할수 있어서 좋았어요  아쉬운 점:생각보다 시간이 빨리지나갔어요',1635),(1885,'2018-02-09 00:00:00.000000',5,'  좋았던 점: 질문을 잘해주셔서 편하게 말할수있었어요  아쉬운 점:많은 얘기를 못 나눴어요',1636),(1886,'2019-06-25 00:00:00.000000',4.5,'짧은 시간인데도 최대한 같이 고민해주셔서 감사했습니다',1637),(1887,'2017-08-16 00:00:00.000000',1,'  좋았던 점: 공감을 잘 해주신것 같았어요  아쉬운 점:채팅속도가 좀 느리신것 같아요 ㅜ 충분한 상담을 받긴 아쉬웠어요',1588),(1888,'2017-11-28 00:00:00.000000',5,'  좋았던 점: 아이 때문에 상담 못 할뻔 한걸 이해해 주시고 배려해 주셔서 감사했어요  아쉬운 점:짧은 시간',1601),(1889,'2019-04-20 00:00:00.000000',5,'많은 얘기를 하지않아도 통찰력있는 선생님덕분에 많은 도움을 받았습니다.',1638),(1890,'2019-01-31 00:00:00.000000',5,'이야기를 잘 들어주시고 제 마음을 잘 표현할 수 있도록 도와주시는 부분이 많은 도움이 되었습니다',1639),(1891,'2019-04-20 00:00:00.000000',5,'앞으로의 계획을 명확하게 잡아주셨어요\n당장 실천해보렵니다\n도움이 많이 될거 같아요',1640),(1892,'2019-06-26 00:00:00.000000',4.5,'처음엔 상담사께서 제 말을 제대로 듣고 있는 건지 매뉴얼대로 질문하시는 건지 잘 몰랐다. 상담사에 대한 신뢰가 없었다.\n그래서 상담할 때 마음이 편하지 않았다. 그러나 상담을 할수록 나 혼자서는 생각해보지 못했던 질문들을 해주셨고 사고가 트이는 느낌이었다.\n아직도 많이 불안하고 답이 뭔지 모르겠지만 그래도 전에 생각보단 좀 더 편해진 마음이다.\n기본적으로 공감하시지만 가끔 단호한 말투로 지금의 내 상태를 진단해주신 것이 좋았다.',1641),(1893,'2017-08-25 00:00:00.000000',3.5,'  좋았던 점: 제 마음을 너무 헤어려 주시고 공감해 주셔서 많이 도움이 되었습니다  아쉬운 점:시간을 좀 너무 맞추시는거 같아서 아쉬웠습니다',1642),(1894,'2019-06-09 00:00:00.000000',5,'정성스러운 상담 감사합니다',1643),(1895,'2017-08-27 00:00:00.000000',4.5,'  좋았던 점: 솔직히 얘기해주셔서 좋았습니다  아쉬운 점:경계라는 것이 명확하지 않은 것이 많은데 일반적으로 적용한 것(나이 독립 등)이 조금 아쉬웠습니다',1615),(1896,'2019-04-23 00:00:00.000000',5,'세심하게 저의 감정을 잘 파악해주셔서 좋았어요. 제가 몰랐던 점이나 살면서 놓치고 있었던점들까지 잘 집어주셔서 너무 감사했습니다',1644),(1897,'2019-05-21 00:00:00.000000',5,'답답했던점을 이야기를 통하여 객관적인 눈으로 볼수있었고 홧병이 조금 누그러 졌어요',1645),(1898,'2019-03-11 00:00:00.000000',4,'제 얘기에 공감하고 경청해주고 어린시절 아픔을 듣고 보듬어주시려고 노력해주신점,안되는건 안되는거라며 단호하게 말해주신것도 좋았습니다.',1646),(1899,'2020-05-27 00:00:00.000000',5,'우울감이 심했는데 상담을 하면서 되게 저 자신에 대해 이해할 수 있던 시간이었어요 ',1647),(1900,'2020-05-25 00:00:00.000000',5,'저의 작은 변화에도 칭찬을 아끼지 않으시고 저의 이야기를 끝까지 잘 들어주십니다 \n제가 혼란스러워 할때 어떤 방향을 잡으면 좋은지 조언도 잘 해주시고 저의 감정 변화가 왜 일어났고 어떻게 극복 하면 좋은지 정리해 주셔서 힘든일이 생겨도 상담자님에게 조언을 구해보자 하며 우울감에서 빨리 벗어 날 수 있었습니다 \n',1648),(1901,'2020-05-22 00:00:00.000000',5,'위로와 많은 도움이 되었어요:)',1649),(1902,'2020-05-14 00:00:00.000000',5,'제 이야기를 듣고 저를 잘 파악해주셔서 저에게 필요하고 도움되는 조언들을 많이 받았습니다. 생각하지 못했던 시각으로 조언해주셔서 큰 도움이 되었고요. 텍스트라 큰 기대를 하지 않았는데 기대이상으로 큰 도움 받고있어요. 당분간 상담을 지속할 계획입니다.',1650),(1903,'2020-04-18 00:00:00.000000',5,'좋았습니다\n\n',1651),(1904,'2020-04-06 00:00:00.000000',4,'제 이야기를 잘 들어주시고 \n공감해주셔서 좋았어요',1652),(1905,'2020-03-15 00:00:00.000000',5,'친절하시고 위로를 많이 해주셨고 다독여주셨어요\n응원도 잘 해주셨습니다... 시간이 짧아 아쉬웠네요',1653),(1906,'2020-03-12 00:00:00.000000',3,'일단 저의 이야기를 들어주셔서 감사했습니다. 근데 막 생각이나 마음이 정리되기엔 조금 시간이 부족했어요 ',1654),(1907,'2020-03-11 00:00:00.000000',5,'길지 않은 수험생활동안 스트레스 받고 울었던 부분에 대해 상담했는데 저 스스로도 많이 나아진 것 같아서 다행입니다.\n선생님도 친절하게 말씀 잘 들어주시고 위로 정말 잘 해주셨어요\n저랑 비슷하게 힘드신 분들도 도움받으시면 좋을 것 같습니다',1655),(1908,'2020-03-10 00:00:00.000000',5,'정말 잘들어주시고 다독여주시고 마음이편해져요 감사합니다!!',1656),(1909,'2020-03-06 00:00:00.000000',5,'제 마음의 가려웠던 부분을 긁어주신것 같아요.제가 고민하던 걸 정확하게 알아주시고 방안도 말해주셔서 정말 유익한 시간이었습니다!',1657),(1910,'2020-02-28 00:00:00.000000',5,'두서없이 감정을 쏟아내는 제 얘기를 차분히 들어주시고 공감해주시고 해결책을 찾아주셨어요^^\n마음이 편해지면서 객관적으로 나를 바라볼수도있었구요\n쉽지않겠지만 꾸준히 상담사님의 따뜻한 말씀을 되새기면서 노력해보려합니다 \n다음에 시간되면 계속 상담 받으려구요\n정말 감사합니다!',1658),(1911,'2020-02-27 00:00:00.000000',5,'제대로 정리해서 말을하지는 못했지만 친절하게 상담해주시고 정리도 깔끔하게 해주시고 힘들었던점 공감해주시고 감사했습니다 뜻깊은 상담이었습니다 다음에도 상담할일 있으면 또 다시 찾아뵐게요^^',1659),(1912,'2020-02-25 00:00:00.000000',5,'4회기 상담을 받았는데, 제 자신을 많이 돌아볼 수 있어 좋았어요!\n상담사님도\n\n\n 저에게 집중해주시고 적절한 질문을 통해 저를 이해할 수 있게 도와주셨어요 :)\n감사드려요^_^\n',1660),(1913,'2020-02-21 00:00:00.000000',5,'시간이 짧아서 아쉬웠어요 .. 그래도 얘기를 최대한 많이 해주셔서 감사했어요 ',1661),(1914,'2020-02-19 00:00:00.000000',5,'제 이야기를 잘 들어주시고 마지막에 제 상태나 실천해 볼수 있는 방법을 알려주셔서 좋았습니다\n',1662),(1915,'2020-02-18 00:00:00.000000',5,'전적으로 제 편에서 제 감정과 마음을 인정하고 이해해주셔서 큰 위로가 되었어요\n제가 놓쳤던 감정도 짚어주셔서 답답함이 해소 되었습니다^^\n짧은 시간이었지만 충분히 공감받았고 적절한 조언도 얻을 수 있어서 큰 도움 되었습니다~^^',1663),(1916,'2020-02-18 00:00:00.000000',5,'위로의 말씀을 해주셔서 좋았습니다\n\n',1662),(1917,'2020-02-13 00:00:00.000000',5,'제 이갸기를 잘들어주셔서 너무좋았어요ㅜㅜ너무 감사드러요ㅜㅜ',1664),(1918,'2020-02-07 00:00:00.000000',5,'상담사님과 첫 상담이었고 채팅을 이용한 상담이었습니다.\n제가 길게 말했는데도 끝까지 잘 들어주시고 어떻게 행동해야할지보다도 제가 어떤 감정이 드는지 제 상태가 어떤지에 집중하도록 계속 질문해주셨습니다.\n진심으로 상담을 진행하고 계시다는 느낌을 받았으며 상담 마무리에서 오늘 상담에 대해 정리해주셔서 그 부분이 마음에 들었습니다.',1665),(1919,'2020-02-06 00:00:00.000000',5,'상담을 하면서 저의 문제의 원인을 찾게 되었습니다.',1666),(1920,'2020-06-23 00:00:00.000000',5,'제가 답을 알고 있어서 상담이 별로 효과가 없을거라고 생각했는데 아니었네요 너무 복잡하고 얽혀있던 생각이 잠시나마 바르게 자리잡은 기분이에요 이야기를 잘 들어주셨어요 감사합니다',1667),(1921,'2020-06-22 00:00:00.000000',5,'선생님과 함께 이야기 나누면 항상 한결 마음이 차분해지고 가벼워지는 느낌이었어요. 혼자 내 생각을 정리하려하는 것보다 내 마음의 오타를 객관적으로 같이 관찰해주시고, 같이 바로 잡아 주셔서 매우 도움이 되었습니다! ',1668),(1922,'2020-06-22 00:00:00.000000',5,'최근 힘든일로 상담받는 걸 생각해보게 되었습니다. 뭔가 누적된 불안이였던거 같아 병원을 가려고 찾던중 트로스트를 알게되었어요. 가기 전에 글로 상담을 받아보면 좀더 쉽게 시작할 수 있지 않을까해서 신청하게 되었습니다. 정말 짧았지만 상담을 통해 이 힘든 상황보다 저자신의 다른 상황?을 마주하게 되었습니다. 상담사님 감사합니다. 상담이 더 필요한거 같아 고민해보려 합니다.',1669),(1923,'2020-06-19 00:00:00.000000',5,'좋은 말씀과 정보 감사했습니다 ^^',1670),(1924,'2020-06-18 00:00:00.000000',5,'한 번도 저의 어릴 적 이야기를 꺼내지 않은 채 살아와서 저는 늘 다른 사람의 위로도 받지 못했고, 스스로를 사랑하지도 못했어요. 오늘 꽁꽁 숨겨놓은 제 아픔을 처음으로 상담사님께 보여드렸고, 제가 문제가 있는 것이 아니라는위로를 태어나서 처음 받아봤습니다. \n\n상담을 받으면서 지금까지 꾹꾹 누르며 살아왔던 감정들이 한꺼번에 쏟아져서 정말 많이 울었고, 한결 나아졌습니다. 누군가와 얘기하고 위로받는게 이렇게 소중한 건지 처음 느꼈어요. \n\n제 걱정의 원인과 그 당시의 감정을 제대로 바라볼 수 있었고, 상담사님의 위로가 정말 감사했던 시간이었습니다. 저처럼 어렸을 적 트라우마로 인해 지금까지 마음의 문을 닫고 계신 분들이 있다면 상담을 통해 한결 나아졌으면 좋겠어요.',1671),(1925,'2020-06-17 00:00:00.000000',5,'내 상황에서 느끼는 분노와 배신감. 자책감 같은 감정이 \n당연한거라고 말씀해주셔서 많은 위로가 되었습니다 \n내가 이상한건가 내가 잘못한건가 하는 생각 대신\n누구라도 그 상황엔 속을 수 밖에 없었고 도와줄 수 밖에 없었다는 사실을 잘 기억하겠습니다 \n나를 잘 아는 사람들에게 고민을 많이 이야기하고 공감을 받아 \n상처받은 부분을 잘 치유해 나가겠습니다 \n그 친구와의 관계는 저를 위해서라도 끊어내고 다시 연락이 와도 적정한 거리를 유지하며 나를 보호하겠습니다 ',1672),(1926,'2020-06-15 00:00:00.000000',5,'항상 마음속에 있는 불분명한 감정? 불분명한 단어? 들을 딱 찝어서 얘기해주는 상담사님! \n가끔 내가 어떤 마음인지 파악이 안될 때 찾아뵙는 분!^^\n힘든날 또 오겠습니다!',1673),(1927,'2020-06-13 00:00:00.000000',5,'좋았어요\n\n',1674),(1928,'2020-06-13 00:00:00.000000',5,'저에대해 잘 안다고 생각했는데, 실은 정말 필요한게 무엇인지 모른채 감정적으로 많이 억누르고 스스로 힘들게하고있던 사람이었을지도 모른다는 생각이 들었어요\n몇달간 저를 괴롭히던 생각의 실체나, 감정을 다루는 법에 대해 배우게 된것같아요\n4번에 거쳐 많이 마음이 편해지고 제가 못 놓던 생각들이 조금씩 달라짐을 느꼈어요\n특히 감정을 대하는법과 그것이 제게 필요한 이유에 대해 알려주시고 확신을 주셔서 좋았어요.\n제게필요했던 상담이었단 생각이 들어요\n상담 감사합니다.\n',1675),(1929,'2020-06-13 00:00:00.000000',5,'위로가 됐어요. ',1676),(1930,'2020-06-11 00:00:00.000000',5,'저녁시간에도 신경써서 상담해주시고 감사합니다!!',1677),(1931,'2020-06-10 00:00:00.000000',5,'좋았어요!!',1678),(1932,'2020-06-08 00:00:00.000000',5,'그동안 저도모르게 외면했던 저의 모습을 하나씩 꺼내보면서 생각을 정리하고 방향을 잡는 시간이 된 것 같아요.\n앞으로 상담을 통해서 점점 더 나아질 수 있었으면 좋겠습니다!',1679),(1933,'2020-06-07 00:00:00.000000',5,'생각이 정리안되고 답답할때마다 상담을 받았습니다\n언제나 제가 보지못한 부분을 봐주시면서 따뜻하게 말씀해주셔서 스스로 점점 건강해지고 있다고 느껴집니다\n항상 따뜻하게 이해해주셔 감사합니다 ',1680),(1934,'2020-06-04 00:00:00.000000',5,'선생님의 따뜻한 메세지가 위로가 되었어요.\n제 말을 차분히 들어주시고 대답해 주실때\n이해와 그걸 듣고계시는 마음이 느껴졌습니다.\n\n결국엔 힘든 것도 제 스스로만이 이겨낼 수 있는 일이지만 선생님께 의지하면서 더 발전이 있을 수 있을 것 같아요\n',1681),(1935,'2020-06-02 00:00:00.000000',5,'어떻게  상담해야  될지  몰라서  고민하다가  너무  힘들어서  상담신청했는데.....다  이야기  허지 못했는데  감정이  올라와서...\n아직까지도   울게만  괴는 것  같아요...!\n그래도  혼자서  참다가  울수 있어서   좋았어요...!\n좀  진정되면  꼭  다시  찾아갈께요!\n감사해요!',1678),(1936,'2020-06-02 00:00:00.000000',5,'전화였으면 울면서 말을 못했을텐데\n텍스트상담이라 울면서 말을 할 수 있어서 좋았어요.\n제 내면의 자아를 더 보듬어주는 시간을 갖고 다음에 또 상담신청할게요',1682),(1937,'2020-06-02 00:00:00.000000',5,'이야기 잘 들어주시고 공감하면서 상담 해주십니다.',1683),(1938,'2020-05-30 00:00:00.000000',5,'상처가 많은 내면의 아이를 어떻게 보살펴주어야하는지, 어떻게 나를 돌봐야하는건지 너무 막막하고 어려워서 늘 포기하고 접어뒀었는데 노은혜 상담사님께서는 저와 함께 제 내면의 아이를 마주해주시고 아이가 듣고싶어하는 말들을 들려주시면서 자연스럽게 저도 그 아이에 대해 깊게 생각하고 아이에게 이야기를 해주며 스스로 방법을 찾을 수 있었어요.\n\n내면의 아이도 자라지 못하고 그 자리에 머물러버린 작은 나니까 함께 자랄 수 있도록 그 당시의 내게 필요했던 말들을 자주 들려주면서 긍정적인 마인드를 가질 수 있게 되었어요.\n“괜찮아. 잘 하고 있어. 넌 소중한 사람이야.” 등의 말들로 상처가 많이 치유되었고, 삶을 건강하게 살아갈 수 있을 것 같아요. 4주동안 정말 도움 많이 받았고 감사했습니다😊',1684),(1939,'2020-05-18 00:00:00.000000',5,'그동안 상황이 나아졌으면 빨리 괜찮아져야지하는\n강박관념이 있었던 것 같아요 근데 그러지 않아도 된다는 생각을 상담을 통해 처음하게 되었어요. 그동안 어딘가 정체되어있고 불안