생각을  되돌아보는 시간이어서 좋았어요',1717),(1973,'2020-02-26 00:00:00.000000',5,'어떤 큰 변화를 주고 받기엔 짧은 시간이었잖아요!\n그렇지만 중간중간 해주시는 답변에 위로가 많이 됬어요 감사합니다!',1718),(1974,'2020-02-25 00:00:00.000000',5,'상담사님과 함께한지 두 달이 되어가는데 매 번 따뜻하고 신중하게 들어주시고, 제가 놓치고 있던 부분들을 잘 짚어주셔서 생각이 잘 정리가 되고 제 자신이 바뀔 수 있다는 희망이 조금씩 생겼어요! 항상 감사드립니다:)',1668),(1975,'2020-02-24 00:00:00.000000',5,'생각이 많은 변화가 생겼습니다\n\n',1719),(1976,'2020-02-17 00:00:00.000000',5,'제가 듣고싶던 말, 위로가 되는 대화가 너무 좋았어요. \n갈피를 못잡고 우왕자왕하며 말을 했는데도 포인트를 알아서 잘 이야기를 이끌어나가주셨던거 같고 필요한말들 듣고싶던말들 너무 잘해주셔서 눈물이 났어요\n',1720),(1977,'2020-02-14 00:00:00.000000',5,'저의 고민을 잘 이끌어내주시는 편이 참 좋았어요 감사드립니다',1721),(1978,'2020-02-11 00:00:00.000000',4,'상담사님께 고민을 얘기하면 그럴때마다 해결책을 제시해주셔서 좋았습니다. 스스로 충분히 해결할 수 있는 방법들이라 상담을 안 받을때도 적용해보면 좋을거같아요. 다만 아쉬운 점은 상담시간을 자주 조정했던 거에요~',1722),(1979,'2020-02-08 00:00:00.000000',5,'감사합니다',1723),(1980,'2020-02-06 00:00:00.000000',5,'섬세한 질문 감사합니다\n\n',1724),(1981,'2020-02-02 00:00:00.000000',5,'선생님을 통해 많이 회복되었습니다\n\n',1725),(1982,'2020-02-02 00:00:00.000000',5,'마음이 불편할 때 선생님 찾아왔는데 정말 많이 편해졌어요. ',1726),(1983,'2020-01-24 00:00:00.000000',5,'따뜻한 격려와 지지를 받았습니다.\n감사해요.',1727),(1984,'2020-01-21 00:00:00.000000',5,'너무 힘들 시간을 보내고 있을 때 마지막으로 심장을 뜯는 심정으로 신청했습니다.\n심리상담은 온오프라인 통틀어 처음이어서 어떻게 해야될지\n어떤 말을 해야할지 전혀 모르겠더라구요.\n일단 아무 말이라도 지껄여보자 하는 마음으로\n지금 느끼는 감정, 힘든 일, 내 생각 등을 정말 쏟아내듯 말했습니다.\n나조차도 내 말의 요점이 무엇인지 모르겠는데, 상담사님께선 그 많은 대화 중\n내가 생각해봐야 할 것, 놓치고 있는 것, 힘들었던 감정의 원인 등을\n정확히 집어서 온건하게 설명해주시더라구요.\n나의 쓰레기같이 냄새나고 썩었던 마음의 원인을 더 정확하고 부드러운 단어로\n다시금 알게되니 이제 해야할건 나를 치유하는 일만 남더군요.\n매주 상담사 선생님께서 내주시는 숙제에 대해 생각해보며\n울고 또 울고 울었던 날이 모두 저를 치유하는 시간이었어요.\n비록 마지막 상담시간은 저의 불찰로 아쉽게 놓쳐버렸지만 단 3번만의 상담으로 저의 하루가 아주 많이 편해졌습니다.\n아직 저의 속에 들어있는 상담거리들이 많이 있어서 또 뵐 날을 기약해야하지만 그 때도 믿고 좋은 상담을 받을 수 있을 것이라 생각해요.\n정말 감사합니다.\n\n',1728),(1985,'2020-01-21 00:00:00.000000',5,'일상적인얘기 그상황속에서 나도 모르고있던 제3자의입장과 제입장을 잘섞어서 이해하기쉽게 설명해주시는게 나를 알아갈수있게하는데 도움이되었어요!\n하루하루 상담마무리를 할때 숙제를 내주시는데 예를들어 내가 왜그런생각을하는지 라는 숙제를 내주시면서 이건 내마음을 알아보기위한 방법이에요 ~~ 하면서 설명해주시는게 내가 생각을 하면서도 이건 내가 나를 살펴보는데 도움이 되는거구나 싶어서 좋았어요\n다음에도 고민이생길때 찾을거같아요 고민이 제 선에서 해결되도록 선생님 말씀대로 해보고 나서요!!',1729),(1986,'2020-01-18 00:00:00.000000',5,'상담사님 감사합니다 ',1730),(1987,'2020-01-15 00:00:00.000000',5,'너무감사해요',1731),(1988,'2020-01-13 00:00:00.000000',5,'짧은 시간동안에 정말 제 이야기를 많이했는데 제가 고민하는 부분을 잘 집어서 공감해주시고 위로해주셨어여ㅠㅜ 제가 계속 긴글을 횡설수설 폭격기처럼 보냈는데 다 잘 읽어주신것같아서 죄송하고 감사합니다.ㅠ ',1732),(1989,'2020-01-08 00:00:00.000000',5,'제 이야기를 잘 들어주시고 거기에따른 적절한 문제점과 해결방법을 방향이라도 제시해주셔서 좋았어요. 그동안 받았던 두루뭉슬한 위로가 아니라 이렇게하면 나아질수도있겠다는 생각이 들었어요. 감사합니다!!ㅎㅎ',1733),(1990,'2020-01-03 00:00:00.000000',5,'기분이 한결 나아졋어요 마지막말이 크게 와닿앗습니다 \n감사합니다',1734),(1991,'2020-01-03 00:00:00.000000',5,'처음에는 카톡같은 상담으로 뭐가 달라질수 있을까? 싶었어요. 하지만 너무 힘들어서 뭐라도 해야겠다는 심정으로 시작을 했어요. \n\n처음부터 내가 완전 변화하겠다라는 마음으로 시작한건 아니지만 상담을 받으면서 조금씩 더 나아지고 치유받는 제 내면을 느꼈어요. 처음과는 생각하는것도 많이 달라졌고, 이제 나도 달라질수있겠다는 희망이 생겼어요. 감사합니다 ^^',1735),(1992,'2019-12-29 00:00:00.000000',4.5,'공감을 잘 해주셔서 좋았어요 그냥 제 얘기를 들어줄 사람이 필요했는데 잘 들어주셔서 정말 감사했어요 그리고 저도 몰랐던, 저는 표현 못한 저의 감정들을 잘 얘기해주셔서 내가 이런감정이었구나 이런것도 느낄 수 있었어요!!',1736),(1993,'2019-12-28 00:00:00.000000',5,'얘기 잘 들어주셔서 감사했어요\n덕분에 답답한 것도 풀리고 차분해진 것 같아요\n감사합니다 ~',1737),(1994,'2019-12-21 00:00:00.000000',5,'지금 고민하는 부분에 대한 해결책을 구체적으로 제시해주시고 제가 못보던 부분들을 발견하게해주셔서 감사했어요!\n\n혼자서만 가지고있기엔 벅찼던 부분들이 많았는데\n좋은 질문들을 많이 던져주셔서 흐릿했던 것들이 선명해지고 정리가 잘 되었습니다 :)  감사합니다~~ \n',1738),(1995,'2019-12-21 00:00:00.000000',1,'50분이 아깝다고 느꼈어요.\n상담사가 좀 주도적으로 질문도 던져주고 편안하게 마음을 털어놓을 수 있게 이끌어야하는데 저 혼자 벽에 대고 말하는 느낌이었습니다.\n대답도 제가 한 말 반복하면서 \"~하셨군요.\" 여기서 끝내면 대체 그 다음은 제가 뭐라고 해야하나요? \n이게 공감과 경청인가요? 차라리 전문지식이 전혀 없는 사람들이 더 잘 들어주는 거 같아요.\n제가 문제 해결을 위해 조언을 해달라고 여러번 물어봐도 끝날 때 되어서야 감정일기를 써보라고 한마디 하더군요.\n\n친구들을, 지인들을 놔두고 비용을 지불해가며 상담사를 이용하는건, 전문적인 상담을 받고 싶어서에요.\n원인을 속시원히 파악하고, 도움이 될만한 행동이나 방법을 제시해주길 바랬습니다. 그런 면에서 전혀 도움이 안 됐어요. \n원인도 제가 그냥 다 말해줬죠. 과거에 이런 경험이 있었고 거기서 기반이 된 것 같다라며ㅋㅋ\n\n\n감정일기 쓰라면서 텍스트 몇 자 던져주고 상담 끝내려길래 그냥 맞장구는 쳐줬는데 돈이 너무 아까워요.\n실제로 써본결과 하나도 도움이 안 되었답니다.\n\n\n이 분에게 상담하지 말란 말씀은 안 드릴께요. 맞는 사람도 있었겠죠.\n다만 앞으로 다른 분들에게는 좀 더 능동적으로 이끌어주고 전문적인 모습을 보여줬으면 좋겠어요. 마음이 힘든 사람들이 제3자에게 혼자 이야기를 털어놓는 게 쉬운 일이 아니니까요.\n',1739),(1996,'2019-12-18 00:00:00.000000',5,'상담을 받고 나서 처음엔 어색해 했지만 중반부로 갈수록 상담의 깊이가 깊어 지는거 같아서 좋았습니다!!  많은 고민 끝에 상담을 하게 되었지만 제 맘속에 안좋았던 생각들과 다르게 따뜻한 말들을 해주셔서 감사하게 생각하고 있습니다!! 짧지만 그만큼 깊은 대화를 나눈거 같아서 생각에 변화가 많이 생긴거 같아요! 어려운 말들을 많이 했지만 밝은 목소리로 이야기 해주셔서 고맙습니다!! 덕분에 좋은 마인드 얻어서 갑니다♥️♥️♥️',1740),(1997,'2019-12-16 00:00:00.000000',5,'제가 어떤 기분이었는지 저보다 더 잘 아시는듯 했어요ㅎㅎ 좋은 상담이었습니다!',1741),(1998,'2019-12-14 00:00:00.000000',5,'천천히 제 이야기를 다 들어주시고\n섣불리 판단하거나 조언해주지 않고\n같이 생각하고 길을 찾아가게 만들어준\n선생님께 참 감사해요.\n모든게 다 씻은 듯 해결됬다면 거짓말이겠지만\n점차 나아질거란 희망이 듭니다.\n감사해요.',1742),(1999,'2019-12-13 00:00:00.000000',5,'전화상담은 처음이었는데 텍스트보다 훨씬 효율적이고 효과적이라는 생각이 들었어요. 두서없이 말하고 옆길로 새고 그랬는데도 잘 캐치해주셔서 좋았습니다. ',1743),(2000,'2019-12-12 00:00:00.000000',5,'10년 넘도록 우울증으로 힘들었고 정신 신체화로 몸까지 아팠는데 잘 맞는 상담선생님을 만나지 못했었어요. 오랜 우울증으로 많이 지쳐 병원방문조차 어려운 상황에서 노은혜 선생님을 만나 정말 많은 도움을 받았습니다. 스스로 문제를 찾고 변화할 수 있도록 잘 안내해 주셔요. 지금 많이 좋아져서 새로운일에 도전하며 잘 지내고 있지만 계속 상담을 받으며 지금 컨디션을 잘 유지하고싶습다. ',1744),(2001,'2019-12-11 00:00:00.000000',4,'뭐가 문제였는지 알게되어서 좋았어요',1745),(2002,'2019-12-08 00:00:00.000000',5,'상담사선생님이 너무 편안하게 잘 기다려 주시고, 얘기도 해주시고, 질문을 해주시고 하면서 몰랐던 저의 마음에 대해서도 하나하나씩알아가고 ,, 또 믿음에 대한부분도 같이 얘기하면서 확신이 들수 있게 해주셨고 \n제마음을 잘 읽어내 주셔서 저도 몰랐던 제 마음 다시 확인하며 발전하고 성장할수 있었습니다.\n또 감동한점은 제가 넘 힘들었을때 감정일기 쓰라 하셔서 감정일기를 썼는데 상담사님이 그거 보시고 예약된 상담시간이아니었는데 상담 도와주실려고 하시고 ...\n제가 비록 그 트로스트 톡을 나중에 봐서 못했지만...도움주시려고 하신것도 너무 좋았어요.\n\n4회만에 많은 변화가 있었고, 제가 많이 좋아지고 더 좋아질거라는 확신도 생겼습니다.\n다음에 힘든일이 있어 도움이 필요하면 다시 뵙고 싶습니다.\n너무좋은 상담이었고 감사드립니다.',1746),(2003,'2019-12-05 00:00:00.000000',5,'문제가 뭔지 잘못된 사고가 무엇인지 정확히 말씀해주셨고\n해결방안과 실천해야 할 여러가지도 알려주셨습니다.\n\n시간이 나는 대로 바로 실천해보려고 해요!!!!♡♡\n\n정말 감사합니다.\n\n잊지 못할 거예요...',1747),(2004,'2019-12-05 00:00:00.000000',5,'얘기 잘 들어주시고 위로 잘 해주셔서 좋았습니당',1748),(2005,'2019-11-29 00:00:00.000000',3.5,'상담하지 않았던 것 보다 확실히 한 후의 제 생각이 더 정리되는거 같아요.\n',1749),(2006,'2019-11-27 00:00:00.000000',4,'생각지도 못한 부분을 찝어주셔서 좋았어요 한달간 편하게 상담받았네요ㅎㅎ',1750),(2007,'2019-11-25 00:00:00.000000',5,'나름 스스로에 대해 많이 고민하여 문제를 잘 인지하고 있다고 생각했는데, 얘기를 나누다 보니 선생님께서 제가 놓쳤던 중요한 포인트들을 정리해 주시더라구요. 어떻게 헤쳐나가야 할지 깨닫게 된