인을 전문가이자 제 3자의 눈으로 짚어주시니 마음이 나아질 방향을 잡을 수 있었습니다. 그 부분이 제일 큰 성과이자 상담을 통해 기대했던 부분이었습니다. 외출하기 어려우신 분들께 더욱 추천하고 싶어요. ',1767),(2025,'2019-10-18 00:00:00.000000',5,'상담을받을땐 답답한마음이 편안해진것같아 좋지만\n대화시간이너무짧아 미쳐마무리되지못한상태로 종료되어 답답한마음은있네요\n상담프로그램이 좀 더길거나 연속사용가능하게 있는거도있었으면좋겠어요\n',1768),(2026,'2019-10-16 00:00:00.000000',5,'생각도 많고 부정적인 감정이 많이 드는 시기였는데, 상담 받으면서 제 마음과 감정을 어루만져주고 위로하며 스스로를 보듬어 줄 수 있는 시간이었어요. 마음에 차곡차곡 쌓여있던 무언가가 눈 녹듯 사라져서 한결 편안하고 포근한 그런 기분이 드네요. \n무엇보다 오래 고민해왔던 문제행동에 대한 원인과 해결방법 또한 알고 갑니다. 감정의 원리에 대해 깨닫고, 스스로 감정을 돌보는게 얼마나 중요한지에 대해서도 배우고 가네요. 짧지만 귀중한 시간이었습니다. \n여유가 된다면 지속적으로 받아보고 싶어요. 감사합니다 노은혜 상담사님 :)\n',1769),(2027,'2019-10-15 00:00:00.000000',5,'스스로 답을 찾을 수 있게끔 대화를 이끌어주셨습니다\n',1770),(2028,'2019-10-13 00:00:00.000000',5,'힘든 제 모습을 부정하며 살아왔어요.\n그게 현실도피와 망상에 빠지는 방식으로\n드러났었는데, 그것도 모르고 살았네요.\n제 마음을 돌봐주는 방법을 알려주셔서\n진심으로 감사합니다.',1771),(2029,'2019-10-12 00:00:00.000000',5,'이야기를 잘들어주시고 감정을 이끌어내주셔서 좋았습니다. 제가 가진 고민들을 여러 각도로 다시 한 번 생각해보는 계기가 되었어요. \n',1772),(2030,'2019-10-11 00:00:00.000000',5,'반복되는 포기와 절망 때문에 스스로를 잃어버려서 \n많이 예민해져 있는 저를 짧은 시간이지만 친절하게 상담도 잘해주시고 스스로 생각할 수 있게 자극해 주셨어요  맘이 편해졌어요 감사합니다.\n선생님 말씀 대로 차후 추가 상담 생각이 듭니다.',1773),(2031,'2019-10-07 00:00:00.000000',5,'이야기 잘 들어주시고 다른 방향으로 접근하면서 제 안에 저도 몰랐던 부분을 끌어내주셔서 마음이 편해지는 시간이었어요 아직 갈길이 멀어서 조만간 또 봬야할것같아요ㅎㅎ\n',1774),(2032,'2019-10-03 00:00:00.000000',5,'우울증과 불안장애를 오랫동안 겪어왔지만 전문 상담가를 만난다는 것이 부담이 커서 한시간 가까이 이야기를 나누는 상담은 해본적이 없는데 정말 도움이 많이 되었어요. 감정적 위로도 되었지만 전문가가 저를 객관적으로 바라보고 조언을 해준다는 점이 정말 큰 도움이 되었습니다. 그동안 반복되었던 심리적 문제들을 상담사님의 적절한 질문과 분석으로 양파껍질 벗기듯 하나씩 해결해나가고 있어요. 앞으로 상담 지속하며 더 잘 살 수 있도록 노력하려고요. 고맙습니다. ',1744),(2033,'2019-10-01 00:00:00.000000',5,'저는 제 자신에 대해서 잘 모르고 있었어요\n이번 기회를 통해 제 자신과 마주할 수 있었어요\n그로 인해서 제가 뭐가 문제인지도 알게되었구요 \n저한테는 값진 경험이였습니다.',1775),(2034,'2019-09-29 00:00:00.000000',5,'처음 신청할때는 별 도움이 될까 싶기도 했는데 제 말을 잘 들어주시고 제가 생각지 못했던 부분까지 짚어주시고 정리해주셔서 좋았습니다. 무엇보다 진심으로 걱정해주시고 조언해주시는게 느껴져서 좋았습니다. 감사합니다.',1776),(2035,'2019-09-26 00:00:00.000000',5,'짧은 시간이지만 내 고민에 대해 이해해주시는 느낌이 들어 감사합니다. 말씀해주신 방향으로 제 감정과 생각을 솔직하게 정리해보는 시간을 갖겠습니다. 그리고 행동으로 옮길 준비를 해야겠네요. 막히는 부분이 있으면 다시 상담 부탁드리겠습니다. 감사합니다 선생님.\n\n',1777),(2036,'2019-09-23 00:00:00.000000',5,'단지 답답하다로 밖에 설명 못하는 것들을 이래서 이런감정이 들었네요 라고 풀어주셨어요  좀 더 정확히 내가 어떤상황에서 어떤감정이 들었는지 쉽게 나를 내가 이해해볼 수 있었어요 나자신을 머리로만 알고 있는게 아니라 마음으로 이래서 그랬구나라고 이해해줄 수 있게 도와주셨어요 이것만으로도 어질러진 책상위가 정리된 기분이었어요 혼자서는 못했어요 책을 읽어도 지식은 쌓이겠지만 제얘기에 딱 맞는 말은 찾기 어려웠어요 선생님 감사합니다 ',1778),(2037,'2019-09-22 00:00:00.000000',5,'너무너무 잘 들어주셔서 감사드렸고 제가 몰랐던 부분 놓쳤던 부분을 하나하나 자세히 짚어주시니 상담이 끝나고도 그것에 대해 제 스스로 고민하고 고찰할 수 있는 시간을 가질 수 있어서 너무 좋았습니다. 상담을 받지 않게 되는게 가장 좋겠지만 만약 또 하게 될 일이 생긴다면 다음번에도 이 선생님과 상담하고 싶어요..\n게다가 텍스트 테라피의 가장 많은 걸림돌인 타자속도도 정말 빠르셔서 막힘없이 술술 진행되었습니다. 오히려 제가 더 막혀서 타자치는데 오래걸릴정도였어요. 그만큼 많은 분들이 혹시나 텍스트 하나 치고 받다가 시간 다가는거 아닌가 불안해하실텐데 저는 그런 불안함없이 정말 일대일로 만나서 이야기하듯 상담할 수 있어서 좋았습니다 다른 분들도 꼭 용기내셔서 선생님과 상담받으시고 도움받으셨으면 좋겠어요 :)',1779),(2038,'2019-09-19 00:00:00.000000',5,'마지막 상담 마지막 10분 때 급하게 전화가 와서 진행을 못한부분이 못내 아쉽습니다\n선생님과 대화나누면서 그동안 잊고 있던 소중한 사실도 알게 되었고 제가 너무 많은 짐을 지고 살아왔던건 아닐까 하며 마음도 많이 편해졌습니다',1780),(2039,'2019-09-19 00:00:00.000000',5,'한 달동안 정말 좋았습니다! 처음 받는 상담이고, 처음에 무슨 얘기를 해야할지 고민되었는데, 질문도 주시고 거기에 제가 생각나는 것들 이야기했는데, 분명 제 이야기임에도 불구하고 그 상황에 대한 감정을 더 잘 알고 계시고 이해해주셔서 놀라웠습니다ㅠㅠ 감동도 받아서 첫번째상담에선 펑펑 울었습니당 두번째 상담도 울고.. \n그런 이야기들을 편안한 분위기 속에서 이끌어 주시고 공감해주시고 들어주셔서 진심으로 감사했습니다ㅠㅠ \n한 달 전 감정 기복이 커서 나란 사람에 대한 두려움과 우울함 속에서 이런저런 상황을 말씀드렸는데, 전 다 별개 상황이었다고 생각했는데 공통점이 있었다는 것도 놀라웠습니다 ! 어떻게 그걸 찾아낸건지ㅠㅠㅠ 그런 제가 이상한게 아니다라는 걸 그냥 너 이상한 사람 아니야~ 이렇게 말해주기보단 진심으로 공감받고 내가 이상한게 아니구나. 내가 그래서 그런거였구나. 이런생각이 들게 말씀주셔서 좋았습니다\n저를 새로 발견하는 느낌이었어요 나보다 나를 잘 정리해주셔서!! \n처음엔 우울함과 분노 속에서 시작한 상담이었는데 4주차 될 때 밝게 마무리 되었습니다! ㅎㅎ많이 좋아졌단 이야기 듣고 기분도 좋았습니당:)\n언제 다시 무너질지 모를 두려움도 있지만 일단 잘 해결해보며 나아가도록 할거예요! 그러다 안되면 고민하지말고 바로 찾아올게요!!\n정말 한 달동안 감사했습니다❤️❤️❤️',1781),(2040,'2019-09-18 00:00:00.000000',5,'벌써 두번 째 찾아뵀어요!! 얘기도 너무 잘 들어주시고 \n\n단순한 따뜻한 위로가 아닌 조언들 해주셔서 너무 좋았습니다:) ',1782),(2041,'2019-09-15 00:00:00.000000',5,'3개월이 넘는 시간 동안 제 이야기에 너무나도 많은 공감과\n제가 생각하는 사고방식이 이상하다고 말씀하시거나 그런 거 파나 없이 있는 그대로의 제 모습으로 봐주셨고, 상담을 통해 저의 아픈 부분들, 그리고 그동안 외면하고 방치했던 제 안에 내면의 아이를 돌보는 방법과, 감정