거에요.',1793),(2053,'2019-08-28 00:00:00.000000',5,'제 말에 항상 귀 기울여 들어주시고 같은 편에 서서 공감해주시니까 정말 많은 위로를 받게 되었어요. 제 생각을 객관적으로 바라볼 수 있도록 도와주시니까 불안에서 조금은 벗어나는 것 같아요. 여전히 상황은 그대로지만 그걸 바라보는 시선을 바꾸는 과정이니까요. 또 상담 받고 나면  마음이 안정되서 정말 좋아요.',1794),(2054,'2019-08-27 00:00:00.000000',5,'새로운 각도에서 제 인생을 돌아보게 되었습니다. 제가 이야기하는 것들에 대한 전폭적인 지지를 보내주셔서 더 용기를 얻게된 것 같아요. 앞으로 어떤 일이 생겼을 때 제 자신을 탓하기 보다 더 객관적인 주변 평가를 해보려고 해요. 너무 제 자신만 원망하다보니 우울하고 무기력해진지가 오래인것 같거든요. 그리고 또 제 인생을 살아감에 있어서 저를 가장 중요시 여기기로 다짐했습니다. 그 동안 다른 사람의 기준에 맞춰서 살아오다보니 이제 더이상 제 삶에 동력을 찾지 못하고 있었거든요. 좋은 말씀 감사드려요 ',1795),(2055,'2019-08-25 00:00:00.000000',5,'인터넷이 계속 끊겨서 힘들었지만 괜찮았어요 ㅠㅠ 깊은 생각도 해보고 정말 좋았던 시간이었어요',1796),(2056,'2019-08-24 00:00:00.000000',5,'감사합니다\n',1797),(2057,'2019-08-23 00:00:00.000000',5,'차분히 제 이야기를 끝까지 들어두시고\n섣불리 답을 안하시는 모습이 좋았습니다\n스스로 얘기하면서 생각을 정리할 수 있었어요\n종합하고 이해하고 통찰력있는 답으로\n마음을 항상 편하게 해주셨어요\n너무 감사합니다.\nㅣ',1742),(2058,'2019-08-22 00:00:00.000000',5,'그냥 누군가에게 말할 수 있다는 사실 자체가 위로네요. 감사합니다.\n',1798),(2059,'2019-08-20 00:00:00.000000',5,'50분이란 시간이 정말 금방지나가요\n저는 운이 좋게도 1,2번째 상담때 제가 고민했던것들중에 몇개를 제가 왜이러는지, 어떻게 하면 좋을지를 상담을 통해서 알게 되었어요\n그래서 이번 상담을 통해서 느낀점들이 있고, 이러면 좋겠다하는 부분들이 생겼어요\n저도 꽤 오랫동안 고민했던 문제였는데 조금만\n 시선을 돌려서 바라보면 실마리가 보이는 문제였을수 있겠단생각을 상담을 통해서 느꼈어요',1794),(2060,'2019-08-13 00:00:00.000000',5,'선생님께서 잘 들어주셔서 좋았습니다! 감사합니다:)\n',1799),(2061,'2019-08-12 00:00:00.000000',5,'갑작스런 파혼문제로 저희 가족과 전 남자친구 모두에게 노력했지만,끝내 전해지지 않은 제 마음이 방황을 많이 했던거 같아요! 사실 모든 이별이 아프듯이 2~3주 정도는 죽을만큼 너무 힘들어서 상담을 신청하게 되었구,모르는 사람에게 구구절절 내 속내를 털어놓는게 부끄럽기도 했지만 오히려 타인이기에 더 객관적인 입장에서 잘 들어줄수 있다고 생각했어요! 2주 패키지를 2번 진행하면서 그래도 이제 마음의 안정도 조금씩 찾아오며 슬픔이 서서히 무뎌지고 있네요! 한번씩 해보면 좋은거 같아요!\n',1800),(2062,'2019-08-10 00:00:00.000000',4,'답답했던 마음들이 노은혜 상담사분과 통화를 하고 나면 굉장히 편안해졌어요!!\n',1801),(2063,'2019-08-10 00:00:00.000000',5,'상담하면서 생각하지 못했던 부분을 집어주시고 새로웠어요. 조곤조곤 말씀하시고 다른사람들에게 휘둘리는 저를 제편이 되어서 같이 생각해주시고 말씀해주셔서 많이 의지가 됬어요. \n계속해서 저를 중심으로 살아가도록 노력하겠습니다~\n또 마음이 힘들어지면 다시 상담하러오겠습니다~\n감사합니다!',1802),(2064,'2019-08-09 00:00:00.000000',5,'감사합니다 앞으로 지속적으로 상담받아보려구요 ',1795),(2065,'2019-08-05 