00.000000',4.5,'누군가에겐 별거 아닌. 하지만 저에게는 별거였던 고민과 문제를 잘 들어주셨고 문제해결을 위해 함께 방법을 고민해주셨습니다. 덕분에 변화 할 수 있을것같습니다 ㅎㅎ 감사합니다!',1832),(2095,'2019-03-16 00:00:00.000000',5,'짧은시간내에 상담이라 30분안에 적절하게 방법을 주셔서 \n도움이 많이 받았습니다 ',1833),(2096,'2019-03-17 00:00:00.000000',4,'조금씩 변화하고 있어요',1834),(2097,'2019-03-17 00:00:00.000000',4,'제가 느끼는 감정에 대해 죄책감과 이 감정을 느끼는 것이 옳은가? 하는 혼란이 많았는데 선생님이 \"ㅇㅇ씨가 그 감정을 느끼는 것은 너무도 당연하다\"고 해주셔서 너무나 안심이 되었어요^^ 그리고 \"그런 감정이 들어서 다시 그런일이 반복되지 않도록 해주는거다\"라는 말도 인상 깊었어요 :) 그래서 저의 감정에 대해 \"아, 이런 말 들으면 누구라도 나 같은 기분을 느끼겠구나..\"하는 생각을 했고, 그때부터 저는 흔들리지 않았고 그 사람이 자기가 잘못 얘기했다는 것을 스스로 깨달았는지 제 눈치를 보고있었ㄷ',1835),(2098,'2019-06-16 00:00:00.000000',5,'공감을 잘 해주시고 이야기 귀 기울여주시는 선생님이세요!',1742),(2099,'2019-04-08 00:00:00.000000',4,'참을성 있게 이야기 들어주시고 제 이야기를 많이 들어주시는 편이었어요. 혼자 고민하는 것보다 누군가 내 고민을 들어준다는 느낌만으로도 큰 위안이 되었던 것 같아요. 시간 조절해서 좋은 이야기 알차게 해주셔서 감사합니다. 신기하게 마음이 위로가 되네요~',1836),(2100,'2019-05-27 00:00:00.000000',5,'친절하게 너무 잘 들어주셔서 편안하게 고민을 이야기할 수 있었어요!',1837),(2101,'2019-03-19 00:00:00.000000',5,'진심으로 들어주시는 느낌이 들어서 감사했습니다',1838),(2102,'2019-04-08 00:00:00.000000',5,'만나지않고하는 상담이라 어떨가 걱정많이했는데\n오히려 더 편하게 속마음을 이야기할수있었던거같아요\n나의 대나무 숲 처럼\n상담사님이랑 얘기하면서 모르는 내 자신을 보게된것도 있는거같아요\n짧지만 행복했던 시간이였습니다',1839),(2103,'2019-05-27 00:00:00.000000',5,'저는 상담사님의 한줄소개라고 하나요?..그 무엇도 당신의 잘못이 아니다 라는 말에 이끌려 바로 상담사님께 고민을 털어놓았어요..그런데 공감을 너무 잘해주시고 제가 뒤죽박죽 이상하게 말해도 찰떡같이 알아들어주셔서 얼마나 감사했는지 몰라요ㅎㅎ상담도 처음이고 이렇게 어플로 상담도 처음이라 모든게 서툴렀는데 상담사님께서 잘 이끌어주셔서 덕분에 잘 이겨냈고 앞으로도 잘 이겨낼거에요! 하지만 더이상 이겨낼 수 없는 상황이 다가온다면 주저말고 다시 트로스트를 찾을 것입니다! 많은 도움되어주셔서 정말 감사합니다',1840),(2104,'2019-02-18 00:00:00.000000',5,'처음에 텍스트 상담이여서 이런것들을 통해서 과연 내가 조금이나마 좋아질수 있을까..?라는 생각이 컸었는데 \n상담사님과 이야기를 하고 그리고 제 스스로 많이 애썼다고 그리고 어린시절의 나를 제 3자의 입장으로 보면서 그때 하지 못한 감정 해소가됐습니다.',1742),(2105,'2019-03-17 00:00:00.000000',5,'제가 평소에 생각지못하던 내용을  차근히 잘 말씀해주셔서 고마웠습니다. ',1841),(2106,'2019-03-17 00:00:00.000000',5,'아.. 마지막 상담 스케줄을 제가 깜빡 하는 바람에..ㅠㅠ\n이 얘기 했다가 저 얘기 했다가 정신없게 얘기해도 제 심리 상태나 상황들을 잘 정리해서 이해해주시면서 얘기해주셨어요..\n마지막 상담을 그냥 보내버려서 아쉽네요..ㅠㅠ\n당분간은 일 때문에 시간을 따로 잡기가 힘들거 같아서\n더 신청을 안했었는데... 여유가 생기면 다시 신청 할거에요\n고맙습니다 :)',1842),(2107,'2019-03-18 00:00:00.000000',5,'외부의 문제로 고민 했었는데 \n내면에 있었던 문제들을 끄집어 낼 수 있게\n도와주셨어요 \n해결책도 알려 주셔서 다음 상담을 위해 \n실천 해 보려 합니다 \n\n\n',1843),(2108,'2019-03-18 00:00:00.000000',4.5,'감사합니다',1844),(2109,'2019-02-25 00:00:00.000000',4,'채팅으로 상담하니 이야기를\n곱씹으며 생각할수있어서 좋았어요 \n제 말에 공감해주고 맞춰주려 노력햐줘서 감사했습니다 \n',1845),(2110,'2019-05-07 00:00:00.000000',4.5,'잘 들어주시고 상황을 이해해주셔서 좋았어요 제가 말을 횡설수설하게한것같은데 거기서 연결점을 찾으셔서 해주신 얘기들도 좋았고 실질적인 해결책 및 위로를 건네주셔서 감사했습니다',1846),(2111,'2019-06-19 00:00:00.000000',5,'어떻게 보면 깊게 생각하지 않았던 상담인데 더 깊은 속마음을 들여다볼 수 있는 기회가 된 것 같아요! 질문 해주시는 것들이 너무 좋았어요. 마지막에 주신 매일 저녁마다 미션도 차곡차곡 노력해보겠습니다. 다만 50분이 생각보다 짧게 느껴지는 건 아쉬워요ㅠ.ㅠ',1847),(2112,'2019-02-21 00:00:00.000000',5,'친한사람에게도 털어놓을 수 없는 이야기들이 있었습니다. 오히려 나의 대해 잘 알지 못한 분에게 설명하듯 이야기 하다보니 스스로 더 자신에 대해 알수있는 시간이었고 제가 고민하던 많은 부분들이 그런 이야기를 털어놓음 으로 인해 위로 받을수있었습니다',1848),(2113,'2019-04-11 00:00:00.000000',5,'일단 저의 말을 끝까지 다 들어주시는 점이 제일 좋았어요\n제가 제 느낌과 생각 또는 일상에서 겪는 어려움을 얘기를 하면 선생님이 정리를 해주시거나 질문을 던져주실때가있어요\n그럴 때 참 좋았습니다. 앞으로 길게 같이 저를 찾아가는 상담을 하고싶어요 ',1742),(2114,'2019-02-22 00:00:00.000000',5,'제 이야기나 고민에 가볍게 접근 하지않고 충분히 생각하시고 이야기를 꺼내 주셨습니다 덕분에 마음을 열고 진솔한 이야기를 꺼낼수 있었어요 , 저스스로도 바라보지못하는 모습까지 따듯한 마음으로 바라봐주시고 공감해주셔서 상담내내 많은위안을 얻었습니다',1849),(2115,'2019-07-06 00:00:00.000000',5,'상담사님 마음이 따듯하신게 느껴졌습니다. 제가 왜 인간관계에 휘둘리고 힘들어 하는지 원인을 알게 되어서 좀 속시원 하기도 했고 응원해지 주시고 격려해 주셔서 감사했습니다.\n\n평소에 가성비를 많이 따지게 되는데 상담은 그럴 수 없는 거 같아요. 사람의 내면이라는게 복잡하고 어려워서 시간도 돈도 그만큼 많이 투자되는 거 같다는 생각이 문득 들더라구요. \n\n항상 여러 사람들의 말에 귀를 기울여 주시고 제 이야기도 듣고 공감해주신 상담사님께 감사드립니다.\n\n',1850),(2116,'2019-03-21 00:00:00.000000',5,'꼼꼼하게 들어주시고 차분하게 좋은 조언들을 이야기해주셔서 좋았습니다. 마음이 많이 힘들었는데 커다란 도움을 받았습니다.',1851),(2117,'2019-02-24 00:00:00.000000',4.5,'이야기를 해나가면서 내가 정말로 필요한것, 개선해나가야되는 것을 깨닫게 해주셨고 그것에 대한 구체적인 해결방안까지 제시해주시는게 많은 도움이 되었어요. 얘기에 공감해주시고 잘한 점은 칭찬해주시는게 편하게 털어놓을 수 있게 해주셨던 거 같아요! :)',1852),(2118,'2019-06-20 00:00:00.000000',5,'한 번 놓쳐기에 50분밖에 대화를 나누지 못해 아직은 잘 모르겠습니다. 그래도 더 이어서 상담받고 싶습니다. 감사합니다.',1853),(2119,'2019-05-09 00:00:00.000000',4.5,'상담을 진행하면서 내가 왜 우울하고 무기력한지 제가 몰랐던 원인을 조금이나마 깨닫게 된 시간이였습니다.\n제 이야기를 공감해주시는것을 넘어서 , 근본적인 이유를 알려주셔서 상담을 하면서 저에 대해 저 스스로 돌아보게 되었어요.\n앞으로 좀 더 상담을 진행하면서 , 이겨낼 수 있는 방법을 찾으면 좋을 것 같다고 생각했습니다.\n',1854),(2120,'2019-02-24 00:00:00.000000',5,'내 문제는 내가 제일 잘알고 있을텐데 풀리지않아서 너무 힘들었습니다상담사님과얘기해보니 잘못된 방법으로 내자신을 대하고있었다는걸 알게되었어요 비록 짧지만 어떤점이 힘든지 어떤게 문제였는지 정확히 짚어주셔서 방법이 생겨 기뻐요 따뜻하게 들어주셔서 감사해요',1785),(2121,'2019-04-14 00:00:00.000000',5,'일주일에 30분씩 전화 상담을 통해 상담을 진행했습니다. 편하게 제 이야기를 이야기할 수 있게 도와주셔서 감사합니다. 덕분에 많은 도움이 되어서 마지막 상담을 웃으면서 할 수 있었던 것 같습니다. ',1855),(2122,'2019-07-08 00:00:00.000000',5,'제가 처한 현실에서 근본적으로 회피하고 있는 것이 무언인지 깊게 이야기 나눠주셔서 감사했습니다.\n상대방과의 관계에 있어 \'나의 감정과 자존감\'을 지키는 대화방법에 대해서도 구체적인 조언을 해주셨습니다.\n불면증에 시달렸었는데 오늘 받은 위로로 깊은 잠을 잘 수 있을 것 같아요. 감사합니다.',1856),(2123,'2019-02-25 00:00:00.000000',4,'제 이야기를 듣고 공감을 해주시는 게 좋았어요. 제가 무엇 때문에 힘들었는지 이해해주시고 조심스럽게 대안책을 건네셨어요. 대화를 유도하는 게 저를 편안하게 해 주었어요.',1785),(2124,'2019-05-31 00:00:00.000000',4,'진심으로 들어주는 분께 가감없이 심리상태를 말할 수 있는 것 만으로도 충분한 위로가 되었습니다\n구체적인 방안들로 실수를 미연에 방지할수 있는 팁들을 알려주셨고 2차적인 우울이 오지 않도록 하는 현명한 처방이었다고 생각합니다. 늘 진정성있는 상담 감사했습니다 ',1672),(2125,'2019-04-14 00:00:00.000000',4,'이야기를 다 들어주시고 정리를 해주시는 부분이 좋았습니다. 해결책도 주셔서 좋았어요',1857),(2126,'2019-03-23 00:00:00.000000',3.5,'문제의 근원지가 어딘지 또 그에 대한 얘기도 들어주셔서 감사했어요\n',1858),(2127,'2019-03-24 00:00:00.000000',4,'이야기를 많이 들어주고 상처로부터 객관화하고 나아갈 수 있도록 도와주는 부분이 좋았습니다.',1859),(2128,'2019-02-27 00:00:00.000000',3.5,'50분이라는 시간이 짧아서 아쉬웠지만\n\n\n실천할 수 있는 실질적인 조언을 주셔서 좋았어요.\n',1860),(2129,'2019-06-02 00:00:00.000000',5,'항상 남탓하기 바빴고\n내가 왜 화가 났는지, 기분이 안좋은지 이유를 찾지 못한채\n몇일동안 잠도 제대로 못자고 답답한 마음만 가지고\n상담사분을 찾게 되었어요!\n일단은 모바일 상이지만 편안하게 \n내 마음을 표현 할 수 있는 장소가 되어서 너무 좋았어요,\n그리고는 감정 표현에도 연습이 필요하다는 것을 알았구요\n2회기는 뭔가 답을 얻기는 힘든 시간이라고 생각했는데\n그 와중에도 세세하게 짚어주셔서 좋았어요!',1861),(2130,'2019-03-25 00:00:00.000000',5,'자존감이 굉장히 낮은편이라 힘들었는데 저보다도 더 제자신을 아껴주신다는 느낌이 들었습니다. 말한마디 한마디가 다 저를 위한 말이었고 제말도 충분히 들어주셨고 공감해주셔서 울컥했네요. 타인보다 저와 제마음이 가장중요하다는것을 말씀해주셔서 감사합니다. \n',1862),(2131,'2019-02-28 00:00:00.000000',5,'솔직히 큰 기대는 안 했는데... 얘기도 잘 들어주시고 제가 생각지 못했던 해결책도 제시해주셨어요. 아무한테도 하지 못하던 얘기를 털어놨더니 별 것도 아닌데 눈물이 나더라구요. 그리고 이제는 마음이 많이 편해진 것 같아요. ',1863),(2132,'2019-03-01 00:00:00.000000',5,'제가 하고싶은 얘기를 다 할수 있게 질문을 너무 잘 해주셨습니다.\n제가 왜 힘들어 하는지 원인을 파악해주시고 해결하는 힌트도 제공해주셨어요. \n상담하면서 느낀건 나만 힘든게 아니였다라는 겁니다. 나의 고민이 내가 못나서가 아니라 원래 어려운 문제이기 때문에 고민이였구나 를 느끼게 되었습니다.',1864),(2133,'2019-07-10 00:00:00.000000',5,'길이 없이 막막하다고 느껴질때 상담을 시작하게 되면서  내 감정들을 객관적으로 보게되고 스스로 위로할 수 있는 방법을 잘 알려주셨어요. 저의 상담 내용에 공감해주시면서 제가 모르던 저의 감정들까지 정리해주시고 위로 해주셨어요.. 정말 많은 힘이 되었어요.. 다시한번 정말 감사드립니다!',1865),(2134,'2019-03-02 00:00:00.000000',5,'답답하고 막연했던 마음이 조금 편해졌습니다 감사합니다\n',1866),(2135,'2019-06-24 00:00:00.000000',4,'누군가에게 내 이야기를 털어 놓는 것만으로도 상당히 스스로 정리가 되었고 대화함으로써 우울함의 근본 원인을 알 수 있었습니다. 그리고 생각지 못한 해결방법들을 알려주셔서 굉장히 도움이 많이 됐습니다. 두 번의 상담은 짧은 것 같지만 우선 제 스스로 알려주신 방법대로 해보고 또 고민이 생기면 상담 받고 싶습니다.',1867),(2136,'2019-03-02 00:00:00.000000',5,'제 고민을 잘 들어주셔서 좋았습니다. 공감을 잘해주셨고 방향 또한 좋게 이끌어주셨습니다. 감사합니다',1868),(2137,'2019-05-15 00:00:00.000000',5,'내면의 고민이 있는걸 알고는 있었지만 어떻게 생각정리 할지, 무엇이 문제인지 잘 몰라서 항상 고민을 반복 했었는데, 상담사님께서 편안하게 제 말들어주시면서 제가 미처생각하지 못한 부분, 어떻게보면 가장 핵심적인 부분을 말씀해주신거 같아요 제 단점에만 치우쳐져 있었는데 제 자신을 다시 생각할수 있는 기회가 된거 같아요 상담사님께 감사말씀드리고 싶네요',1869),(2138,'2019-03-03 00:00:00.000000',3,'첫 상담이라 긴장도 많이 되고 질문 받은 후에 생각이 많아서 대답하는데 시간이 오래 걸렸는데 차분히 기다려주시고  제 생각의 방향도 잡아주셨어요. 오랜 마음의 병이라 한 번의 상담으로 완벽하게 해결되지 않았지만 상담 감사합니다.',1870),(2139,'2019-06-25 00:00:00.000000',4,'하나하나 차근차근 방향을 잡아가는 게 좋았습니다.\n새로운 모습을 알게됐고, 부모님과 대화를 이에 관해서 했는데 과거에 대해서도 알게됐네요\n감사합니다',1871),(2140,'2019-06-24 00:00:00.000000',5,'확실히 전문가는 다르다는 생각이 들었습니다 제 글을 끝까지 읽어주셔서 감사드립니다',1872),(2141,'2019-03-03 00:00:00.000000',5,'정말 감사드려요........ 진심으로 감사드립니다...',1725),(2142,'2019-03-03 00:00:00.000000',4.5,'그냥 제 삶이 너무 의미없고 부담되고 미래가 없었는데 상담사님께서 진지하게 이야기도 들어주시고 힘이 되주셧어요... 처음엔 이거한다고 뭐가달라질까 하는 생각에 결제하고 앱을 삭제할까 생각도했는데 확실히 진심으로 해주시는 상담이여서 그런지 마음이 좋네요',1873),(2143,'2019-03-28 00:00:00.000000',4.5,'감사드립다 ㅎㅎ\n',1874),(2144,'2019-06-25 00:00:00.000000',5,'저도 잘 몰랐던 제 마음이 어떤 이유 때문인지 알 수 있도록 해주셨어요. 아주아주 잠깐의 상담이었지만, 꽤 오랫동안의 고민의 원인을 알게 되므로써, 제가 할 수 있는 연습에 다해도 말씀 주셔서 좋았습니다.',1875),(2145,'2019-03-28 00:00:00.000000',4.5,'너무 힘들때 상담신청하고\n반신반의 했지만 뭐라도 해보자는 마음으로 \n상담하게 되었어요\n두서 없는 제 글에도 잘 들어주시고 \n해주시는 질문들 통해서 생각도 많이 하게되었고\n저에 대해 집중하는 시간이되었어요\n제 스스로 의지를 갖게끔 도와주셔서\n감사했어요 ',1876),(2146,'2019-04-20 00:00:00.000000',5,'혼자서 돌아보고 생각 할 시간이 많이 주어졌던거 같아요. 상담을 통해서 앞으로 어떻게 나아가야 할지 배우는 귀한 시간이었습니다! \n',1731),(2147,'2019-03-30 00:00:00.000000',4.5,'제 자신을 돌아보는 시간을 만들어주셔서 좋았어요\n',1782),(2148,'2019-05-19 00:00:00.000000',4.5,'30분 통화를 하며 좋았던거같습니다.\n처음에는 막긴장되며 떨리면서 전화를 했는데 점점 하다보니 편해지고 괜찮았습니다 제가 속마음을 잘이야기를 못하고 있었는데 오늘 상담 선생님께 다이야기하고나니 저는 좋았습니다! \n감사합니다! ',1877),(2149,'2019-03-06 00:00:00.000000',4.5,'내가 생각해보지 않았던 방향으로 생각할 수 있도록 해주셔서 좋았습니다. 생각의 흐름을 바꿔서 부정적인 감정으로 부터 벗어날 수 있도록 도와주셨어요. 그리고 지금도 충분히 잘 하고 있다는 격려가 힘이 되었습니다\n',1878),(2150,'2019-05-19 00:00:00.000000',5,'한번도 생각해보지 못한 부분을 콕 찝어 말씀해주시고 위로해주셔서 너무 큰 도움이 되었습니다.\n\n누군가의 이야기를 들어준다는건 살다보니 쉬우면서도 참 어려운 일이더라구요. 상담사님도 늘 행복하셨으면 좋겠습니다 :)\n\n',1879),(2151,'2019-06-07 00:00:00.000000',4.5,'받아들이기 편한 방법을 알려주시고 고민을 들어주셔서 좋습니다\n',1880),(2152,'2019-04-21 00:00:00.000000',4.5,'해결책을 제시해주실때 제가 할수 있는 만큼 정도 부담없이 해결책을 제시해주셨어요.\n그리고 변화가 있었을 때 같이 좋아해주셔서 용기가 생겼던것 같습니다^^',1881),(2153,'2019-06-26 00:00:00.000000',5,'공감해주셔서 감사합니다.\n제가 원했던 답변을 찾은 것 같아서 좋았습니다.\n앞으로 또 힘들어지면 연락 드리겠습니다! 감사합니다.',1856),(2154,'2019-02-11 00:00:00.000000',5,'꺼내기 힘든 이야기도 잘 꺼낼수 있도록 이끌어 주시고 저의 이야기를 잘 들어주셔서 너무 감사했습니다. 스스로의 깊은 감정 속까지 들여다 볼 수 있었던 좋은 기회였습니다.',1882),(2155,'2019-04-23 00:00:00.000000',5,'너무 만족도가 높았던 상담이었습니다.\n상담사님은 정말 따뜻하고 친절하셨고, 제가 논리적으로 말하지 않아도 제 말을 너무 잘 이해해주셨어요. 저의 말에 대한 공감도 잘 해주셨지만 무엇보다 저의 문제를 어떻게 풀어나가면 좋을지 방향을 잘 잡아주셨어요. 상담 동안 제 감정을 끌어내주시는 것, 터진 감정을 다독여주시는 것들도 도움이 많이 되었습니다. 상담 마지막에는 한 주 동안 생각해 볼 수 있는 것들을 제시해 주셔서 상담 매 회 느낀 점들이 정말 많았습니다. 상담사님께 정말 감사드립니다 :) ',1883),(2156,'2019-04-24 00:00:00.000000',5,'어릴적 잊고 있던 상처를 알게됐어요\n속이 진짜 후련합니다\n이제라도 제자신의 소리에 귀기울여 보려 합니다\n정말 감사합니다\n',1884),(2157,'2019-06-28 00:00:00.000000',5,'이전 다른 상담사분과 상담진행중 상담사분이 중간에 상담을 포기해서 그게 또 마음에 걸렸고 상처였지만, 이번 노은혜 상담사님은 그런 부분까지 다 포용해주셨고, 한주한주 과제와 제가 가야될 방향, 작은 것 하나하나 세심하게 응원해주시고 칭찬해주시고, 제가 몰랐던 제 감정들을 돌아보고, 그것마저 지지해주셨고 세심한 부분까지 신경써주셔서 너무 고맙고, 행복했던 시간들었습니다. 아직은 가야할 길이 멀지만 천천히 상담 받으며 지난 날의 아픔 상처들을 승화 시켜 보려고 합니다. 너무 감사합니다^^\n',1783),(2158,'2019-03-09 00:00:00.000000',3,'스스로 생각해보는 시간을 갖게됐어요 \n',1688),(2159,'2019-06-28 00:00:00.000000',4.5,'자기 자신에 대해서 생각할 수 있었습니다\n',1885),(2160,'2019-03-10 00:00:00.000000',5,'두 번의 상담을 하며... 생각지도 못한 부분에서 눈물이 핑 돌면서 저 자신을 이해하는 경험들을 했습니다. 내가 완벽하지 않다는 것, 나를 믿어줘야 한다는 것들을 잊고 있었어요.. 정말 감사합니다 노은혜 상담사님!!\n',1886),(2161,'2019-06-29 00:00:00.000000',5,'마음을 털어놓을 수 있어 좋았어요',1887),(2162,'2019-03-10 00:00:00.000000',5,'말하기 힘든 일들을 선생님께서 진심으로 들어주시는 것만으로도 너무 마음이 가벼워지는거 같습니다. 그리고 깊이 공감해주시고 따뜻하게 말씀해주셔서 위로가 많이 되었습니다. 덕분에 더 좋은 방향으로 생각하고 방법을 찾은것만 같습니다..너무 감사해요. \n',1888),(2163,'2019-04-25 00:00:00.000000',5,'제가 고민하고 있던 부분들을 명확하게 분석해주시고 해결할 방향도 차분하게 설명해주셔서 너무 감사했어요 ㅠㅠ 이래저래 방황했던 제 마음이 차분해짐을 느꼈습니다 왜 후기가 많고 많은 분들이 도움을 받았다고 했는지 알 것 같아요 그리고 내담다에게 진심으로 다가가는 모습을 비록 텍스트이지만 알수 있어서 진정성이 느껴지는 상담이었습니다. 다시 한 번 감사드려요 \n',1889),(2164,'2020-06-23 00:00:00.000000',5,'gooooooooooood',1890),(2165,'2020-06-20 00:00:00.000000',5,'제 우울함이 어디서 오는지, 어디서 부터 시작된건지 차근차근 알아가는게 좋았어요. 타인과 비교해서 만든 본인의 틀림이 아닌, 그저 다름에서 오는 특이점으로 잡아주시고, 잘 해쳐나갈 수 있는 방향을 지시해주셨어요.',1891),(2166,'2020-06-20 00:00:00.000000',5,'감사합니다',1892),(2167,'2020-06-19 00:00:00.000000',5,'여러 회차를 거치며 조금씩 객관적으로 상황과 자신을 바라볼 수 있게 되었어요.\n막연한 위로보다는  차근차근 자신을 바라볼 수 있는 진정한 상담이라고 생각해요.\n김수한 선생님과 꼭 이야기 나누어 보세요. \n',1893),(2168,'2020-06-18 00:00:00.000000',5,'상담을 받기 전 한참을 고민하다 했었는데 하길 잘했다는 생각이 들어요! 매주 고민을 나눌 수 있는 상담사분이 계시다는 것 자체로도 도움이 되었고, 제가 어떤 성향을 갖고 있는지 어떤 것 때문에 힘이 들었던 건지 차근차근 설명해주셔서 너무 좋았어요 이제 상담사님이 말씀해주신 것들 참고하면서 변화하는 건 제 몫이지만 상담 덕분에 변화할 수 있다는 희망도 갖게 된 것 같아 만족스러웠어요!',1894),(2169,'2020-06-17 00:00:00.000000',5,'상담인생 어연 4년차...가장 가치있는 1시간이었습니담\n물론 첫느낌이고 계속 상담을 하며 어떤식로 전개될지 모르지만, 짧은 시간안에 이렇게 나를 정확히 파악해주신 상담사분은 처음이라...실력보장⭐️이런 느낌이었어요. 그리고  나도 몰랐던 나를 알아주는 분이 있다는 것만으로도 나아질 수 있다는 희망이 생겨요.\n\n망설일것도 없지만 망설이고 있다면\n당신...! 여기까지 왔는데 아무것도 하지 않는다면 또다시 아무것도 변하지 않을거에요. 스스로를 위해 투자하는 9만원, 저는 아깝지 않았어요.(물론 비싸지만...!)\n\n선택은 당신의 몫⭐️\n(새벽에 자비결제+실시간 상담받고 남기는 찐 후기)\n\n다들 행복하세염',1895),(2170,'2020-06-16 00:00:00.000000',5,'큰 도움이 되었습니다. 선생님 감사드려요.',1896),(2171,'2020-06-15 00:00:00.000000',5,'감사합니다',1892),(2172,'2020-06-15 00:00:00.000000',5,'시험에 대한 불안이 시작되면 한 글자도 읽지 못할 정도로 증상이 심해져서 불안증세를 완화시킬 수 있을까 해 상담을 하게 되었습니다. \n불안이 남들보다 심하다는 저의 말을 들으시고는 5-10분사이에 가족과의 관계에 문제가 있어서 시작된 불안이라는 걸 찾아내 주셨습니다. \n처음에 할 말이 없으면 어떻게 하지 걱정을 했는데 질문을 계속해서 던져주셔서 흐름이 끊기는 일도 없었습니다. 상담 분위기 자체가 너무나 편안한 분위기라 처음 받는 상담이었는데 정말 만족도가 높았습니다. \n단순히 동감만 해주시는 게 아니고 이럴 땐 어떻게 해야하는지 현실적인 방법을 알려주셔서 도움이 많이 됐습니다.\n일단 2회에 걸쳐 알려주신 방법대로 해보고 중간에 시행착오를 겪게 되면 다시 재상담을 신청하고 싶네요! \n그리고 상담을 받고 며칠 후에 한 번 더 받았는데 중간에 혼자 생각을 정리할 시간을 충분히 가져서 두번 째 상담이 더 도움되었습니다:) ',1897),(2173,'2020-06-14 00:00:00.000000',5,'감사합니다!',1892),(2174,'2020-06-14 00:00:00.000000',5,'감사합니다 ',1892),(2175,'2020-06-13 00:00:00.000000',5,'나 자신을 받아들이는게 가장 컸어요.\n나도 모르는 내자신을 발견했고 받아들이고 이해하기 시작했어요.',1898),(2176,'2020-06-12 00:00:00.000000',5,'너무 편안하고 진짜.. 친누나가 있으면 이런느낌일까 하는 느낌이였습니다..',1899),(2177,'2020-06-12 00:00:00.000000',5,'저또한 설마? 하는 마음으로 상담했는데 정확히 문제를 알고 대화해주시는거에 엄청 놀라웠습니다. 저는 항상 이곳에 있으니 또 찾아와도 된다는 마지막 말이 정말 큰 힘이 됬습니다.\n\n',1900),(2178,'2020-06-12 00:00:00.000000',4,'상담 처음 받아봤는데 좋았어요 ',1901),(2179,'2020-06-11 00:00:00.000000',5,'단순히 공황장애가 심하게와서 한번 상담이나 해볼까라는 마음에 시작했습니다.그런데 진짜 선생님께서 지금까지 살아온 제 인생 구석구석 하나하나 다 들어주시며 어느부분에서 상처가 되었고 공황이 오게되었는지도 알려주셨고, 앞으로의 인생또한 어떤 마음으로 살아가고 어떤 생각으로 살아가야하는지 알게해주셔서 너무 감사했어요 ^^ 혹시나 또 살아가다 고민이나 걱정이 생기면 또 상담하고싶습니다. 감사했습니다.',1902),(2180,'2020-06-11 00:00:00.000000',5,'저를 알아가는데 많은 도움이 되었습니다. 감사합니다. 힘드신분들 꼭 받아보시길 바랍니다.',1903),(2181,'2020-06-11 00:00:00.000000',5,'저도 몰랐던 제 마음을 알아주시고 공감해주셔서 감사했어요\n가끔 던지시는 새로운 사고방식과 관점이 저에게 많은 도움이 됐습니다\n무엇보다 이런 거 저런 거 따질 것 없이 편하게 대화할 수 있어서 정말 마음이 좋았습니다\n조언해주셨던 몇가지 잘 지키면서 잘 해보다가 또 힘들어지거나 뭔가 잘못된 방향으로 가는 게 아닌가 불안할 때 다시 찾아뵐게요\n감사했습니다',1904),(2182,'2020-06-09 00:00:00.000000',5,'핵심을 짚어주시는\n 상담 만족스러워요!',1905),(2183,'2020-06-09 00:00:00.000000',5,'많이 생각하게 됐고 저와 제 주변 사람들에 대해서도 알게되어서 좋았습니다!',1906),(2184,'2020-06-09 00:00:00.000000',5,'감사합니다',1892),(2185,'2020-06-07 00:00:00.000000',5,'정확하신 부분들을 집어주실 때 놀랐습니다. 감사합니다 선생님\n',1907),(2186,'2020-06-07 00:00:00.000000',4,'이야기를 차분한 목소리로 잘 들어주셔서 감사했습니다. 상담 받던 기간 동안 저에 대해 많은 생각을 해 볼 수 있는 기회였던 것 같습니다. 아직 극복하고 스스로 정리해야할 점들이 많지만 힘들고 외로운 때 옆에서 누군가 이야기를 들어주는 것만으로도 큰 위안이 된다는 것을 느꼈던 기간이었던 것 같습니다. :)\n',1908),(2187,'2020-06-07 00:00:00.000000',5,'늘 좋습니다',1909),(2188,'2020-06-07 00:00:00.000000',5,'좋앗어요ㅛㅛㅛㅛㅛㅗㅛㅛㅛㅛㅛㅛㅛㅛㅛ',1910),(2189,'2020-06-06 00:00:00.000000',5,'짧은 상담이었지만 핵심적인 부분을 말씀해주셔서 앞으로 저 자신에 대해 생각할 거리들을 던져주신 것 같아 좋았습니다. 따뜻한 공감의 말씀 감사드립니다. ',1911),(2190,'2020-06-05 00:00:00.000000',5,'퇴사할때까지만 해도 몰랐는데 퇴사 후에 제가 그동안 믿어왔던 모든 것들, 그리고 제 자신이 누구인가에 대해서도 전부 무너져내리는 것만 같은 절망감에 휩싸여서 다시 선생님을 찾게 되었어요. 결론적으로 한 달 내내 저는 또 어디든 지원서 작성도 못하고 이것저것 찾아보기만 하고 고민만 해서 선생님께 민폐를 끼치는 게 아닌가 하는 걱정이 많이 들었는데...그래도 두려움을 무릅쓰고 매번 시간에 맞춰 상담을 진행하길 잘 한 것 같아요. 마지막 회기까지 마치고 이제 어느 정도 방향성을 정한 것 같거든요. 핵심은 남이 나를 어떻게 볼 것인가에 집착하는 게 아니라 내 약점들을 수용하고 그럼 여기서 어디서부터 시작을 해야 할지 찾아나가는 거였어요. 저는 약점도 많고 너무 겁도 많고 나약해서 그 시작점이 굉장히 미미하지만...특히나 남들이 보기에 쟤는 진짜 패배자다 싶을 수도 있는 정말 초라한 시작이지만 제 나름대로 큰 그림을 그리고 여기서부터 시작한다 생각하니까 조금은 마음이 나아졌어요. 비록 남들이 무시한다 해도 오히려 제가 그 사람들을 비웃어줄 수도 있지 않을까 하는 생각이 들기도 해요. 정말 답답한 상황이었을텐데도 화 내지 않고 이야기 들어주시고 차분하게 제가 시작해야할 지점들 제가 앞으로 어떻게 한 발자국이라도 나갈 수 있을지 알려주셔서 감사했습니다. 다시 또 길을 잃게 되거나 도움이 필요할 때 찾아뵙겠습니다!\n',1912),(2191,'2020-06-05 00:00:00.000000',5,'많은 위로가 되었습니다 \n\n\n\n',1913),(2192,'2020-06-04 00:00:00.000000',5,'불안증이 보이기 시작할 때쯤 아무것도 들리지 않고, 눈에 들어오지 않던 시기에 세 분의 상담사를 거쳐 만나게 된 분이세요. 소개에 써있는 것처럼 \"마법같은 상담\" 이라는 말이 정말이네요! 당시 저는 위로와 공감, 상처받지 않는 현실적인 조언이 필요했는데 필요했던 3가지를 다 충족시켜 주셨어요. 총 8회 상담했는데 나를 점점 알아가는거 시원하고 흥미있는 일이네요^^ 모두 느껴보셨으면 좋겠어요!\n\n',1914),(2193,'2020-06-04 00:00:00.000000',5,'감사합니다 ',1915),(2194,'2020-06-03 00:00:00.000000',5,'감사합니다',1916),(2195,'2020-06-03 00:00:00.000000',5,'감사합니다',1917),(2196,'2020-05-30 00:00:00.000000',5,'아직 갈길이멀고 힘든데 전 아직 노력해야해요.\n변화를 원하시는분에게 추천드립니다.',1918),(2197,'2020-05-30 00:00:00.000000',5,'친구같이 편안함을 느끼게 해주셔서 말하는게 더 수월하게 편했어요 감사합니다~~~~',1919),(2198,'2020-05-30 00:00:00.000000',5,'감정에 치우쳐서 보지 못했던 스스로의 마음을 들여다볼 수 있었어요.',1920),(2199,'2020-05-29 00:00:00.000000',5,'처음에는 평소 친구들과 고민상담할때와는 다른 방향으로 진행되는 것 같아서 이게 맞나 싶었는데 점차 진행될수록 저에게 정말 필요한 답을 찾아주셨다는 생각이 들었어요. 문제의 현상적인 해결에 그치는게 아닌 본질적인 해결안까지 제시해주셔서 좋았습니다.',1921),(2200,'2020-05-27 00:00:00.000000',5,'너무 좋네요\n',1922),(2201,'2020-05-24 00:00:00.000000',5,'좋았습니다 속에묻은 이아기를 주고받으며 절 알게해주시고\n❤',1923),(2202,'2020-05-24 00:00:00.000000',5,'하루 하루 상담을 해나가면서 제가 제 자신을 많이 지지해주고 있다는 느낌을 받았어요. 선생님의 목소리가 제 안에 들어와 어느샌가 내재화된것 같습니다. 앞으로 상담의 힘을 얻기보다 제 안의 힘을 키워나가는 과정의 상담을 받고 싶습니다.',1924),(2203,'2020-05-24 00:00:00.000000',5,'처음 상담 받을 때보다 더 방향이 잡힌 것 같아요.  감사합니다! ',1920),(2204,'2020-05-23 00:00:00.000000',5,'상담을 받기 시작하면서 그다음번 상담이 궁금해지고 기대되고 시간을 체크하게되면서 변화가 시작된것 같아요!총4회 상담이 끝났지만 이젠 내가 변할수 있고 이렇게 변하면 되겠구나 하는 희망과 미래가 다시금 그려져서 힘이나고 이걸 신청한 제스스로에게 너무 대견스럽고 상담사 선생님을 만난건 제인생에 변화를준 기회였던것 같습니다. 감사합니다. ',1925),(2205,'2020-05-23 00:00:00.000000',5,'상담사님 통해서 제 마음에 어떤 문제가 원인이 되어서\n불안한지 알 수 있었어요!! 진짜 너무 감사합니다 ㅜㅜ',1926),(2206,'2020-05-23 00:00:00.000000',5,'현재 저의 문제에 집중하게 해주셔서 상담사님께 감사드려요. 상담사님께서 핵심을 정확하게 지적해주셔서 큰 도움이 되었습니다. 남은 건 저의 행동 변화에 달려있으니 잘 해보려구요! 감사합니다! ',1927),(2207,'2020-05-23 00:00:00.000000',5,'상담이 처음이었는데, 좋았어요. 상담 과정은, 답답했던 게 왜 답답했는지 그 실마리를 조금씩 조금씩 찾아나가는 과정이었던 것 같아요. \n\n특히 가까이 있는 사람에게 말하기 어려운 것들이 몇가지 있는데, 그 부분들에 대해서 상담사님과 이야기를 편하게 할 수 있어서  좋았습니다. 처음에는 당장 힘든 표면적인 문제 때문에 상담을 신청했는데요, 그 문제를 이야기하다보니 이를 통해서 근본적으로 나에 대한 사람, 나의 자세에 대해서 생각해 보는 기회가  되었어요. \n\n중간중간 표면 상의 문제를 이야기하다가, 상담사님께서 더 깊은 근본적인 문제를 짚어서 물음을 던지고, 그것에 대해  생각해 볼 수 있게 해 주셨는데 그런 부분들이 제게 도움이 많이 되었던 것 같아요. 그리고 텍스트를 통해서 하다보니, 상담이 끝나고 나서 아 내가 여기에 대해서 이렇게 말했구나. 이렇게 내가 말을 하는 구나.. 하는 게 보다 객관적으로 보여서 좋더라구요. \n\n이렇게 생각할 수 있는 기회를 만들어 주셔서 감사합니다! \n다음에 답답한 일이 또 생기면 다시 상담 신청할게요~ ',1928),(2208,'2020-05-22 00:00:00.000000',5,'매우만족 \n\n',1922),(2209,'2020-05-21 00:00:00.000000',5,'정말 마음이 많이 힘들때 많은 위로가 되어요.\n제가 엄마에게 느꼈던 갈증을 콕집어 찾아내주셔 \n처음에 많이 놀라기도 했어요...\n깊은 감사를 드립니다..',1929),(2210,'2020-05-19 00:00:00.000000',5,'두 시간 연이어 끝까지 동감해주시고 들어주셔서 좋았어요ㅜ 다시 또 상담받으러 올게요\n',1930),(2211,'2020-05-19 00:00:00.000000',5,'차분히 다 들어주시고 동감해주셨어요\n',1930),(2212,'2020-05-18 00:00:00.000000',5,'친절하게 이야기 들어주고 소통해주셔서 너무 좋았습니다 :)',1931),(2213,'2020-05-17 00:00:00.000000',5,'우울해요 ㅠㅠㅠㅠㅠㅠ',1892),(2214,'2020-05-17 00:00:00.000000',5,'힘든 새벽에 한줄기의 빛 같은 상담이였습니다.\n너무 도움이 많이됐고 해결책을 제시해주서서 감사했습니다.\n앞으로 정기권을 끊을 의향도 생기네요\n여러가지 환경들을 다 꼼꼼히 챙겨서 파악해주셔서\n너무 시원한 상담이였습니다',1932),(2215,'2020-05-16 00:00:00.000000',5,'제 고민에 대해 제가 어떤 성향이라서 이렇게 느끼고 있는건지 무엇을 생각해봐야 할지 길을 잡아주신것 같아요. 상담했던 내용을 토대로 저자신에 대해 생각해 보는 시간을 가져야 할 것 같습니다.\n차분히 얘기 들어주셔서 감사해요.',1933),(2216,'2020-05-16 00:00:00.000000',5,'비교적 단기간이지만 부드럽게 해법을 말씀해주신 것 같아서 좋습니다',1934),(2217,'2020-05-14 00:00:00.000000',5,'만족했어요!\n\n',1935),(2218,'2020-05-14 00:00:00.000000',5,'감사합니다 ',1892),(2219,'2020-05-13 00:00:00.000000',5,'감사합니다 ',1892),(2220,'2020-05-13 00:00:00.000000',5,'감사합니다',1936),(2221,'2020-05-13 00:00:00.000000',5,'제가 횡설수설 말해도 찰떡같이 알아들어주셔서 좋았어요. 대화를 잘 이끌어 주시고, 제 안에 있던 감정을 알게 돼서 신기했어요. 1회기만 신청한게 너무 아쉽네요ㅠㅠ 늦게까지 상담해주셔서 정말 감사합니다!',1937),(2222,'2020-05-12 00:00:00.000000',5,'상담을 시작하기까지 정말 여러번 망설였는데 지속적으로 하는게 좋겠다는 확신이 생겼어요. 감사합니다 :)',1938),(2223,'2020-05-12 00:00:00.000000',5,'\n융통성도 있으셔서 상담을하면서 배려하시는 부분들에 숨고르기가 가능했어요!\n\n전문지식을 보유하고계시고 상담자가 보지못한 포인트를 인지할수있게 지도해주십니다.',1910),(2224,'2020-05-12 00:00:00.000000',5,'전에 2회권으로 상담 받았었는데 다시 2회권으로 찾아뵙게 됐어요! 제 고민에 대해 현실적인 방향으로 이끌어 주셔서 도움이 많이 되었습니다. 인간관계나 상황에 분명 문제가 있는데, 저 자신도 문제를 모르니 악순환의 반복이었는데.. 상담사님께서 객관적으로 말씀해주시고 방법도 친절히 알려주셔서 좋았습니다. 어떻게 대화를 해야하는지, 나의 특성은 뭔지 등등.. 말씀을 들으니 생각하는 관점이 달라진 것 같아요. 저를 응원해주는 분이 생겨서 든든합니다. 그동안 정말 감사했습니다!',1939),(2225,'2020-05-11 00:00:00.000000',5,'솔직하고 다정하다. 답변내용이 피상적이지도 않다. 이전 상담내용을 기억하고 점점 나아지고 있는지 아닌지를 알아채준다. 도움이 많이 되었음. ',1940),(2226,'2020-05-11 00:00:00.000000',5,'늘 감사합니다 새로운 방안을 찾을 수 있도록 도와주시고 \n고민있을때 다시 찾아올께요\n',1941),(2227,'2020-05-08 00:00:00.000000',5,'상담받고 감정이 힘들어졌어요\n근데 나에게 나쁜게 아닌것같아요\n아마 많이 쌓여있던거라 어쩔 수 없는것같아요\n방향성을 잡아주신 점이 좋았어요\n목표가 생긴것같아서\n나아질수있다고 말씀해주셔서  \n확신이 없던 저한테 의지가 됐어요\n제가 원하는 방향으로 얘기가 진행되고\n앞으로 어떤부분에서 더 상담을 하자고 얘기해주셔\n믿고 나아갈 수 있을것같습니다\n엄청 격하게 위로나 공감만 해주시는게 아니라서\n오히려 더 좋았어요\n질문 많이 해주셨는데 저에 대해 알아가시는 과정같아서 단순 1회성에 끝맺음 하려 하지 않으신것도 좋은것같아요\n신기했던건 기억력이 좋고 대충 다 알고 있다, 기억하고있다 생각했는데 선생님이 질문하신거 대부분에 모르겠어요라고 대답한 제가 의외였어요\n다음 상담도 잘 부탁드립니다',1942),(2228,'2020-05-08 00:00:00.000000',5,'감사합니다',1943),(2229,'2020-05-07 00:00:00.000000',5,'요즘 많이 힘들어서 어플통해서 이런 곳이 있다는 것을 알게 되었습니다.\n오프라인보다 온라인 상담이 좋았던 점이 내가 하지 못했던 말까지 할 수 있어서 좋았습니다.\n처음으로 받아보는 상담이라서 ㅠ 속에 암덩어리처럼 쌓인 이야기를 하다보니 현재 힘들었던 심정이 좀 나아졌습니다. \n늦은 시간에 상담하였지만 그래도 이해해주시고 제 이야기를 끝까지 잘 들어주셔서 감사합니다. 앞으로도 자주 찾아뵙겠습니다.',1944),(2230,'2020-05-07 00:00:00.000000',5,'감사합니다',1943),(2231,'2020-05-06 00:00:00.000000',5,'어디에 말할 곳 없어 혼자 힘들어하다가 전문가님께 상담을 받고나니 진짜 이유를 알게 된 것 같아서 너무 좋아요.',1945),(2232,'2020-05-06 00:00:00.000000',5,'차분히 얘기나눌 수 있어서 좋았고, 제 감정을 들여다볼 수 있어서 좋았던 것 같아요~',1946),(2233,'2020-05-05 00:00:00.000000',5,'사실 심리상담이 처음이라 과연 이게 도움이 될까 반신반의했는데 받을수록 조금씩 제 자신이 바뀌는거같습니다. 상담잘해주셔서 정말감사합니다 \n\n제가 왜그렇게 생각하고 행동하는지 잘 짚어주시고 솔루션도 명쾌히 주시구요 다시한번 감사합니다..',1947),(2234,'2020-05-05 00:00:00.000000',4,'짧은 시간이었지만 감사했습니다',1948),(2235,'2020-05-05 00:00:00.000000',5,'잘 받았아요',1949),(2236,'2020-05-04 00:00:00.000000',5,'감사합니다',1943),(2237,'2020-05-03 00:00:00.000000',5,'감사합니다 ',1943),(2238,'2020-05-02 00:00:00.000000',5,'좋았습니다^^',1950),(2239,'2020-05-01 00:00:00.000000',5,'늦은 시간 그리고 짧은 시간에 불구 정확한 상태 파악을 해 주셔서 감사합니다. 대안을 찾기가 쉽지 않겠지만 극복에의 노력은 필요한 상황같습니다. 어떻게 하면 가능할 지 그 방법론에 대해 다시 논의할 시간을 상담사님과 갖고 싶습니다. 감사드립니다.\n',1951),(2240,'2020-04-28 00:00:00.000000',5,'처음이라 떨렸는데 따뜻하게 다가와주셔서 고마웠습니다. 저는 횡설수설하는 느낌이 있는데, 상담사님께서 잘잡아주시고 잘들어주시니 맘이 편해집니다. 시작단계니 잘해나가고싶어요',1952),(2241,'2020-04-28 00:00:00.000000',5,'좋아요 마음이 한결 편안해졌어요',1953),(2242,'2020-04-27 00:00:00.000000',5,'아주 오랜 시간 동안 짊어지고 있었던 짐을 가장 오래된 기억부터 김수한 선생님과 함께 차근차근 되짚고 있습니다. \n쉽지 않은 일이네요. \n그렇지만 반드시 해야 하는 일이란 걸 상담이 끝날 때 느낄 수 있어요. 단순히 \'누군가에게 털어 놓아서 기분이 좋다\'는 차원을 넘어서, 쏟아낸 기억과 아픔이 있던 자리에 나다운 마음을 채워가는 상담 같아요. \n망설이시는 분들이 이 후기를 보신다면, 혼자 아프지 마시길 바라요. ',1893),(2243,'2020-04-27 00:00:00.000000',5,'공감을 많이 해주셔서 그리고 또 용기를 주셔서 감사합니다. 실질적인 해결책도 주시고 마음을 편안히 해주셔서 감사합니다. 많은 분들에게 도움이 되실 것 같습니다. 다음에 또 상담을 받고 싶은 분이라고 생각했