 마인드가 생겼어요. 감정을 쏟아부어 선생님께 죄송하면서도 도움 주셔서 정말 감사드립니다!',2057),(2406,'2019-03-23 00:00:00.000000',5,'말씀을 잘들어주시고, 내담자가 불안하지 않게 상담을 잘 유도해주신 것 같습니다. 다음에 다시 요청하겠습니다.^^',2058),(2407,'2019-07-08 00:00:00.000000',5,'말씀드릴 내용이 좀 많아서 상담을 완전히 마무리짓지는 못했어요.  조심스럽게 다가와주시는 것에 대해 감사함을 느끼고 있어서 상담사님과 조금 더 이야기를 나눠보고싶어요.',2047),(2408,'2019-05-12 00:00:00.000000',5,'상담사님이 커뮤니케이션도 좋으시고 제입장에서 잘 헤아려 주셨어요 감사합니다 ',2059),(2409,'2019-05-13 00:00:00.000000',5,'너무 좋았고 언니처럼 편안하게 상담해 주셔서 감사합니다^^',2060),(2410,'2019-06-02 00:00:00.000000',5,'걱정할까봐 또는 조언이랍시고 상처 되는 말을 반복적으로 듣다보니 어디에 말할 곳이 없었는데 굳이 시간,공간의 제약 없이 편하게 제 말을 들어주고 제 마음 속에 있던 깊은 고민을 알아채고 ‘아~그래서 그랬던거구나’ 제가 저를 좀 더 잘 알게된 계기도 됐어요 그리고 제가 받았던 상처에 대해서 잘 보듬어주시고 제가 말하기 망설일때도 무슨일이 있었든 제 편에서 들어주시겠다는 말씀에 많은 용기도 얻었고 제가 힘든일이 생겨도 든든한 지원군이 생긴거 같았어요 상담을 진행한게 정말 잘한일이 같아요 !\n\n',1957),(2411,'2019-05-14 00:00:00.000000',5,'힘드신 분들께 추천드립니다. 감사해요 선생님!',2061),(2412,'2019-05-15 00:00:00.000000',4,'상담을 받으면서 제가 모르겠다고 한 저지른 행동의 내면의 마음과 심경을 끄집어내주시고 제 입장에서 공감을 해주려고 해주셔서 감사합니다\n',2062),(2413,'2019-06-03 00:00:00.000000',5,'제가 계속 고쳐보려고 했는데 못고쳤던 부분을 고쳐주셨습니다',2063),(2414,'2019-03-04 00:00:00.000000',4.5,'차분하게 제 이야기에 대답해 주셔서 마음을 열고 대화할 수 있었어요. 꼭 문제 해결을 위한 것이라기 보다는 가능성을 이야기 해주신 것 같아요. 항상 힘들 때 저에게 문제가 있다고만 생각 했었거든요. 짧지만 생각을 전환할 수 있었습니다.',2064),(2415,'2019-04-20 00:00:00.000000',4,'현실적 조언과 따뜻한 마음으로 상담 해주심에 좋았습니다. 짧은 시간이었음에도 불구하고, 최대한 내담자에 도움,조언이 될만한 말씀 해주셨고, 공감해주셔서 마음이 조금이나마 편해졌습니다.\n감사합니다.',1998),(2416,'2019-06-07 00:00:00.000000',4,'단편적인 생각들을 차근차근 정리해가는 느낌이라 좋았습니다. 아직 어떤 방향으로 정리될 수 있는지는 잘 모르겠지만 앞으로의 과제가 조금이나마 명확해진 것 같아요. ',2065),(2417,'2019-06-08 00:00:00.000000',5,'제대로 상담받는건 처음인데 친절하게 잘 이끌어주셔서 감사했습니다 :) 상담에 대한 두려움이 있었는데 덕분에 긍정적으로 생각이 바뀌었어요, 추가로 더 상담 신청하려고 합니다 ^^',2066),(2418,'2019-05-20 00:00:00.000000',5,'사실 상담을 채팅으로 한다는거에 있어서 의구심이 들었는데, 정말 정말 정말 감사한 시간으로 위로받고 조언을 들었어요.\n\n인생을 살아가면서 성향을 이유로 대며 변화의 의지 없이 한탄을 해왔는데, 전략이 필요하다는 발상의 전환이 너무 충격적이었어요. 그리고 아주 제가 필요한 방식이라 반가웠어요.\n\n정말 공감받으며 위로되고, 새로운 발상이 있다는게 너무 놀라웠고 상담사님한테 그냥 정말 감사한 마음뿐이에요..\n\n고민이 있다면 꼭 추천드러요',2067),(2419,'2019-04-22 00:00:00.000000',4.5,'제 이야기를 잘 들어주시고, 정리도 잘해주셔서 너무 좋았어요. 어디가서 하지 못하는 이야기들 들어주시고 본질을 꿰뚫는 질문을 하셔서 저도 생각 못했던 제 속마음을 이야기 할수 있었어요. ',2068),(2420,'2019-04-01 00:00:00.000000',5,'편안하게 이야기 들어주셔서 감사했고, 해결방법도 적절하게 제시해주셔서 너무 고마웠어요 앞으로 더 발전적인 상담 이어가고 싶습니다 ',2051),(2421,'2019-06-10 00:00:00.000000',5,'감사해요\n',2069),(2422,'2019-04-24 00:00:00.000000',5,'편안하게 이야기 들어주시고 제시해주신 솔루션에 불안했던 마음이 편안해졌습니다❣️ 정말 감사합니다\n',2070),(2423,'2019-04-25 00:00:00.000000',3.5,'부드럽게 잘 받아주시고 해결책을 제시해주셔서\n마음이 너무 가벼워졌어요',2071),(2424,'2019-05-21 00:00:00.000000',5,'잘 생각 해 볼게요!!\n감사합니다',2072),(2425,'2020-06-17 00:00:00.000000',5,'말씀 잘들어주셔서 감사했네요 변하고 안정적인 상담감사했어요',2073),(2426,'2020-06-16 00:00:00.000000',5,'9주간 상담을 받으면서, 어지러운 생각을 정리할 수 있었고, 억누르고 무시했던 감정들을 의식하게 되었습니다. 저 자신을 알아가는 느낌을 찾았어요. 첫 상담부터 제 마음을 깊이 들여다볼 수 있도록 귀기울여주신 유현정 상담사님 덕분에 짧은 기간 안에 밀도 높은 상담이 이루어졌던 것 같아서 감사했습니다. \n\n대인관계에서 항상 자신감이 없고, 제가 원하는 게 뭔지 몰라서 진로 고민도 발전 없이 정체된 느낌이 강해서 상담을 받기 시작했습니다. 초반에는 감정보다는 생각이 앞서서, 제 행동이나 생각의 이유를 설명하고 있는 제 자신을 발견했고, 그 후로는 일상 속에서 의식적으로 제 감정과 느낌을 찾아보게 되었습니다. 또 그동안의 틀에 박힌 생각과 현실인식에서 벗어나서 대인관계나 저 자신의 역할과 객관적인 상황을 정리해보기도 했습니다. 그 과정에서 상담사님이 제 감정에 확신을 가질 수 있도록 구체적인 질문이나 단계적인 과제를 제시해주셨고, 저는 그런 가이드가 많이 도움이 되었습니다. \n\n아직 대인관계나 진로에 대한 막막한 마음도 크지만, 전보다 마음이 많이 편해졌어요. 늦었다고 생각하지 않고, 이제는 좀 더 스스로 확신을 가지고 질서를 만들면서 주체적으로 살아볼 수 있을 것 같아요. 마음이 약해졌다고 느끼거나, 생각이 많아서 스스로 원하는 게 뭔지 흐려졌다고 느끼시는 분들은 유현정 상담사님과의 상담에서 도움을 받으실 수 있을 것 같아서 추천드립니다. ',2074),(2427,'2020-06-09 00:00:00.000000',5,'차근차근 들어주고 잘문해주셔서 좋았습니다!\n잘 생각해볼게요!',2075),(2428,'2020-06-05 00:00:00.000000',5,'감사드립니다!',2076),(2429,'2020-06-02 00:00:00.000000',5,'제가 했던 말을 상담사 선생님께서 정리해서 알려주시니 저를 더 객관적으로 바라볼 수 있었던 것 같아요. 칭찬도 해주시고 용기도 주시고.. 정말 감사했습니다. 그동안 억눌러온 감정이나 말들이 많았는데 그것을 하나씩 꺼내니 처음은 어렵지만 두번째부턴 점점 나아지더라구요. 앞으로 내 작은 감정들을 무시하지 말아야겠구나 느꼈어요. 나를 이해하고 돌보는 방법을 알 수 있었던 시간이었고 큰 도움 주셔서 너무 감사했습니다.',2077),(2430,'2020-05-31 00:00:00.000000',5,'자존감을 높여주는 좋은 이야기를 해주셔서 감사합니다^-^\n선생님의 좋은 조언과 위로가 마음에 확 와닿네요\n정말 감사합니다 \n제 이야기를 잘 들어주시고... 그에 맞는 좋은 이야기를 해주셔서 좋은 에너지를 받은 것 같네요~ :)',2078),(2431,'2020-05-29 00:00:00.000000',5,'항상 방법이나 제가 저의 불안정한 심리상태를 위해 제가 앞으로 해봐야할 것을 하나씩 제시해주시는 것 같아서 감사해요.',2079),(2432,'2020-05-22 00:00:00.000000',5,'지쳐있고 힘들었던 마음을 이야기할 수 있어서 도움이 되었습니다! \n',2074),(2433,'2020-05-19 00:00:00.000000',5,'상담 후 주셨던 미션이 큰 도움이 되었고\n\n나에 상처에 진심으로 공감해주시는게\n\n느껴졌어요.. 아직 마음의 상처를 다\n\n씻어내진 못했지만\n\n큰 도움이 되었습니다 정말 감사드려요♡',2080),(2434,'2020-05-19 00:00:00.000000',5,'4년째 우울증약 복약중이고 상담은 불편해서 꺼리다가 텍스트상담으로 진행했어요. 1회 해보고 저랑 잘 맞으셔서 10회기 진행했습니다.\n\n우울이 심할 때 스트레스를 많이 받을 때 부정적으로 편향된 생각을 많이 하게 되잖아요. 그리고 그런 생각을 자꾸 곱씹어서 더 화나고 짜증나고 속상하게 되고.. 내가 가지고 있는 부정적인 명제들이 어느 지점에서 논리적으로 오류를 가지고 있는지 천천히 짚어주십니다.\n\n스스로의 생각이 잘못되었을 수 있다는 걸 인정하실 수 있는 분, 자기 자신을 더 나은 방향으로의 변화에 열린 시선을 가진 분들께 추천드려요.\n\n부정적인 감정에 빠져서 허우적대는걸 낭만적이라고 느끼면서 즐기시는 분들, 앞뒤 없이 마구 쏟아내고 성찰 없는 시간을 원하는 분들께는 추천드리지 않아요.',2081),(2435,'2020-05-18 00:00:00.000000',5,'무기력에 대해 구체적인 방안을 제시해주셔서 너무 좋았어요. 격려 또한 아낌없이 해주셔서 잠깐이었지만 든든한 지지자가 생긴 기분이었습니다.',2082),(2436,'2020-05-02 00:00:00.000000',5,'나  자신을  되돌아  볼수있어서  좋았어요.!',2083),(2437,'2020-04-24 00:00:00.000000',5,'상담하기 전까지 걱정을 많이 했는데 \n제 스스로의 감정을 알게 해주시려고 \n질문도 많이 해주셔서 시간이 지날수록 좀 더 제 감정에 솔직해질 수 있었습니다.\n불편하지 않고 편하게 상담을 이끌어주셔서 감사합니다^^',2084),(2438,'2020-04-21 00:00:00.000000',5,'상담받으면서 되게 오랜만에 울기도 하고, 마음이 많이 편해졌어요. 혼자서 고민하고, 생각하고, 속상해했던 시간들을 꼼꼼히 들여다봐주시는 기분이 들어서 감사했습니다. 텍스트로 상담 전에 마음 상태도 챙겨주시고, 정말 충분히 들어주시고 진지하게 말씀해주시는 게 느껴졌어요. \n\n상담사님 말씀대로, 생각을 너무 많이 하면서 저 자신을 혹사시키고 있었던 것 같아요. 알고는 있었지만, 저나 주변 사람이 아니라 제3자의 목소리로 들으니까 더 납득이 가고, 방향성도 명확해져서 큰 도움이 되었습니다. 세 가지로 생각 조절하는 습관 기를 수 있다고 조언해주셨는데, 꼭 실천해보고, 다시 상담 받아보고 싶습니다! ',2085),(2439,'2020-04-19 00:00:00.000000',5,'힘들때 트로스트를 만나서 많은 도움이 되었어요.\n찬찬히 잘 들어주시고 적절한 질문으로 혼란과 어수선한 고민의 실체를 잘 드러내주셨구요.  안정되게 방향을 잘 잡아가게 도움 주셨어요 .\n미술상담쪽으로 많이 공부하신거 보고 상담사님 선택했는데  효과적인 미션을 주셔서 짧은 상담이지만 많이 좋아진 자신을 느껴요.\n넘 감사하고 다음에 또 휘청하면 선생님 찾을게요ㅎ\n친구에게도 추천했어요~~^^',2086),(2440,'2020-04-18 00:00:00.000000',5,'질문을 많이 해 주시는 편입니다. 처음에는 친밀도가 없던 상태라 그런지 불편하다는 생각도 들었지만, 시간이 지나고 곰곰히 꼽씹어보니 스스로 생각의 전환이 이뤄지게끔 질문을 던져주시는 듯한 느낌을 받았습니다. ',2087),(2441,'2020-04-14 00:00:00.000000',3.5,'처음 상담을 받아본거라 제가 생각하는 상담과는 좀 달랐다고 생각했는