과 얘기 들어주는 누군가였는데 상담사님이 너무 알맞게 위로해주시고 조언해주셔서 마음이 편해졌어요. 지금 닥친 상황에 남은 기간 버틸수 있게 멘탈을 잡아주셔 감사합니다. :) ',2130),(2490,'2020-05-06 00:00:00.000000',5,'천천히 제 얘기 들어주셔서 감사합니다.\n\n',2131),(2491,'2020-05-06 00:00:00.000000',5,'차분하게 대화를 이끌어 주셔서 좋았어요 :)\n \n50분은 다소 조금 짧고 찝찝함이 남아있는 시간이네요 \n방문상담이 부담스러우신 분들한테 적극 추천해 드리고 싶은 텍스트 테라피예요 . \n언제 어디서나 상담할수있다는게 큰 장점인것 같아요 \n\n\n전 5G가 마지막에 잘 안터져서 조금 불편했지만 .. \n그래도 저렴한 가격에 텍스트 테라피에 대해 경험해 볼수있어 좋았어요\n상담사님 . 지인한테는 너무 가벼워서 할수 없는 제 속마음 들어주셔서 감사해요 또 봬요 ☺',2132),(2492,'2020-05-05 00:00:00.000000',5,'공감하면서 상담해주셔서 감사합니다. 덕분에 마음이 조금 편해졌습니다',2133),(2493,'2020-05-04 00:00:00.000000',5,'생각이 정리가 되고 제 마음에 더 집중할 기회가 생겼어요 감사합니다 :)',2134),(2494,'2020-05-03 00:00:00.000000',5,'해야할 일을 말해주셔서 좋았어요',2135),(2495,'2020-05-01 00:00:00.000000',5,'최근 가지고 있던 가장 큰 고민을 \n혼자 떠안고 끙끙 거리고 있었습니다. \n\n조은아 상담사분은 상담하기에 짧다면 짧은 시간이지만 \n그 시간을 결코 짧은 시간이라고 생각하게끔 만드시지 않았습니다.\n\n제 이야기를 들어주시고 크게 공감해주셨습니다\n1시간이 아깝지 않았어요! 제가 말이 많은 편인데도 \n차분히 읽어주시고 요약해주신 뒤에, 깊게 공감해주시고\n그 뒤에 솔루션까지 \n\n감사합니다! 고민하지 마시고 상담 받아보세요\n마음이 한결 편안합니다',2134),(2496,'2020-05-01 00:00:00.000000',5,'선생님과 상담하면서 몰랐던 부분을 새로 알게 되었어요',2136),(2497,'2020-05-01 00:00:00.000000',5,'그낭그랬어',2137),(2498,'2020-04-26 00:00:00.000000',5,'주위 사람들에게 고민상담 했다가 오히려 상처받은적 누구나 한번쯤 있을거라고 생각해요. 내 고민을 상대방이 너무 가벼이 여겨서, 위로는 커녕 자기 얘기만 늘어놔서 등등..,\n\n또, 상담해준다는게 감정노동이기도 하잖아요. 그래서 미안한 마음에 주위에 얘기하지 않고 저 혼자 껴안고 있기도 했어요. \n\n조은아 상담사 님은 정말 상담사가 천직이신거 같아요. 일단 인류애가 정말 상당하시고요. 그냥 얘기를 잘 들어주기만 하는데서 그치는게 아니라 정말로 제게 딱 필요한 조언을 따뜻하게 해주셨어요. \n\n아무 기대없이 신청했던 건데 뜻하지 않게 소득을 얻었네요. 진짜로 마음이 치유됩니다. 앞으로 어떻게 해야 할지도 알겠고요.\n\n\n선생님 감사해요! :)\n\n',2138),(2499,'2020-04-26 00:00:00.000000',5,'50분이라 제약이 많았지만 잘 들어주셔서 감사했어요, 머릿속에 있는 생각이나 걱정을 홀가분하게 털어놓을 수 있는 시간이었어요~',2139),(2500,'2020-04-24 00:00:00.000000',5,'끝까지 책임감을 가지고 보살펴주시는것같아요 ',2140),(2501,'2020-04-24 00:00:00.000000',5,'생각이 정리가 잘되는것같아요',2141),(2502,'2020-06-22 00:00:00.000000',5,'마음도케어해주시고좋았는데\n\n서버가다운되는바람에ㅜㅜ',2142),(2503,'2020-06-22 00:00:00.000000',3.5,'한바탕 울고 다 털어놓으니까 마음이 좀 편안해진거같아요! 위로해주시고 좋은 말씀 해주셔서 감사합니다! ',2143),(2504,'2020