 감사합니다!',2191),(2566,'2020-02-07 00:00:00.000000',5,'감사합니다. 1회 상담인데도 빠른 진단과 많은 조언을 들을 수 있었습니다. ',2192),(2567,'2020-02-05 00:00:00.000000',5,'말도안되는 가정사로 인해, 분노에 눈이 뒤집히다 못해 정신병에 걸린것 같아 상담을 처음으로 해보게 되었습니다. 가정사다보니 어르신인 상담사님께 상담을 요청하게 되었습니다. 상담사님의 상담엔 공감, 격려, 지지, 극복 방안 등 다양한 면이 있었습니다. 무엇보다도 상담사님의 의견은 제가 생각해온 관점들과는 달랐고 새롭게 느껴졌습니다. 상담사님이 말씀하신 내용들, 방법들 힘들때 하나씩 꺼내보고 실천해보겠습니다. 사건들이 해결되고 좋은 소식 생기면 다시 한번 상담신청 드릴게요. 건강하세요.',2193),(2568,'2020-02-01 00:00:00.000000',5,'큰 기대를 하고 상담했지만 별 도움을 받지 못 했어요\n\n공감은 해주셨으나 진심으로 느껴지지 않았으며  해결 방안도\n\n그다지 도움이 되지 않았어요',2194),(2569,'2020-01-31 00:00:00.000000',5,'너무도 지치고, 힘든 하루에 마음의 평안을 찾게 도와주셨습니다. 늦은 시각 절망감에 휩쌓여 지푸라기라도 \n잡고 싶다는 심정으로 트로스트를 켜고, 많은 상담사 분들의 프로필과 후기를 보고 엄마 같이 따스하다는\n유영임 상담사님을 선택하게 되었어요. \n\n제 긴 이야기를 쭉 들어주시고, 따스한 위로를 건네주셨고 스스로 문제에 대해 자문해보며 과거에 대한 후회를 버리게 도와주셨어요. \n\n처음에 상담 시각이 제한적이라 상담사님의 즉각적인 답변을 갈구했는데 상담 시각이 훨씬 지난 시각까지 상담해주시는 모습을 보고, 진심으로 제 고민을 함께 해주셨구나 느꼈습니다.\n\n오늘 밤은 편안한 마음으로 잠들 수 있을 것 같아요.\n정말 감사합니다. \n다시 또 뵈어요~!!^^ ',2195),(2570,'2020-01-31 00:00:00.000000',5,'바꿀수 있는 자신감을 얻었지만 시간이 너무 짧았어요',2196),(2571,'2020-01-30 00:00:00.000000',5,'외국에서 긴 우울증으로 고통받던 와중에 검색을 통해서 이렇게 좋은 상담사님을 만나게 됐어요. 제 말을 듣고 하나하나 건내주시는 말씀에 저도 모르게 울컥하고 감동이였어요. 누군가 제 말을 주의깊게 들어주는 느낌..? 해외 사용자들에게도 정말 강력히 추천드립니다! 제 주위사람들에게도 당연히 추천할거에요ㅠㅠ 이제야 알게된게 너무 안타까울 뿐입니다. 광고좀 많이해주세요ㅠ.. 나만 알기 너무 미안한 어플..\n상담사님 정말 감사드립니다! 곧 전화예약으로 봬요^^ ',2197),(2572,'2020-01-28 00:00:00.000000',5,'생각정리가되어 좋습니다. ',2198),(2573,'2020-01-28 00:00:00.000000',5,'좋아요\n차근하게 복잡한 심경을정리되고\n마음이 휩쓸리지않도록 붙잡아주는 느낌을 받습니다',2198),(2574,'2020-01-26 00:00:00.000000',5,'늦은 밤인데 잘 들어주시고 \n제가 추측하고 있었던 부분을 콕 찝어주셔서 \n너무 감사합니다. \n위로해주셔서 감사합니다. \n',2199),(2575,'2020-01-24 00:00:00.000000',5,'제 얘기에 공감해주시고 남들이 해주지 않는 저에대해 말씀해주셔서 위안이 됐어요.\n도움되는 방법도 제시해주셔서 그렇게 해보려고 노력하려해요.\n힘든일이 또 생기면 안되지만 생기게되면 다시 찾아뵈려고 합니다.',2200),(2576,'2020-01-23 00:00:00.000000',4,'이야기를 나누면서 다시한번 생각해보게 되고 정리하는 시간이었어요. 하지만  좀더 심도깊은 상담을 해보고 싶은데 어플상담으로는 한계가 있는것같아요. 저희 엄마가  고아였듯이 저또한  보호자를 찾듯이 방황하는 기분이에요. 그리고 상담사분이 저를 싫어할까 두렵고  매번 불안해요. 하루빨리 불안함이 좀 안정을 찾았으면 좋겠어요. ',2198),(2577,'2020-01-23 00:00:00.000000',2,'제 상태를 진찰 할 수 있어서 좋았습니다',2201),(2578,'2020-01-22 00:00:00.000000',5,'제 얘기에 집중을 잘 해주시고 좋은 말씀 많이 해 주셔서 도움이 되었어요^^',2201),(2579,'2020-01-22 00:00:00.000000',5,'깊은 우울감에 있을때 도움을 받았어요 감사합니다\n',2202),(2580,'2020-01-22 00:00:00.000000',5,'저에게 필요한 말씀을 해주셨어요.',2203),(2581,'2020-01-21 00:00:00.000000',5,'여러모로 자기 감정에 대해 알 수 있어서 좋았어요 이야기를 꾸준히 잘 들어주셔서 감사합니다\n',2204),(2582,'2020-01-19 00:00:00.000000',5,'고민을 털어놓을 수 있어서 감사합니다~',2205),(2583,'2020-01-18 00:00:00.000000',5,'항상 감사합니다',2165),(2584,'2020-01-18 00:00:00.000000',5,'어느정도 자기 생각이 정리된 분들은 1회 상담으로도 조언을 듣고 도움을 많이 받을 수 있는 것 같아요 :) 상담사님이 얘기 잘 들어주시고 인생의 선배로서 지혜로운 조언을 들은 것 같아서 도움이 많이 됐습니다. 적극적인 변화를 위해 스스로 노력하도록 북돋아 주세요!',2206),(2585,'2020-01-17 00:00:00.000000',5,'내가 왜 힘들어하는지 알 수 있게 도와시고, 대처 방법 알려주셨다. 상담하는 동안 든든했고 감사했다.',2207),(2586,'2020-01-15 00:00:00.000000',5,'너무 좋았어요\n모호한 부분을 긁어주시니 시원하네요',2208),(2587,'2020-01-12 00:00:00.000000',4,'이야기를 충분히  들어주셔서 감사합니다.\n예약한 시간이 넘도록 상담 베풀어주셔서 감사합니다.\n스스로 감정을 잘 정리하면 좋을텐데  제가  머릿속이 엉키게되면 가끔  못빠져나오는때가 있어서 예기치못하게 그런 불만스런 감정이 잘못 표출이 될때가 있어요.\n그래서  상담을 통해  그런 감정들이  차분히 제자리로 돌아갈수 있도록 도움을 받는것 같아요.\n담임선생님과 가끔씩  면담을 하는것처럼 고민상담이 되어서 좋았습니다. ',2209),(2588,'2020-01-11 00:00:00.000000',5,'제 이야기를 잘 들어주시고 아픔에 대해 공감해주셔서 좋았습니다.',2210),(2589,'2020-01-08 00:00:00.000000',5,'상담사분이 너무나도 공감및 경청을 잘해주십니다. 이야기를 꺼낼때도 잘 받아주시고하셔서 상담내내 마음편히 이야기 할수있었습니다',2211),(2590,'2020-01-07 00:00:00.000000',5,'제얘기 끝까지 다 들어주시고 공감해주셔서 감사합니다',2212),(2591,'2020-01-05 00:00:00.000000',5,'선생님의 음성과 그 안에 담긴 진심이 느껴져서 마치 엄마랑 대화하는 것 같은 기분이 들어서 저도 모르게 이야기하면서 눈물이 쏟아졌습니다 하루종일 무기력해서 울 기운도 없을 줄 알았는데 말입니다 울고 나니 정신이 조금 맑아지고 또 선생님의 삶의 지혜가 담긴 조언이 특히 좋았습니다 저는 트로스트에서 같은 고민으로 여러번 상담 받았어요 그런데 마지막에 응원한다고 진심을 담아 여러번 말씀해주신 분은 처음입니다 지금도 후기 작성하면서 눈물이 납니다 이 고민이 올해는 꼭 해결되었으면 좋겠습니다 따뜻한 상담과 조언 감사합니다 ~~ 선생님 :)',2213),(2592,'2020-01-03 00:00:00.000000',4.5,'좋았습니다\n\n',2214),(2593,'2020-01-01 00:00:00.000000',5,'좋은 얘기도 많이 해주시고 끝까지 얘기를 잘 들어주셔서 너무 감사했습니다^^ 앞으로도 종종 깊은 우울감이 찾아올때마다 상담사님이 말씀해주셨던것들 생각하면서 노력해볼것 같아요ㅎㅎ',2215),(2594,'2019-12-31 00:00:00.000000',5,'그냥 다 감사합니다..... 따뜻하게 위로해주셔서 감사합니다..',2216),(2595,'2019-12-31 00:00:00.000000',5,'새로운 시각으로 문제상황을 바라볼수 있었어요, 감사합니다. \n어디에도 말할수 없던 이야기를 털어놓을수 있어서도 감사해요.',2217),(2596,'2019-12-30 00:00:00.000000',5,'너무좋았어요. 일단 저를 평가하려고 하지도 뭔가를 진단하려고도 당장 해결책을 제시하려고 하시지도 않으셔서 그게 너무 편안하고 좋았어요. 이야기를 정말 잘들어주세요. 전화를끊고나면 힘내서 잘해볼수 있을것같은 자신감도 좀 생기고 기분이 아주 후련해져요. 상담하는시간동안도 좋지만 상담받고나면 하루종일 기운이 나요. 주기적으로 받고 열심히 노력하다보면 상담주기가 좀 길어도 괜찮을만큼 마음에 힘이 생기지 않을까 싶어요. 유영임 상담사님 정말 좋은 상담사이신것같아요. ',2218),(2597,'2019-12-30 00:00:00.000000',4,'사실 첫 상담이고, 한번에 모든 얘기를 하기에는\n시간이 부족했지만, 끝까지 제 얘기 들어주시고 오랜시간 대화해주셔서 감사합니다. 구체적인 해결방안을 제시해주셔서 한번 생각해보는 시간이였던것같아요.',2219),(2598,'2019-12-27 00:00:00.000000',5,'제가 가진 문제에 대해서 다 설명하고 해결책을 얻기에는 시간이 부족 했습니다. \n\n너무 복잡한 것들이라 그저 글로 적으며 풀어 놓았습니다 \n감정의해소가 된 기분은 조금 들지만, 해결책에 대해서는 설명듣기에 너무 제한적이었습니다. \n\n복잡한 일들에 대해선 \n1회 텍스트 테라피는 추천하고 싶지 않습니다.\n\n상담사님은 여유있게 진정시켜 주시는 정도로 저를 대해 주셔서\n그 부분은 감정이 안정되고, 긴 문장에도 끝까지 읽어 주시고 공감 해 주셔서 그부분은 만족 하였습니다. \n\n',2220),(2599,'2019-12-26 00:00:00.000000',4,'주변사람들에게 마음을 털어놓는게 힘들어서 말못하고  끙끙않고 있었는데  이야기 나누면서  방법을 생각하게되고  내입장에서만 생각하다보니 객관적으로 판단하기보다 감정적으로 판단을 하게되어 점점  잘못된길을 가고있어도 모르고 있었어요. 부모님처럼 인생에 대한 팁을 얻은것같아 인사하는것에 노력을 해서  사람들과 가까워지도록해봐야겠어요. \n다만, 상담비용이 비싼편이라 부담스럽기도하고  저에대해 모르기때문에  어디서부터 뭘말해야하는지도  막연하기도했고 모든걸 다 말할수있는 시간적 여유가 없어서 아쉬웠습니다. 역시 사람은 혼자살면 안되는것같습니다. 하지만 사람과의 관계는 정신차리지않으면  틀어지기쉽고 너무 힘들고 어렵습니다.\n제대로된 친구 한명 있다는것이 정말 큰힘이 되는데  그런존재가 없는것같아서  저는 너무  힘에 겨웁니다. 친구가 없다고하면 성격이 안좋다는인식으로 바라보는것또한  스트레스이고  그렇지않다고 이야기하고싶어도  들어주는사람이 없다는것은 사람을 서서히 죽게만드는것같습니다. 세상살이 사는게 너무 힘드네요.\n이야기할게 많긴한데 주구장창  이야기나눌수있는 친구가 없어서 넘 우울합니다',2209),(2600,'2019-12-25 00:00:00.000000',5,'정말 마음이 편안한 상담이였습니다 감사해요 \n',2221),(2601,'2019-12-23 00:00:00.000000',5,'마음속의 결정을 꺼내주신것같아서 감사합니다\n어떤 결정을 할지는 잘 모르겠지만\n\n제 앞으로의 미래에대한 결정에 큰 도움을 주셔서 감사합니다',2222),(2602,'2019-12-22 00:00:00.000000',5,'유영임 상담사님 말씀은 너무 따듯하고 현실적인 조언을 많아 해주십니다. 많은 상담을 받아봤는데 정말 편하고 이해 잘 되게 설면해주시는 분들은 많이 없는데. 강력히 추천드립니다.',2223),(2603,'2019-12-19 00:00:00.000000',4,'감사합니다 이야기만으로 힘이 되는게 있네요. ',2224),(2604,'2019-12-1