0:00:00.000000',5,'감사합니다 매번\n',2255),(2640,'2019-10-29 00:00:00.000000',5,'유영임 상담사님 늦은 시간 바로상담 요청드렸는데도 잘들어주시고 공감해주시고 같이 고민해주셔서 큰 도움이 되었어요 감사합니다!!! ',2256),(2641,'2019-10-28 00:00:00.000000',5,'급 우울하고 불안한 마음이 들던 차에 바로 상담 기능을 활용해보았습니다. 사실 비용을 보고 선생님을 선택했지만 50분간의 짧은 상담 후에는 그것이 죄송해질 정도였어요. 차분하게 저의 이야기를 읽어주시고, 이야기의 요점을 짚어주시고, 저의 상태에 대해 어렵지 않은 말로 즉각 반영해주셨어요. 덕분에 혼란스러운 마음이 금새 가라앉았네요. 스스로에 대한 토닥토닥~ 알려주신 방법 잊지 않겠습니다. \n\n따뜻한 상담사님을 원하신다면 추천합니다 :)',2257),(2642,'2019-10-28 00:00:00.000000',5,'짧운 시간안에 포인트를 잘 짚어주셔서 큰 도움이 되었어요. 장기적으로 받으면 더 좋을 것 같습니다. 감사합니다.',2258),(2643,'2019-10-27 00:00:00.000000',5,'고민하고 있었던 부분을 잘 정리해서 말씀해주셔서 정말 좋았습니다~. 마음이 위로가 되고 답답했던 부분이 내려가는것 같았습니다. 감사합니다.',2259),(2644,'2019-10-27 00:00:00.000000',5,'초반에 횡설수설하는데도 차분히 잘 들어주시고\n방향성을 제시해 주셔서 감사합니다. ',2260),(2645,'2019-10-26 00:00:00.000000',5,'정말 좋았습니다. 최고! 다음에 또 힘들어질때 상담 부탁드려요!!!',2261),(2646,'2019-10-26 00:00:00.000000',5,'좋은 정보도 알려주시고, 용기도 북돋아주셔서 좋았습니다. 감사합니다',2262),(2647,'2019-10-24 00:00:00.000000',5,'급한 성격에 바로 전화 상담 드리게 되었어요. \n관계에 대한 고민이라 저 뿐만 아니라 상대방에 대한 과거 및 현재 이야기 까지 들어주시고 공감해주셨어요.\n정답이 있는 문제가 아니어서 빙빙 도는 고민이지만 다정하게 들어주셔서 상담이 진행될 수록 마음도 진정되었어요. \n울면서 상담 신청 했는데 끝날 쯤엔 웃으면서 상담 마칠 수 있었습니다.\n인생의 첫 상담이었는데 꼭 큰 고민 아니어도 내 마음이 힘들 때 위로 받을 수 있는 길이 있다고 느껴졌어요.\n선생님 감사합니다. ^^',2263),(2648,'2019-10-22 00:00:00.000000',4,'최대한 도움을 주시려고 하셨어요! 급작스럽고 처음 겼는 일에 당황해하고 잇었는에 덕분에 도움이 되었습니다. 감사합니다. 진정이 많이 되었고 할 수 있는 것 한해서 노력을 할 수 있을 것같아요. 계속해서 제 이야기를 다시 정리해주셔서 명확하게 문제를 짇면할 수 있던 것같습니다.',2264),(2649,'2019-10-22 00:00:00.000000',5,'다급하게 터져나오는 슬프고 힘든 생각과 마음을 털어놓을 곳이 없어서 상시대기 바로상담을 이용해 보았습니다.\n상담사님께서는 저의 이야기를 차분히 친절히 그리고 공감하며 들어주셨고\n저의 딱한 사정과 상황을 위로해주시면서\n접근해야 하는 생각과 방향을 잡아주셨습니다.\n짧은 시간동안 저의 그동안의 스토리와 지금의 상황이 오기까지의 일들을 설명하느라 시간이 모자란 부분까지도 상담선생님의 배려로 더욱 길게 상담해주셨고 충분한 이야기를 할 수 있도록 들어주셨습니다.\n상담사님과의 통화로 인해 저에게는 마음을 진정시키고 상황을 더욱 객관적으로 바라볼 수 있는 힘을 좀 더 가져다 주었습니다.',2265),(2650,'2019-10-21 00:00:00.000000',5,'격려와 응원 고맙습니다. 공감하며 들어주시니 마음이 따뜻했어요.',2266),(2651,'2019-10-20 00:00:00.000000',5,'그냥 괜찮았던 것 같아요... 사실 심리 상담 시간도 20분 가량 초과가 됐는데도 얘기 잘 들어주시고