자체를 바라봐 주시는 느낌이 너무 좋았어요. 제 스스로도 그렇게 봐라봐 주지 못하던 때에 바라봄을 알려주셨어요. 이것 만으로도 지난달 외면하기 급급했던 저이기에 삶에 있어 작지 않은 발견 이었다고 생각해요. 선생님이 주신 위로 따뜻함 잊지 못해요.\n감사합니다.☺',2408),(2814,'2020-04-14 00:00:00.000000',5,'좋았어요 언제나처럼!\n',2409),(2815,'2020-04-11 00:00:00.000000',5,'\'남에게 보여지는 나 \' 에 대해서 항상 걱정하고 고민해 왔다는것 . . . 하지만 \'나의 내면에 대한 생각\'은 너무 하지 않고 살았다는 것을 지금에야 알았습니다.\n\n물론 선생님 덕분에요. . .\n\n항상 선생님이랑 대화를 나누고 나면 마음이 가벼워지기도하고 무거워지기도 하고 저에 대해서 스스로 미안해지기도 하는거 같아요\n뜻깊은 시간이었습니다 👍🏻\n',2410),(2816,'2020-04-02 00:00:00.000000',5,'상담 진작에 받을걸 그랬어요.\n무슨 효과가 있을까 싶었는데\n몰랐던 내 모습을 알게 되고\n막막했던 삶에 답이 보이는 것 같아요.\n4회 상담 받았었는데\n추가로 몇 번 다 하려고요 ^^\n상담 받을 때마다 눈물을 흘렸지만 ㅠㅜ\n그만큼 마음에 쌓인 상처도 같이 내려간 것 같아요.\n감사합니다 \n\n',2411),(2817,'2020-03-31 00:00:00.000000',5,'저를 좋은 방향으로 끌어가주셨어요. 저도 잘 모르겠는 제 마음을 잘 알아봐주시고, 공감해주시는 것 만으로도 큰 위로가 됐어요. 차분히 나눈 이야기들이었는데도, 눈물이 났던 적도 있구요. 그냥 나아지기만을 위한 상담이 아닌, 인내심있고 관심있게 제 자신을 들여다보고 다시 한 번 생각해 볼 수 있는 시간이었습니다. 조리있게 말하지 못할 때에도 같이 정리를 해볼 수 있게 도와주셨고, 객관적으로 통찰을 해주셨습니다. 상담을 하고 나면 마음이 편해져요. 이 편안한 마음이 지속되도록 계속 해나가고 싶어요.',2412),(2818,'2020-03-26 00:00:00.000000',5,'처음부터 끝까지 눈물 가득했던 경험이였어요. \n\n너무 세심하게 얘기들어주셔서 감사해요. 오랫동안 혼자 담아두었던 얘기들을 꺼내기가 쉽지 않았는데 선생님과 얘기하면서 치유가 조금씩 되는걸 느꼈어요. 무엇보다 얘기를 하고 싶은 용기가 생긴 것 같아요. 아프다고, 힘들다고 솔직하게 얘기하고 싶은데 혼자 담아두려니까 너무 힘들었어요. \n\n선생님 마지막 상담 받고 10년 후 제 모습을 상상해보려구요. 그리고 해주신 말씀 덕분에 예의바른 모습 좀 뒤로 하고 앞으로는 더 솔직해지고 싶다는 생각이 들었어요. 뒤로 숨어지내는 제 모습 이제 지쳐요. 남한테 상처가 되더라도 싫은 소리 솔직하게 하면서 살고 싶어요 앞으로. \n\n다음주에 다시 얘기할때까지 선생님 해주신 말씀 고민하면서 제가 변하는 모습 선생님이랑 같이 볼 수 있었으면 좋겠어요 :) 감사합니다. ',2413),(2819,'2020-03-21 00:00:00.000000',5,'친절하시고 진심으로 조언해주세요. ',2414),(2820,'2020-03-13 00:00:00.000000',5,'저 자신에 대한 문제의 \n해결지점을 \n대화를 통해 천천히 끌어주셨습니다.\n\n감사합니다 :)',2415),(2821,'2020-03-11 00:00:00.000000',5,'처음에는 제 문제를 알고 고치면 되는 심플한 일이겠다 생각했는데. 저조차도 모르고 있었던 상처를 알아봐주시고 위로해주셔서...계속 원인모르고 답답했던 마음도 풀리고 좀 더 스스로를 아낄 수 있게 됐어요. 계속 상담을 받겠지만 쌤이 같이 걱정해주시고 고민해주시니 정말 든든하고 위로가 되네요! ',2416),(2822,'2020-03-11 00:00:00.000000',5,'감사합니다아! ',2416),(2823,'2020-03-09 00:00:00.000000',5,'지난번에는 진심을 담아 들어주셔서 속이 후련해졌습니다. 더 깊은 내용을 이야기하고싶습니다.',2417),(2824,'2020-03-08 00:00:00.000000',5,'정말 큰 힘이 되었어요.',2418),(2825,'2020-03-06 00:00:00.000000',4.5,'먼저 제 고민을 진심으로 들어주셔서 감사했습니다. 그리고 저조차 몰랐던 제 모습을 같이 찾아주시고 공감해주셔서 너무 마음이 따스해지는 시간이었습니다. 이 기회를 통해 더 좋은사람이 될 수있도록 노력해보고 싶어졌습니다.\n',2417),(2826,'2020-03-05 00:00:00.000000',5,'처음으로 받는 온라인 텍스트 상담이었는데 상담사님이 부담도 크게 덜어주셔서 편하게 할 수 있었습니다:)  좋았습니다ㅎㅎ',2419),(2827,'2020-03-01 00:00:00.000000',5,'잘 들어주세요. 솔직하셔서 좋았어요. ',2410),(2828,'2020-02-29 00:00:00.000000',5,'상담을 통해 알수없던 제마음에 확신이 생겼고 그를 지킬수있는 방법을 알려주셔서 그 방법을 통해 지켜보기로 다짐했어요.\n생각보다 훨씬 많은 도움을 얻은것같고 저에 대해 알게된것같아요.\n정말 감사합니다.',2420),(2829,'2020-02-25 00:00:00.000000',5,'차분히 이야기 경청해주시고 제 마음 속 깊이 듣고 싶었던 위로와 공감을 해주셔서 감사드려요',2421),(2830,'2020-02-15 00:00:00.000000',5,'감사합니다람쥐',2422),(2831,'2020-02-09 00:00:00.000000',5,'친절하시고 좋아요!',2423),(2832,'2020-02-03 00:00:00.000000',5,'여러 이야기를 두루 돌아보고 풀어나가야할 부분과 방향을 잘 짚어주십니다 :) 상담을 받아보기 전에는 문제점을 알고는 있었지만 막막한 마음이었는데 이제는 조금 마음이 편해졌어요! 무언가 막힘이 생길 때 함께 해결해주실 분이 있다는게 너무 든든해요 또 뵐게요 감사해요!',2424),(2833,'2020-01-31 00:00:00.000000',5,'사실알고있으면서도 그걸어찌풀이해야되는지몰랐는데 풀어주셔감사해요\n살다보면 내감정이먼지 모를때가많은데 참 도움이 됩니다♡또 뵈욥',2425),(2834,'2020-01-31 00:00:00.000000',5,'아아고양 ㅠㅠㅠㅠ',2403),(2835,'2020-01-30 00:00:00.000000',5,'두서없이 이야기 하는데도 방향성을 잘 잡아 주시네요. 저의 내면의 하고 싶은 말과 생각들도 이끌어내 주시고. 감사합니다',2422),(2836,'2020-01-29 00:00:00.000000',5,'친절하시고 좋아요!',2426),(2837,'2020-01-29 00:00:00.000000',5,'다른 시각에서 조언을 해주시니 많은 도움이 돼었습니다.',2427),(2838,'2020-01-20 00:00:00.000000',1,'별로입니다. 아무 도움이 되지 못했어요. 처음부터 상담을 계속 해야한다는 강요만 있었을뿐 마지막에 별로 도움이 되지 못한거 같다고 이야기 하니 그럼 다른 상담사 찾으래요....오늘 저는 상담 용기내서 한건데 계속 상담을 강요하는 느낌에..왜 신청 했는지 후회가 됩니다. 친절한 느낌도 없어요. 상담이 좋지도 않았는데 밑에 좋은점은 왜 선택해야 하죠? 억지로 선택은 합니다.',2428),(2839,'2020-01-20 00:00:00.000000',5,'감사합니다 용기를 얻었어요\n',2429),(2840,'2020-01-18 00:00:00.000000',5,'친구들에게 하던 상담은 그냥 수다였구나 싶네요.\n제가 생각지도 못한 부분에 어려움이 있었고\n저 스스로 잘 이해하고 느낄 수 있도록 설명해주셨어요\n잘 들어주고 공감하고 이해하고 있다는 느낌을 받았고\n중간중간 든든한 내 편이 되어주고 있구나 하고 느꼈어요\n단회로 시작했는데 정기로 하기로 마음먹고 결제했어요\n잘 부탁드려요 :) ',2430),(2841,'2020-01-16 00:00:00.000000',5,'순식간에 떨어지고 솟는 흔들리는 순간에 등대가 되어 주셨습니다.\n혼자서 큰파도를 마주하고 너무나 작은 보트에 몸이 실려있는거 같아 무섭고 포기하고 싶은 이순간에 빛이 되어 주신거 같아요.\n아직은 무섭고 저 자신을 믿기 힘들어요.\n다만 이제 조금은 방향을 알거 같다는 생각을 하게 됩니다.\n감사합니다.',2431),(2842,'2020-01-16 00:00:00.000000',5,'잘 공감해주시고 적절한 조언을 날려주셔서 큰 도움이 됐습니다.',2432),(2843,'2020-01-13 00:00:00.000000',5,'내가 변화되면 먼가 삶이 다시 즐겁고 행복해지겠구나 하는 희망이보여요\n\n횡설수설해도 잘정리해서 말씀해주셔서 감사합니다  또 뵙겠습니다 ',2433),(2844,'2020-01-10 00:00:00.000000',5,'4주+2번의 상담동안 격동의 나날을 보냈는데, 그때 선생님과의 상담이 크게 도움이 되었어요. 특히 저는 제가 무엇을 원하는지, 어떤걸 바라는지 조차 몰랐고 마음에 고장이 난 상태였는데, 선생님이 아픈곳을 이어붙여주시고 이건 이래서 이렇다 하고 하나하나 짚어주시는데 정말 이해받는 기분이 들었습니다. 특히 저는 코칭이랑 새로운 시각을 가지게 되길 바랬는데, 저 스스로의 틀에서 벗어나 좀 더 넓은 관점에서 제 문제나 상황을 바라볼 수 있게 도와주셨어요. 행복한 물고기ㅎㅎ가 되려고 합니다. 쌤 정말 감사해요! ',2434),(2845,'2020-01-09 00:00:00.000000',5,'저 스스로를 돌아보게끔 대화를 유도해주셔서\n많은 도움이 되었습니다\n\n사실 상담을 받을때 처음 마음은 내가 하는 행동에 대한 원인과 심리학적 분석을 통해 ‘그럴수 있다’ 는 위안을 얻으려는 마음이 컸는데, 상담을 통해 오히려 스스로 결정하고 책임지는 주체적인 자아로 성장 해야겠다는 마음을 갖게 되었습니다. ',2435),(2846,'2020-01-08 00:00:00.000000',5,'너무 큰 도움이 되었어요. 지금까지 스스로에 대해서 소홀했고 그런 것들을 당연하다고 여겼고 그랬기에 이런 저런 어려움을 많이 겪었던 것 같아요. \n차분하게 얘기도 잘 들어주시고 스스로 생각하지 못했던 점을 이해가 잘 되도록 많이 도와주셨어요. 처음에는 제가 아집을 부렸던 것들도 시간이 지나면서 상담사님이 얘기했던 것들이 맞았구나 그리고 스스로 나아지는 모습을 보면서 정말 많은 도움이 되었다는 걸 깨달았구요. 너무너무 감사드려요. ',2426),(2847,'2020-01-03 00:00:00.000000',5,' 제 감정의 원인들을 알기쉽게 설명해주셔서 큰도움이되었고 차분한 화법도 대화에도움이 되었습니다',2436),(2848,'2020-01-02 00:00:00.000000',5,'제가 되게 두서없이 말했던것 같은데..ㅎㅎ 상담의 방향성을 잘 잡아주셔서 짧은 회차지만 저에 대한 많은 생각을 해볼수있었던것 같아요 앞으로 남은시간동안 저를 채워갈수있도록 노력하겠습니다',2437),(2849,'2020-01-02 00:00:00.000000',5,'상담 하면서 제 문제가 뭔지 다시 짚어본거 같아요\n제 얘기를 듣고 확정짓지 않고 이해하려고 해주신게 감사했어요 \n',2438),(2850,'2020-01-02 00:00:00.000000',5,'선생님이 공감을 잘 해주셔서 좋았어요. 나의 힘든 점을 내가 생각해보지 않은 관점으로 접근을 해주셔서 신기했어요. 이렇게 생각해 볼수 있구나 하고 위로가 되고 도움이 되었어요\n. 앞으로 긍정적 도움이 되어 주실것 같아서 기분이 좋으네요.',2403),(2851,'2020-01-01 00:00:00.000000',5,'나아짐으로 갈 도약의 힌트를 얻은 것 같아요.\n저의 이야기를 들으면서도 동시에 분석을 해주시려하시는게 너무 감사합니다.\n\n와닿을 수 있게 쉽고 좋은 말로 상담 해주셔서 감사합니다.',2429),(2852,'2020-01-01 00:00:00.000000',5,'생각은 다른 생각을 물고 사실은 그생각은 하나의 길로만 걸어갔었던 것을 깨닳았습니다 저만의 세계를 벗어난 또다른 세상을 마주한 기분입니다',2439),(2853,'2019-12-31 00:00:00.000000',5,'다정하게 손을 잡고 이끌어 길을 안내해주는 인도자.',2440),(2854,'2019-12-29 00:00:00.000000',5,'좋아요... \n',2441),(2855,'2019-12-28 00:00:00.000000',5,'감사합니다.',2442),(2856,'2019-12-22 00:00:00.000000',5,'상담은 처음해보는 건데, 저의 정확한 심리 상태와 내가 힘든게 무엇이고 그게 무엇때문에 이렇게 된 건지 알고 싶었어요.\n아무래도 혼자나 주변 지인들과 이야기를 하는 건 한계가 있다고 생각이 들어서 전문가와의 상담을 신청하게 되었어요.\n\n상담하면서 제가 원했던 부분을 정확하게 짚어주시고, 잡아주셔서 그동안 제가 무엇때문에 이렇게 된 건지에 대해 알게 되었어요. 따뜻함 목소리와 배려가 단지 공감과 위로가 아니라 현재 상황과 방향성을 잡아주시는 점이 좋았네요.\n\n항상 친구들이나 지인들한테는 말을 해도 결국 똑같은 자리로 돌아오는 느낌이라 말하는 것도 지쳐있는 상태였거든요.\n\n선생님이 말씀해주신 부분 혼자 생각해보고 힘들면 다시 상담 요청 드리도록 할게요~ \n\n남의 힘든 부분을 들어주시는 점도 쉽지 않을텐데 감사한 마음이 듭니다. :) 감사합니다. ',2443),(2857,'2019-12-21 00:00:00.000000',5,'제가   왜 힘들어하는지 알게되었네요\n그동안은 그냥 힘들어만했는데 지금은 내가 왜 힘든지 알게 됐습니다 원인을 알았으니 문제를 극복할수있을것같은 생각이 듭니다 상담 내용 생각하면서 생활에 잘 적용해보겠습니다 감사합니다!',2444),(2858,'2019-12-18 00:00:00.000000',5,'생각해보지 못한 관점에서 설명해주셔서 좋았어요!\n',2445),(2859,'2019-12-15 00:00:00.000000',5,'오늘 상담 너무 감사합니다  앞으로 더 노력한번 해 볼게요 너무 감사요',2446),(2860,'2019-12-15 00:00:00.000000',5,'전화상담을 처음 받아보았는데 편안함을 주는 목소리로 말씀해주셔서 더욱 제 이야기를 솔직하게 털어놓을 수 있었습니다. 상담에서 제가 원하는 바를 빠르게 캐치하시고 제가 원하는 방향으로 상담을 이끌어주신 것 같아 감사드립니다.',2447),(2861,'2019-12-14 00:00:00.000000',5,'7년전 정신과 치료도 받아봤고 공황과 자살시도로 해외에서 intervention centre에도 들어가봤어요. 그 이후 다시는 정신과나 상담의 문을 두드리지 않겠다고 다짐했었는데 근래 가족의 투병생활로 다시 마음이 힘들어졌었습니다. 어떻게든 버티려하다가 결국 다시 공황이 도져서 연차 2일내고 쉬고 있던차에 지푸라기라도 잡는 심정으로 어플을 깔고 상담의 문을 두드렸습니다. 50분 상담이였는데 정말 펑펑 울었어요. 특히 저는 위로나 공감보다 조언과 코칭을 원했는데, 저도 모르는 제 마음과 생활을 읽어주셔서 위로를 넘어서는 인정을 받은 느낌이였습니다. 상담을 더 신청하려고 합니다. 앞으로도 잘 부탁드립니다!',2448),(2862,'2019-12-01 00:00:00.000000',5,'처음엔 단순히 제가 최근에 겪고 있는 대인관계 문제를 급하게 짧게나마 얘기하고 싶어서 시작을 했는데, 상담사님께서 더 깊은 제 내면적인 문제를 생각해보게끔 이끌어주셨습니다. \n\n특히 어릴 때부터 있었던 폭식증에 대해 깊이있게 얘기를 나누어본 적이 없었는데, 폭식증에 대한 지식을 나눠주시고 그것으로 인해 제가 겪던 우울과 폭식이 그냥 단순히 다이어트나 단발적인 상황에 의한 게 아니라 더 근본적으로 제가 늘 겪고 있던 대인관계에서의 어려움이 있었다는 걸 깨달았습니다. 타인과의 관계에 제가 얼마나 집착하고 있었는지, 또 그것이 제 마음 뿐만 아닌 몸까지 지배하고 있었다는 걸 알게되었네요... 제 자신에게 미안함을 느꼈고 또 대견했습니다. \n\n무엇보다 앞으로도 상담을 해 나갈 때 어떤 방향성과 마음으로 해야 할 지 알게 된 것 같아요. 상담사님 말씀처럼 제 마음의 문제가 당장에 해결될 문제는 아니지만 용기내서 차근차근 해볼게요! 수고 많으셨고 너무 감사드립니다...\n',2449),(2863,'2019-11-30 00:00:00.000000',5,'문제점이 무엇인지 객관적인 부분에 대한 조언과 해야할 방법들을 시간 내에 잘 설명해주셨어요 텍스트라는 한계가 있지만 텍스트라서 보이는 부분이 있는 것 같아요. 감사합니다',2450),(2864,'2019-11-29 00:00:00.000000',5,'고민되는 부분을 잘 들어 주시고 적절한 질문을 해주셔서 제 고민에 대해 생각을 할 수 있게 해주셨습니다. 선생님과의 네 번 상담을 통해 저와 제가 처한 상황에 대해 객관적으로 바라 볼 수 있었습니다. 짧은 시간이었지만 많은걸 배우고 느끼고 성장한것 같네요! \n선생님도 항상 행복하시길 바랄게요 :) \n감사합니다\n밍디 드림 ',2451),(2865,'2019-11-27 00:00:00.000000',5,'처음엔 좀 걱정이 됐고 돈을 낸 뒤에는 이미 냈는데 어쩌겠어 하고 마는 마음으로 큰 기대를 사실 안했어요.\n그런데 제가 상담신청을 한 날이 그때가 새벽이였거든요? 그래서 아침이나 오전쯤 연락이 오실 줄 알았는데 늦은 시간에 상담사님께서 연락이 오시더라고요\n상담시간 전까지는 별 생각이 없다가도 막상 상담시작하면 생각이 많아지고 어떤 날은 울기도 했어요\n상담사님 말씀이 너무 와닿고 말하지 않았는데 알아주셔서 저도 모르게 집에서 왈칵 쏟았네요....ㅎㅎ\n혹시 이해가 되지 않는다고 말하면 아니면 그냥 대화를 할 때에도 제가 이해할 수 있게끔 알맞는 비유로 설명을 다시 해주세요 오히려 제가 너무 못알아먹은건가 죄송할정도였어요 ㅜㅜ 이 상담을 끝내고 나서 저는 화를 다스리고 달래는 법,나를 존중하는법,관계는 배워야 하는 것 등을 배웠어요 제 첫상담이였는데 너무 감사했습니다 :)',2452),(2866,'2019-11-24 00:00:00.000000',5,'벌써 두번째 후기네요. 정말 많이 나아졌고, 스스로 나아졌다는 것을 자각할 수 있고, 더 나아질 수 있다는 생각이 들게 해주시는 상담사 분이에요. 사소한 문제부터 당장의 급한 문제, 인생의 힘들었던 문제까지 전문적인 관점에서 잘 분석해주시고 제가 답을 찾을 수 있도록 최선을 다해 도와주세요. 이분이 해주시는 공감과 위로는 전문적이라는 데에서 정말 큰 신뢰감과 안정감이 들어요. 단순히 힘들었겠다, 괜찮을거다 라는 말보다는 왜 그게 힘들게 느껴질 수밖에 없었는지, 왜 그게 나의 문제가 된건지 전문적으로 분석해주시기 때문에 이분이 나의 문제를 공감해주시는 구나, 하는 생각이 잘 들고 그것덕분에 위로가 되죠. 막연한 문제가 있으신 분들께 추천 드려요. 그 문제가 무엇인지 아는 것 부터 엄청나게 위로가 되고, 그 문제를 고쳐나가는 과정동안 달라지는 자신을 볼 수 있을 거에요. 이 상담사분을 만나게 돼서 정말 기쁘고 행운이었어요. 상담사님, 정말 감사드립니다!',2453),(2867,'2019-11-20 00:00:00.000000',5,'처음에는 단순히 남친을 원망하고 기억을 지우고싶다는 생각이었는데, 상담하다보니깐 제 자신을 제가 자책하는 마음이 컸던 것 같아요.\n저는 실수할 수 있고 서투를 수 있는 사람이었는데 너무 스스로에게 호되지않았나 싶네요..\n그래도 아직 스스로를 이해하는 부분이 어려운 것 같아서 추가상담으로 좀 더 성숙해지고 싶어요!\n제 마음을 저보다 더 잘 아시는 상담사님 덕분에 홀가분해질 수 있게 되는것 같아요. 늘 감사합니다♡',2454),(2868,'2019-11-11 00:00:00.000000',5,'저한테 정말 큰힘이 되었습니다.',2455),(2869,'2019-11-08 00:00:00.000000',5,'상담사님이 솔직하게 말씀해주셔서 저도 편하고 솔직하게 이야기할 수 있었습니다. 상담을 응해주셨다는 거 자체가 고마웠습니다. 그리고 돌아보니 상담할때 잠시나마 제가 긍정적이었던 모습을 찾은 것 같아 기분이 좋습니다. 또 상담사님이 저의 말에 집중하셔서, 저의 말로부터 새로운 이야기를 끄집어내주신 점이 좋았습니다.',2456),(2870,'2019-11-08 00:00:00.000000',5,'일단은 상담사분이 솔직하게 말씀해주셔서 저도 참 마음이 편했어요. 오늘 내가 어떻게 말했나 생각해보니 예전에 긍정적이었던 모습이 잠시나마 겹쳐져서 기분이 좋았습니다. 오늘 상황이 어려웠는데도 상담해주셔서 감사합니다.',2456),(2871,'2019-11-04 00:00:00.000000',5,'겉으로 보기에는 멀쩡히 사회생활 잘 하는것처럼 보이고, 남들이 들으면 배부른 소리라고 할 법한 상황이라 어디가서 고민을 고민이라고 제대로 꺼내기도 힘들었어요. 혼자 우울과 무기력을 끌어안은채 자책만 했었습니다. 그러다 우연히 프로스트를 알게 되었고, 유난히도 힘들던 날 바로 상담을 통해 처음 상담을 접했어요\n\n시작할때 두서없이 횡설수설했던것 같은데 상담사님이 잘 정리해주셔서 좋았어요. 또 상담사님은 제 고민거리가 자꾸 원점으로 돌아가도 친절하게 다양한 방향으로 벗어나는 법을 알려주셨어요. 제 생각을 전환할 수 있는 여러 방법들은 상담사님이 아니면 절대 몰랐을거에요. 단 몇 번의 상담으로 몇십년 동안 쌓은 생각이 한순간에 무너지지는 않겠죠. 그러나 분명 균열이 생겼을거에요. 이제 서서히 허물어갈 수 있을 것 같습니다. \n\n혹시 \'내 문제가 상담할만한 거리인가?\' 라고 생각하시는 분들께 주저 말고 시작해보라고 추천드리고 싶습니다 :)\n\n 상담사님, 덕분에 마지막 상담까지 매우 유익한 시간이 되었어요. 여행 잘 다녀올게요 감사합니다!!',2457),(2872,'2019-11-04 00:00:00.000000',5,'오늘 처음으로 상담받아봤는데  정말 상담받기를 잘 했는 것 같습니다 오늘 너무 감사합니다 속이 시원하네요 \n조금  더 빨리 상담을 받았으면 좋았을 걸  그런 생각이 듭니다 너무 감사합니다',2446),(2873,'2019-10-31 00:00:00.000000',5,'제 스스로 어떤 것에 대해서 목마름을 느끼고 있는지 잘 모르겠어서 답답함을 느끼고 있었습니다. 그런 와중에 상담사님과 상담을 통해서 제가 무엇을 갈구해왔는지 정확하게 알 수 있었어요. 이번 상담이 제 자신에 대한 큰 변화를 시작할 수 있는 계기가 되었습니다. 정말 많은 도움 되었어요. 감사합니다 :)',2458),(2874,'2019-10-30 00:00:00.000000',5,'처음 상담을 받으시는 분께 진심으로 추천드려요. 뭔가 문제가 있는 것 같은데 뭔지는 모르겠고, 어떻게 해결할지도 모를 때 전문적이고도 편안한 상담으로 문제의 발견부터 해결까지 도와주시고, 이 과정을 상담사분께서 전적으로 제공해주시는 게 아닌 제가 스스로 할 수 있도록 격려해주세요. 그 모든 과정으로 위로를 받고 변할 수 있겠다는 자신감이 생겨요. 정말 추천드립니다.',2453),(2875,'2019-10-16 00:00:00.000000',5,'추가상담이었는데 언제나 좋은 말씀 주시고 용기를 주셔서 감사했어요!!',2459),(2876,'2019-10-15 00:00:00.000000',5,'제가 가진 문제에 대해 이런저런 생각이 많은 상태에서 상담을 찾았는데,\n상담사님과 대화 과정에서 본질적 문제를 찾을 수 있었습니다.\n사실 텍스트로 상담을 하기엔 50분의 시간이 무척 짧더라구요...\n그렇지만 앞으로의 상담에서 차근차근 제 감정을 마주하는 법을 배우고 문제의 해결에 가까워질 수 있으리라 생각합니다.\n감사합니다!^^',2460),(2877,'2019-10-14 00:00:00.000000',5,'쉽게 찾아오는 우울감에 어쩔 줄 몰라 상담신청을 했는데 상담을 통해서 한결 마음도 가벼워지고 저의 우울감이 어디서 오는 건지 다시 한 번 찾아볼 수 있었어요.\n텍스트상담이었지만 답답하지 않게 질문과 답변을 해주셔서 좋았고요\n부담스럽지 않고 따듯하게 권유해주시는 것도 좋았습니다.\n또 힘들어서 상담을 필요로 할 때면 다시 선생님께 신청하고 싶어요',2461),(2878,'2019-10-13 00:00:00.000000',5,'친절하게 상담해주셔서 감사해요.\n예민해져 있었는데... 해답을 알려주셨네요.\n이 상담으로 당분간 버틸수 있을꺼같아요.\n또 힘들어지면 상담신청할께요.\n오늘 너무 감사했어요. 마음이 훨씬 가벼워졌어요...',2462),(2879,'2019-10-12 00:00:00.000000',5,'열심히 준비해오던 일을 포기하고서 자존감이 많이 떨어져있었는데 상담사님이 저 자신도 인식하지 못했던 문제를 콕! 집어주셔서 마음이 가벼워졌어요ㅎㅎ 상담 받으면서 행복해지는 비결을 전수받은 것 같아요',2463),(2880,'2019-10-11 00:00:00.000000',5,'저의 말을 잘 들어주시는 것 뿐만아니라 그에 맞는 말씀을 해주십니다. 저의 말에 깊게 들어주시고 깊게 고민해주셨다는 증거 겠죠!- \n\n50분이후에 맘도 편해졌구 더 알아봐서 상담을 더 해볼 계획입니당-:\n',2410),(2881,'2019-10-09 00:00:00.000000',5,'제가 하고자 하는 말들과 의미를 너무 잘 캐치 해주셔서 상담 들어갈때마다 맘 편하게 대화할수 있었고 공감해주시는것과 적절한 솔루션을 이끌어내주신점도 도움이 많이 되었고 무엇보다 항상 친절한 태도로 대해주시고 진짜 성심성의껏 상담해주시는게 느껴져서 정말 좋았습니다 :3\n\n',2464),(2882,'2019-10-08 00:00:00.000000',5,'제 스스로가 많이 지쳤구나를 많이 느꼈습니다 .\n50분이 너무 짧게 느껴질 정도로 유익하고 솔직해지는 시간이였어요 . 저는 앞으로 추가 상담을 받을 예정이구요, 많은 변화가 생기길 바라면서 ',2465),(2883,'2019-10-07 00:00:00.000000',5,'지금 상태에서 무엇이 우선순위인지 알려주어서 더 나은상태로의 변화에 방향을 잡을 수 있었습니다!\n사실 지금 어디로 어떻게 가야할지 모르겠는 상태라, 앞에서 함께해줄 지도자 역할이 필요했는데 \n선생님이 잘 이끌어주셔서 다음 상담도 할 예정입니다!\n감사합니다 :)\n',2466),(2884,'2019-10-04 00:00:00.000000',5,'내자신이 화를 내지말기  처음엔 상담하기가 어려웠지만 누군가가 내이야기울 들어주고 호웅 해준거에 대해서 감사드립니다',2467),(2885,'2019-09-25 00:00:00.000000',5,'처음에는 별 기대없이 상담했는데 생각보다 많은걸 느낀것 같아요. 혼자서는 힘들수 있지만 이렇게 얘기하면서 방향도 잡은 것 같구요. 다른 사람들과 행복의 출발이 느릴수도 있지만 그게 문제가 아니라 앞으로 내가 따라잡을 수 있다는 희망을 주셨어요. 감사합니다. ',2423),(2886,'2019-09-19 00:00:00.000000',5,'상담을 통해 스스로 깨닫지 못했던 나의 가치관, 모습들을 발견할 수 있었습니다. \n제 생각을 쏟아냈을 때, 그 내용들을 차분히 정리해주시고, 이 과정 속에서 그 생각에 대한 원인과 이유들을 생각 볼 수 있도록 이끌어 주시는 점이 특히 좋았습니다. \n조언 속에서 도움을 얻기도 했지만, 다른 관점에서의 질문을 주셨을 때 답하는 과정 속에서 스스로 깨닫거나 정리되는 부분도 많았습니다.\n단순한 위로가 아닌 실질적 도움과 치유를 얻고자 상담을 진행하였고, 상담을 통해 많은 도움을 얻을 수 있었습니다. 감사합니다.\n\n',2468),(2887,'2019-09-16 00:00:00.000000',5,'체계적인 방향을 잡아주셔서 감사합니다\n좀 더 힘내볼게요\n감사합니다',2469),(2888,'2019-09-11 00:00:00.000000',5,'객관적 상황판단과 함께 실질적인 해결방책을 함께 모색할 수 있어서 너무 좋았습니다. 그 동안 \'내 잘못\' 인 줄만 알았던 일이 내 잘못이 아니라 상황이 만든건 아닐런지 다시 곱씹어 보게 됩니다. \n감사해요. \n같은 문제로 또 힘들어지게되더라도 오늘 해 주신 말씀 잘 새겨서 저답게 잘 극복해내고 싶습니다.\n\n\n\n\n\n\n',2470),(2889,'2019-09-09 00:00:00.000000',5,'저랑 맞는분 찾느라 많이 헤맸는데 드디어 만난것 같아서좋아요. 횡설수설해도 요지를 바로 캐치하시는게 인상깊었고 자세한 설명도 덧붙여주셔서 좋았어요 :)',2471),(2890,'2019-09-08 00:00:00.000000',5,'해결책을 제시해주셔서 좋았습니다.',2472),(2891,'2019-08-22 00:00:00.000000',5,'생각할 방향을 잘 잡아주시고, 당연한 것인데도 미처 놓치고 있었던 부분을 말해주시면서 다시 생각하도록 도와주시고, 위로와 상담 진행을 한 쪽으로 치우치지않게 잘 이끌어 주시는 분입니다. 한달 전에 그냥 막연히 시작했는데도 지금은 변화하려는 제 모습이 보이네요. 감사했습니다.\n제대로 말을 못해드렸지만 상담하면서 변한 점이 사소한 것들 부터 정말 많아요! 선생님이 해주셨던 말씀들 자주 떠올리며 별에 더 집중하겠습니다! ',2473),(2892,'2019-08-18 00:00:00.000000',5,'많은 도움이 되었어요 스스로를 칭찬하는 시간을 많이 가져볼게요 감사합니다~~\n',2474),(2893,'2019-08-15 00:00:00.000000',5,'네 만족합니다',2475),(2894,'2019-08-04 00:00:00.000000',5,'도움이 많이 되었습니다.',2476),(2895,'2019-08-04 00:00:00.000000',5,'아무 희망이 없고 절대 변할 수 없을 것 같았는데 상담하면서 점점 힘들었던 마음을 자세히 보게되고 해결할 수 있는 길을 찾게 된 것 같아서 좋았습니다. 누군가 내 마음을 공감해주고 위로해준다는게 큰 힘이 되네요. 부산까지 가는 길 포기하지 않고 잘 가볼게요..!',2477),(2896,'2019-08-01 00:00:00.000000',5,'별 것 아닌 거 같은 고민이라 많이 망설이다가 상담 받았습니다\n저도 인지하지 못했던 근본적인 제 고민을 알아채주셔서\n그리고 공감해주시고 이런저런 말씀 해주셔서\n두번째 상담 때는 조금 눈물이 났어요\n\n또다시 제 마음이 sos를 친다면 꼭 선생님 찾아뵐게요\n감사합니다!\n\n',2478),(2897,'2019-08-01 00:00:00.000000',5,'주변에 시선을 뺏기지 않고 본질을 바로 볼 수 있는 시간이었습니다. ',2479),(2898,'2019-07-27 00:00:00.000000',5,'항상 도움되는 말 들 감사합니다. 자존감도 높아졌고 고민이 많이 해결 되었어요. 또한 앞선 고민이 사라지고 나니까 다른 고민거리가 생겼는데 이것 또한 목표로 잡고 해결해볼게요 이직 하면 소식 전하러 올게요~\n',2480),(2899,'2019-07-25 00:00:00.000000',5,'과자폭식때문에 늘 답답했던 마음도 정리되고\n근본적인 원인도 알게되어 많은 도움이 되었습니다.\n구체적인 방안과 근본적인 원인을 같이 고민해주시고 고민만 해주시는것이 아니라 실질적으로 도움이 될만한 해결책도 제안해주시니 이제 다시 극복할 힘이 생겼어요\n식이장애 또는 강박이 조금이라도 있으신분들에게도 많은 도움이 될거 같습니다~!\n\n',2410),(2900,'2019-07-22 00:00:00.000000',3.5,'그냥 기분좋게 원인 파악하고 이야기할수 있었던 시간이었습니다.\n감사합니다',2481),(2901,'2019-07-20 00:00:00.000000',5,'깊은 이해와 통찰력으로 공감해주셔서 위로도 받고 새로운 시각으로 바라볼 수 있는 희망도 생겼습니다.',2482),(2902,'2019-07-16 00:00:00.000000',5,'불안때문에 많이 초조한 상태에서 상담 진행했지만 친절하시고, 또 잘 들어주셔서 감사했습니다. 시간이 짧아 많은 얘기를 전달하진 못하다보니, 공감이나 위로보다는 제가 겪은 일들을 제가 바라보는 시선을 교정해주신 게 더 컸던 것 같아요. 모든 ‘나’를 발견할 순 없었지만, 혼자서는 스스로의 두려운 지점이나 자존심 때문에 무의식 중에 인정하기 싫었던 부분을 짚어주셨기 때문에 상담사님과 함께 만난 ‘나’를 돌이켜 볼 수 있게 되었어요. 말씀해주신 내용 다시 곱씹어보며 객관화 해보겠습니다. ',2483),(2903,'2019-07-13 00:00:00.000000',5,'상담사님께 어떻게 제 이야기를 전해야할지도 정리해보지 못하고 상담을 시작했는데요 , 짧은시간안에 제가 이야기를 잘 풀어낼수 있도록 정확하게 잘 리드해 주셨습니다. 그리고 잘 이해해주셨고 공감, 위로, 또 제 문제에 대해서 그게 시작된 지점을 잘 생각할수 있게 해주셔서 마음이 참 명쾌한 동시에, 앞으로 어떤 노력을 해보면 좋을지까지 제시해주셨습니다. 제가 필요로 하던 모든것들이 충족된 상담이었습니다 ^^ 감사합니다.\n',2484),(2904,'2019-07-13 00:00:00.000000',5,'선생님께서 잘 들어주시고 듣는걸로 그치는 것이 아니라 감사한 조언으로 저에게 힘을 주셨어요 감사합니다!',2474),(2905,'2019-07-12 00:00:00.000000',5,'남들에게 말하지 못한 고민들이 있었는데 정말 잘 들어주셔서 감사하고 말을 너무 위로가 되게끔 잘 하시는 것 같아요. 많은 도움 되었고 전화 하면서 힐링이 되었습니다 감사합니다\n',2480),(2906,'2019-07-12 00:00:00.000000',5,'위안만 얻으면 다행이라고 생각했는데, 제가 겪고 있는 문제에 실질적으로 대처할 수 있는 방법까지 찾아내도록 도와주셨어요. 많은 도움이 되었습니다!',2474),(2907,'2019-07-12 00:00:00.000000',5,'생각지못한관점을말씀해주셔서 다시한번생각해볼수있었습니다 적절히 감정을 흘러보내는연습이 필요할거같아요\n',2485),(2908,'2019-07-10 00:00:00.000000',5,'안녕하세요 쌤!\n롤과 류준열이야기로 예시를 들어주셔서 좀더 저에게 맞게 이해가 된것같아요 저는 바보라서 말만들으면 잘 이해를 못하거든요ㅎㅎ\n음 고민을 생각할때, 나는 왜 자존감이낮지? 왜 부정적이지? 이런 내가 싫어. 라는 생각이였어요 그래서 상담신청을 한거고요. 처음엔 쌤이 제가 스스로를 모른다고, 관심을 가져주라했을때 그냥 아그렇구나 이런느낌이었는데 예시들어주시면서 어떻게 방향을 잡아야 하는지 알려주신거같아요 쌤이 관점을 달리해서, 고쳐보려는 나에 대해 관심을가져주라고 하셨을때 뭔가 딱콩한느낌? 이었달까.... 저는 어느구석에라도 예쁜모습이 없는데\n어떻게 그걸발견할까 했어요 근데 \'고쳐보려는 나\'라는게...\n나름 내안에서 이쁜구석이라는걸 일깨워주셨어요\n대화시간이 50분이라는게 너무나 짧다고 느껴졌고 아직은 두리뭉실해서 다음엔 길게 해보려구요 조금이나마 행복을 주셔서 감사합니다.늦은시간에 고생하셨어요\n',2486),(2909,'2019-05-22 00:00:00.000000',5,'진로에 대한 막연함과 불안함이 컸는데, 상담을 통해 마음이 많이 편안해졌습니다! 좋은 말씀 감사해요:) 말씀해주신 대로 남은 기간동안 제 목표를 향해 느리지만 꾸준히 전진하겠습니다ㅎㅎ',2487),(2910,'2019-06-11 00:00:00.000000',5,'첫 트로스트 후기네요.\n모르는 사람에게 진심어린 위로의 말을 들으니\n참 어색하기도 하고 쑥스럽기도했는데\n진작에 이런 진심어린 위로를 받을 수 있었으면 지금처럼 힘들진 않았겠구나 하는 생각이 들었습니다.\n저의 이야기를 더 많이 들어주시려 노력해주셨고 계속해서 질문해주시며 제 마음을 많이 차분하게 만들어주셨던 것 같아요.\n방향이 어긋나지 않도록 계속 잡아주시고 어떻게보면 뻔하지만 귀담아 듣지 않앗던 부분들도 마음에 와닿는 걸 보니 선생님 덕분에 많은 위로가 된 것 같아요~\n감사합니다^^\n\n\n\n',2488),(2911,'2019-05-23 00:00:00.000000',5,'편하게 다가와주신거같아서 좋았습니다. 상담할때는 가끔 무언가를 숨기고싶지만 딱딱 캐치해주시니 숨기지않고 편하게 말하게되네요. 짧은 시간이 아쉽긴하지만 조언을 많이해주시니 좋았어요. 고민됐던걸 다른 관점으로 한번 더 생각해주시고 이렇게하면 어떨까요 하고 한번 정리해주시고 다시 생각하게 되는 상담이되었습니다. ',2489),(2912,'2019-05-23 00:00:00.000000',5,'우선 상담 후 제가 갖고 있는 문제의 원인이 뭔지 알게된 거 같아서 마음이 정말 후련했어요ㅠ\n앞으로 제가 나아가야 할 방향, 그리고 중간중간 짚어주시는 포인트 들을 들으면서 제가 놓치고 있는 것들도 되새길 수 있는 시간이었습니다\n',2490),(2913,'2019-06-13 00:00:00.000000',5,'제가 어떤 상황에서 받은 느낌에 대해 명쾌하게 정리해 주시고 구체적인 행동 방식의 변화 방법을 말씀해 주샸습니다.\n',2491),(2914,'2019-07-01 00:00:00.000000',5,'너무 많은 생각으로 인해서 힘들었는데 선생님께서 알려주신 방법으로 실천해보려구 합니다. \n1시간동안 들어주시고 질문도 해주시고 마지막에 해결 방법을 어렵지 않게 알려주셔서 지금부터 천천히 실천해보겠습니다. \n선생님은 해결하는 방법을 잘 알려주시는거 같아요^^ 센터 가려면 금액이나 시간 같은 부분에서 좀 부담 되었는데 이렇게 좋은 어플 알게되어서 좋네요 감사합니다 ',2492),(2915,'2019-06-14 00:00:00.000000',5,'많은 부분을 공감 해주시고..들어 주셔서 상담.받는 내내 너무 편안히 대화 나눌수 있어 너무나.행복했습니다. 다른 사람들에게\n나눌수 없고.정말 마음이.힘들고 지칠때 똑똑똑 찾아오세요.',2493),(2916,'2019-05-25 00:00:00.000000',5,'임신출산육아의 문제에 맞닥뜨리며 여러면에서 한계에 부딪힐때 도저히 혼자서는 감당할 수 없겠다는 급박함이 트로스트의 박소형선생님과 연결하게 해주었던 것 같습니다. 감정일기를 쓰며 반복되는 우울과 무기력, 폭식의 패턴을 차츰 알게되었고 문제해결의 실마리를 잡은 것 같아 희망을 발견한 기분입니다. 아직까지 혼자서 나로 서는 연습이 자신이 없기에 선생님과의 계속적인 상담을 통해 훈련하고 성장하고 싶습니다. 절망 중 큰 힘이 되었어요. 정말 감사합니다.',2494),(2917,'2019-07-02 00:00:00.000000',5,'며칠동안 망설이다가 상담을 받았는데 제가 잘 얘기한건 아니지만 잘 들어주시고 차분하게 조언도 해주셔서 좋았어요. 그 조언들이 많은 도움이 되었네요. 정말 감사합니다:)',2495),(2918,'2019-07-03 00:00:00.000000',5,'(선생님께서 알아볼 수 있도록 슈퍼마리오 인형을 흔들고 있음)\n\n2주 2번 상담을 받았어요! 차근차근 친절하게 다 들어주시고 공감해주셔서 너무 좋았어요. 1회차 상담이 끝나고 나니 생각이 많이 정리되어서 2회차에는 확실히 스스로가 변화했다는 느낌이 들었어요. \n정말 고맙습니다. 도움이 또 필요하면 찾아올게요. 쌤 또 만나요!',2496),(2919,'2019-05-27 00:00:00.000000',4.5,'제가 표현한것들에 비해 마음을 잘 읽어주셨어요~ 좋은 조언들도 많이 해주셔서 도움을 많이 받았답니다..^^ 선생님 이야기가 더 듣고싶어서 제가 말을 많이 하지 않았는데, 조금 힘드셨겠구나 하는 생각도 드네요ㅜㅜㅋ',2497),(2920,'2019-07-03 00:00:00.000000',5,'짧은시간이였지만 제일 중요한 시작을 알려주셔서 방향을 잡은거같아요 감사합니다 텍스트바로상담이라 너무 정리가 안된 앞뒤도 안맞는 고민내용까지 차분하게 집중하게 해주셔서 너무 감사했습니다',2498),(2921,'2019-05-27 00:00:00.000000',5,'최근 고민의 해결방안에 대해 상담하고싶었는데 \n고민을 해결할수있는 방안을 같이 잘 찾아봐주셔서\n 너무 좋았습니다.',2499),(2922,'2019-06-18 00:00:00.000000',5,' 답답한 현재 상황에서 조금은 벗어날 수 있도록 용기를 주신 것 같아요. 글로 쓰는 것이더라도 1년간 누적되었던 고민이라서 이야기하는데 두서가 없었거든요. 하지만 잘 정리해서 말씀해주셨고 짧은 시간이라 모든 고민과 문제들을 이야기 할 수 없었지만 일단 시작할 수 있는 포인트를 집어주신 점 감사합니다. 말씀해주신대로 시작해볼께요! 공감해주신거 그리고 격려해주신거 감사드립니다:)',2500),(2923,'2019-05-30 00:00:00.000000',5,'상담사 선생님께서 제가 하고 싶은 이야기를 할 수 있도록 잘 이끌어 주셔서 좋았습니다. 이야기를 잘 들어주시고, 진심으로 그에 대한 조언을 해주시는 게 느껴집니다. 짧은 기간이었지만, 제가 원하는 방향으로 삶을 바꿀 수 있다는 희망을 얻었어요. 감사합니다!',2501),(2924,'2019-06-20 00:00:00.000000',5,'처음 받아보는 상담이라 두서없이 막 말한거같은데 다 잘받아주셔서 감사했습니다 그리고 쫌 충격받을 정도로 다시 좋은쪽으로 깊게 생각하는 시간을 보내는거같습니다\n',2502),(2925,'2019-07-08 00:00:00.000000',5,'일단 말하는 중간중간에\n원하는 니즈를 말씀해주셔서 너무 좋았고\n정신없이 대화해도\n흐트럼없이 캐치를 잘하시는것 같아요\n타이핑이라 좀 하지말까 하는 마음이 \n들다가도 자세히 보면 또 재미잇엇고\n행복한 시간이었던거 같아요 :)\n원래 다른곳에서 상담을 받앗다가 트라우마가 \n있어서 약먹을 생각조차 하지않았는데\n상담사님 만나고 나서\n병원을 찾아볼 생각까지햇어요.\n지금 이렇게 힘든것들이 다 지나갈거라고 말하시는것 같아서\n너무 기뻣고.\n또 추가해서 상담할 의향이 있습니다.상담후\n스스로 아껴야할 이유가 생겻네요.',2503),(2926,'2019-05-31 00:00:00.000000',5,'얘기를 편안하게 들어주시고 제 고민을 진심으로 같이 나눠주시는 기분이 들어 좋았습니다. 그냥 얘기를 하는 것 만으로도 마음이 편안해졌고 안정된 것 같아 감사하고 좋은 시간이였습니다. 감사합니다^^',2504),(2927,'2019-06-01 00:00:00.000000',5,'잘 들어주셔서 감사하고 하면서 눈물도 났어요 정말 감사합니당\n',2505),(2928,'2019-06-01 00:00:00.000000',5,'제 고민을 따뜻하게 들어주시고 전혀 생각지도 못했던 새로운 해결책을 들을 수 있어서 감사한 시간이였어요 :) 선생님이 말씀해주신 대로 다른 방향으로 더 생각해 보고자 노력하고 고민 있으면 또 뵙도록 하겠습니다!',2506),(2929,'2019-06-01 00:00:00.000000',5,'속 이야기를 할 수 있어서 좋았습니다. 제가 생각치 못한 해결책이나 말씀을 해주셔서 위로가 되었어요!!\n',2507),(2930,'2019-06-02 00:00:00.000000',5,'제 입장에서는 너무 어려운 때에 상담사님을 만났어요 다행히도 상담사님이 편하게 이야기를 들어주시고 제가 혼자서 정리하기힘든부분을 짚어주시고 함께 정리하는 시간을 가졌답니다 2번 밖에 상담을 하지못해서 급한 불만 끈 느낌이 있어요ㅎㅎ 그래도 저에겐 도움이 되었습니다. 감사합니다 ^^',2508),(2931,'2019-06-03 00:00:00.000000',5,'스스로 생각하게 해주셔서 감사합니다. \n',2509),(2932,'2019-07-10 00:00:00.000000',5,'고민때문에 힘들어하면서도 내 고민 정도면 너무 약한 것 아닌가? 이런걸로 상담받아도 되나 하는 생각에 한동안 계속 망설였지만 생각을 정리할 수 있게 질문도 잘 해주시고 진지하게 상담해주신 덕에 머리가 복잡하고 혼란스러웠던 것이 중심이 잡히게 되어서 감사해요. 여유가 될때 또 상담 받고 싶어요. ',2510),(2933,'2019-06-03 00:00:00.000000',5,'다른시각을 얻을 수 있었습니다. 감사합니다.',2511),(2934,'2019-06-05 00:00:00.000000',5,'제 고민을 들어주시고 해결방안을 찾아주시려고 노력 많이 해주셨습니다. 친절하게 대해주셔서 감사합니다.\n나중에 힘들때 찾아 뵐께요 ㅎㅎ ',2512),(2935,'2019-06-26 00:00:00.000000',5,'혼자서는 닿지 못 했던, 희망적인 생각의 방향을 찾았어요. 상담을 받을 때면 착하고 단순한 아이가 되어버린 느낌이에요. 두 회기 동안 감사했습니다. 다른 문제가 부각될 때, 또 찾아뵐게요!',2513),(2936,'2019-06-08 00:00:00.000000',5,'우울감이 들면 왜 그런 감정이 들었는지 그 깊은 내면의 나와 대화하는 것이 익숙치가 않았고 하더라도 대충 이렇겠지 하는 생각으로 끝났는데 상담사님이랑 대화를 나누면서 상담사님이 경청도 해주시고 기억도 잘해주시고 제가 들었던 감정에 계속 질문을 던져주셔서 근본적인 것을 마주하는데 도움이 되었습니다. 상담을 신청했을 때는 큰 기대안하고 내 말을 들어줄 사람이 생겼다는 것만으로도 위안이 되었는데 상담하면서 새롭게 알게 된 것도 많았고 탄력을 받은 기분입니다. 여러모로 도움이 되었습니다! 감사합니다',2514),(2937,'2019-06-09 00:00:00.000000',5,'정말 많이 좋아졌어요.\n한 번 하고 일주일새 변화가 많이 찾아왔어요!\n상담도 친절하고 편안하게 잘 해주셨어요♡♡\n고민도 들어주시고 칭찬과 위로도 해주시고 ㅠㅠ 용기도 많이 얻었어요\n제시해주신 해결책도 저에게 많은 도움이 되었어요!\n상담받길 정말 잘 한 것 같아요.\n다음에 또 무슨 일이 생긴다면 다시 찾아올게요.\n감사합니다 상담사님 ♡♡',2515),(2938,'2019-06-10 00:00:00.000000',5,'다른 관점에서도 문제를 확인할 수 있었습니다.',2516),(2939,'2019-05-21 00:00:00.000000',5,'다른 상담사 분과 대화하다 좀 부족해서 뵙게된 상담사님입니다!정말 시간이 훌쩍 지나갈 정도로 말씀을 잘해주셨고 가끔 눈물이 날거같기도 했고 몰랐었던 감정에 대해서 알게 해주셔서 좋았어요!너무 만족스러웠고 살아가면서 또 상담이 필요할때 다시 찾게 될거같아요!\n공감도 잘 해주시고 이해도 잘해주시지만 이성적이면서도 부드러운 대화를 이끌어주시니까 여러분도 꼭 상담받아보세요!!!!\n',2517),(2940,'2019-05-21 00:00:00.000000',5,'짧은 상담이었지만 진심어린 위로와 조언을  해주셔서 많은 도움이 되었습니다 정말 감사드립니다:) 평가가 아니라 관심이라는 그 한 마디가 제 마음을 눈녹듯이 녹게 만들었어요 낮은평가를 받았다 라는 생각의 덫에 빠져서는 절망만하고 제대로 된 상황을 인지를 못하고있었는데 저도 몰랐던 제 부분을 탁 알고 조언을 해주셔서 마음잡는데 많이 도움이 되었어요!',2516),(2941,'2019-05-21 00:00:00.000000',5,'오랫동안 가져온 고민이기에 한번의 상담으로 크게 나아질거란 기대는 사실 없었어요. 그렇지만 상담 초반부터 저의 관념을 확 바꿔버리는 이야기를 해주셔서 순식간에 집중하게 되었어요. 그렇게 대화를 나누다보니 앞으로 어떻게 생각을 바꿔야하고 실천해나가야할지 방향이 잡혔습니다. 알려주신 방법들로 저의 문제를 조금씩 극복해볼게요! 그리고 또 도움 요청드릴게요:)',2518),(2942,'2020-06-17 00:00:00.000000',5,'연하영상담사님은 정서적 공감과 실질적인 조언을 둘 다 해주셔서 아픔을 가라앉히고 앞으로 나아가는데에 많이 도움이 됐습니다. 공감이 크게 필요하지 않다고 느꼈었는데 지지와 공감도 중요하다는 걸 알게 됐고 무엇보다 문제상황에 대해 실질적인 방향성을 제시해주셔서(나는 나를 보살필 줄 알아야 한다, 나를 이해시키는 연습을 ㅇㅇ하게 해야한다 등) 훨씬 편해졌어요. 추천드립니다!',2519),(2943,'2020-06-16 00:00:00.000000',5,'must의 삶을 살았던 제가 상담을 통해 can 의 삶도 살아갈 수 있게 되었어요',2520),(2944,'2020-06-10 00:00:00.000000',5,'감사했습니다.',2521),(2945,'2020-06-08 00:00:00.000000',5,'막막한 부분이 있었는데 조금이나마 해소된 거 같습니다 제자신 돌보면서 옆에서 잘 도와주고 싶어요 감사합니다',2522),(2946,'2020-06-03 00:00:00.000000',5,'짧은 시간이었지만 진심으로 들어주신 점\n해결책을 원한 방안에 대한 \n선생님의 생각,의문점을 던져 주셔서\n스스로 돌아보게 되는 생각을 하게 되어\n좋았습니다^^',2523),(2947,'2020-06-01 00:00:00.000000',5,'연하영 상담사님과 상담을 진행한지 꽤 되었는데\n점점 더 심리상담의 효과를 보고 있는거같아요.\n선생님께서는 공감을 잘해주시면서도 저에 대해 잘 파악하시면서\n적절한 과제와 질문을 통해 저의 내면을 끌어주시는것 같아요.\n항상 감사드리고 정말 추천드리는 분이예요.\n앞으로 당분간 상담을 지속할 생각이예요.',2524),(2948,'2020-05-29 00:00:00.000000',5,'연하영 상담사님 덕분에 정말 많은 도움이 되었습니다. 논리적으로 이해시켜주시고 공감도 해주시고, 다른 영혼없이 질문만 하는 상담사 분들이랑 다르게 실용적으로 정말 도움이 되었습니다. 저도 이번 4회에 만족해서 다음번 세션도 생각중입니다. 대인관계 고민이신 분들께 적극 추천드립니다!!',2525),(2949,'2020-05-21 00:00:00.000000',5,'감사합니다',2526),(2950,'2020-05-18 00:00:00.000000',5,'감사합니다',2527),(2951,'2020-05-14 00:00:00.000000',5,'두번째 회차이고, 제자신에 대해 생각하지 못했던 부분들을 돌이켜보면서 스스로에 대한 이해도가 높아졌습니다.\n 첫 상담때에 비해 마음이 많이 편안해진 것 같아요.\n곧 또 뵐게요 선생님!',2528),(2952,'2020-05-13 00:00:00.000000',5,'감사합니다',2526),(2953,'2020-05-05 00:00:00.000000',5,'상담의 방향을 정확히 짚어주시고\n무조건적인 지지와 위로가 아닌 현실적인 조언들이\n큰 도움이 되었습니다.\n공감을 잘해주시는 상태에서 정확한 지적과 방향성을 알려주시니\n미처 제가 생각하지못한 부분까지 돌아볼수있었고 \n마음의 큰 위안도 받았습니다.\n앞으로 완전히 극복할때까지 선생님과 좀 더 함께하려고 합니다.\n이런 어플이 있는지도 몰랐는데 우울의 끝에서 우연히 알게되어\n큰 도움을 받고있어 감사한 마음입니다.',2524),(2954,'2020-05-02 00:00:00.000000',5,'저의 상황과 심리상태를 정확히 알게 해주셔서 문제 해결에 \n한발짝 디딘것같아요 감사합니다\n',2520),(2955,'2020-04-24 00:00:00.000000',5,'제마음과 문제를 정확히 파악해주신것같아요 \n감사합니다..',2529),(2956,'2020-04-22 00:00:00.000000',5,'고민했던 부분을 차분하게 잘 들어주시고 이해해 주시고 마음이 급해서 생각나는대로 두서없이 말해도 생각정리가 될수있게 하나하나 정리를 도와주셨어요 \n내가 잘 이해한 부분과 부족한 부분도 구별해 주시고 제가 저에대한 채찍질만 한다고 당근을 주라고 조언해 주셨는데 잘 되지 않아서 망설일때도 격려해 주시면서 기다려주셔서 많은 도움이 되었어요\n처음 시작 전에는 계속 예약해두고 고민되어서 미루고 미루다했는데 전혀 후회없는 시간이었고 터닝포인트가 되었어요\n감사합니다♡ ',2530),(2957,'2020-04-21 00:00:00.000000',5,'감사합니다 앞으로 쭉 상담받아보고싶어요~\n',2531),(2958,'2020-04-16 00:00:00.000000',5,'많이 힘들때 되게 상담 많이 하다가 어느 정도 해결이 되서 한달만에 상담을 했는데 고민 해결도 됬지만 얘기를 나누고 나니 기분이 더 좋아졌어요 매번 후기 쓸때마다 말하는 거지만  트로스트에서 상담 5명 정도 받아보고 다 안 맞았었는데 마지막으로 상담 받아보고 탈퇴할 생각으로 하영쌤이랑 상담 했는데 하영쌤 만난 일이 제 인생에서 손꼽히는 일이 됬어요 다들 고민 마시고 하영쌤한테 받아 보세요 하영쌤 항상 감사해요ㅎㅎ 항상 너무 만족해서 이렇게 후기 쓰는데 알바쓰는 거 아니냐고 생각하실까 나름 자제 한 거예요 다들 화이팅 ❤️',2532),(2959,'2020-04-09 00:00:00.000000',5,' 제가 느끼거나 생각하는 바에 대해서 비교적 명확하게 짚어주셔서 좋았습니다. 뒤죽박죽 고민으로 뒤덮였던 머리가 명쾌해지는