991,'2019-07-25 00:00:00.000000',5,'마음 깊은 곳에 있던 이야기들을 가감없이 꺼낼 수 있었고, 편안하게 들어주셔서 저도 모르게 눈물이 나왔어요. 제 잘못이 아니라고 말씀해주시는 순간, 저 스스로도 자신을 용서할 수 있는 기분이었습니다. 사랑하는 가족을 위해 반드시 더 건강해지고 싶다고 했을 때, 그럴 수 있다고 응원해주고 격려해주셔서 큰 용기를 얻었습니다.',2559),(2992,'2019-07-23 00:00:00.000000',5,'감사합니다 답답한마음어디에도 이야기할곳없다 생각할때에 들어주셔서 너무감사합니다 \n\n',2560),(2993,'2019-07-22 00:00:00.000000',5,'바로후기를 남겼어야 했는데 늦어서 죄송합니다ㅜㅜ\n너무 도움이 되었구요 공감도 너무 잘해주시는거 같애여\n',2561),(2994,'2019-07-20 00:00:00.000000',5,'처음에 긴장되고 많이 떨렸는데 편하게 대해주시고 더 얘기 해보라고 해서 진짜 막힘없이 고민을 술술 다 말하게 된 거같아요!!!  문제의 원인을 콕콕 찝어주셔서 좋았습니다!!  시간이 이렇게 빨리 갈 지 몰랐네요 ㅠㅠㅠㅠ 감사합니다.',2562),(2995,'2019-07-19 00:00:00.000000',5,'감사합니다 또 감사합니다',2563),(2996,'2019-06-11 00:00:00.000000',5,'빠른 시간에 맥을 정확히 짚어주신 것 같아 감사합니다.',2564),(2997,'2019-07-08 00:00:00.000000',5,'연하영 상담사님과는 2번째 상담인데 너무 만족해요\n전에 다른 상담사 분이랑 상담했었는데.. 불만족 이어서 한 번만 더해 보고 아니다싶으면 삭제하려고했는데\n응원도 해주시고 해서 조금씩 나아질거같아요 !!!',2532),(2998,'2020-06-23 00:00:00.000000',5,'상담이라는것을 처음으로 받아봤습니다.\n절망적인 상황에서 이거라도 해봐야겠다고 신청을 했습니다. 누군가에게 이렇게까지 제 얘기를 해본적이 없는것같습니다. 선생님의 말씀 한마디 한마디가 제자신을 알게 하셨습니다. 얼마나 제자신을 사랑하지 않고 괴롭혔는지 상담 도중 눈물이 멈추지 않았습니다. \n저는 잘할수 있을것같습니다. 물론 쉽지 않겠지만\n포기하지 않고 제자신을 제일먼저 사랑하겠습니다. 제자신을 사랑해야 비로소 남을 진심으로 사랑할수 있을것같습니다. 상담시간을 훨씬 넘으셔도 오히려 제가 미안할정도로 상담을 해주시는 마음에 진심이 느껴졌습니다. 선생님 너무 감사드리고 너무 힘이 됐습니다. 또 뵙겠습니다.',2565),(2999,'2020-06-21 00:00:00.000000',5,'감정코칭 방법을 알려주셔서 감사합니다\n공감뿐만아니라 스스로 조절하는\n실질적인 방법을 말해주셔서 정말 좋았습니다\n정말 감사합니다 🤗',2566),(3000,'2020-06-21 00:00:00.000000',5,'텍스트테라피는 처음 받아보는데 만족스러워요 직접 대화하는 것보다 긴장도 덜 되고 생각할 시간이 충분해서 더 편안하게 상담했네요 상담사님께서 횡설수설한 제 이야기도 잘 들어주시고 원래 상담시간보다 더 오래 해주셔서 감동받았습니다 문제원인을 찾고 질문을 통해 스스로 깨닫게  해주시는 방법이 맘에 들었어요 ',2567),(3001,'2020-06-17 00:00:00.000000',5,'매우 유익한 상담이었습니다\n',2568),(3002,'2020-06-16 00:00:00.000000',5,'응원해주셔서 감사했습니다.\n위로가 된 것 같아요.',2569),(3003,'2020-06-15 00:00:00.000000',5,'항상 정성스런 상담 감사드립니다. 전 꽤 오래 상담을 받았는데요 한번 상담할때 마다 많이 좋아졌답니다. 이제는 정말 많이 좋아져서 몇달에 한번 상담받을 정도가 되었습니다. 상담도 중요하지만 무엇보다 내담자의 태도가 중요하다고 하셨던 말씀이 생각납니다. 저도 상담 받다가 자포자기했다면 지금의 저도 없었겠죠! 하지만 저를 다독여가며 여기까지 이끌어 주신 상담사님께 감사할뿐이랍니다 😊👍 ',2570),(3004,'2020-06-14 00:00:00.000000',5,'평소에도 스스로 감정표현을 잘 안한다고 생각은 해왔지만\n이렇게나 무의식 중에 감정표현을 안하려고 하고 있었는지 \n몰라서 상당히 놀랐습니다.\n앞으로 상담을 통해서 감정표현을 잘하게 되는 제가 되었으면 좋겠습니다.',2571),(3005,'2020-06-13 00:00:00.000000',5,'제가 가장 듣고싶은 말을 해주셨습니다\n그것만으로도 정말 큰 위안을 받아서 정말 감사했습니다\n다음번에도 힘들때 찾아오고 싶을정도로요!',2572),(3006,'2020-06-12 00:00:00.000000',5,'많이 망설이다가 신청하게된 상담인데 많은 도움이 되었어요. \'누가 날 이해해 줄 수 있을까?\' 이런 생각이 많았는데 그 누구보다 나 자신이 나를 이해하고 보듬어주어야한다는 걸 배우게 되었어요. 나의 감정을 조금더 알아가고 이해하고 안좋은 감정을 좋은감정으로 바꾸는것도 나를 위한 선택이라는 것도 배웠습니다. 상담을 통해 알게된것들을 잘 적용하면 자존감도 높아지고 무엇보다 제 자신이 좀더 편안하고 행복할 수 있을것같아요. 상담사 선생님 감사합니다!:)',2573),(3007,'2020-06-12 00:00:00.000000',5,'우울한 생각에만 빠져서 지냈었는데 막혀있던 사고를 확 뚫어주셨어요. 생각이 전환됫고 긍정적인 변화가 조금씩 찾아오고 있어요. 너무 큰 도움이 됫고 위로받고..사랑받고 칭찬받는 시간이였습니다. 진심으로 감사드립니다.',2574),(3008,'2020-06-11 00:00:00.000000',5,'친절하시고 제 얘기를 잘 들어주셨어요\n감정의 원인을 먼저 파악하고 지금의 제가 형성되기 까지 경험했던 부정적인 감정을 이성적으로 파악할수 있어서 노력할수 있겠금 좋은 정보와 시야를 주셨습니다.\n선생님 감사합니다\n감정일기 열심히 쓸게요 ',2575),(3009,'2020-06-10 00:00:00.000000',5,'혼자만의 생각으로 더 파고들지 않고 멈출 수 있었어요. 아 맞아 이렇게 해야하지! 하고 긍정적이고 생산적인 방향으로 물꼬를 틀 수 있었습니다. 늦은 시간에 에너지 넘치게 상담 해주셔서 감사해요^^',2576),(3010,'2020-06-09 00:00:00.000000',5,'내가 누구인지 기억이 나지도 않을 많큼 .. \n무얼위해 살아야 하는지 무기력하고 \n아무의지도 없이 인생 실패했단 생각에 \n몇년을 저를 방치한채로 지냈습니다\n세상에 나혼자 인것같아 맘붙일곳 없던 저에게 \n누구보다 열심히 살았다 고생했다 인정해주시는 \n그말 한마디가 너무 큰 위로가 됩니다\n긴시간 힘들어했고 이제 죽고싶은 생각은 사라졌지만\n사는게 벌같고 이대로 있다간 죽는게 답인거 같아 \n나한테서 도망치고 싶어 상담 문의 드렸네요\n한번의 상담으로 몇년간의 마음의 병이 나을순 없지만 \n선생님께 더 상담받고 싶은 긍정적인 맘이 생겼습니다 \n오늘 같이 아파해주시고 \n진심으로 저를 위해 말씀해주셔서 정말 감사드립니다',2577),(3011,'2020-06-07 00:00:00.000000',5,'시간이 지나서까지도 이야기 해 주셔서 감사했어요\n짧은시간인데도 핵심을 정확하게 짚어내 주셨고\n더 이야기 나누고싶어요 계속 상담받으려구요 ',2578),(3012,'2020-06-06 00:00:00.000000',5,'선생님 잘 들어주셔서 감사합니다 고민을 털어놓을 수 있었어요.. ',2579),(3013,'2020-06-01 00:00:00.000000',5,'일단 분노가 가득찬 상태에서 쉽게 말못하는것을 누군가가 끝까지 들어주고 있다는걸로도 위안이 됐는데, 여러가지 상황과 방법 예시까지 주시면서 적극적으로 변화할수있는 방향을 알려주셔서 도움이 많이 됐습니다.  비록 한번으로 극적이 변화가 오진않겠지만 어떤 부분을 노력해야하는지 알았습니다. 귀한시간 감사합니다!',2580),(3014,'2020-06-01 00:00:00.000000',5,'감사합니다\n\n',2581),(3015,'2020-05-31 00:00:00.000000',5,'별 생각없이 무슨 도움이 되겠어! 라는 생각이었는데 상담을 하다보니, 마음이 놓였습니다 ! 항상 내 잘못이라하고 생각했던 것을 어느정도는 놔주게 되었네요. 상담을 통해서 ~ 아무에게도 하지 못했던 말을 하게 되고 옆집 언니처럼 제 입장에서 대변해주셔서 감사했습니다! ',2582),(3016,'2020-05-30 00:00:00.000000',5,'제가 어릴적부터 겪었던 트라우마와 그에 따른 현재의 결핍 상황에 대해 너무 잘 이해해 주셨고 겉으로 호응이아닌 진심으로 저를 걱정해주시고 응원해 주시는 모습에 깊은 감사를 드립니다.\n제가 살아온동안의 세월이 한번에 정리되었고 마음이 참 따뜻해졋네요..많이 우울햇는데 저 잘 살아보고 싶다는생각 오랜만에 듭니다 감사합니다 ',2583),(3017,'2020-05-28 00:00:00.000000',5,'감사합니다. \n덕분에 스스로를 이해할 수 있는 계기가 되었어요\n 더욱 긍적적인 마음으로 지낼게요:)',2584),(3018,'2020-05-27 00:00:00.000000',5,'이번 상담도 만족스러웠습니다. 이전에 이어오던 상담과 마찬가지로 상담사님께서 신경 많이 써주셨고 그 덕분에 저도  이야기들을 털어 놓을 수 있었습니다. 매주 해오던 상담이 끝나고 이제는 가끔 상담은 받아도 될 정도로 불안감이 많이 줄었습니다. 감사합니다 상담사님 다음에 또 상담 부탁드려요~🙂',2570),(3019,'2020-05-27 00:00:00.000000',5,'솔직히 대면상담이 아니라 기대하지 않았는데\n제가 고민하는 부분들 잘 파악하고\n원하는게 무엇이지 질문을 통해 잘 이끌어주었어요\n답을 얻었어요만족합니다 감사해요^^\n ',2585),(3020,'2020-05-24 00:00:00.000000',5,'상담이 저에게 큰 도움이 되어서 감사한 마음에 후기를 씁니다. 처음엔 남에게 내 속마음을 털어놓을 수 있을까 걱정을 많이 했어요. 그런데 상담가님께서 잘 이끌어주셨습니다. 생각보다 깊은 얘기도 나눌 수 있었구요. 기대했던 것 이상으로 도움을 받았습니다. 대화 자체가 큰 위로가 되기도 했고, 상담사님께서 중간 중간에 던져주시는 전문적인 질문들에서도 문제 해결을 위한 도움을 받았습니다. 그리고 상담사님의 전반적인 밝은 분위기와 따뜻한 말씀이 저는 너무 좋았어요^^ 덕분에 제 얘기를 솔직히 할 수 있었던거 같아요. 4회권 상담을 통해 제 자신을 조금이나마 더 알게됐네요. 앞으로도 종종 단기 상담권 통해 상담 받으려고 합니다. 필요하신 분들이라면 상담 적극 추천드려요! :)',2586),(3021,'2020-05-23 00:00:00.000000',5,'전문가 분과의 상담은 처음이었습니다만 정서적 공감 이외에도 고민했던 것을 새로운 시점으로 바라볼 수 있게 되어 만족입니다. 복잡했던 머리가 잘 정리된 거 같습니다.\n다음에도 문제가 있다면 상담받고 싶습니다.',2587),(3022,'2020-05-23 00:00:00.000000',5,'공감해주시고 위로의응원도 감사했어요\n소통의한계가있지만 마지막상담때 언제나지지하고사랑한다구 따뜻한말한마디가 깊게위로되더라구요. .',2588),(3023,'2020-05-20 00:00:00.000000',5,'매우 만족스러운 상담이었습니다. 일단 잘 들어주셨고, 차분히 객관적인 조언을 주셨습니다.\n가장 인상적인것은 사람에 대한 케어를 잘 하신다는 것이었습니다.  힘든 와중에 온화한 말투와 누군가 나를 위해 귀기울여주시고 하시는 과정이 약간 과장하자면 인류애마저 느껴지는 상담이었습니다. 금번 상담을 계기로 평온한 인생이 펼쳐지기를 바래봅니다. 상담사님께 다시한번 감사드립니다.\n',2589),(3024,'2020-05-19 00:00:00.000000',5,'제가 힘들어하는 부분이 무엇인지, 왜 힘들어하게 되었는지를 정리해주셔서 좀 더 마음을 직시할 수 있었습니다.',2590),(3025,'2020-05-19 00:00:00.000000',5,'선생님께서 제 이야기를 들어주시고 공강해주시면서 많은 위로가 되었습니다. \n상담을 통해 저에대해 새로운 부분을 알게 되었고 \n선생님 덕분에 힘들게 생각하고 마음 한구석에 쌓여있던 감정들을 털어낼수 있었습니다. 앞으로 저 자신을 더 사랑하고 아껴주며 삶의 주인공이 되도록 노력해보려구요!!\n선생님 감사합니다 ❤❤❤\n',2591),(3026,'2020-05-19 00:00:00.000000',4,'차분하게 이야기를 들어주셨어요\n주어진 시간을 넘겼는데도 끝까지 최선을 다해주셨어요',2592),(3027,'2020-05-19 00:00:00.000000',5,'많은 도움이 되었습니다.',2593),(3028,'2020-05-18 00:00:00.000000',5,'제가 진짜 어떤분을 택해야할지 고민이 많아서 많은  선생님 후기를 다 찾아봤어요. 그러다가 후기가 너무 좋아서 무작정 4주차 신청하게 되었어요. 처음 갔을 때는 선생님이 \"소중한 ㅇㅇ님\"이라고 하시는 게 어색했는데 상담이 진행될수록 그게 존중받는 기분이 나서 너무 감사했습니다ㅠㅠ 저는 문제가 많다고 생각했는데 제 깊이 있는 부정적인 생각들을 선생님과 이야기 나누면서 많이 생각해보게 되었어요. 다른 분이 말하신 것처럼 어떠한 것에 대해 제게 먼저 질문을 해서 스스로 생각해보게 한 점이 너무너무 좋았어요ㅠㅠ 4주가 너무 짧게 느껴져서 아쉬워요 그래서 한번 더 신청할 예정입니당! \n\n선생님과 함께하면서 자기 자신을 사랑하는 방향성을 찾을 수 있어서 좋았어요. 아직은 막 시작하는 단계라 완성되진 않았지만 그래도 첫걸음을 함께 해주셔서 감사합니다 ㅎㅎ 계속 이야기 나눠보면서 제 인생을 찾고 싶어요. 감사합니다. ㅠㅠ 4주가 너무 짧네요ㅠㅠㅠ \n\n추천 100% 입니당~!~!~!~! 소중한 허혜정 선생님을 찾아주세요♡♡',2594),(3029,'2020-05-17 00:00:00.000000',5,'늦은시간에 답답했던 마음을 명쾌하게 뚫어주셔서 감사합니다 상담비용이 전혀 아깝지 않은 너무너무 힘이되고 감사한 상담이었어요 제가 그동안 잊고지낸 가장 중요한 부분을 상기시켜주셔서 감사합니다^^',2595),(3030,'2020-05-17 00:00:00.000000',5,'참 귀여우신것같아요 예시도 잘들어주시고 상담에도 잘 임해주시고..👍',2596),(3031,'2020-05-17 00:00:00.000000',5,'늦은시간까지 잘 들어줘서 감사합니다\n',2597),(3032,'2020-05-15 00:00:00.000000',5,'정말 막막하고 정리가 안되서 혼란스러운 상황이었는데 정해진 시간이 넘어서까지 따뜻하게 들어주시고 무엇이 그 마음 기저에 있었던건지 알 수 있게 도와주셔서 너무 만족했습니다. 인생에서 중요한게 무엇인지...무엇이 그걸 가로막고 있는지...상담이 끝나고 많이 명확해졌고 다른 많은 가능성들을 긍정적으로 볼 수 있을 것 같습니다. 감사합니다. 정말 필요한 시간이었는데 좋은 상담사분을 만나 운이 좋았던 것 같습니다. ',2598),(3033,'2020-05-14 00:00:00.000000',5,'상담사님 진심 어린 상담 정말 감사드려요ㅠㅠㅠ 울고 나니까 차라리 기분이 더 나아진 것 같아요. 사소한 말까지 공감해주시고 이해해주셔서 정말 큰 위로를 받았어요\n따뜻하게 응원해주셔서 감사하고 다음에 또 상담 신청할게요..!!',2599),(3034,'2020-05-13 00:00:00.000000',5,'내일처럼 공감해주시는 가운데 체계적인 상담을 받을 수 있었어요. 시중에 떠도는 잠언들에만 귀기울이지 않고 상담을 통하여 내면의 나에게 좀 더 집중할 수 있게 되었어요. 한걸음 나아간 느낌과 자신감을 얻은 상담이었습니다. ',2600),(3035,'2020-05-12 00:00:00.000000',5,'친절하십니다',2601),(3036,'2020-05-12 00:00:00.000000',5,'선생님 진짜 늦은새벽에 상담시간도 초과하면서 너무너누 감사합니다\n아직 너무 힘들지만 노력해 볼께요\n선생님과 한께 극복해 나아가길 희망합니다 ㅜㅠ\n',2597),(3037,'2020-05-11 00:00:00.000000',5,'전지금까지 저의 강한 신념이 저에게 강점인줄만 알고 살아왔어요\n상담사님과 상담을 통해서 그 강한 신념이 저에게 양날의 칼이었다는 것을 알게 되었어요\n지금으로서는 앞으로 나아질 수 있을지 자신이 없지만\n상담을 더 받아가면서 극복하고 싶어요\n',2571),(3038,'2020-05-10 00:00:00.000000',5,'잘해왔다는 것은 어느정도 알고있었지만 이게 옳은 방법인줄은 몰라서 마음의 확신이 없기때문에 괴로운점이 있었는데 두서없는 이야기를 매우 잘 경청해주시고 , 차근차근 생각을 정리해주셨어요 . 거기서 제가 듣고싶은 부분을 명확하게 콕 짚어서 해결방안도 내주시고 덕분에 막혀있던 고구마가 사이다로 해결되었네요~^^ \n감사합니다. 고민있으신 분들 주저하지 마시고 바로 상담 받아보세요 !',2602),(3039,'2020-05-10 00:00:00.000000',5,'늦은저녁시간 힘드실텐데 원래결재한 50분이 초과해도 차분히 제 얘기를 잘 들어주셨어요 \n제 상황을 잘 정리해서 다시 받아들여질 수 있도록 해주시고\n좋은점과 나쁜점 고쳤으면하는 점도 명확하게 알려주시구요 \n선생님께 의지를 많이 하고 있습니다\n더 나은 제가 되기위해 많이 도와주세요\n항상 감사드립니다',2597),(3040,'2020-05-09 00:00:00.000000',5,'매번 큰 도움 받고 있습니다. 진심으로 감사드려요~\n',2603),(3041,'2020-05-08 00:00:00.000000',5,'상담시간이 지나서도 따뜻한 마음을 담아 저의 힘듬에 대한 이해로 상담을 해주셨어요. 저의 깊은 곳에 있는 원인에 대해 고민할수 있도록 해주셨고, 당장 실천해볼 수 있는 처방전도 함께 받았습니다. \n\n저는 세분의 상담사와의 상담 경험이 있어요. 그 경험으로 보면 참 좋은 상담사 님이라고 생각합니다. \n\n',2604),(3042,'2020-05-07 00:00:00.000000',5,'알고는 있었지만 확실히 입밖으로 내진 못했던 생각들이 정리되었어요\n덕분에 집착에 대한 마음이 조금 나아졌어요\n단순히 사랑해서 아픈거라 생각했는데\n보상심리에 의해 억울해서 슬픈거라고는 생각못했거든요. 그렇게 생각하고 나니 상대방을 제외한 저 자신만을 들여다 볼 수 있게 되었어요\n준만큼 받지 않아도 된다는 마음\n아직은 잘 모르겠어요 받아들이기 힘들고 마음속에서 인정하고 싶지 않은것같아요\n무조건적인 사랑을 받길 원하는데 \n이런게 어릴적과 관련이 있는지\n뭘 낫게해야하는지도 모르겠어요\n이런 문제들이 앞으로 상담을 통해서 나아지길 바랍니다\n일단 첫회 상담 신청을 했었는데\n조만간 다시 신청할것 같아요\n감사합니다\n\n\n',2605),(3043,'2020-05-04 00:00:00.000000',5,'처음해보는 상담에 감정이 폭발해서 울면서 두서없이 이야기를 했는데 차분히 잘 들어주셔서 정말 감사합니다\n결국 카톡은 읽고씹혔지만 선생님 말씀대로 잘 기다려 볼께요\n다음상담 기다리고 있겠습니다!\n\n',2597),(3044,'2020-05-03 00:00:00.000000',5,'원인을 탐색하는 과정부터 구체적인 치료법 제시까지 체계적이고 따듯한 상담이었습니다. ',2606),(3045,'2020-05-03 00:00:00.000000',5,'내면의 많은 문제들로부터 자유로워졌다고 생각했는데 그렇지 않았다는 것을 깨닫게 해주셔서 감사합니다. 선생님 말씀대로 좀 더 자신에게 관대할 수 있는 사람이 될게요. :)',2607),(3046,'2020-05-02 00:00:00.000000',5,'쌤과 함께 이야기 하면 더 건강한 생각을 하게됩니다 감사합니다',2608),(3047,'2020-05-01 00:00:00.000000',5,'생애 첫 상담이었고 이 상담을 하게 되기까지 많은 고민과 걱정이 있었지만 하고보니 진작 할 걸이라는 생각이 드네요. \n친절하게 잘 들어주시고 제 내면을 들여다볼 수 있는 방향을 잡아주셔서 지금 상황에 많은 위로와 도움이 됐어요. \n하시는 질문들도 정말 스스로에게 던져야 하는 질문들을 해주셔서 저 자신에 대해 많이 생각해볼 수 있었던 것 같아요. \n텍스트상담 했는데 문자로도 온화하심이 느껴지는 것 같아서 선생님의 말 한마디 한마디에 더 진심을 느낄 수 있었습니다. \n상담 시간이 조금 지났는데도 끝까지 저에게 필요한 말들, 위로와 공감들 해주시며 상담 마무리 해주셔서 너무 감사했어요. \n',2609),(3048,'2020-05-01 00:00:00.000000',5,'저의 본질적인 상태와 솔루션까지 알게해주셔서 항상 너무감사해요.  늦은시간까지 상담 감사합니다..',2610),(3049,'2020-05-01 00:00:00.000000',5,'상담사님과 이야기하고 마음이 많이 편해졌어요.\n차근차근히 잘 설명해주시고 해결책도 제시해주셔서 앞으로 어떻게 해야할지 갈피를 잡은 것 같아요. 감사합니다~~',2611),(3050,'2020-04-27 00:00:00.000000',5,'정말 너무 많은 위로와 공감을 해주시고 시간이 끝났는데도 계속 말씀을 해주시고 마지막에도 상담방을 다시 한번 읽어보라고 해주시며 유익한 말씀 많이 해주셔서 정말 많은 도움 되었습니다. 강력추천드립니다. ',2612),(3051,'2020-04-27 00:00:00.000000',5,'굿 좋아요 너무',2613),(3052,'2020-04-27 00:00:00.000000',5,'문제가 있어서 상담을할때는 누구나 자신의 문제를 볼수는 있습니다\n그러나 상담을 하면서 정확한 문제를 볼수 있습니다\n그러면 스스로 문제해결 능력이 생기는것 같습니다\n어렴풋이 보이던 문제를 확실하게 볼수 있도록 해주셔서\n감사합니다',2614),(3053,'2020-04-26 00:00:00.000000',5,'처음에는 긴가민가하는 맘에 신청했어요 코로나때문에 대면 상담은 할수가 없어서 추천받아 이용했는데.. 무엇보다도 공감과 위로가 많이 도움됐고 실질적으로 도움이 되는 이야기들을 많이 해주셔서 좋았습니다. \n',2615),(3054,'2020-04-26 00:00:00.000000',5,'상담사님이 너무 잘 들어주시면서 공감해주셔서 얘기하는거 자체로도 위로 받는 느낌이었어요\n감사합니다\n\n\n',2616),(3055,'2020-04-24 00:00:00.000000',5,'첫 상담 받았는데 너무 좋았습니다!\n\n우선 제 말씀을 잘 들어주시고 중간 중간 질문을 하시면서 제 자신에 대해서 생각해보게 해주셨어요. 짧은 시간만에 저를 이렇게 많이 알게 된게 신기합니다. 전에는 생각지도 못했던 점을 많이 발견한거 같아요.\n저는 개인적으로 대 만족이고 더 장기적으로 상담을 받아볼 계획입니다!\n',2617),(3056,'2020-04-24 00:00:00.000000',5,'그동안 많은 치유를 받았습니다~^^',2618),(3057,'2020-04-23 00:00:00.000000',5,'그간 누구에게도 말 못 한 과거, 현재 겪고 있는 증상 등을 전해드렸는데 \n그에 따른 저의 본질적인 원인, 해결방안을 구체적이고 따뜻하게 말씀해 주셨습니다.\n여유가 된다면 다시 찾아뵙고 싶습니다.',2619),(3058,'2020-04-22 00:00:00.000000',5,'혼자 생각하면 우울함에 정리도 안 됐을 이야기를 옆에서 잘 다독여주시니 덕분에 차분하게 이야기 꺼내어 마음 정리했습니다. 감사합니다',2620),(3059,'2020-04-22 00:00:00.000000',5,'답답한 마음을 두서없이 이야기했는데\n잘 들어주시고 정리도 잘 해주셔서 \n짧은 시간임에도 좋은 상담 할 수 있었던것 같습니다',2621),(3060,'2020-04-21 00:00:00.000000',5,'토닥토닥해주셔서 감사합니다',2622),(3061,'2020-04-21 00:00:00.000000',5,'생각보다 따뜻하게 위로해주시고\n생각보다 냉철하게 제 상황을 바라봐주셨습니다.\n\n제 삶이 나아지기 위해\n직면하고 생각할 것들을\n이끌어내 주셔서 감사합니다.\n\n',2623),(3062,'2020-04-20 00:00:00.000000',5,'항상 감사드려요.\n\n\n',2603),(3063,'2020-04-20 00:00:00.000000',5,'좋았어요^^ 원래 상담하면서 눈물 잘 안흘리는 성격인데 한판 시원하게 울었고 내가 뭔가 뿌듯하게 잘하고 있다는걸 느끼게 해주셨어요. 감사드려요',2624),(3064,'2020-04-19 00:00:00.000000',5,'생각만 하고 있던것들을 정리해서 털어놓고 그에 따라 조언을 받으니 너무 좋았어요 단순히 위로 공감 만이 아니라 적절한 현실적 상황파악과 조언을 해주셔서 다시 한번 많은 생각을 하게되는 시간이였습니다.',2625),(3065,'2020-04-18 00:00:00.000000',5,'상담받아보니 저의 근본적인 원인을 알수있었습니다~\n너무 감사해요ㅠ',2610),(3066,'2020-04-17 00:00:00.000000',5,'처음상담인데 저의 감정의 원인을 알게되었어요\n감사합니다.',2610),(3067,'2020-04-15 00:00:00.000000',5,'처음에는 상담에 돈쓰기가 부담스러워 2만원정도 상담사님과 함께 상담을 했는데 아무래도 전문가의 말을 듣고싶어져서 큰맘먹고 4주 상담을 결정했습니다! 만족스럽지 않으면 어쩌나하고 걱정했는데 정말 돈이 아깝지않은 상담이였습니다 제가 몰랐던 부분에 대해서 정확하게 알려주셨고 적절한 예시를 들어주셔서 이해가 정말 잘되고 잘 와닿았습니다 그리고 무턱대고 조언해주시는게 아니라 스스로 답을 찾을 수 있기 이끌어주셔서 더 깨달은게  많은 상담이였던 것 같습니다 그리고 정말 이야기도 열정과 정성을 다해 들어주십니다 저말고도 많은 상담손님들이 있을텐데 정말 세세하게 기억도 잘 해주시고 그거 바탕으로 조언해주셔서 감동이였습니다  역시 괜히 전문가가 아니다라는 생각이 들었습니다 많은 것을 배우고 갑니다 사랑합니다 허혜정 선생님❤️❤️❤️',2626),(3068,'2020-04-14 00:00:00.000000',5,'너무 열심히 상담해주셔서 중간중간 마음이 찡하고 눈물날뻔 했어요. 저도 몰랐던 모습을 알게 되니 조금 더 차분해지더라구요! 정말 감사합니다',2627),(3069,'2020-04-14 00:00:00.000000',5,'감사합니다',2628),(3070,'2020-04-13 00:00:00.000000',5,'마음이 너무 힘들어 찾게되었습니다. 상담사님의 말씀 한마디 한마디에 치유되는 느낌이 들었습니다. 4달동안 불면증에 시달렸던 날들.. 좀 더 일찍 찾아뵈었으면 좋았을텐데 하는 아쉬움이 남습니다. 그러나 이만큼의 고통이 아니었다면 내면에 있던 아픔을 마주하는 시간을 마주하지 못했을 것이라는 생각이 드네요. 상담비용이 아깝지 않았던 훌륭한 상담이었습니다. 상담을 하면서 제 자신을 좀 더 아껴줄 수 있게 된 것 같습니다. 상담시간을 넘겨서면서까지 아끼지 않고 조언을 남겨주셔서 감사합니다 선생님. 마음이 힘든 분들께 강추합니다.',2629),(3071,'2020-04-12 00:00:00.000000',5,'들어주시고 공감해주시는 것뿐만 아니라 제 불안의 원인이 무엇인지 파악해주시고 제가 스스로 찾을 수 있게 도와주셔서 정말 좋았습니다. 해결방법도 같이 제시해 주셔서 도움이 정말 많이 되었습니다. 제 남자친구의 심리를 저보다 더 잘 아시고 남자친구의 입장은 어떤건지 알려주셔서 정말 마음이 편해지고 도움이 많이 되었습니다. 상담사님 덕분에 이전보다 좀 더 나은 연애 할 수 있을 것 같습니다. 감사합니다!',2630),(3072,'2020-04-10 00:00:00.000000',5,'문제를 통해 \'나\'를 들여다 볼 수 있었습니다 감사합니다.',2631),(3073,'2020-04-09 00:00:00.000000',5,'불안했던 마음이 대화속에서 가라앉기 시작했고 언제가 끝일지는 모르겠지만, 점점 나아지는 것을 느낍니다. 솔직한 대화감사했어요',2600),(3074,'2020-04-08 00:00:00.000000',5,'너무힘들었던 제 고민 들어주셔서 감사드립니다.\n\n제 자신을 돌아보며~생각하는 시간이되었구요.\n\n문제가 어디서부터 왔는지 알게해주시고\n\n힘주셔서 감사드려요.\n\n또다시 상담받고싶어요^^~',2632),(3075,'2020-04-08 00:00:00.000000',5,'전화하기전에 정말많이 고민했는데 상담 너무 잘 해주셔서 감사합니다',2633),(3076,'2020-04-08 00:00:00.000000',5,'내면의 많은 변화들이 일어나기 시작하고있는거 같아요~^^',2634),(3077,'2020-04-08 00:00:00.000000',5,'짧은시간에 정확하게 저를 들여다 봐주시고 원인과 해결방안을 잘 이야기 해주신거 같아서 마음가짐이 조금 달라진거 같아요..선생님과 상담하면 뭔가 건강해지는기분이 들어서 참 좋았습니다! 또 어렵고 힘들때 찾아올게요 ㅠ감사합니다',2622),(3078,'2020-04-08 00:00:00.000000',4,'내 이야기를 하기가 워낙에 힘들어서 아무데도 적지 못하고 그냥 속에 담아두고만 있었는데 상담사님이 어떠할거같은지 물어보고 계속 말할수 있게끔 유도해주셔서 다시 제 생각을 정리할 수 있었던 1회차 상담이었습니다. \n1회차는 아무래도 상담사님과 처음 만났었어서 제 이야기를 하고 정리하는 시간이어서 방향제시나 치료를 본격적으로 할 순 없었지만 내 이야기를 하는 것만으로도 조금 나아간 기분이 들었습니다\n\n',2635),(3079,'2020-04-07 00:00:00.000000',5,'늦은 시간에 연락드렸는데도 친절하게 상담해주셨어요. 얘기를 곰곰이 들어주시고 어느 방향으로 생각의 길을 트면 될지 차분히 길도 안내해주셨어요. 상담해주시는 동안 한마디라도 더 도움이 되는 말을 해주시려 한다는 느낌이 피부로 와닿아서 더욱 감사했어요. 언니처럼, 선배처럼 위로해주시면서도 푸념 받아주시는 데 그치지 않고 마음의 짐을 덜어주는 조언을 해주셨어요. 너무 답답해서 오밤중에 즉시상담권을 끊어서 상담받았는데 앞으로 계속 상담받고 싶다는 생각이 들었을 정도로 좋았습니다. 감사합니다 선생님😊',2636),(3080,'2020-04-06 00:00:00.000000',5,'우울로 일상생활이 어려워서 3월부터 정신과 약을 먹고 있던 와중에 상담을 받아보고 싶어서 처음으로 신청하게 되었어요! :-) 회복탄력성이 느린 저를 다독여주시고 많은 이야기 들어주셔서 든든한 마음이 들었어요ㅎㅎ 조언 듣고 깨달은게 너무 많아서 통화 중간에 울컥했었어요ㅎㅎ 따뜻하게 해결방안까지 같이 찾아주셔서 더더욱 감사드립니다!! 시간도 훨씬 초과되서 제 얘기만 한 것 같아서 맘이 편치 않더라구여ㅠㅜ 다음 상담 또 신청 드리겠습니다!! 그리고 스스로를 돌보고 사랑해주기는 다음 상담 전까지 매일 지켜보도록 노력하겠습니다!!!!! ㅎㅎ',2637),(3081,'2020-04-05 00:00:00.000000',5,'상담사님 이야기도 잘 들어주시고 답을 먼저 알려주지않고 내면을 끌어내여 질문함으로써 깨닫게 해주시는 방식이 너무 좋았습니다 어떻게 보면 알고 있는 내용을 말해주는것보다 질문에 대답하면서 내 고민에 이유에대해 인지해가면서 해답을 내가 찾는 모습이 오래 기억에 남아 평소에도 잊지않고 조금씩 행할수 있을꺼 같아 긍정적인 힘이 났습니다 상담사님 추천합니다~',2638),(3082,'2020-04-03 00:00:00.000000',5,'상담사님으로 상상하는 좋은 점들을 많이 갖고 계신 분 같아요~! 공감이 너무나 필요했던 저에게 상처받은 마음 위로가 되도록 헤아려주시고 문제점이 뭔지 정리해주셔서 도움이 되었어요. 힘들고 누군가 필요할때 손 내밀 수 있는 제 편이 생긴 기분‥ 밝고 따뜻한 기운으로 상담  이끌어주셔서 정말 감사합니다. 다음에도  찾아뵐게요~! ',2639),(3083,'2020-04-02 00:00:00.000000',5,'예약없이 바로 상담신청해서 바로 상담을 진행하게되었습니다\n텍스트테라피이지만 직접대면해서 상담을 받는것보다 더 공감과 위안의 조언을 들을수있어 너무 기뻤습니다\n다음기회에도 상담 꼭 받고싶습니다~~',2640),(3084,'2020-03-31 00:00:00.000000',5,'정말 추천드리고 싶네요... 친구들 가족들에게 본인의 고민을 이야기하는 것은 한계가 있을 때가 있죠... \n전문 상담사분과 이야기를 하다보니 이야기하는 것도 편하고, 공감도 공감이지만 정말 어디에서도 듣지 못했던 해결방법을 제시해주는 것이 제일 만족스러웠습니다...\n상담센터로 직접 찾아가는 것도 사실상 수고스러움과 힘듦이 있었는데 이렇게 전화로 하니까 정말 좋네요...\n그리고 30분 상담이었지만 거의 시간 제한 없이 제 이야기 다 들어주시고 해결방법에 대해서 끝까지 이야기 해주셨어요ㅠㅠ 거의 한시간동안 이야기한 것 같네요 정말 진심으로 들어주시고 답변해주셔서 감사했습니다\n자신감도 생기고, 제 문제가 변화할 수 있을 거라는 자신이 생겼어요. 정말 감사합니다.',2641),(3085,'2020-03-26 00:00:00.000000',5,'왜 이렇게 힘들고 어려울까 생각했는데 제 얘기를 잘 들어주시고 정확하게 봐주셔서 좋았어요. 계속 들어주시고 공감만 해주시다 끝나시는 분들도 계시는데, 그럼 그때는 시원하지만 또 같은 일이 반복되고 또 괴로웠어요. 지금 상태가 어떻다 이것이 계속되면 앞으로 이렇게 될 것이다 이런 방법이 있다 제시해주셔서 힘이 됐습니다. 시간 가는 줄 모르고 떠들면 칼같이 시간 다됐다고 하시는 분들도 계시는데 조금 초과해서까지 말씀 해주셨어요. 지금 당장은 제가 변하기 힘들겠지만 조금씩 변화해보려고 노력하겠습니다. 변화의 방향을 제시해주셔서 감사합니다.',2642),(3086,'2020-03-24 00:00:00.000000',5,'쌤과 얘기나누면 더 잘 살아갈 수 있는 에너지가 생깁니다. 마음이 미워져서 내 모습 보는게 괴로울때, 힘든일이 있어서 한없이 우울할 때, 감정이 크게 파도칠때 쌤과 얘기하면서 울다 웃으면 어느새 평온해져요. 그리고 더 소중하고 밝고 진솔한 제 자신이 됩니다. 감사합니다.',2608),(3087,'2020-03-24 00:00:00.000000',4,'늦은 새벽에 상담을 할 수 있어서 감사했습니다. ',2643),(3088,'2020-03-23 00:00:00.000000',5,'성심성의껏 이야기를 잘 들어주시고 시간을 훨씬 초과해서 정성껏 상담 마무리해 주셨습니다.\n첫상담이라 제이야기가 길었는데 들으시면서 중간중간 포인트를 집어주셔서 말하면서 정리가 되어 좋았습니다.\n다음번 상담시에도 선생님을 찾을 예정입니다. ',2644),(3089,'2020-03-22 00:00:00.000000',5,'트로스트로 처음 상담받아봤는데 추천합니다.\n50분 1회권이었음에도 1시간 30분동안 더 추가로 상담해주셔서 충분한 대화를 할 수 있었어요.\n제가 제 주변에서 저만큼 생각이 복잡한 사람을 본 적이 없어서 상담하는 동안 조금 시니컬한 내담자였을 수도 있을 것 같아요. 그럼에도 같이 논리적인 방향으로 고민을 공유할 수 있어서 좋았습니다.\n상담이 끝난 후 다시 마인드맵으로 제 생각을 쭉 정리했더니 란결 나아진 기분이에요.\n상담 한 번으로 모든 문제가 해결되진 않지만 앞으로 차근차근 나아가야겠다는 다짐을 하게 되었습니다. 감사합니다. ',2645),(3090,'2020-03-22 00:00:00.000000',5,'이별 후 자꾸 안 좋은 생각이 들어 도움을 얻고자 상담 신청했는데요, 선생님께서 찬찬히 들어주시다가 어떻게 이별을 극복해야 할지 방법을 제시해 주셨습니다. 이 과정에서 저는 의존하며 타인에게 사랑을 확인한다는 것을 알게 되었고 저 스스로 먼저 사랑하며 더 나은 사람이 되기 위해 긍정 언어로 일기를 쓰기로 했어요.\n긍정과 자기 사랑에 대한 조언이 중심이었고 결과적으로 저는 남자친구를 잘 보낼 수 있는 용기를 얻게 되었어요. 저는 문제 해결을 원한다고 첨부터 말씀드렸기 때문에 만족스럽습니다.\n당장 슬픔이 해소되지는 않지만 장기적으로 내가 무엇을 해야할지에 대해 알게된 점이 좋았어요. 새벽에 SOS로 급하게 잡은 상담인데 제 마음을 잘 헤아려주셔서 감사합니다.',2646),(3091,'2020-03-21 00:00:00.000000',5,'정말 좋은 상담이였습니다. 날카로운 통찰력으로 조언해주셔서 어떤것이 문제였고 어떻게 해야할지를 알았습니다. 또 위로도 함께 해주셔서 정말 신뢰가 배가 되었어요. \n너무 감사합니다. 상담사님 앞으로 망망대해를 지나는거 같을때 또 뵙겠습니다. ',2647),(3092,'2020-03-21 00:00:00.000000',5,'따뜻한 말씀과 진심어린 조언 감사합니다.',2648),(3093,'2020-03-14 00:00:00.000000',5,'상담자분께서 저를 많이 이해해주시고 따뜻한 조언도 해주셔서 너무 만족했습니다. 불편했던 마음이 한결 나아지고 새로운 희망이 생겼습니다. 그동안 힘들어서 많이 우울했는데 치유해주셔서 감사합니다. 모든 분들께 추천해드리고 싶습니다.^^',2649),(3094,'2020-03-14 00:00:00.000000',5,'상담을 시작하기 전에 정말 많이 고민했었는데 허혜정 선생님과 상담을 진행할 수록 신청하기를 잘했다는 생각이 정말 많이 들었습니다.\n가장 좋았던 것은 상담을하면서 스스로를 잘 알게 되면서 우울함과 무기력한 감정들을 조금씩 컨트롤 할 수 있게 되었다는 점입니다. 상담하고 이틀 정도가 지났는데 평소 같으면 기분이 안좋아지고, 짜증냈을 일들이 아무렇지 않게 지나가고 있다는 것입니다. 감사합니다 선생님 \n지금도 저에게는 너무나도 기적같은데 \n선생님을 꾸준히 만난다면 얼마나 더 긍정적으로 변화할지 생각만으로도 설렙니다! \n상담시간동안 선생님의 행복함까지 느껴져서 더욱 좋았던 것 같습니다. \n힘드실 수도 있었을텐데 상담 내내 긍정적인 목소리와 말투로 말씀 해주셔서 너무 좋았습니다 \n우연치않게 선생님과 상담을하게 되었는데 정말 저에게 큰 복이였던 것 같습니다 ㅎㅎ \n',2650),(3095,'2020-03-13 00:00:00.000000',5,'고민이 있었던 점을 심도있게 파악하고 신중히 얘기해주셨습니다. 얘기하면서 마음이 정말 편안해지는 것을 느낄 수 있었어요 감사합니다.',2651),(3096,'2020-03-11 00:00:00.000000',5,'감사합니다.',2652),(3097,'2020-03-09 00:00:00.000000',5,'허혜정 상담사님께서 정말 마음을 담아서 열과 성으로 상담해주셔서 말씀을 듣는 것 만으로도 많은 위안이 되었습니다. 상담사님께서 진심어린 뜻깊은 조언을 많이 해주신 덕분에 당장 닥쳐진 고통에 좀 더 생각하며 스스로 소화해내는 힘이 생길 수 있어서 감사한 마음 뿐입니다. 말씀해주신 부분들은 생활에 반영하며 긍정적인 변화들이 조금씩 생겨나고 있습니다. 더 많은 분들이 허혜정 상담사님과의 대화를 통해 스스로를 회복하고 돌아볼 수 있는 계기를 가지면 좋겠습니다. :)',2653),(3098,'2020-03-07 00:00:00.000000',5,'너무 힘들고 불안해서 누구한테라도 털어놓고 싶은 마음에 상담신청을 했는데, 제 이야기를 잘 들어주실 뿐 아니라 제 고민을 근본적으로 해결할 수 있는 실질적인 방법까지 알려주셔서 정말 좋았습니다. 사실 그동안 나름대로 노력해도 안됐었고, 심리상담도 별로 효과가 없다고 생각했었는데ㅠㅠ 제 얘기를 통해 문제의 근본이 무엇인지 찾아가게끔 해주시고(덕분에 처음으로 명확하게 알게되었습니다) 앞으로도 제가 어떻게 해야하는지 솔루션을 제공해주셔서 탄탄한 마음가짐으로 이겨낼 수 있다는 힘이 생겼습니다. 비대면 상담임에도 불구하고 조금씩 일상이 편해지는 것이 느껴졌을 정도로 많은 도움이 되었습니다. 정말 감사합니다!!',2654),(3099,'2020-03-05 00:00:00.000000',5,'감사합니다',2655),(3100,'2020-03-04 00:00:00.000000',5,'제 자신을 객관화 하는데 도움이 많이되었습니다.\n스스로를 객관화 하면서\n갖고 있는 고민의 무게도 작아지고\n지금 당장 해결할 수 있는 부분에 대해서\n캐치할 수 있게 되네요. \n텍스트 상담이지만 대면한것 처럼 큰 위안을 받을 수 있었고 더 많은 속 얘기를 주절주절 털어놓을 수 있어서 좋았습니다.',2656),(3101,'2020-03-03 00:00:00.000000',5,' 만족스러운 첫 상담이었습니다.\n부부문제, 시댁갈등이라는 문제때문에 상담했는데 \n그 문제를 해결하기 위해 나의 문제 상처를 보게해주셔서 모든 상황을 이해할 수 있게 됐습니다..! \n이야기 잘 들어주시고 공감도 잘 해주셔서 큰 위안이 됐습니다 \n감사합니다^^!!\n',2631),(3102,'2020-03-03 00:00:00.000000',5,'상담을 지속할수록 몰랐던 제 자신을 들여다볼 수 있게 되는 것 같았습니다.  고민하던 부분도 해결할 수 있을 것 같아요. 시간 많이 지났는데도 끝까지 성의있게 상담해주신 상담사님 감사합니다. ',2657),(3103,'2020-03-03 00:00:00.000000',5,'제 마음이 부서져버려서 다시는 붙지 않을줄 알았는데.. 상담을 하면서 제 마음을 이야기하는 과정에서 조금씩 문제의 원인을 알게 되었습니다. 상담사님 너무 감사합니다. 마음이 많이 편안해졌어요..',2657),(3104,'2020-03-02 00:00:00.000000',3.5,'나쁘지않았습니다',2658),(3105,'2020-03-01 00:00:00.000000',5,'잘받았습니다',2659),(3106,'2020-02-29 00:00:00.000000',5,'다시금 나를 돌아보고 인지해야 한다는걸 알았습니다. 차분히 들어주시고 방법까지 안내해주셔서 도움이 많이 되었어요~',2659),(3107,'2020-02-29 00:00:00.000000',5,'감사합니다',2659),(3108,'2020-02-29 00:00:00.000000',5,'50분이 너무 짧게 느껴질만큼 제 마음속 감정 얘기하는데 많은 도움이 되었어요. 선생님께서 차분히 제 얘기에 공감해주셨고 제가 불안하고 질투심이 드는 이우에 대해서도 설명해주셨어요. 가끔 내 머리와 감정이 따로 작동하는 경우가 있는데 데 감정들에 대해 진단해주시고 이성적으로 판단해주시니 제 마음이 훨씬 편해졌어요.\n다음 상담때는 감정조절에 대해 더욱 심도있게 받아보고싶어요. 감사합니다 선생님 또 뵈요! ',2660),(3109,'2020-02-28 00:00:00.000000',5,'50분이라는 짧은 시간이었지만 제 이야기에 경청해주시고 조언해주셔셔 감사합니다',2661),(3110,'2020-02-24 00:00:00.000000',5,'너무너무 유익한 시간이었어요 \n하나씩 꼬인 문제를 풀어가는 것이 좋았습니다 \n단회 상담에서 끝나는게 아니라 꾸준히 \n상담을 이어나갈 예정이에요 \n오래된 습관 생각을 변화시키는게 쉽진 않겠지만 \n천천히 조금씩 변화할거라 믿어요 \n감사합니다 \n\n\n',2662),(3111,'2020-02-24 00:00:00.000000',5,'아직 많은 부분들을 알아가야겟지만...\n첫 상담만으로도 제 안에 있는 꼬인마음들이 어디서부터 왓는지 그 시작점을 찾을 수 있게 되었어요. \n그전에 대면상담을 진행한 경험이 있었는데 그때에는 아무런 진전 없이 끝나서... 상담에 대해서 회의적이었는데...\n그냥 한풀이라고 하고 싶은 심정으로 전화했다가... \n제가 꽁꽁 싸매고 있었던 진짜 마음을 조금이나마 들여다 볼 수 잇엇던 시간이엇습니다...\n정말 감사합니다. ',2663),(3112,'2020-02-23 00:00:00.000000',5,'인생의 힘든일들부터 소소한 고민까지 따뜻하고 현명하게 들어주시고 가이드 해주시는 쌤이있어 다행입니다. 쌤과 얘기하면 무거웠던 마음이 가벼워지고 웃음이나요~! 항상 감사합니다.',2608),(3113,'2020-02-23 00:00:00.000000',5,'샘의 현명한 조언과 따뜻한 공감으로 언제나 힘내고 있어요 :) 어려움이 생길 때마다 계속 찾아뵙게 되네요 늘 감사합니다\n',2608),(3114,'2020-02-22 00:00:00.000000',5,'감사합니다~\n다음 시간을 기대합니다!',2664),(3115,'2020-02-22 00:00:00.000000',5,'진심으로 제 아픔을 이해해 주시고 저보다 저를 더 잘 알아주셔서 너무나 큰 위로가 되었어요. 정말 마음이 많이 힘들었고, 한 번의 상담만으로 해결이 될수 없는 문제들 이지만 방향을 잘 잡아 주시고 일으켜 세워주셔서 너무나 감사합니다. ',2665),(3116,'2020-02-20 00:00:00.000000',5,'감사합니다\n',2666),(3117,'2020-02-19 00:00:00.000000',5,'정말 좋습니다',2667),(3118,'2020-02-19 00:00:00.000000',5,'정말 좋은 시간 이었습니다',2667),(3119,'2020-02-18 00:00:00.000000',5,'여러모로힘든일때문에 고민끝에 상담했는데\n제맘잘알아주시고 이야기들어주신부분 너무감사해요 \n사실지금도 내가어떻게해야될까 고민도많지만 상담내용을 되새기면 해결방안이 만들어져요\n마음치유가 좀더필요하겠지만 오늘로서는 많이안정되었어요\n다음에또다시상담하고싶어요\n',2668),(3120,'2020-02-17 00:00:00.000000',5,'기운얻고갑니다~',2669),(3121,'2020-02-16 00:00:00.000000',5,'저 혼자만의 문제라고 생각했는데 꼭 제 잘못이 아니라고 구체적인 사례를 들어주셔서 감사했습니다. 덕분에 자존감이 올라갔어요. 상담 하면서 좋은 말들 많이 해주셨는데 참 위로가 크게 되었어요 감사해요 좋은 상담사님 만나서 행복했습니다.',2670),(3122,'2020-02-14 00:00:00.000000',5,'오랜 시간 불안한 시기를 지내오던 중 한달 전 트로스트에서 단회성 상담 이후 많이 안정되었고 스스로의 문제에 대한 자각은 했으나 자각한 것은 좋았지만 짧은 시간 쏟아내며 큰 줄기만 정리된 터라 명확한 제 심리를 몰라 눈앞의 일이 안풀리지않게되며 다시 불안했었습니다. 과연 더 상담이 필요한지 나는 이미 고비를 넘겼지않았나하며 여러번의 고민 끝에 결국 한번 더 상담사님과 대화를 했고 대화를 통해 제 안의 불안함의 원인을 제대로 짚어볼 수 있는 기회를 가질 수 있었습니다. 시간에 구애하지않고 제가 차분히 제 스스로를 알아볼 수 있게 도와주시고 응원의 말을  해주신 것이 너무나 도움이 되었습니다. 감사합니다. 앞으로 마음가짐에 따라 일이 잘 풀려나갈 것 같습니다.',2671),(3123,'2020-02-11 00:00:00.000000',5,'저의 문제점을 정확히 집어주시고 장점들도 말씀해주시고 어떻게 고쳐야하는 건지 방법도 알려주시고 해서 감사해요 마음이 편해지로 고칠 일들만 남은 것 같아요 기회가 된다면 더 더욱 또 참여하고 싶습니다\n\n',2672),(3124,'2020-02-10 00:00:00.000000',5,'허혜정상담사님께서 늦은 시간인데도 불구하고 정말 명쾌한 상담덕분에 마음 편히 잠에 들 수 있었을뿐만아니라 앞이 캄캄했었던 직장생활을 즐겁게 대할 수 있도록 해주셔서 너무 감사했습니다! 완전 추천드려요! ',2673),(3125,'2020-02-10 00:00:00.000000',5,'많은 도움을 주시려고 하셔서 좋았습니다.',2674),(3126,'2020-02-09 00:00:00.000000',4,'어디서도 터놓을 수 없었던 제 이야기를 차근차근 들어주셨어요\n사실 상담 이라는 단어 자체에서 오는 위압감이 있긴 하지만 조금이라도 아주 조금이라도 나를 더 알고 이해할수 있다면, 그래서 변화할수 있다면..! 이라는 작은 기대를 가지고 시작했는데\n저를 돌아보고 아껴줄수 있는 기회가 된것 같아 많은 위로가 됬어요\n당장 병원을 찾아가거나 상담센터를 방문 하기엔 많이 고민되고 어렵거든요.. \n작게나마 용기를 가지고 시작한거지만 저한텐 희망을 심어주셔서 상담사님께 감사합니다..!',2675),(3127,'2020-02-08 00:00:00.000000',5,'속시원히 말하지 못한부분까지 잘 들어주시고 공감해주고 위로해주시면서 다른방안을 제안도 해주셨어요 상담하는 내내 안정적인 톤과 함께 잘 공감해주셔서 너무 감사했고 상담시간이 초과했지만 조금이라도 더 좋은말씀 해주시는 부분이 너무 좋았어요',2676),(3128,'2020-02-07 00:00:00.000000',5,'타지에서 유학생활 하면서 도움을 요청할곳이 없었는데 이렇게 운좋게 허혜정 선생님을 알게되어서 너무 운이 좋았던거 같아요! 정말 제가 외롭고 우울했던 시간에 바로 전화상담 해주시고 저의 문제점들을 하나하나 씩 짚고 상처는 치료해주시고 격려와 위로를 받을수 있었습니다 1주일만에 저 자신이 달라진걸 느낄수 있었어요 답답했던 속이 뻥뚫리는 기분이였습니다 정말 돈이 아깝지 않았어요! 이계기로 제 삶의 태도가 달라질수 있다는 희망이 생겼으니까요! 너무너무 감사하구요 알려주신 해결책 꾸준히 실행해서 완전하게 변화해보려고 노력하겠습니다 이젠 드디어 우울증에서 벗어날수 있을거같아요 ! 유학생분들이나 위로가 필요하시고 해결책을 알고싶은분들 적극추천합니다!',2677),(3129,'2020-02-05 00:00:00.000000',5,'처음 받는 상다입니다\n\n채팅이라는 한계 말곤 단점이 없습니다\n\n반신반의 했는데 생각보다 대화 후\n\n기분이 좋았습니다\n\n통화 상담도 기대가 됩니다\n\n\n',2678),(3130,'2020-02-05 00:00:00.000000',3.5,'제 고민은 답이 없는거 같아요..',2673),(3131,'2020-02-04 00:00:00.000000',5,'하기전에 정말 이게 효과가 있을까 내가 달라질 수 있을까 걱정이 되서 많은 고민을 했었어요 주변사람들한테 물어보니 심리상담 받는거 효과있다 좋다!괜찮다 해서 더 악화되면 더 힘들어지니까 한번 해보자 하고 용기내서 상담 신청 하게 되었는데 정말 많은 변화를 느끼고 제자신을 더 잘 알 수 있게 되서 너무 좋았고 상담사님께서 친절하게 잘 해주시고 날짜 연장도 할 수 있게 이해해주시며 배려해주시고 상담 시간도 초과되었음에도 계속 이어가 주셔서 마음 편하게 할 수 있었던 거 같아요! 길다면 길고 짧다면 짧은 4회 동안 너무 감사했고 ! 또 상담이 필요한 순간이 오게 된다면 저는 또 허혜정상담사님께 찾아올겁니다!! 제 얘기 들어주시고 도와주셔서 정말 감사했습니다 수고많으셨어요!! 사랑합니다~!',2679),(3132,'2020-02-03 00:00:00.000000',5,'제가 보지 못했던 부분을 명쾌하게 짚어주셔서 감사합니다! ',2680),(3133,'2020-02-03 00:00:00.000000',5,'쌤과 함께하는 상담은 언제나 마음이 편하고 그동안 몰랐던 관점에서 저를 돌아볼 수 있어 좋습니다. 꽤 오래전 인연을 맺게 되어 힘든일이 생길 때마다 쌤께 상의하게 되네요! 감사합니다 :)',2681),(3134,'2020-02-02 00:00:00.000000',5,'혼자서 끙끙 앓다가 고민을 털어놓는 것만으로 마음이 훨씬 편해졌어요. 그리고 제 이야기를 잘 들어주시고 공감해주시고 문제를 똑바로 바라볼 수 있도록 해주신 것 같아요. 선생님이 알려주신 방법대로 용기를 내보려고 합니다. 도움주셔서 너무 감사합니다!',2682),(3135,'2020-02-01 00:00:00.000000',5,'너무 많은 고민을 안고 살았던지라 처음엔 채팅상담이 도움이 될까 싶었어요. 상담 하는 내내 얼마나 울었는지 모르겠네요. 밤 늦은 시간 어려운 얘기 잘 들어주시고 또 해결책도 적절하게 알려주셨어요. 결국 모든 정답은 제 마음속에 있다는걸 알게 되었습니다. 추천해준 동생에게 너무 고맙고 허혜정 상담사님께도 정말 감사드립니다.\n',2683),(3136,'2020-01-30 00:00:00.000000',5,'선생님이 문제를 정확히 짚어주시고 해결점을 알려주셨어요\n아 정말인지 상담을 왜 하는지 알겠어요\n고민많이하고 처음으로 상담했는데\n그게 허선생님이어서 다행입니다. 감사합니다',2684),(3137,'2020-01-28 00:00:00.000000',5,'문저를 객관적으로 파악하고 해결책을 알려줘서 좋습니다. ',2685),(3138,'2020-01-27 00:00:00.000000',5,'이야기 많이들어주시고 좋았습니다\n',2686),(3139,'2020-01-27 00:00:00.000000',5,'모르고 지나치면 안됐던 저의 모습들을 성찰할 수 있게 해주셨어요. 진심으로 감사합니다.',2652),(3140,'2020-01-26 00:00:00.000000',5,'허혜정 선생님과의 상담후에 마음이 한결 가벼워졌어요. 나의 문제의 원인이 단순히 의지의 문제가 아니라 마음의 결핍에서 왔다는 걸 인지하게 되었고, 다음으로 나아가기 위해서는 나를 몰아붙이기보다 나를 이해하는게 더 크다는 걸 배우게되었습니다. 긴시간동안 많이 들어주시고, 지금 당장 제게 닥친 문제를 해결하는 정답이 무엇일지 스스로 찾을 수 있게 많이 도와주셨어요. 조만간 다시 찾아뵐께요! 오늘 상담 감사합니다 :)',2687),(3141,'2020-01-26 00:00:00.000000',5,'제 낮은 자존감의 원인이 어디인지, 그럴때 제가 어떤 감정을 느끼는지 선생님과 대화하다보면 스스로 답을 찾게 돼요.\n상담의 핵심을 잘 짚어주십니다. \n\n거기에 더불어 일상에 적용하고 실천하는 방법까지 제시해주세요.\n저한테는 원인이나 이유보다도 당장의 변화가 더 필요했기때문에\n현실적인 조언들이 매우 유용했어요.\n\n 덕분에 상담 50분이 아깝지 않았어요. \n제 이야기를 차분하게 들어주시고, 시간을 더 할애해주시기도 했습니다. 이제는 정말 실천만 남았어요.\n건강한 마음을 가진 사람이 되기 위해 노력하려구요.\n\n힘들때 또 찾아뵙겠습니다.\n감사해요~',2688),(3142,'2020-01-25 00:00:00.000000',5,'감사합니다 상대방을 이해하는데 도움이 되었어요\n저의 문제에 대해서도 다음번상담을 통해 바뀌어 나가도록 노력해보려구요\n좋은상담 감사합니다 :-)',2671),(3143,'2020-01-21 00:00:00.000000',5,'많이 응원해주셔서 힘이되었습니다. 감사합니다.',2689),(3144,'2020-01-20 00:00:00.000000',5,'많은 고민으로 새벽에 상담 신청을 했는데 한시간이 훌쩍 넘는 시간 동안 이야기를 차분히 들어주셨을 뿐 만이 아니라 실제로 제가 해볼 수 있는 해결책을 같이 찾아주셔서 앞으로 나아질 수 있을거란 희망이 생겼습니다. 제가 제일 소중하고 저만이 저를 챙겨줄 수 있다는 말 잘 새기고 있겠습니다. 감사합니다 선생님.3',2690),(3145,'2020-01-19 00:00:00.000000',5,'짧은대화를 통해서 허혜정 상담사님이 핵심을 바로바로 파악해서 해결방향을 제시하고 원인과 답을 빠르게 찾는 2회 텍스트상담이었고 결과는 상당히 만족스럽습니다. 제가 뭐가 문제인지 알수있고 어떻게 해결하면 좋을지 질문을 통해서 생각해보고 알수 있어서 좋습니다. 진심으로 대화하는게 느껴져서 더 좋았습니다. 필요하면 또 허혜정 상담사님께 상담받겠습니다. ',2691),(3146,'2020-01-19 00:00:00.000000',5,'문제를 바로 파악해 주시고 그에 맞는 조언을 주셔서 정말 도움이 많이 되었습니다. 전화상담으로 이렇게 바뀌게 될지 몰랐는데 마음이 한결 편해지고 문제를 좀 더 객관적으로 볼 수 있게 된 것 같아요. 정말 감사드립니다.',2630),(3147,'2020-01-19 00:00:00.000000',5,'정말 생각보다 더더더 더 좋았습니다. 눈덩이처럼 불어있던 고민들이 얘기를 하고 상담사님이 객관적으로 얘기해 주시니까 정말 훨씬 더 마음이 편해졌습니다. 허혜정 상담사님이 정말 공감을 많이 해주시고 상황을 객관적으로 볼 수 있게 해 주셔서 정말 도움이 많이 되었습니다. 1시간 통화로 이렇게 많이 변할 수 있을 거라고 생각 못 했는데 혼자 끙끙 앓고 있다가 통화 한 번 하니까 정말 지금까지 했던 고민들이 눈 씻듯이 내려가 버렸습니다. 허혜정 상담사님 정말 정말 강추드립니다. 정말 상담하기로 결정한 게 요근래 제일 최고의 결정인 것 같습니다. 정말 정말 감사합니다.',2630),(3148,'2020-01-18 00:00:00.000000',5,'상담사님이 제 말을 끝까지 잘 들어주시고 제가 부족한 부분을 잘 짚어주셨어요. 설명도 예시를 들어서 잘 해주셔서 매우 만족스러웠어요. \n특히 잘 못 이해한 부분이 있었는데 끝까지 이해 시켜주시려고 한 부분에서 큰 감동을 받았습니다!',2692),(3149,'2020-01-16 00:00:00.000000',5,'짧은대화를 통해서 허혜정 상담사님이 핵심을 바로바로 파악해서 해결방향을 제시하고 원인과 답을 빠르게 찾는 2회 텍스트상담이었고 결과는 상당히 만족스럽습니다. 제가 뭐가 문제인지 알수있고 어떻게 해결하면 좋을지 질문을 통해서 생각해보고 알수 있어서 좋습니다. 진심으로 대화하는게 느껴져서 더 좋았습니다. 필요하면 또 허혜정 상담사님께 상담받겠습니다. ',2691),(3150,'2020-01-10 00:00:00.000000',5,'진심으로 귀기울여 주시고, 들어주시고 그에 맞는 조언해주시며 다시 한번 더 생각 해 볼 수 있도록 도와 주셨어요~ 마음이 너무나 따뜻해 지는 시간이였고, 제가 몰랐던 내면적인 고민들도 알아차릴 기회를 주셨어요~ 처음에 너무 답답한 마음에  한번 밑져야 본전이라고 해본 상담이 너무나 좋은 기억으로 남을 것 같아요^~^\n너무 감사드려요♡ ',2693),(3151,'2020-01-09 00:00:00.000000',5,'상담을 받으면 얼마나 좋아질까 했었는데 정말 말도 안되게 좋아졌어요. 내가 몰랐던 내 자신에 대해서 알게 되고 내 문제의 뿌리에 대해서 알아보는 시간이였어요. 정말 추천 합니다. 감사해요 상담사님^^',2694),(3152,'2020-01-06 00:00:00.000000',5,'친구들이나 주변사람들한체도 말하기 힘들었는데\n상담사님한테 말하고 듣고 ... 50분 상담시간인걸로아는데 1시간넘게 상담해주셨구요.. 그시간 동안 계속 눈물이 멈추지않았습니다ㅠㅠ ... 마지막까지도 울리시더라구요..ㅠㅠㅠㅠ \n처음 해보는 나를 알아보기여서... 한번쯤 받아보는게 나쁘지않겠구나 싶네요..ㅎ 정말너무 감사드리구요...\n상담사님이 해주신 과거의 나의 어린아이와 계속 작별인사할거구요...ㅎㅎ지금의 아주 괜찮은  저로서 계속 살아갈라고합니다 \n정말 감사합니다',2695),(3153,'2020-01-06 00:00:00.000000',5,'상담 시작할 때 폭풍같았던 마음을 가라앉게 해주셔서 감사합니다 .\n얘기를 차근차근 하다보니 감정이 가라앉는 것들이 신기하네요.\n많은 사례를 아셔서 더 가능한 것 같구요.\n그렇지만 애인을 지나치게 이해하게 되는 바람에 마음이 아프기도 합니다..ㅎㅎ',2696),(3154,'2020-01-05 00:00:00.000000',5,'정말 감사합니다. 짧은 시간에도 단번에 파악하셔서. 필요한 조언을 해주셨어요. ',2695),(3155,'2020-01-05 00:00:00.000000',5,'너무 유익한 상담이었어요~^^\n위로와 격려의 말씀 감사합니다~\n다음에 또 찾아뵐께용~ㅎ',2697),(3156,'2020-01-05 00:00:00.000000',4,'처음에는 답답함이 있었지만 이야기 하면 할수록 생각지도 못한 것들도 알게 해 주시고 진심을 다해 상담 해주셔서 너무 좋았습니다',2698),(3157,'2020-01-04 00:00:00.000000',5,'늦은 시간에 상담해주셔서 정말 감사했습니다. 예민한 문제고 감정 컨트롤이 안되었지만 제 말 다 들어주시고 너무 좋았어요. 상담사님 덕분에 문제 해결도 하고 마음도 한결 편해져서 숨쉬기가 편해졌어요. 너무너무 감사드립니다.',2699),(3158,'2020-01-02 00:00:00.000000',5,'감사합니다\n\n',2700),(3159,'2020-01-02 00:00:00.000000',5,'그동안 트로스트에서 받았던 상담중 제일 실질적 도움이 많이 됐어요! 감정 정리도 덕분에 잘 할 수 있었습니다. 감사합니다 :)\n\n',2701),(3160,'2020-01-01 00:00:00.000000',5,'누구에게도 말못할 고민거리를 공감해주고 격려해주셔서 위로가 되었습니다 다음에 또 상담받고싶어요 감사합니다',2702),(3161,'2019-12-31 00:00:00.000000',5,'상담은 처음입니다. 상담시간이 짧게 느껴졌지만 긍정적인 생각을 가지게 해주셨고 문제를 좀 더 객관적으로 볼 수 있었어요, 성심성의껏 들어주시고 답해주셔서 감사합니다.',2703),(3162,'2019-12-30 00:00:00.000000',5,'2번의 상담 모두 만족스러웠어요.\n\n첫번째 상담에는 내가 모르던, 그리고 알면서도 부인하고 있던 내 감정을 이끌어내 어려움없이 마주할 수 있도록 도와주셨고\n\n두번째 상담에는 마주봤던 감정들을 정리하면서 앞으로 어떤 감정을 어떻게 받아들여야 할지 또 그 긍정적인 마음 가지기까지.\n\n무거워서 주체할 수 없었던 마음들이 정말 한결 가벼워지고 기분도 좋아져서 현재 기쁘게 지내고 있어요\n\n',2704),(3163,'2019-12-28 00:00:00.000000',5,'상담을 정기적으로 받아왔음에도 도움을 찾을 때면 두려움이 앞서곤 합니다. 이번에도 상담자께서 저를 이상하게 생각하실까봐, 징징거린다고 느끼실까봐 조금 걱정했어요. 그런데 정말 귀기울여 들어주셨고, 제 얘기가 여러 방향으로 흐를 때에도 핵심을 잘 찾아주셨어요. 제가 조금 무례한 질문을 드린 걸까봐 걱정했는데 편안하게 답해주신 점도 좋았어요. 저처럼 불안하고 걱정 많은 내담자분들도 따뜻하게 맞아주시는 분인 것 같습니다. 감사합니다.\n',2705),(3164,'2019-12-27 00:00:00.000000',5,'선생님과 이야기 나누면 복잡하고 불안한 마음이 차분히 정리됩니다. 상담 전에도 후에도 여전히 약하고 불완전한 나이지만 편안한 마음으로 잠든 후에는 더 감사한 날들을 보내게 되고 좋은 선택을 하게 됩니다. ',2681),(3165,'2019-12-25 00:00:00.000000',5,'상담사님, 이별 후에 잠을 잘 잘 수 있던날이 손에 꼽을 정도였습니다.\n그런데 오늘은 푹 잘 수 있을것 같네요..^^\n상담사님 말씀대로 자존감이 높은 사람, 거리를 둘 줄 아는 사람이 되도록 노력할게요\n혹시나 방법이 떠오르지 않으면, \n또다시 헤매이게되면 꼭 다시 찾아뵙겠습니다.\n늦었지만, 메리크리스마스입니다!',2706),(3166,'2019-12-23 00:00:00.000000',5,'혼자서 맴돌기만했던 고민의 원인을 알게되었고 무엇을 해결해나가야할지 실마리를 얻어낸 기분이예요.감사하고 노력해볼께요. ',2707),(3167,'2019-12-22 00:00:00.000000',5,'제 마음속 고민과 감정의 뿌리를 차분하게 조목조목 짚어주셔서 제 고민의 원인, 현재 상황, 문제를 해결하기위해 제가 해야할 일들을 알게되었고 불안을 진정시킬 수 있었습니다. 상담은 처음이라 사실 어느정도 긴가민가 하는 마음으로 신청했었는데 너무 마음이 편해졌고, 가족들에게도 가능하면 추천해보고 싶습니다.',2708),(3168,'2019-12-22 00:00:00.000000',5,'감사합니다',2709),(3169,'2019-12-21 00:00:00.000000',5,'시간넘어서까지 상담해주셔서 감사드립니다\n온종일 넉다운되어있었는데\n너무 좋은 말씀으로 힘나네요...',2666),(3170,'2019-12-18 00:00:00.000000',5,'시원한 상담 감사드립니다. 어떻게 대처해야하는지도 구체적으로 알려주셔서 너무 좋았어요^^',2710),(3171,'2019-12-15 00:00:00.000000',4.5,'생각하는 방향을 알게된 것 같아요',2711),(3172,'2019-12-15 00:00:00.000000',5,'너무좋아요 진정이되요\n어떤것에서 부터 시작이된건지\n시작의 원인이뭔지 끄집어내주셨어요\n\n',2712),(3173,'2019-12-14 00:00:00.000000',5,'처음으로 받은 상담인데 허혜정 상담사님이 잘들어주시고 잘 이해해주셔서 마음이 한결편안해졌습니다. 다음에 자존감올리는 상담신청해보고 싶습니다~ 감사합니다^^',2713),(3174,'2019-12-13 00:00:00.000000',5,'좋았어용❤️❤️',2714),(3175,'2019-12-12 00:00:00.000000',5,'공감을 정말 잘해주셔서 너무 좋았구요. 나 자신을 소중히 한다는 의미를 알게 해주셔서 감사합니다~',2715),(3176,'2019-12-12 00:00:00.000000',5,'이야기를 잘 들어주시고 공감도 너무 잘해주셨어요!\n마치 친구와 이야기하는 것처럼 편안했습니다\n힘든 고민이 있을때 어떻게 생각해야하고 어떻게 대처해야할지 방법에 대해서 고민해볼 수 있는 기회도 주시고 알려주셨어요ㅎㅎ 늦은 새벽시간에 갑작스러운 이야기에도 좋은 말씀 많이 해주셔서 너무 좋았습니다^^\n말씀해 주신것은 오늘부터 열심히 실천해보려고 합니다ㅎㅎ 화이팅!! \n',2716),(3177,'2019-12-11 00:00:00.000000',5,'너무 좋았어요\n',2717),(3178,'2019-12-11 00:00:00.000000',5,'제 자신에 대해서 더욱 잘 알 수 있었던 시간이었어요. \n',2714),(3179,'2019-12-10 00:00:00.000000',5,'항상 감사합니다 선생님~!!!',2608),(3180,'2019-12-10 00:00:00.000000',5,'불안함과 초조함, 우울함이 너무 심해 시작했었는데 많은 위로와 격려를 해주셨고 금방 지나갈 우울함이라고 생각했던것이 알고봤더니 유년기때의 아픔에서부터 시작되었던것을 알게 해주셨습니다. 단순한 위로보다 이 우울함이 어디서부터 시작된걸까 스스로 질문하고 대답하게 해주셔서 많은것을 되돌아보는 시간이 될수있었어요. 불안할때마다 매주마다 진행되는 상담을 기다리며 버텼습니다 소중한 존재라고 말씀해주셔서 감사합니다.',2718),(3181,'2019-12-10 00:00:00.000000',5,'도움이 되는 시간이었습니다. 감사합니다.',2719),(3182,'2019-12-08 00:00:00.000000',5,'2회 상담을 받았습니다. 유학생활 중 우울감이 심하게 찾아왔을 때 상담사님을 찾게 되었어요. 타지에서 혼자 생활하다보니 누군가에게 내 아픈 모습들을 꺼내기가 힘들었는데, 상담사님께서 따뜻하게 대화를 이끌어가 주시고, 저 스스로 생각지 못한 점들을 상기시켜 주셔서 참 좋았고 기대 이상이었어요. 얼굴을 보지 않고 텍스트로 하는 상담은 처음이지만, 그만큼 또 진솔할 수 있는 시간이었고.. 또 혹시나 힘든 상황이 생기면 다시 찾게 될 것 같아요. 이렇게라도 도움 얻을 곳이 생겨서 참 다행이라는 생각을 합니다. ',2720),(3183,'2019-12-07 00:00:00.000000',5,'안녕하세요 ^^ 저는 8회기 상담을 받았었던 내담자입니당\n개인적인 고민으로 상담신청했었는데 상담사님이 도와주셔서 정서적으로 많이 회복이 되었습니다. 처음 상담시작할때 불안정하고 감정적으로 너무 힘들었는데 상담사님과 상담에 집중하면서 다시 제 중심을 잘 찾아갔던거 같아요 ^^ 감사합니다 상담사님 !!',2721),(3184,'2019-12-07 00:00:00.000000',5,'충분히 제 상황에 공감해주시고 이유파악과 방향 제시가 좋았어요',2722),(3185,'2019-12-07 00:00:00.000000',5,'새벽에 알수없는 우울감에 사로잡혀 기대 없이 상담을 진행하였습니다. 정리 되지 않은 채로 최근 있었던 힘든 감정들을 마구 뱉었는데 정리를 잘해주셨고 원인부터 해결 방향에 대해서 한가지씩 짚어주셨어요. 열등감에 시달리던 제자신에 대해 깊게 공감해주시고 함께 고민해주시면서 긍정의 에너지를 뿜어주셔서 한결 마음이 편안해졌구 한번의 상담만으로도 원인과 해결점을 찾은 몇가지 부분덕에 제자신의 복잡미묘한 감정을 편안하게 만들어주신거같아요. 몇번 트로스트에서 상담을 진행했었고 같은 상담사분께 중복으로 진행해본적이 없이 매번 다른 상담사분을 찾았었는데 앞으로는 다음 이용시에도 허혜정상담사님에게 받을 예정입니다. 가장 만족도가 높았던 상담이었어요. 벌써 새벽 세시가 넘었네요!! 오늘 상담 감사합니다. 다음번에도 힐링하러 오겠습니다. 감사합니다 :)',2723),(3186,'2019-12-07 00:00:00.000000',5,'정말 어떻게 해야할지 막막하고 답답했는데\n1회 상담만으로도 가슴이 뻥 뚫린느낌이에요! 콕 찝어서 말씀해주시고 또 공감해주셔서 정말 좋았어요 감사합니다 다음에 또 상담받을게요!! ෆ\n',2724),(3187,'2019-12-01 00:00:00.000000',5,'허혜정 상담사님 덕에 제 자신이 어떤 사람인지 알게 되었습니다. 자신을 알게되면 어떤 방향으로 나아가야할지 스스로 알게 되구요. 그 방향으로 나아가는 과정 또한 상담사님이 항상 함께해주셨습니다. 단순한 위로뿐만 아닌, 여러 지식을 바탕으로 해주시는 해결 방안 탐색이 저는 너무 좋았습니다.',2725),(3188,'2019-11-30 00:00:00.000000',5,'잘들어주시고 공감해주시고 그리고 너무치우친 마음을 돌려서 상황을 좀더넓게 바라볼수있게 해주셔서 정말감사합니다\n큰 도움이 되었어요',2726),(3189,'2019-11-29 00:00:00.000000',4.5,'저는 몇 주 전쯤 극도로 우울했을때가 있었습니다.. 진짜 \'지금 상담을 받지 않으면 나는 내일, 아니 당장 아무것도 못하겠구나, 잠도 못자고 그냥 펑펑 울고만 있겠구나\' 싶은 느낌이 강하게 들었고, 급하게 \'지금\' \'당장\' 상담을 할 수 있는 분을 골라서 상담을 받자 했을 때(늦은 밤) 계셨던 분 중 한 분이 허혜정 상담사님이셨습니다.\n극한의 우울감이 가라앉고 나니 상담을 제대로 받자는 마음이 들었고, 우울감에 대해서 공감해주시려고 노력해주셨던 상담사님의 상담 스타일이 저랑 맞는 것 같아 4회기의 텍스트 상담을 더 진행했습니다.\n덕분에 항상 제 뇌리, 마음 속에서 자리하던 우울감과 무기력함, 낮은 자존감을 조금이라도 덜어내는데 도움이 되었던 것 같습니다. 제가 우울했던 상황, 좌절감을 느꼈던 상황에 대해서 말하다보면 그 때 어떠한 감정이었는지 조금 더 구체적으로 생각해볼 수 있도록 해주셨고, 그러다보니 객관적으로 마음을 가라앉힌 상태에서 제 감정을 들여다 볼 수 있는 좋은 기회가 되었던 것 같습니다. \n\n다만 조금 아쉬운 점이 있었다면, (아무래도 저 이외 많은 내담자분들과도 상담을 하시기 때문인 것 같습니다만,) 매 상담시 저와 이전에 했던 상담 내용의 구체적인 부분을 다시 물어보시는? 것 같아서.. 상담이 매끄럽게 이어졌다는 생각은 좀 덜 들었던 것 같습니다.\n하지만 상담사님께서 항상 불러주셨던 \'소중한 ***님\'이라고 사소한 말씀과 저의 상황에 대한 충분한 공감과 깊은 이해가 있었기에 저는 조금더 긍정적인 사람이 될 수 있었던 것 같습니다.\n\n혹시라도 상담을 고민하고 계신 분이 지금 있다면, 지체하지말고 상담을 받으시고, 누구에게 받을지 고민된다면 허혜정 상담사님께 받으셔도 (물론 개인의 취향차이, 성향차이가 있을 수 있습니다) 충분히 심도있는 상담을 받을 수 있을 것 같습니다!\n모두들 마음의 감기 잘 치료하세요!',2727),(3190,'2019-11-24 00:00:00.000000',5,'상담 시간이 짧아서 아쉬웠습니다 하지만 그 짧은 시간에도 굉장히 큰 위로를 주셨어요..! 기대 않고 설치한 어플이었는데 위안을 주셔서 감사해요 상담사님께도 항상 좋은 일만 있었으면 좋겠어요',2728),(3191,'2019-11-24 00:00:00.000000',5,'제 자신을  돌아볼수 있었고  나의  문제점도 알게되었어요  상담사님 이  나의  아픔에  공감해주시고  나를  성찰해볼수있게 해주었네요  내가  행복해야  자녀들이  행복해질수있단말에  힘 입어  이때까지  우울한 기분과   나쁜생각들을  떨쳐버리려고 합니다  사람은  누구나 실수할수있단 말  나또한  엄마라는   자리가  첨 이기에     어렵네요  이젠  딸을 있는 그대로  인정하고  저또한  딸의  인생이 아닌  제 인생을 살겠습니다  상담사님의  이야기들이  제 맘을 굉장히 편안하게  만들어주셨고 나를 성찰할수있어  깊은 감사드립니다 ',2729),(3192,'2019-11-18 00:00:00.000000',5,'많은 도움이 되었습니다. 감사합니다!!',2719),(3193,'2019-11-17 00:00:00.000000',5,'명쾌한 상담 김사합니다',2730),(3194,'2019-11-17 00:00:00.000000',5,'육아든 인생에 정답이 없는건데 전체적으로 바람직하다는 그 틀에 강요받으면서 나 자신과 또 아이와 씨름했던 거 같아요 그냥 아이 있는 그대로 아이 기질대로 맞춰서 잘 키울 수 있게 힘을 주셔서 감사합니다.',2731),(3195,'2019-11-13 00:00:00.000000',5,'감사합니다 \n\n',2732),(3196,'2019-11-13 00:00:00.000000',5,'많이 지쳐있던 상태였는데 마음이 개운해졌고 내 스스로를 위로할 수 있어서 좋았습니다! 그러면서 긍정에너지를 다시 찾게 되었어요!! ',2733),(3197,'2019-11-12 00:00:00.000000',5,'좋았습니다',2734),(3198,'2019-11-12 00:00:00.000000',5,'좋은 말씀들 많이 해주시고 진심으로 들어주셔서 감사합니다',2735),(3199,'2019-11-10 00:00:00.000000',5,'상담 처음 받아보는데 많은 도움 받았어요 마음이 한결 가벼워졌습니다 감사함니다 :)\n\n',2736),(3200,'2019-11-10 00:00:00.000000',5,'여러 예시를 제시해 주셔서 감사합니다.',2737),(3201,'2019-11-07 00:00:00.000000',5,'늘 많은 도움을 받고있어요',2608),(3202,'2019-11-07 00:00:00.000000',5,'막혀있던 불편한 감정들을 해소시켜주셨어요 \n\n제 상황들이 무엇이었는지 이해가 되니 한결 편안해졌네요 \n\n힐링되는 상담이었습니다 ',2738),(3203,'2019-11-06 00:00:00.000000',5,'상담이 짧은게 너무 아쉽네요.. 감사합니다 상담사님. 덕분에 단기간에 마음이 많이 풀렸습니다',2739),(3204,'2019-11-06 00:00:00.000000',5,'항상 인사하실때 소중한@@라고 얘기해주시고 제 편이라고 해주셔서 감사했어요. 소중한@@은 .. 처음에는 부담스러웠는데 상담이 진행되고 나에대해 알아가고 인정하면서 참 감사한말이라는 생각이 들었어요! \n나에대해 생각하고 이해하는 시간이 부족했던 저에게 그런 시간을 갖게해주시고 부정적인 단어도 긍정적으로 바꿔주시려고 노력해주셔서 감사해요 !! 고민많이하고 해본 상담이었는데 하길잘했어요. 절 인정하고 이해하게되고 응원하는법을 배웠네요.  \n저한테 해주신 만큼 다른분들과의 상담도 진심으로 해주실거같아서 추천하고싶습니다 ! \n그동안 감사했습니다. \n',2740),(3205,'2019-11-05 00:00:00.000000',5,'감사합니다.\n',2741),(3206,'2019-11-04 00:00:00.000000',5,'텍스트로 대화했음에도 많은 걸 깨달고 배우는 유익한 시간이었습니다. 자존감 업! 시키고 현재에 집중하라는 소중한 말 감사했습니다^^ 응원해주셔서 감사해요~',2737),(3207,'2019-11-03 00:00:00.000000',5,'심리상담이 아예 처음이었고 고민들 때문에 신체증상이 너무 심해져서 거의 내몰리듯이 신청하게 됬었어요. 상담사분도 별로 고민하지않고 고민 키워드에서 추천 받아서 했어요. 그래서 반신반의 했지만 잘 맞았던것 같아요. 심리증상이 너무 제가 편한 시간, 편한 상태에서 상담을 한다는 거 자체가 저의 감정에  집중할수있고 더 솔직해질수 있었던것같아요. 상담하면사 가장 인상깊었던건 힘들었던 제 자신에게 위로의 말을 해보는 시간이었는데요, 처음에는 정말 한마디 쓰는데 어려웠어요. 그런데 한번 하고 나서 진짜 위로 받은 거에요.. 눈물이 나더라구요 ㅜ 상담사님 도움이 없었다면 절대 혼자서 못했을것 같아요. 고민하고 계신 분들이 있다면 너무 추천드립니다!! 생각한 것보다 더 값진 경험을 하게 되실거에요.',2742),(3208,'2019-11-03 00:00:00.000000',5,'항상 귀기울여 들어주세요',2681),(3209,'2019-11-03 00:00:00.000000',5,'화를 조절하는 방법과, 상대방과 현명하게 협상하는 방법에 대해 너무 좋은 조언주셔서 힘을 얻고 있습니다..\n제 스스로 에게도 긍정적인 변화가 있는것 같구요.\n힘든것도 곧 지나가리라 믿고 있습니다!\n\n\n\n\n\n\n\n\n\n\n\n',2743),(3210,'2019-11-02 00:00:00.000000',5,'늦게까지 제 이야기를 들어주시고 \n제가 고민했던 부분을 정확히 집어주셨습니다\n한결 마음이 편안해지고  힘이 났습니다.\n',2744),(3211,'2019-11-02 00:00:00.000000',5,'토요일 저녁 혼자 고민하다가\n바로 상담으로 텍스트 테라피를 하게 되었는데요\n\n제 고민의 해결 방향을 알려주셔서\n유익한 시간이었습니다\n마음이 한결 가벼워졌어요..!\n\n늦은 시간까지 얘기 잘 들어주시고\n응원해주셔서 감사합니다!\n\n저에게 쓰신 시간 아깝지 않으시게\n노력하겠습니다',2714),(3212,'2019-11-01 00:00:00.000000',5,'내가 중요하고 존중받아야할 사람이란걸 교과서로 배우는것처럼 사람들에게 당연하게 들었고 말해왔지만 정작 고민의 근본적인 부분은 그러지 못해서 생긴 것들이었어요.\n이제 괜찮지 않아도 괜찮은척 하지 않으려 조금씩 연습하는 중입니다.\n자신은 소중하다라는게 머리로 당연하게 생각했던때와는 달리 의미를 다시 한번 알게 된 이후 제 생활이나 생각등 많은게 변해서 요즘 행복한일이 많아지고 있습니다.',2745),(3213,'2019-10-25 00:00:00.000000',5,'이야기를 차분히 들어주셔서 나의 이야기를 들어주신 분이 계신다는 것 자체가 치유되는 느낌이었습니다.\n문제에대한 진단을 해주시소 처방해주신 방법들은 생각 하지 못한 방법이라 시도해볼 기대가 됩니다.\n기회가 된다면 다시 선생님께 상담받고 싶습니다',2746),(3214,'2019-10-25 00:00:00.000000',4,'상담을 받고나서 제가 스스로 옳지 않다 생각하는 부분, 원하지 않는 것을 상대에게 단호하게 얘기하는 것이 때로는 필요하다는 것을 알았습니다. 끝없는 희생은 결국 분노와 우울증이라는 부작용을 낳고.. 결국 폭발하게 되어 있다는 것을요. 그것이 결코 잘못이 아니라는 용기를 얻게 되었습니다. 인생의 중요한 전환점을 앞두고 상담을 통해 정리가 많이 되었습니다.',2747),(3215,'2019-10-25 00:00:00.000000',5,'극한의 감정에서..\n저의 문제점과 해결점을 찾아주시고\n따뜻한 위로까지 해주셔서...\n깊은 깨달음을 얻었습니다....\n진심으로 감사하다는 말씀 전해 드려요..',2603),(3216,'2019-10-22 00:00:00.000000',5,'감사합니다\n',2748),(3217,'2019-10-19 00:00:00.000000',5,'늘 상담사님은 제 편이라고, 어떤 것보다 제 행복이 우선이라고 말씀해주셔서 위안이 되었습니다.',2749),(3218,'2019-10-17 00:00:00.000000',5,'늘 깊은 상담과\n 지지에 감사드립니다',2732),(3219,'2019-10-17 00:00:00.000000',4,'제 감정을 인정하고 수용할 수 있게 됐던 상담이었습니다. 내가 안 좋은 상황에 처했다, 우울하다는 상태를 인정하지 못해서 더 힘들었다는 걸 알게 됐네요. 첫 상담 때는 많이 울었는데 마지막 상담 때는 편안히 대화할 수 있었습니다. 텍스트 상담이다보니 아무래도 비언어적인 부분을 느낄 수 없어서 아쉬운 점도 있지만, 저를 노출시키지 않고 위로와 해결책을 얻어갈 수 있어서 좋았습니다. 감사합니다.',2750),(3220,'2019-10-16 00:00:00.000000',5,'독박육아로 지쳐있었는데 상담사님과 얘기하고는 답답했던마음이 풀렸구요\n아이에대한 죄책감이 책임감으로 바꼈습니다\n정말감사합니다',2751),(3221,'2019-10-15 00:00:00.000000',5,'상담사님이 제 이야기에 공감을 많이해주셨고 저에게 화의 본질에 대해서 말씀 해주셨습니다. 화의 본질은 저의 신념이 만든결과 즉 어떠한 결과가 나와야 된다한는 질서인데 이것이 무질서해지면, 화가 나는것이다. 화가 났을때는 이것을 잘 다스려야 하는데, 두가지 방향을 제시해 주셨고 즉 이런 상황을 잘 판단해서 미리 예측하면 화를 예방할수 있다는 것이다. 예를 들어 여자는 치마를 입어야한다는 강박관념을 갖고 있는 사람이 바지를 입은 여자를 보고 불쾌하거나 화가난다는 것인데...치마를 입을수도 있고 바지를 입을수도 있다고 생각의 변화를 갖고 확대한다면...화가 나는 상황을 만들지 않을것이다 라는 내용으로 이야기 했습니다. 좋은 말씀 감사드려요  ',2752),(3222,'2019-10-15 00:00:00.000000',5,'많이 좋은 방향으로 변화 할수 있는 용기도 생기고 가능성도 생긴것 같습니다 \n성의있게 상담해주셔서감사합니다.',2753),(3223,'2019-10-15 00:00:00.000000',4,'대면 상담도 물론 좋겠지만 매번 시간을 내야하는 번거로움이나 비용이 부담스러워서 선뜻 도전하지 못 했었는데 휴대폰으로 편하게 상담을 하니까 좋았습니다. 또 선생님이 명쾌하게 결론을 내려주셔서 감사했어요. 내 삶을 주체적으로 살아보도록 하겠습니다 감사합니다!',2754),(3224,'2019-10-14 00:00:00.000000',5,'너무나도 큰 도움이 됐습니다~!\n',2755),(3225,'2019-10-14 00:00:00.000000',5,'추장적인 내용으로 말씀 주신게 아니라 이렇게 하라는 구체적인 내용으로 응대해 주셨어요 너무 공감가고 힘이 됩니다',2756),(3226,'2019-10-13 00:00:00.000000',5,'지금 상담을 망설이고 계신 분이 있다면, 꼭.. 꼭 혜정 선생님이랑 상담 해보셨으면 좋겠습니다. 머리속이 복잡하고, 생각이 많아져서 가슴이 너무 답답해서 누구에게라도 털어 놓고 싶어서 상담을 진행하게 되었는데.. 정말 상담시간에 제가 제 얘기를 하면서, 속이 후련해진다 라는 생각이 들었고.. 제 얘기를 들어주시고, 또 선생님의 얘기도 해주시면서 진심으로 저를 격려하고 응원해주시는게 느껴졌어요. 과거에 내가 이런 이런 상처들이 있어서 과거에 얽매여 현재가 이런 문제들이 생기고 날 힘들게 만들었구나 판단하게 되고, 얘기를 들어주시는 것 뿐만 아니라, 앞으로 어떻게 해야할지 예방법도 설명해주시고 정말 너무 좋았어요.. 50분 그냥 제 얘기를 하다가 마무리 되고 있었는데 선생님이 아직 얘기를 다 못해주셨다고 \n또 상담을 이어서 정말 길게 진행해주셨어요.. 정말 너무 감사했고, 정말 나를 위해주시는 구나, 나를 위해 온 힘을 쓰고 계시는 구나가 느껴지는 상담 이었습니다. 선생님 말씀 처럼 이제 저를 만났으니 저를 아껴주려고 합니다! \n저를 위해 시간 내주셔서 너무 감사합니다. 사람의 마음은 유리알 같으니, 제 힘으로 안될 것 같으면 또 선생님 찾아뵙겠습니다 감사합니다 선생님. ',2757),(3227,'2019-10-13 00:00:00.000000',5,'불안하고 잠 못이룰때 쌤이랑 얘기하면 정리가 되요.\n점점 나아지는게 느껴저요. 감사합니다 선생님',2758),(3228,'2019-10-12 00:00:00.000000',5,'되돌릴 수 없는 과거에 대한 집착을 없애고\n새 미래로 나아갈 수 있게 많은 지지를 해주셨어요.\n문제점을 깨달았고 이제 반복하지 않을 수 있었요.\n감사합니다.',2759),(3229,'2019-10-10 00:00:00.000000',3.5,'제가 너무 부정적으로만 저를 대하고 있다는 걸 깨달았어요. 앞으로 부담 주지 않으려고 노력해보려고요. 감사합니다!',2759),(3230,'2019-10-09 00:00:00.000000',5,'만족합니다',2760),(3231,'2019-10-05 00:00:00.000000',4,'제 목소리가 계속 메아리치고 자꾸 끊기고 상담사님 목소리가 들리지않는 등등 통신상태가 좋지않아 트로스트로 통화하는 내내 집중하기가 너무 어려웠습니다.(특히 제가 말하는게 다시 들히는 메아리가 가장 민망하더군요)\n\n집중해서 얘기하기 힘들고 지속하기도 힘들었는데, \n상담사 선생님께서 잘 알아들어주시고, 핵심을 잘 찝어주셔서 너무 감사했습니다\n\n무엇보다 상담 고민에 대해 새로운 시각을 