 있게 변화시켜주십니다. 감사합니다. ',2758),(3247,'2019-09-15 00:00:00.000000',5,'처음부터 끝까지 제 이야기를 털어놓고 마음이 편해지는 걸 느꼈어요. 제 얘기에 귀 기울여 주시면서 해결책을 말씀해 주셔서 많은 위로가 되었습니다 감사해요',2770),(3248,'2019-09-14 00:00:00.000000',5,'새벽에 여러모로 멘탈이 나가서 바로상담으로 상담진행했는데요 늦은 시간까지 성심성의껏 상담해주셨습니다. 현재 제가 처한 상황을 해결할 방향을 제시해 주시고자 최선을 다해주셨어요 그리고 중간중간 저에 대해 파악한 것을 말씀해주셔서 스스로에 대해 좀 알 수 있어서 재밌었구요!',2771),(3249,'2019-09-13 00:00:00.000000',5,'이러한 상담이 처음이라 반신반의했는데 생각보다 많이얻어갑니다. 늦은시간 자세하고 따뜻한 상담 진심으로 감사드립니다. ',2772),(3250,'2019-09-12 00:00:00.000000',5,'늦은 시간인데도 성심껏 상담해주셔서 감사합니다',2732),(3251,'2019-09-11 00:00:00.000000',5,'허혜정 상담사님은 혼란스럽고 무기력했던 제게\n좀더 객관적인 시선으로 저 자신을 바라볼 수 있도록\n아낌없이 공감해주시고 이야기해주셨습니다.\n정말 감사했던 상담 시간들이었습니다.\n\n주변 사람들에게는 하지 못했던 이야기들도\n할 수 있었고, 무조건적인 공감만이 아니라\n전문가의 시선으로 바라본 제 문제의 본질적인 원인을\n부드럽게 이야기해주셔서 정말 도움이 되었습니다.\n\n앞으로도 상담 기록들 보며 되짚어볼 수 있을 것 같아\n마음이 든든합니다.\n\n저 같은 경우는 오랜 시간 가져온 문제라 \n4회기로는 조금 부족하다고 생각이 들어,\n한 두 차례 더 신청하려고 합니다.\n\n처음 상담권을 구매할때, \n권장되어진 상담 횟수에 따라 구매할걸 합니다.\n\n앞으로도 저처럼 많은 분들이 상담을 하고\n삶을 더 긍정적으로 바라볼 수 있기를 바랍니다..!! \n\n\n',2773),(3252,'2019-09-11 00:00:00.000000',5,'첫 상담이라 사연만 이야기하고 끝나겠지 했는데 기대 이상이었어요. 제가 먼저 꺼내고 싶은 속마음을 콕 짚어 꺼내주시고 힘듦의 근본적 원인과 제가 우선적으로 해야할 일들까지 짚어서 말씀해주시는데 너무 위로 많이 받았구요.\n상담사님 믿고 계속 진행해보고 싶어요.\n',2774),(3253,'2019-09-10 00:00:00.000000',5,'정말 위로.격려를 많이 해주시고 상담시간이 좀 넘어서라도 정말 날 위해 응원해주시는게 진심으로 느껴졌습니다. 비록 말하는것보단 속도가 느렸지만 그렇기때문에 천천히 부담없이 상담내용을 곱씹을수도 있다는 장점이 있어요.  짧지않은 시간동안 제 안의 긍정적인 심경변화를 유도해 주셔서 정말 감사드립니다 기회가 된다면 또 찾아뵙겠습니다',2775),(3254,'2019-09-10 00:00:00.000000',5,'제 지금 상태를 그대로 직면할 수 있는 시간이였습니다.',2776),(3255,'2019-09-08 00:00:00.000000',5,'상담을 받기 전에는 할지말지 고민이 많이 되지만 막상 받으면 진짜 내가 고민하고 있는게 뭔지.. 이 문제의 경중을 알 수 있어서 좋은 것 같습니다 \n또 어찌보면 그리 심각하지 않은 고민일수도 있는데 상담사님이 제가 고민하는 포인트를 잘 찝어주셔서 텍스트 상담이지만 실제로 마주하고 얘기하는 것처럼 느껴졌어요\n다음에는 더 깊은 고민에대해 상담을 받아볼 생각입니다 \n제 고민의 크기를 줄여주셔서 감사합니다! ',2777),(3256,'2019-09-07 00:00:00.000000',5,'얘기할곳도 마땅하지 않았고 고민도 많았는데 이렇게 얘기할 수 있게되서 속이 시원해졌어요! 상담사님 덕분에 맘이 많이 편해졌답니다. 감사해요 상담사님!! 상담사님이랑 상담하면서 지금의 저에게 집중하고있지 못하다는걸 알았어요... 지금은 현재에 집중하려고 노력하고 있답니다! 매일 그날 있었던 일, 무슨생각을 했는지등등 다기록해보고 아 내가 이런생각을하는구나 한답니다. 아무래도 속으로만 생각하던것보다 생각나는대로 적으니까 확실히 눈으로 보이니까 더 좋아요 아직 상담이 부족한거같아서 한번더 상담 하려구요ㅋㅋ 상담사님 화이팅!',2721),(3257,'2019-09-06 00:00:00.000000',5,'네감사합니다.',2778),(3258,'2019-09-06 00:00:00.000000',5,'늦은 시각인데도 불구하고 끝까지 귀 기울여 주시는 모습에 많은 감동을 했습니다.\n말씀하시는데 끊을 수가 없어서 계속 읽고 또 읽었어요.\n예전에 몇 차례 상담을 받았지만 상담사님 같은 분들은 없었던 것 같아요.\n감사해요 용기를 얻고 가요. 이제 제 삶을 찾아갈게요 :)',2779),(3259,'2019-09-02 00:00:00.000000',5,'상황을 객관적으로 바라봐주시고,\n또한 내담자의 입장에 서서 이해해주려 하셔서 좋았습니다.\n단편적인 상담이 아니라, 근본적인 뿌리를 바꿀 수 있게 멀리 내다봐주셔서, 앞으로의 상담이 기다려집니다\n ',2780),(3260,'2019-09-02 00:00:00.000000',5,'처음에는 새로운 표현법으로 말씀을 하셔서 당황스러웠지만 제 문제를 단시간 안에 찾아내고 바로 실천할 수 있는 해결방법을 알려주셔서 신기했어요. 예시를 들어서 말씀해준 부분이 크게 와닿았고 응답을 빨리 해주셔서 좋았습니다. 앞으로도 어려울 때 고민하지않고 찾아뵐 수 있을 거 같아요.',2781),(3261,'2019-08-31 00:00:00.000000',5,'만족합니다',2782),(3262,'2019-08-30 00:00:00.000000',5,'저의 뿌리에 대해서 .\n제가 오랜시간동안 가져온 외로움에 대해서 알게 되었어요. 오랫동안 애써온 저에게 잘했다고 얘기해주고 나니 마음이 편해졌어요.\n허혜정 상담사님과 함께 앞으로 저에 대해서 잘 알아가고 싶어요. ',2783),(3263,'2019-08-30 00:00:00.000000',5,'내면을 좀더알수있었고 건강하  유익한 상담입니다. .',2784),(3264,'2019-08-29 00:00:00.000000',5,'변화할수있는 용기가생겼습니다!^^',2785),(3265,'2019-08-27 00:00:00.000000',5,'스스로를 알수있는 계기가 된것 같아서 너무 좋았어요',2786),(3266,'2019-08-26 00:00:00.000000',5,'정말 마음을 헤아려주시는 상담이였습니다. 기존의 면담식이 아닌 온라인 상담으로는 여태 뵌 분중 가장 도움이 되고 마음이 편한 시간이였어요.',2787),(3267,'2019-08-25 00:00:00.000000',5,'제 입장에서 공감을 많이 해주시고, 편을 들어주시며 제가 앞으로 어떻게 하면 더 나아질 수 있는지까지 많이 도와주셨어요. \n갑자기 답답함을 느껴 어플을 찾아보고 예약상담도 아닌, 바로 상담을 진행해서 별 기대없이 상담진행했는데, 많은 기운 얻어가는 느낌입니다. \n그리고, 상담시간이 지났음에도 불구하고 저를 위해 더 얘기해주시려는 노력에 감사함을표합니다.',2788),(3268,'2019-08-25 00:00:00.000000',5,'제가 느낀 것을 잘 정리해주셨고, 앞으로 어떻게 해결 가능할지 해결책을 잘 제시해주셨습니다.',2789),(3269,'2019-08-23 00:00:00.000000',5,'매 회기 깊이 들어주려고 노력해주시고 이해하려고 마음 써 주시는 게 느껴져서 좋았습니다.\n',2790),(3270,'2019-08-21 00:00:00.000000',5,'누구한테도 말못할 이야기를 터놓는것만으로도  속이 뻥 뚫리는기분이구 친한 언니처럼 잘 상담해주셔서 넘 감사합니다 :) ',2791),(3271,'2019-08-20 00:00:00.000000',5,'새로운 시각으로 문제를 객관적으로 볼 수 있어 좋았습니다. 감사합니다.',2792),(3272,'2019-08-20 00:00:00.000000',5,'선생님 진심담긴경청과 조언에 도움이 많이 되었습니다. 원래 상담은 길게 가는 호흡맞추기 과정이라고 생각해요.  상담 여러번 받아봤지만 저를 이렇게 북돋아준 선생님은 처음 만나봅니다. ',2793),(3273,'2019-08-18 00:00:00.000000',5,'언제나 공감해주시구 좋은 조언 해주셔서 감사해요',2794),(3274,'2019-08-15 00:00:00.000000',5,'저의 상태를 파악할수있는 좋은 상담이였습니다\n처음엔 저가 왜그렇게 행동행는지 이해가 안갔지만 그이유를 콕찝어주섰어요\n\n앞으로 가야할 방향에대해서도 좀 알야야겠네요~ ㅎㅎ',2795),(3275,'2019-08-15 00:00:00.000000',5,'이야기에 집중해주시고 구체적으로 말씀해주셔서 감사했습니다\n',2732),(3276,'2019-08-15 00:00:00.000000',5,'선생님께서 친한 언니처럼 잘 들어주시구 조언해주셨어요. 이번 고민은 조언이 필요한 내용이었는데..!! 너무 예리하면서 재치넘치게 말씀해주셔서. 대화하는동안 답답하고 슬픈 마음이 싹 가셨습니다. 다음번 상담을 꼭 받아야겠다는 생각이 들었어요 ㅎㅎ 저에게 뭐가 필요한지 잘 알아주시구 제 편이 되어주셔서 기분이 좋았어요. 무엇보다 쌤이랑 대화하고 무거운 감정이 날아가서 가장 만족스러웠습니다~~! 감사해용쌤 또만나요.',2794),(3277,'2019-08-15 00:00:00.000000',5,'마음이\n정리되고 위로도 되었어요.\n결국 제가 바뀌어야 하는 거지만요^^\n좋은 상담이였어요.\n\n',2796),(3278,'2019-08-14 00:00:00.000000',5,'제가 몰랐던 제 감정을 스스로 느낄 수 있게해주셨어요. 처음엔 좀 어색했는데 핵심을 짚어주시는 상담으로 막혀있던게 뚫리는 기분이였습니다.\n진짜 참된 상담사분이라는 생각이 느껴졌습니다. 내담자의 입장에서 말씀해주시고, 깊이 공감해주셨어요. 이 상담사님과 상담 진행하면 더욱 좋아지고 건강해진 사람으로 변할것같다는 믿음이 생기네요!',2797),(3279,'2019-08-13 00:00:00.000000',5,'일반상담보다는 전문적느낌을 받았어요. . ',2784),(3280,'2019-08-13 00:00:00.000000',5,'위안받는 느낌과 경청 후 현실적 조언이 좋았습니다.',2798),(3281,'2019-08-13 00:00:00.000000',5,'좋은 상담 감사합니다:)',2799),(3282,'2019-08-10 00:00:00.000000',4,'첫상담인데제감정을잘짚어주셨고\n원래상담시간보다30분이나오래상담해주셨습니다\n도움을주셔서감사하고알려주신방법으로노력해보겠습니다\n좋은상담감사합니다',2800),(3283,'2019-08-10 00:00:00.000000',5,'화이팅있게 지지해주시고 응원해주셔서 정말 감사했고 늦은 시간에 상담시간까지 더 늘려서 해주시고 감사했습니다. 또 찾아뵐게요.\n',2801),(3284,'2019-08-09 00:00:00.000000',5,'그냥 불안하고 우울한 이 기분을 혼자 가라앉히기 힘들어 급히 신청한 상담인데 잠시나마 가라앉히기만 하고 싶다고만 기대했는데 생각보다 더 많은 도움을 받게되었어요. \n감정과 떼어놓고 지금 제가 무엇을 할 수 있을지 돌아볼 수 있는 좋은 시간이었습니다. 불안정한 전화연결 속에서도 끝까지 더 많이 도움을 주시려는 선생님께 정말 감사드려요!!♡',2802),(3285,'2019-08-08 00:00:00.000000',5,'도움되었습다. ',2732),(3286,'2019-08-07 00:00:00.000000',5,'쩐다.....! \n내 마음을 마주하기가 힘들었지만 .. 허혜정 상담사님이 질문으로 잘 유도해주시고 도와주셨다.\n오늘밤 뜬눈으로 지샐 뻔 했는데 마음이 편안해져서\n푹 잘수 있을거같다. 정말 만족스러운 상담이었고\n나에게 필요한 순간에 상담이 이루어 진것은 행운이라는 생각이 든다.',2758),(3287,'2019-08-06 00:00:00.000000',5,'급하게 바로 상담으로 상담했는데 대화하는 동안 따뜻한 격려와 함께 말해주셔서 감동받아 많이 울컥했어요 제가 몰랐던 부분들을 콕 찝어 설명해주셔서 제가 정말 힘들어한 진짜 이유가 뭔지 알게 됐어요\n상담을 받은 후, 전보다 마음이 많이 나아졌어요 감사합니다',2803),(3288,'2019-08-04 00:00:00.000000',5,'감사합니다.\n\n',2701),(3289,'2019-08-03 00:00:00.000000',5,'저는 어릴때부터 상담또한 많이 받아보았고 여러 선생님을 만났지만 이렇게 저를 진정으로 생각하고 제템포를 우선으로 두고 배려해주는 분은 처음입니다 \n대화중의 깨달음이 소름돋을 정도로 마음깊이 온것이 첫회기에 온것은 처음입니다 \n잘들어주시고 여러복합적인감정을 정리정돈하는 정리의 달인처럼 선택권을 저에게 주시면서 정리할수 있도록 도와주셔서 감사합니다 \n이렇게 인연이 될수 있음에 감사합니다 \n트로스트에게도 감사합니다 \n다만 시스템의 결제오류가 심해 여러번 시도해야 하는 번거로움과 통화중 에코가 너무 심하고 통화의 음질도 다른 어플이나 전화통화보다 떨어집니다 \n좋은 선생님이 이렇게 계신걸로도 훌륭한 트로스트이지만 이런점이 개선되어야 더욱더 유저들이 믿고 상담받는 환경이 되어 오래 이용할수 있을거라 생각합니다 부탁드리며 선생님 또 뵈어요❤️',2804),(3290,'2019-08-03 00:00:00.000000',5,'한달동안 제가 힘들었던 이유에 대해 명확하게 알려주셔서 그제서야 제가 왜 힘들었는지 알게됐어요. 문제를 아니까 해결책도 자연스럽게 생각났구요. 계속 질문을 통해서 인지하게 도와주셔서 좋았어요! 무엇보다 쉬운 예를 들어 이야기해주서서 더 와닿았어요. 다음번에 상담 한다면 다시 또 하고싶네요. 무작정 공감만 하거나 돌려말하시지 않고 확실하고 정확하게 말씀해주셔서 더 좋았어요\nㅎㅎㅎ 감사합니.  ',2805),(3291,'2019-08-03 00:00:00.000000',5,'여러가지 감정들이 올라오는 바람에 기분이 안좋아서 늦은 시간에 불쑥 상담 드렸는데 제가 만족하지 못했다고 생각하셨는지 늦은시간인데도 원래 상담시간보다 훨씬 더 연장해서 상담해주셨어요\n제가 왜 그동안 우울했었나 여러가지의 감정들이 막 올라왔을까 나름대로 생각을 많이 해서 안다고 생각했었지만 몰랐었던 제 감정들 생각들을 콕! 집어서 말씀 해주셔서 너무 놀랍기도 하고 가슴이 뻥 뚫리기고 하고 앞으로의 방향이 보였어요\n선생님께서 다음번 상담시 방향을 잡아주셔서 따라 가보려 합니다\n이런경험이 한국에서 이후로 처음이었는데요\n선생님께서 상담해주셨을때 저의 핵심을 톡 건드리니 눈물이 막 나면서 그 감정들이 올라왔어요\n선생님의 따뜻한 말씀이 너무 위로가 되었고\n정말정말 신기한 경험은 저의 핵심을 알았을때 막혔던 가슴이 위에서부터 아래로 쑤욱 내려가는듯한 느낌을 받았는데 너무 놀랬어요!!\n선생님 너무너무 감사했습니다\n시간 맞춰서 연락드릴게요~\n그때 말씀 하셨던 계획대로 상담해요（╹◡╹）\n상담후에 이 창이 계속 뜬다면 늘 후기를 남길 생각이에요\n상담받고 좋아진걸 계속 남기고 싶네요^^',2806),(3292,'2019-07-29 00:00:00.000000',5,'내 자신을 좀 더 사랑하고 위로와 칭찬을 많이 해야겠다고 생각했습니다. 계속 격려해주시고 감정코칭해주셔서 많은 도움이 됐어요.',2791),(3293,'2019-07-29 00:00:00.000000',5,'바로상담으로 이용한 후기입니다. 사실 예약제로 진행된 상담이 아니어서 기본 정보가 많이 부족한 상황이었는데 차근차근 이끌어주셨습니다. 만나뵈었던 상담사님 중에서도 정말 좋은 분이었던 것 같습니다. 혹시 고민하시는 분들이 계시다면 추천드립니다.',2807),(3294,'2019-07-29 00:00:00.000000',5,'상담을 통해서 카페에서 일했던것이 왜 그렇게 힘이들었던건지 이해할 수 있었습니다.  사실은 제 뿌리에 원인이 있었던 것이죠. 희안하게도 직장에서 일을 할때 이런식으로 관련된 문제점들이 들어난다는 것이 신기하기도하고... 저 스스로를 다시한번 파악하게 되네요. 제 나이가 28이기도하고 가정을 꾸려야하는 것에 있어서 사실 제 속마음은 정서적으로 부족하지 않는 가정을 만드는게 제 꿈이면서 제가 원하는 방향이 아니었나 상담 후에 생각이 들었습니다. 그러니 자꾸 상담을 받으려하고 책도 찾아보고 있는게 아닌가 싶기도 하구요. 사실아직 뭔가 속시원한 기분은 안들어서요. 또 상담 신청하겠습니다. 감사합니다^^',2570),(3295,'2019-07-27 00:00:00.000000',5,'새벽 2시 급하게 전화상담 요청을 하였는데 \n짧은 통화였지만\n이성적으로 생각할수 있게 많은 도움이 되었습니다\n굉장히 흥분 상태로 울며 통화했지만. 대화도 속마음도 포인트도 잘 끄내주기고 짚어주셨어요 \n스스로 그다음을 생각할수 있는 힘을 주셔서 감사합니다\n앞으로 정기권 예약하여  허혜정 상담사님과의 상담을 통해 \n변화되는 모습들을 만들어가고 싶네요 \n\n감사합니다',2808),(3296,'2019-07-25 00:00:00.000000',5,'너무 감사합니다 덕분에 아주큰힘이됬어요',2809),(3297,'2019-07-20 00:00:00.000000',4.5,'급하게 상담 진행하고 싶어서 새벽에 바로 상담되는 선생님과 연결한건데 만족감이 높았습니다.\n선생님은 특정행동,팁,구체적인 상황에 대한 대처방향 을 제시해주시는 타입이어서 저에게 도움이 되었습니다.',2810),(3298,'2019-07-14 00:00:00.000000',5,'처음 상담을 해봤고 짧다면 짧은 2시간이 저에게 너무 소중한 경험이 되었습니다. 공감도 잘 해주시고 저의 내용을 잘 파악하여 제가 이해할 수 있게 예도 들어주시고 그리고 앞으로 어떻게 하면 좋을지 방법도 제시해주시고 \n너무 좋은 경험이었습니다! \n\n감사합니다! \n\n\n',2811),(3299,'2019-07-01 00:00:00.000000',5,'오랜시간동안 늦은시간에 좋은 이야기를 해주셔서 감사했습니다. ',2807),(3300,'2019-07-03 00:00:00.000000',4,'감사드려요!!\n',2812),(3301,'2019-07-04 00:00:00.000000',5,'어디에고 말 못할 일들이었는데 차분히 들어주셔서 감사했어요. \n고민의 초점도 못맞춰 힘들었는데 조금씩 용기가 생기는 거 같아요\n\n다음 상담도 예약하려구요. 정말 감사합니다.',2813),(3302,'2019-07-07 00:00:00.000000',5,'감정과 경험을 파악해주시느라 많은 시간이 필요했습니다.\n덕분에 잘 알 수 있었네요. 시간이 많이 초과됐는데... 끝까지 들어주시려고 그래서 감사드립니다',2814),(3303,'2019-07-07 00:00:00.000000',5,'기대했던 것보다 큰 도웈이 되었어요. 제 문제를 다른 방향에서 볼 수 있어서 짧으나마 정말 고마운 시간을 보낸 것 같습니다. 감사합니다.',2815),(3304,'2019-06-21 00:00:00.000000',5,'저는 상담이 이곳이 처음입니다.  또 트로스트와같은  텍스트형식의 상담을 통해서는 그냥 한마디의 위로, 잠시나마라도 편이 되어줄 수 있는 한마디가 필요했습니다. 지금당장의 나에 대한답답함, 괴로움을 잠시나마  비워줄 수 있는상담이 필요했습니다.\n\n하지만, \n허혜정 상담사님을 통해 조금은 가벼운마음으로 다시 일상생활을 시작할 수 있을거같습니다. 또, 이 다음에 해야 될 것들을 생각할 수 있게 해주셨습니다.  상담을통해 위로와 용기 받아가셨으면 좋겠습니다! 화이팅',2816),(3305,'2019-06-26 00:00:00.000000',5,'힘든 일이 있을 때, 내 마음을 어떻게 다스려야할지 모르겠을 때 심리상담을 해보고 싶어도 해외생활 중이라 물리적 거리와 언어의 장벽 때문에 포기하기 일쑤였습니다. 문자로 마음이 전해질까 걱정도 되었는데 회기를 거듭할 수록 마음이 편해지더라구요. 제가 듣고 싶었던 말씀을 해주실 땐 눈물이 핑 돌기까지 했습니다. 이해하기 힘들었던 다른 사람의 언행도 알기 쉽게 이야기해주시고 제가 어떤 사람인지 생각해보게 되는 좋은 기회였어요. 조금 강한 마음을 가질 수 있게 된 것 같아요. 감사합니다. 추천!\n\n\n\n',2817),(3306,'2020-06-12 00:00:00.000000',5,'옛날 이야기와 지금의 문제의 연결점도 찾게 도와주셔서\n지금 문제를 이해가 수월했습니다\n명쾌하게 정리되는 것 같아서 .. 찌뿌둥하게 남아있는\n과거와 감정이 편안해진 것 같아요 \n그리고 특히 상담사님의 유쾌하고 긍정적인 \n목소리와 조언이 \n상황을 너무 심각하지만은 않게 볼 수 있게 하는 힘을 주셨어요\n혼자 이 문제를 볼땐 너무 괴롭기만 했는데\n한결 가볍고 마음이 밝아진 느낌이 들어요\n상담이 한줄기 빛같은게 이런 건가봐요\n\n감사합니다 \n',2818),(3307,'2020-06-08 00:00:00.000000',5,'선생님이 객관적으로 제 얘기를 들어주시고\n문제점부터 해결책까지 말씀해주셨어요\n도움이 될만한 미션도 주시고요\n칭찬도 해주시고 용기를 북돋아 주셨어요\n후에 우울증이 낫더라도 다시 올 수 있는 큰 감정기복 대처에 대해 같이 얘기도 했구요\n저는 좀 심한 우울증이라 약을 먹으며 트로스트로 상담도 병행하고 있는데\n저를 포함해 많은 사람들이 행복까진 아니더라도\n적어도 불행하지는 않았으면 해요\n행복하시면 더 좋구요\n저는 상태가 많이 좋아졌어요\n선생님덕분인 것 같아요\n좋은 하루 보내시고 감사합니다:)',2819),(3308,'2020-06-02 00:00:00.000000',5,'감사해요..!\n',2820),(3309,'2020-05-30 00:00:00.000000',5,'제 사고방식이 어디가 왜곡되어 있었는지 깨달을 수 있었습니다. 남도 상처주지 않고 스스로도 상처받지 않으면서 원하는 걸 얻을 수 있는 방법을 배울 수 있었어요. 처음 상담을 시작할 땐 표면적인 문제 하나만 해결하고자 시작한 것이었는데, 생각보다 더 크고 근본적인 부분의 문제들까지 해결하게 됐습니다. 덕분에 마음이 한결 편안해졌어요. 상담사님이 알려주신 방법들을 앞으로도 더 연습하면서 조금 더 건강한 마음을 갖고 싶습니다.',2821),(3310,'2020-05-28 00:00:00.000000',5,'마음이 안정이 됐어요.\n\n안절부절 못하는 사람을 이리저리 달래주고 \n\n아닌 것은 아니라고 얘기도 해주고\n\n안심 시켜줬어요. 엄마같이~~~~\n\n그저 내가 만든 왜곡으로 힘들어했다는 걸 알았어요.\n\n한편 너무 억울하기도 하지만 우리 남편도, 애들도 이런 내가 억울하겠죠.\n\n억울하지만 나만의 억울함은 아니죠.\n\n그냥 이런 나를 받아들이고 힘 뺄래요.\n\n힘빼고 살래요. 항상 바람은 불어오고 이리저리 나부끼면 지내면 되죠. 부러질까봐 안간힘 쓰지 않을래요.\n\n그냥 힘빼고 살래요. 그냥 힘빼고 너무 애쓰지 않고 살래요.',2822),(3311,'2020-05-14 00:00:00.000000',5,'따끔한충고와 따뜻한응원 잊지않겠습니다. 감사합니다!',2823),(3312,'2020-05-13 00:00:00.000000',5,'너무나 진심으로 이야기를 들어주시고\n조언해주시는 게 느껴졌어요\n따뜻하고 정감있는 위로 정말 감사합니다\n\n선생님의 긍정적인 에너지가 전해져서\n금새 다시 할 수 있겠다는 생각이 들었습니다\n\n짧은 시간 상담이었지만\n제 인생의 긴 여운으로 남을 것 같아요\n정말 감사합니다!',2824),(3313,'2020-04-28 00:00:00.000000',4,'상담후 새로운 시각을 갖게됐습니다.\n감사합니다',2825),(3314,'2020-04-27 00:00:00.000000',5,'감사합니다!!!!!!!!!',2826),(3315,'2020-04-24 00:00:00.000000',5,'다른 분들 후기처럼 차분히 들어주시고 구체적인 방향을 제시해주시는 것 같아 신뢰가 갔어요 일회성이 아닌 깊은 얘기를 털어놓는 상담이 필요하다는 말씀 무슨 말씀이신지 알겠어요! 조만간 받도록 하겠습니다^^ 많은 도움 되었어요~! 외로운 마음에 귀기울여 주심이 위로가 되어주셔서 고맙습니다',2827),(3316,'2020-04-22 00:00:00.000000',5,'너무 힘들고 답답하고 왜 극복하지 못하나 저를 재촉하면서 우울했는데\n지금 당장 괜찮지않아도 된다고 좀더 맘껏 슬퍼해도 솔직하게 화를 내도 괜찮다고 말씀해주셔서 너무 감사했어요.\n좀더 맘껏 제 감정을 표출하고 말씀해주신대로 저를 위로하는 시간을 가지고 저를 더 사랑할 수 있도록 노력해보려구요 감사합니다\n',2828),(3317,'2020-04-11 00:00:00.000000',5,'많이 힘들고 지쳐있었는데 그 무계를 덜어주신것 같아요 감사합니다.',2829),(3318,'2020-04-06 00:00:00.000000',5,'막 공감해주시는것이 아니라 진심으로 공감해주시고 들어주시는 모습에 많은.위로를 받아가요',2830),(3319,'2020-03-28 00:00:00.000000',5,'힘든일을 객관적으로 보게되어 불안감이 없어졌어요',2831),(3320,'2020-03-23 00:00:00.000000',5,'두번 밖에 전화상담이 진행 되었지만 오랫동안 갖고있던 제 문제에 대해 진지하게 들어주셔서 감사합니다. 알고는 있었지만 제잘못이 아니라는것을 다시 한번 알게 되었고 말씀해주신대로  죄책감은 계속 들겠지만 그거와는 별개로 버릇없지 않은 선에서 엄마와 싸워 볼게요. 다시한번 힘을 얻고 싶어질때 상담신청 드리겠습니다. 감사합니다.',2832),(3321,'2020-03-07 00:00:00.000000',5,'혼자 고민하며 힘들었는데 선생님과의 상담으로 큰 용기를 얻었습니다. 상담받길 잘 했어요. ',2831),(3322,'2020-02-19 00:00:00.000000',5,'실시간 전화상담으로 조금전 까지도 답답하고\n말하지 못해서 울고싶은데 울지못하고 억눌렸던\n제감정을 털어버린수 있었요~\n한바탕 울고 위로받고 조언받아\n내일 아침에는 좀더 기운있고 힘차게\n생활해 보겠습니다^^*',2833),(3323,'2020-02-19 00:00:00.000000',5,'상담 내내 정말 이야기를 잘 들어주신 것 같습니다. 아직 많이 수줍지만, 좀 더 자기자신을 지지해보려 합니다. 그것이 제게 도움이 될 것이라 확신하게 주시고 제 안에 그럴 힘이 있는 걸 알아채주신 상담사님께 감사드립니다. 만약 살면서 다시 한 번 심리적인 문제에 부딪힌다면 그 때의 상담도 꼭 선생님께 부탁드리고 싶을 정도로 이번 상담에 만족했습니다. 이상입니다.',2834),(3324,'2020-02-18 00:00:00.000000',5,'감사합니다\n',2835),(3325,'2020-02-13 00:00:00.000000',5,'상담사님과 대화 후 생각하지도 못한 부분에 원인이 있다는 것을 깨달았습니다. 가르쳐주신 내용을 바탕으로 일상에서 실천할 수 있도록 노력하겠습니다. 감사합니다',2836),(3326,'2020-02-13 00:00:00.000000',5,'저처럼 주변에 힘든 이야기를 못 하는 사람들에게\n누군가에게 솔직하게 털어놓을 수 있다는 것 자체가 소중한 경험입니다\n한 번의 상담으로 모든것이 변할 수는 없다는 것을 인지하시면 좋을 것 같고 상담사님이 경청해주셔서 감사했습니다',2837),(3327,'2020-02-13 00:00:00.000000',5,'도움 많이 되었습니다. 감사합니다.',2838),(3328,'2020-02-12 00:00:00.000000',5,'감사합니다^^\n',2839),(3329,'2020-02-11 00:00:00.000000',5,'상담이 필요하다는걸 깨닫게해주셨습니다. 꾸준히 상담하여 고쳐나가겠습니다.',2840),(3330,'2020-02-06 00:00:00.000000',5,'위로와 동시에 경각심을 얻고갑니다. 감사합니다. ',2841),(3331,'2020-01-29 00:00:00.000000',5,'오랜시간 혼자서 생각만 하던 것들에 확신을 더해주셨습니다. 따뜻한 위로까지 건네주셔서 정말 감사합니다. ',2842),(3332,'2020-01-07 00:00:00.000000',5,'차분하게 이야기 들어주시고 제 스스로 생각을 정리할 수 있게 도와주셔서 너무 감사했습니다. \n특히 잠시 멈춰서 지금 마음이 어떤지 왜 그런 생각을 하게 됐는지, 지금 바라는 게 뭔지 돌아보는 시간을 갖게 해주신 것이 많이 도움이 되었습니다. 이번 상담을 힌트삼아서 나중에 또 마음이 흔들릴 때 혼자서도 시도해 봐야겠다 생각이 들었어요. ',2843),(3333,'2019-12-20 00:00:00.000000',5,'많이 편안해졌어요 누구한테 맘편히 터놓는거만으로도 도움이많이됐어요',2844),(3334,'2019-12-18 00:00:00.000000',5,'따뜻한 말씀 정말 도움이 많이 되었습니다. 추천합니다. ',2845),(3335,'2019-12-18 00:00:00.000000',5,'진심으로 다독임받는 느낌이 들고 너무 좋았어요. 앞으로도 살아갈 방법이나 용기를 배운 것 같아요. 감사합니다.',2846),(3336,'2019-12-18 00:00:00.000000',5,'감사합니다 놓차고 있던 부분을 차분하게 말씀해주셨어요. 생각보다 50분이 짧네요. 더 길게 받아보고 싶네요. \n  ',2847),(3337,'2019-12-16 00:00:00.000000',5,'앞으로 어떻게 해야하는지 잘 모르는데 방향을 말씀해주셔서 감사했습니다. \n저의 문제가 1회성 상담으로 해결되는게 아니라는 걸 알기에...그래도 감사해요 ',2848),(3338,'2019-12-11 00:00:00.000000',4,'객관적인 관점을 가질 수 있게 해주셨어요. ',2849),(3339,'2019-12-04 00:00:00.000000',4,'50분에 모든걸 담을 순 없었지만 저자신을 위해 마음이 없더라도 노력해보란말씀 다시 생각하게 됐습니다.\n남편과 저의 다름을 인정하는계기도 되었구요. \n감사합니다.기회가 된다면 남편의 입장에서 상담을 해보라고 권하고싶어요.제 생각과 남편생각도 객관적으로 들어볼 수 있는 계기겠지요.',2850),(3340,'2019-11-28 00:00:00.000000',5,'아무 맥락 없이 하고 싶은 얘기만 했는데 풀어나가게 도와주셔서 감사합니다. 속이 좀 풀렸어요.',2851),(3341,'2019-11-28 00:00:00.000000',5,'채팅으로 받는 상담에 무슨 효과가 있을까.. 하는 걱정이 상담 중반까지도 들었는데, 중요한건 매체가 아니라 듣는 이의 마음가짐에 달려있더군요. 정말 뻔한 말이지만 직접 몸으로 느끼고서야 알았습니다.\n\n처음엔 상담사님이 어떤 구체적인 해결법을 알려주시질않아 갑갑했습니다. 어떤 특별한 행동습관을 들여보라던지 하는것이요. 그렇게 상담기회 두어번정도를 무기력하게 보냈는데 상담일정이 귀찮다고 생각하는 나를 발견하고 이 상담을 무의미하게 만드는건 나 자신이 아닌가 하는 생각이 들었어요. 그래서 상담사님이 해준 조언을 믿고 행동해봤죠(구체적인 내용을 적을 순 없지만). 상담사님께서 내 깊은 속내까지 듣고 내려주신 처방전이잖아요. 그리고 변화를 겪었어요. 정말 신기하고 행복한 경험이었어요.\n\n마음이 평안하다는게 이렇게 행복한 일이네요. 정말 감사드립니다.',2852),(3342,'2019-11-27 00:00:00.000000',5,'일단 이야기를 터놓을 수 있고 잘 들어주셔서 좋았습니다. 처음으로 제3자에게 얘기하는 것 만으로도 기분이 나아진 것 같습니다. 비록 횟수가 적다보니 서두르며 마무리가 되었지만, 현재 마음도 잘 들여다봐주시고 앞으로 노력해야 할 부분들도 빠짐없이 정리해주셔서 마음에 잘 새기고 열심히 해보려고 합니다. 감사했습니다.',2853),(3343,'2019-11-25 00:00:00.000000',5,'네...남에게 듣고 싶은말을 저에게 해줘야겠다고 또 생각하게 되네요. 남시선을 너무 보지말고 저의 마음도 알아봐주고 위로해줘야될 것 같아요. 과거의 상처도 문제있고 현재의 상태도 문제가 있듯이 저의 어떤 점으로 계속 이렇게 힘든 것 같아요. 저의 상처를 치료해야 다른 사람의 말투도 상처 안 받을 것 같아요. 짧은 상담이라 아직 부족해서 몇 번 더 상담을 받고 저의 내면이 강해졌으면 좋겠어요. ',2854),(3344,'2019-11-23 00:00:00.000000',5,'정말 감사합니딘',2855),(3345,'2019-11-20 00:00:00.000000',5,' 50분 전화상담으로 하였는데 짧은 시간이지만 주어진 시간 내에 최대한 도움을 주시려고 하시는 것이 느껴졌고, 직접 만나서 상담 해주시는 것 같이 진심이 느껴져 감사했습니다. \n 저의 잘못된 행동을 하게 된 가정 환경과 관련된 계기를 물어봐주시고 연관성에 대해 생각하게 해주셨고 제가 하는 행동(분노표출)이 결국 제 자신에게 아무런 도움이 되지 않는 방법이기 때문에 다른 방법을 제안해주셨습니다..! \n 이야기를 끝까지 들어주시고 \"공감\"과 \"현실적 방안\"을 함께 해주셔서 큰 도움이 되었습니다. 상담사님의 연륜과 경험이 느껴졌던 상담이었습니다.  감사드립니다 ^^!!\n\n',2856),(3346,'2019-11-18 00:00:00.000000',5,'불안하고 걱정되던 마음과 과거로부터 생각의 전환을 할 수 있었어요 마음이 가볍고 기분이 좋아졌습니다 이걸 유지하도록 노력할게요 감사합니다 긍정적인 기분으로 마무리 할 수 있어 좋았습니다\n',2857),(3347,'2019-11-15 00:00:00.000000',5,'진심으로 대해주셔서 너무 감사드립니다 \n상담사님이 알아주시고 마치 엄마처럼 조근조근 이야기해주셔서 너무 많은 위안을 받았습니다\n덕분에 많이 밝아지고 행복해졌어요~~^^구멍뚫린것처럼 허했던 제 마음을 채울수 있는 ㅎㅁ',2858),(3348,'2019-11-14 00:00:00.000000',5,'제가 깨닫지 못하고 있던 부분을 잘 짚어주셨어요.\n감사합니다!',2859),(3349,'2019-11-07 00:00:00.000000',5,'경청해주시는것같아 좋았어요',2860),(3350,'2019-11-06 00:00:00.000000',5,'내가 느끼는 불합리한 감정을 객관적인 시각으로 바라볼 수 있도록 안내해 주시고 끝까지 응원해 주셨어요. 단순한 위로가 아닌 내가 스스로 이겨낼 수 있는 용기를 주셔서 감사해요',2861),(3351,'2019-10-29 00:00:00.000000',5,'감사합니다. 도움이되었어요',2862),(3352,'2019-10-28 00:00:00.000000',5,'좋았습니다. 더 이어가고 싶어요.',2863),(3353,'2019-09-30 00:00:00.000000',5,'총 2회를 상담받았는데 짧은 시간안에 많은 조언을 해주셔서 너무 좋았어요! \n\n',2864),(3354,'2019-09-23 00:00:00.000000',5,'현재의 우울과 화가 자연스러운 것이라고 해주신 점과 앞으로의 방향성을 제시해주신 점이 좋았습니다. \n\n\n\n',2865),(3355,'2019-09-20 00:00:00.000000',5,'감사합니다',2866),(3356,'2019-09-17 00:00:00.000000',5,'트로스트 이용 전, 트로스트 상담사 선생님들이 아닌 다른 곳의 선생님으로부투 심리 상담을 받았던 적이 있었어요. 그 때 당시에 제게 있었던 마음 안의 화를 풀 수 있었고, 지금도 그 방법을 실천하며 노력해 오고 있습니다. 하지만 이 방법으류 화는 줄어들었지만, 제가 현실에 처한 상황 및 다른 기타 주변으로 인해 \'좌절감\', \'우울함\'은 어떻게 대처해야 하는 지 어떻게 해야 할 지 원인도 해결책도 스스로 알 수 없었습니다. 주변 가족과 친구들과 대화를 해도 풀리지 않았어요. 이 기분으로 이 상태로는 살아가기가 힘들어 용기 내어 트로스트앱을 검색하여 이용해보았고, 제게 진심으로 잘 맞는 상담사분을 매칭해주었습니다. 어린시절과 지금의 제 모습이 많이 연관되어 있다는 것를 임명숙 선생님으로부터 확실히 배울 수 있었으며, 제 모습을 평가해주시는 것이 아니라 진심으로 격려해주시고 이해해주셨습니다. 과거는 과거일뿐 없었던 일이 되지 않으니 앞으로 어떻게 하면 제가 즐겁고 행복하게 살 수 있을 지 질문을 던져주시며 이에 대해 제 스스로를 다시 한번 생각할 수 있도록 해주셨습니다. 이에 즐겁고 행복하게 살기 위한 선생님의 조언과 제 생각이 일치하는 순간 그 짜릿함과 희망을 앞으로도 잊지 못할 것 같습니다. 선생님, 정말 정말 감사드립니다 ^^',2867),(3357,'2019-09-10 00:00:00.000000',5,'많이 울었는데 차분히 들어주시고 현명햐 조언 감사합니다 다시 상담받고 싶어요 \n꼭 상담사님한테 받은 조언대로\n실천하도록 노력하겠습니다 \n\n결코 싶지 않지만\n노력하면 나아진다는\n말씀 기억하고\n명심할께요',2868),(3358,'2019-09-03 00:00:00.000000',5,'아내와의 소소한 대화를 통하여 좀 더 편안해지고 불안을 내려놓는 방법을 알게 된 거 같아요. ',2869),(3359,'2019-08-28 00:00:00.000000',5,'워킹맘으로서 한사람의 아내로\n또 아이들의 엄마로 많은 고민과 상처가\n있었는데 공감해주시는 것 자체로도\n많은 도움이 되었습니다☺️\n그동안 표현하지 못했던 고민들에 대하여\n어떻게 표출해야 좋을지 같이 고민해주셔서\n많은 도움이 되었어요\n오랫동안 묵혀두었던 제 감정들을 정리하는데\n많은 도움이 되었습니다.\n4주라는 시간이 너무 짧게 느껴질 정도로\n좋은 시간이 되었기에\n기회가 된다면 더 많은 이야기를 나누어 보고싶습니다.\n',2870),(3360,'2019-08-05 00:00:00.000000',5,'제 문제에 대해 직면도 하게 해주시고 격려도 해주셔서 편안한 상담이 되었습니다. 감사합니다.그때 상담사님이 격려해주신대로 지금 제 삶을 찾으면서 열심히 살아가고 있어요. 다시한번 감사합니다.',2871),(3361,'2019-08-03 00:00:00.000000',5,'아이에게 화를 내는 이유가 과거의 해결하지 못한 감정 때문일 수 있다는 점을 생각해보게 해주셨어요. 2회의 상담으로는 더 깊이 찾아내지 못했지만 고민해보고 추후 더 상담을 받아볼까 합니다.',2872),(3362,'2019-07-16 00:00:00.000000',4,'구구절절이야기들 다 들어주시고 제마음도 이해해주시고 제가 힘든부분들 마음의 짐을 좀 덜어낼 수 있도록 해주신거같아요. 알려주신대로 최대한 노력해보려고 합니다. 시간이 길지않아 더 깊고 많은이야기는 못나눴지만 또 상담이 필요한 때가 오면 다시 상담할 의향있어요',2873),(3363,'2019-07-15 00:00:00.000000',5,'처음 상담을 경험해봤는데 제가 고민하는 부분의 다른 관점에서 이야기 해주시고 용기를 주셔서 제 마음의 짐이 덜어진것 같습니다',2874),(3364,'2017-11-17 00:00:00.000000',5,'  좋았던 점: 질문을 많이 해주시고 친구처럼 얘기해주셔서 좋았어요  아쉬운 점:없습니다',2875),(3365,'2018-08-01 00:00:00.000000',5,'저 자신과 화해하고 장단점을 인정하도록 노력할게요\n',2876),(3366,'2018-04-22 00:00:00.000000',5,'  좋았던 점: 실생활에 바로 적용할 수 있는 문제 해결요령들을 알려주셔서 도움이 되었습니다.  아쉬운 점:크게 없는것 같습니다.',2877),(3367,'2017-09-05 00:00:00.000000',3.5,'  좋았던 점: 첫 상담이라 아직 어떻다라고 적기는 무리네요.\n아직은 물음표만10000개라...\n공감해주신 말씀은 상담을 이어가는데 도움이 되었습니다.\n또 진심으로 저의처지를 함께 걱정해주셔서 고마웠습니다.  아쉬운 점:아직은 50분 상담이 전부라 크게 없었습니다.',2878),(3368,'2019-05-22 00:00:00.000000',4.5,'두번의 상담에서 모든 얘기를 꺼내기 힘들었지만 최선을 다해 들어주시고 방향까지 안내해주시려고 한 점이 너무 감사했고 그냥 그 시간동안 위로를 받은 것 같아요!\n',2879),(3369,'2018-04-23 00:00:00.000000',4,'  좋았던 점: 내담자를 파악하려고 노력하여 내담자가 가진 페인포인트를 집어주셨습니다. 편안하게 이야기 이끌어가시는 점이 좋았습니다.   아쉬운 점:마지막에 혼내듯 이야기 하신거? 근데 이건 저를 위해 해주신거라 아쉬운 점은 아닙니다만 필수 작성하는 칸이라고 해서 겨우 생각하여 씁니다. ㅎㅎ ;;',2880),(3370,'2017-09-06 00:00:00.000000',5,'  좋았던 점: 마음을 다해서 제 이야기를 들어주셨습니다. 제가 잘 되기를 바라시면서 아낌없는 응원과 조언을 해주셨습니다. 오아시스같은 상담이었습니다.   아쉬운 점:없습니다.',2881),(3371,'2017-11-17 00:00:00.000000',5,'  좋았던 점: 짧은 시간이지만 진심을 다해 정성껏 상담해주셔서 넘 좋았어요... 마지막 남은 시간까지 좋은 말씀을 해주셔서 너무너무 좋았어요. 내 마음을 알어가는 시작이 되었네요.  아쉬운 점:제 고민이 좀 많아서 시간부족이 아쉬웠어요.',2882),(3372,'2018-01-02 00:00:00.000000',5,'  좋았던 점: 어떤점이 문제엿는지 확실하게짚어주고 그에대한 해결점까지.. \n짧은시간이긴했지만 먼가 희망이보여요   아쉬운 점:채팅속도가 살짝?ㅎㅎ',2883),(3373,'2019-03-12 00:00:00.000000',5,'답이 없는 가족과의 갈등 상황에 오랫동안 갇혀있어서 객관적인 시각이 필요했는데, 제가 가장 필요로 했던 가이드를 명확하게 해주신 것 같습니다. 차분히 얘기 들어주시고 조언해 주셔서 감사합니다!',2884),(3374,'2019-06-12 00:00:00.000000',5,'상담을 받는 과정이 스스로를 되돌아보며 정리하는 시간이 되네요.\n',2885),(3375,'2018-04-24 00:00:00.000000',5,'  좋았던 점: 실생활에 바로 적용할 수 있는 문제 해결요령들을 알려주셔서 도움이 되었습니다.  아쉬운 점:크게 없는것 같습니다.',2886),(3376,'2017-11-19 00:00:00.000000',3.5,'  좋았던 점: 공감해주시는 점  아쉬운 점:없는듯합니다 ',2887),(3377,'2018-08-13 00:00:00.000000',2,'내 감정이 어디서부터 온 것인지 파악해주심',2888),(3378,'2017-11-18 00:00:00.000000',5,'  좋았던 점: 진심으로 제 말에 경청해주시고 응원해주시는게 느껴져서 참 좋았습니다. 제가 변화할수있겠다 라고 생각들게 만들어주셔서 참 감사합니다.   아쉬운 점:없습니다',2889),(3379,'2018-10-06 00:00:00.000000',5,'오늘 연속으로 두번 100분동안 상담했는데 \n생각보다 훨씬 좋았어요. 역시 전문가는 다른가봐요.\n아직 마무리짓질 못해서 더 연장해서 하려구요 ㅎ\n정말 감사합니다^^ ',2890),(3380,'2018-01-06 00:00:00.000000',5,'  좋았던 점: 일단 고민을 편하게 말할 수 있다는 것이 너무 좋았어요. 그리고 제 고민을 진지하게 생각해주시고 그 고민에 대한 해결 방법들을 얘기해주시고 자신을 한번 돌아보게 되어 만족했던 시간이였습니드.  아쉬운 점:시간이 빨리가서 짧게 느껴지는게 아쉬웠네요. 상담사님께 아쉬운 부준은 없습니다.',2891),(3381,'2018-12-09 00:00:00.000000',4,'온전히 나 자신이 소중함을 생각해볼 수 있도록 대화를 이끌어주셨어요. 감사합니다.',2892),(3382,'2018-03-06 00:00:00.000000',4.5,'  좋았던 점: 편하게 말할 수 있도록 유도해주시고 우왕좌왕할때도 핵심을 잘 이해해주셔서 대화를 계속 이어나갈 수 있었습니다. 시작전에 상태를 먼저 확인하는것이 섬세하다고 느껴졌습니다.   아쉬운 점:채팅속도가 조금 느리신것 같어요 불편할정도는 아닙니다. ',2893),(3383,'2017-11-05 00:00:00.000000',5,'  좋았던 점: 제 얘기를 듣고 공감해 주셔서 좋았습니다. 제가 힘들었던 점을 알아주셔서 감사했어요. 차분히 이끌어 주셔서 아무에게도 말하지 못하는 것도 말할 수 있었습니다  아쉬운 점:없습니다',2894),(3384,'2019-06-13 00:00:00.000000',5,'제 마음 속에 있는 불안함을 상담사한테 처음 털어놓았습니다. 공감, 위로도 잘해주시고 해결 방안도 잘 제시해주셨어요. 말 한마디 한마디가 정말 따뜻했습니다. 정말 강력 추천합니다.',2895),(3385,'2018-06-12 00:00:00.000000',4.5,'  좋았던 점: 공감해주셨다  아쉬운 점:-----',2896),(3386,'2019-05-01 00:00:00.000000',4,'조금 더 감정에 직면할 용기가 생겼습니다.',2897),(3387,'2017-11-22 00:00:00.000000',4,'  좋았던 점: 최대한 제 말을 들어주시려고 했던 점이 좋았습니다.  아쉬운 점:크게 없습니다.',2898),(3388,'2018-04-30 00:00:00.000000',4,'  좋았던 점: 좋았던 점은 문제에 대한 해결책을 알려주려고 하셨던 점이 좋았어요  아쉬운 점:아쉬운 점은 대화 중간 중간에 공백이 많았다는 점?',2899),(3389,'2018-06-12 00:00:00.000000',5,'  좋았던 점: 편안한 대화를 통해 상담이 진행되었습니다. 힘들어했던 원인도 알게되었구요. 현실적인 조언도 함께해주셔서 원인파악에 큰 도움이 되었습니다.  아쉬운 점:전혀 없습니다.',2900),(3390,'2019-05-02 00:00:00.000000',5,'제가 모르고 있었던 부분을 자연스럽게 이끌어주셔서 제 자신이 변화하는데 많은 도움을 받았습니다 알고싶지않은 내 자신을 알게되어 힘이들었지만 선생님이 알아주고 같이 견뎌주셔서 변화할 수 있었어요 항상 잊지말고 감사한 마음으로 제 자신을 사랑하도록 하겠습니다 감사합니다',2901),(3391,'2018-12-12 00:00:00.000000',5,'주신 질문에 답하는 과정에서 제가 겪은 일련의 일들의 공통적인 원인을 알게 된 것 같아요. 해결방안은 생각보다 단순하다는 걸 스스로 깨달은 경험이었습니다. 감사합니다.',2902),(3392,'2018-10-08 00:00:00.000000',4.5,'무리하게 상담 진행을 안 하시고, 상담자를 위해 속도를 맞춰주시려는 모습이 느껴져 감사했습니다.\n또한 지금 당장 나아질 수 있을만한 방법에 대해서도 알려 주셔서, 한결 마음이 편안해졌어요.\n',2903),(3393,'2018-12-12 00:00:00.000000',5,'선생님께서 차금차근 잘 설명해 주셨습니다. 조금은 나를 알아가고 그에 맞는 대처를 만들어가고 내면적으로 들여다 볼 수 있는 시간이었습니다. 무엇보다 복잡하게 생각하는 나의 문제를 알게되고 조금은 심플하게 행동으로 옮기고 받아들이며 변화해야겠다고 느낄 수 있었습니다. 좋은 시간이었습니다. ',2904),(3394,'2019-06-15 00:00:00.000000',5,'처음 받아본 상담인데 그래도 당장 느끼던 심한 불안은 내가 느낀 것들을 털어놓는 것 만으로도 좀 잠재워진것 같습니다 ',2905),(3395,'2017-09-16 00:00:00.000000',5,'  좋았던 점: 먼저, 최초 답장이 빠르셔서 좋았어요. 현실적이고 사이다같은 조언에 마음과 생각을 다잡을 수 있었고, 그와중에 다정하고 따뜻한 말씀도 큰 힘이 되었습니다. 응원 감사히 받아 열심히 해야겠어요.   아쉬운 점:없습니다',2906),(3396,'2018-03-10 00:00:00.000000',4.5,'  좋았던 점: 질문으로 제 고민이 진짜 뭔지 다시 생각할 수 있게 해주셨습니다. 또한 비유가 와닿아서 그것에 대해서 곰곰히 생각해 볼수 있었어요.   아쉬운 점:크게 없었습니다. ',2907),(3397,'2018-10-10 00:00:00.000000',5,'내면의 힘을 잘 길러보겠습니다\n조언 너무 감사드립니다 ',2908),(3398,'2017-11-21 00:00:00.000000',0.5,'  좋았던 점: 글쎄요  아쉬운 점:음 무료 티켓이어서 그랬나요\n상담사님보다 제가 말을 너무 많이 했나요\n제가 한 얘기들 요약해서 그러셨군요 그래서 속상하셨군요가 전부였네요\n글쎄요 저는 상담을 통히니서 제가 한 말의 요약을 듣고싶었던건 아닙니다',2909),(3399,'2017-11-21 00:00:00.000000',2,'  좋았던 점: 잘 들어주심   아쉬운 점:채팅속도가 느림 대화가 추상적 ',2910),(3400,'2018-10-11 00:00:00.000000',5,'섬세하시고 따뜻하세요.\n내면에서부터 시작되는 원인을 들여다보려 애써주셨어요.\n감사합니다.\n',2911),(3401,'2018-03-12 00:00:00.000000',5,'  좋았던 점: 실생활에 바로 적용할 수 있는 문제 해결요령들을 알려주셔서 도움이 되었습니다.  아쉬운 점:크게 없는것 같습니다.',2886),(3402,'2018-06-20 00:00:00.000000',3.5,'일단 이야기를 잘들어주셔서 좋았고 제가 생각하지못했던점을 잘찝어 주셔서 좋았고 책에서 읽었던 내용과 겹치는 부분ㅇㅣ 있었지만 상담은 전체적으로 좋았고 지속적으로 상담 해야겠다는 생각이 들었습니다~~\n',2912),(3403,'2017-11-21 00:00:00.000000',5,'  좋았던 점: 위로받는것 같아서 좋았습니다  아쉬운 점:없는것같습니다\n\n넵 감사합니다 ',2913),(3404,'2019-04-08 00:00:00.000000',3.5,'우선 단편적인 고민이 아니라, 굉장히 깊게 여러가지 방면에서 저의 고민을 들여다봐주셨어요. 제가 이렇게 생각하는 과거의 이유, 현재의 이유 등등.. 아무에게도 시원하게 말하지 못했던, 잊고있었던 제 과거나 상처를 들여다보는 시간이었습니다. 감사합니다!',2914),(3405,'2019-05-04 00:00:00.000000',5,'짧은 시간이었지만.. 지금의 상황에 현명하게 대처할수 있는 솔루션을 주신것 같아요 고맙습니다 ',2915),(3406,'2019-07-03 00:00:00.000000',5,'한참을 울면서 상담을 했어요ㅠㅠ\n제 자신을 돌아볼 수 있는 좋은 시간이었습니다.\n상담사님 정말 따뜻한 조언 많이 해주셔서 감사했어요!\n',2916),(3407,'2017-09-26 00:00:00.000000',5,'  좋았던 점: 짧은 시간에 어려운 상담 내용임에도 작은 조언이라도 해주려 애써주셨습니다  아쉬운 점:크게 없었어요',2917),(3408,'2019-06-18 00:00:00.000000',5,'제가 고민하고 있는 내용의 해결책을 구체적으로 말씀해 주셔서 도움이 됐어요 앞으로 고민이 있을 때 종종 찾아 오겠습니다 감사합니다 :)',2918),(3409,'2018-12-22 00:00:00.000000',4.5,'단기상담이라 큰 변화는 아니지만 좋은 말씀들 해주셨고 다시 상담 받아 보고 싶은 생각이 들었어요',2919),(3410,'2018-01-18 00:00:00.000000',5,'  좋았던 점: 제 이야기를 들어주시고 제 마음을 이해해주시는것만으로도 위로가 많이 되었습니다 예리한 질문으로 제 자신을 깨닫는 시간이 되었고\n칭찬도 많이 해주셔서 감사했습니다 \n처음엔 무거운 마음에 눈물로 시작했지만 평안한 마음과 웃음으로 마무리했습니다\n  아쉬운 점:시간이 너무 빨리 지나갔어요... 시간을 멈출순없나요? ^^;;',2920),(3411,'2019-03-19 00:00:00.000000',5,'저 같은 경우는 많은 날을 우울함과 분노속에 살면서 자신을 못본채 살았는데요 선생님을 만나면서 계속 털어놓았고 선생님은 언제나 그 자리에서 위로의 말씀을 해주셨어요. 10회기라는 긴 시간 동안 변치않은 마음으로 상담해주셔서 감사했고, 이 시간들이 모여서 제가 한층 발전할 수 있을꺼라 생각합니다. 선생님 감사했습니다',2921),(3412,'2017-11-08 00:00:00.000000',3.5,'  좋았던 점: 따스하게 제 맘을 알아주시고 무엇이 문제인지 잡아주셔서 고민을 해결하는데 많은 도움이 된 것 같아요! 위로의 말도 너무너무 맘에 와닿고 도움이 됐어요 다음에 또 고민이 있으면 임명숙 상담사님과 또 상담을 하고 싶어요 ㅎㅎ!  아쉬운 점:없다',2922),(3413,'2018-03-15 00:00:00.000000',5,'  좋았던 점: 마음을 읽어주는 것 같아서 좋았어요.  아쉬운 점:크게 없습니다.',2923),(3414,'2019-03-11 00:00:00.000000',5,'진심으로 도움을 주시려고 하시는 모습이 너무나 감사했어요. 자기 자신을 사랑하는 법이 대해서도 따뜻하게 말씀해주시고 50분 전화를 하고나면 정말 옆에서 따뜻하게 괜찮다고 안아주듯이 마음이 한결 편안하고 많은 위안을 받았습니다 감사합니다',2924),(3415,'2018-10-17 00:00:00.000000',4,'엄청 천천히 말해도 차분히 기다려 주셨고 계속 지지해 주시는 느낌이 들어서 좋았습니다. ',2925),(3416,'2019-02-21 00:00:00.000000',4,'50분 1회권이 참 짧았어요 \n제 감정을 함께 나눠주시고 공감해주셔서 감사했어요 \n',2926),(3417,'2019-04-11 00:00:00.000000',3.5,'본인 스스로 답을 찾도록 도와준다는 생각이 많이 들었습니다.',2927),(3418,'2019-02-21 00:00:00.000000',3.5,'좋은 말씀 많이 해주셔서 감사합니다. 이야기도 잘 들어주셔서 감사해요.',2928),(3419,'2018-05-09 00:00:00.000000',5,'  좋았던 점: 상담 전에  가족에 대해 기록 한 내용을 잊어버리고 있었는데 잊지 않고 그것에 대해 다시 한번 질문해주시고 짚어 주셔서 감사했습니다.   아쉬운 점:없습니다. 상담을 더 꾸준히 받으면 좋겠다는 생각은 듭니다. 첫번째 상담에서는 제 이야기만 늘어놓은거 같았는데 상담을 하면 할수록 내면에서 끌어낼수 있는 이야기가 더 많아질것 같습니다.',2929),(3420,'2019-01-01 00:00:00.000000',5,'명쾌한 답변이 좋았어요! 무엇보다 이야기를 잘 들어줘서 고맙습니다',2930),(3421,'2018-03-20 00:00:00.000000',3.5,'  좋았던 점: 맘이 풀렸어요  아쉬운 점:네트워크 연결이 어려웠어요',2931),(3422,'2017-11-30 00:00:00.000000',4.5,'  좋았던 점: 제 문제점을 정확히 짚어주셔서 좋았고 항상 칭찬으로 마무리해주셔서 힘이 되었습니다!  아쉬운 점:없습니다!:-)',2932),(3423,'2018-03-21 00:00:00.000000',5,'  좋았던 점: 핵심을 잘 정리 해주시고 제가 말을 잘 할수 있게 유도를 잘 해주신거 같아요  아쉬운 점:없어요',2933),(3424,'2017-10-07 00:00:00.000000',5,'  좋았던 점: 해결책을찾았습니다  아쉬운 점:없습니다',2934),(3425,'2019-05-09 00:00:00.000000',5,'어떤 식으로 해결해야할지 해결책도 주시고\n제 감정도 위로해주시고 좋았던 것 같습니다.\n',2935),(3426,'2019-04-12 00:00:00.000000',5,'잘 이해해주셔서 감사합니다',2936),(3427,'2019-07-07 00:00:00.000000',5,'텍스트 문자상담은 처음이었는데 생각보다 좋았어요.\n공감해주시고 위로해주시고 감정도 정리할 수 있게 도와주셔서 더 좋았었던거 같아요.\n짧은 시간이었지만 제 고민은 반 이상 해결 된거 같아요.\n',2937),(3428,'2019-01-07 00:00:00.000000',5,'실질적인 조언 감사합니다 한결 후련해졌고 저 자신을 제정비할수있었어요 ',2938),(3429,'2017-10-10 00:00:00.000000',5,'  좋았던 점: 생각하지 못했던 부분을 이끌어낼수 있도록 질문적 대화를 하셔서 제 스스로 인지할수 있게 도움을 주셨구요 자기이해과정을 통해 전반적인 문제를 볼수있게 알려주셨어요~ 마지막 시간에는 앞으로 제가 어떻게 해야할지 방법을 알려주셔서 뜻깊은시간이었어요  아쉬운 점:크게 없었어요',2939),(3430,'2017-11-11 00:00:00.000000',4,'  좋았던 점: 변화할수 있게끔 이끌어주셔서 좋았어요  아쉬운 점:채팅기다리는시간이 아까웟어요ㅠ',2940),(3431,'2018-07-02 00:00:00.000000',5,'선생님 차분하게 제 얘기 들어주셔서 감사해요 다음에 또 올게요!',2876),(3432,'2019-02-26 00:00:00.000000',5,'상담사님과의 상담은 제게 있어서 큰 축복이었습니다. 내 안의 무엇이 어떻게 된 것이길래 이렇게 힘들게 살고있는지를,상담사님의 차분하면서도 따뜻한 지도로 알 수 있게 되었습니다. 상담사님께서 제 손을 잡고 \'내 안의 평화의 열쇠\'를  함께찾아주셨습니다.',2941),(3433,'2019-06-01 00:00:00.000000',5,'손이 덜덜 떨릴 정도로 스트레스 받는 상황이었는데 덕분에 많이 차분해지고 용기를 얻었습니다. 물론 다시 스트레스 상황에 부딪히니 약간의 긴장감과 불안이 생기긴 했지만요 ㅠㅠ 그래도 몇 번 더 받으면 많이 차분해지고 안정 될 거 같아요. 제 마음도 이해할 수 있게 설명해주시고 앞으로 대처방안까지 말씀해주셔서 훨씬 좋았습니다. 이전에는 그저 당하기만 해야한다는 생각에 괴로웠는데 선택할 수 있는 선택지가 있다는 것만으로도 큰 위로가 되었습니다. 감사합니다.',2942),(3434,'2019-01-15 00:00:00.000000',5,'찬찬히 이야기를 들어주셔서 좋았습니다. 스스로 내면의 힘을  기를 수 있게 안내해주셔서 좋았네요. ',2943),(3435,'2019-07-09 00:00:00.000000',3.5,'공가ㅗㅁ해 쥬시고 육아를 어떤식우로 해야 할지 방향을 가루쳐 주셔서 감사합니다',2944),(3436,'2018-03-28 00:00:00.000000',5,'  좋았던 점: 진실한 공감을 바탕으로 구체적인 대안과 방법을 알려주셔서 너무 좋았습니다. 현실적인 상담으로 대인관계에서 용기가 생기게되었어요. 너무 감사드립니다..^^  아쉬운 점:없었습니다',2945),(3437,'2018-09-09 00:00:00.000000',3.5,'따듯한 말씀 너무 감사해요!',2946),(3438,'2019-06-02 00:00:00.000000',5,'왜그렇게 생각하는지에 대한 이유를 찾아가게 해주신다. \n다른시각의 답변을 들을 수 있었고 짧은 상담을 해서 큰도움은 아니었지만 오래 상담을 받으면 많은 도움이 될 것 같다고 느꼈다.',2947),(3439,'2019-02-28 00:00:00.000000',5,'저 자신과 화해하고 장단점을 인정하도록 노력할게요\n',2876),(3440,'2018-07-07 00:00:00.000000',5,'짧은 시간동안 제 상태를 정확히 짚어주셔서 너무 좋았어요. 문제를 파악했으니 고쳐나갈 차례인데, 두려움을 극복하고 고쳐나가는 과정에서도 많은 도움 받아보고 싶습니다. 감사합니다.',2948),(3441,'2019-01-19 00:00:00.000000',5,'인지하고있었지만 고치기어려웠던 제 단점을 잘 이해해주시고 좋은 말씀해주셔서 제가 노력하면 변할수있을것같다는 희망을 심어주셨어요 감사합니다',2949),(3442,'2017-10-16 00:00:00.000000',4,'  좋았던 점: 잘 들어주시고 다정하십니다   아쉬운 점:채팅속도가 느리시긴 한데, 짧은 시간 내에 많이 커버해주셨습니다.',2950),(3443,'2018-09-17 00:00:00.000000',4,'얘기를 잘들어주셔서 좋앗어요 \n4주 1회씩 햇지만 시간이 촉박하단 느낌이 들엇어요 \n저렴한가격에 상담할수 잇다는건 좋앗지만 \n외부 상담 2회하는것보다 짧은 느낌이엇어요 \n',2951),(3444,'2019-05-14 00:00:00.000000',5,'힘들었던 마음을 해결할 수 있는 힘이 생겨난 것 같습니다. 격려해주시고 실질적인 노력도 할 수 있도록 도와주셔서 감사했습니다 :)\n\n',2952),(3445,'2019-01-22 00:00:00.000000',5,'얘기 잘 들어주시고, 좋은 방향 제시해주셔서 좋았습니다~\n상담후 좀더 편안해지고, 객관적으로 다시 생각할 수 있었네요~\n',2953),(3446,'2018-04-02 00:00:00.000000',5,'  좋았던 점: 제 마음을 읽어주는 것 같아서 좋았어요. 편하게 얘기할 수 있도록 이끌어주시고, 제 문제점에 대해서 부담스럽지 않게 마주할 수 있게 이끌어 주십니다. 긍정적인 사고를 할 수 있게 이렇게도 생각할 수 있죠?라고 생각의 방향을 제시해주셔서 감사합니다.^^  아쉬운 점:크게 없습니다.',2954),(3447,'2018-09-15 00:00:00.000000',4,'상담 감사합니다',2955),(3448,'2018-02-06 00:00:00.000000',5,'  좋았던 점: 아무도 해주지 않았던 말들, 나도 아무도 몰랐던 내 문제.. 말씀해주셔서 마음도 가벼워지고 많이 알아가요. 노력하면 변해갈 수 있을것 같아요. 정말 감사합니다.  아쉬운 점:없어요.',2956),(3449,'2017-12-14 00:00:00.000000',5,'  좋았던 점: 진심으로 문제에 대해 이야기 나눠 주셨고 전문가적인 느낌이 제대로 느껴져 마음이 편안해졌습니다  아쉬운 점:없는거 같습니다',2957),(3450,'2019-01-24 00:00:00.000000',3,'저에겐 힘들었던 고민이였는데 상담을 하고 생각을 바꾸게 되었어요 점점 더 좋아지길 바래봅니다 감사합니다 ',2958),(3451,'2018-05-23 00:00:00.000000',3.5,'  좋았던 점: 잘 들어주시고 제가 생각할수있게 질문도 잘 해주셨어요  아쉬운 점:전혀 없습니다',2959),(3452,'2018-09-17 00:00:00.000000',4,'제 안에 솔직한 모습을 꺼낼 수 있게 도와주셨습니다.',2960),(3453,'2018-09-17 00:00:00.000000',5,'자연스럽게 흐름을 잡아주시고 알맞은 질문들을 툭툭 던져주세요. 상담 전엔 꽉 막힌것만 같았던 것이 상담 막바지에 이르러서는 무언가 해결이 된 느낌에 훨씬 가뿐해요. 방향성을 잡고 힘을 낼 수 있도록 도와주셨습니다. 감사합니다.',2961),(3454,'2018-07-12 00:00:00.000000',4,'장점: 근본적인 문제가 어디서 오는지 생각볼수 있게 도와주심.\n단점: 실시간채팅이라 작성하는 시간,생각하는시간 등 시간적 제안이 있어서 답답함 \n조금식상한답변.선택은나 자신에게 있다.어려움을극복하는데다른방법을모색해봐라 등..\n결론:나스스로해답찾아야한다',2962),(3455,'2019-03-27 00:00:00.000000',4,'노력할 수 있는 용기를 가질 수 있을 것 같아요.',2963),(3456,'2018-09-18 00:00:00.000000',3,'내 생각을 정리할 수 있었습니다 감사합니다',2964),(3457,'2018-11-07 00:00:00.000000',5,'제 이야기에 공감해주시고 좋은 말씀들을 많이 해주셨어요 덕분에 마음이 따듯해졌어요',2965),(3458,'2018-11-08 00:00:00.000000',5,'부모님과의 관계 제 자신을 얘기하라고 해서 왜 이런 걸 물어보시지 했는데 나중에 저에 대한 관찰을 하시고 진단을 내줘서 문제점과 자꾸 반복되는 실수의 원인을 찾을 수 있었습니다. 앞으로 각성하고 실찬하는 일만 남았네요~~ 감사합니다.',2966),(3459,'2019-05-17 00:00:00.000000',4,'친절하고 따뜻하게 현재 앓고 있는 문제들의 실마리를 찾아 주셨어요. 상당 부분이 잊고 있던 어린 시절, 성장과 양육 과정에서 비롯 되었다는 것을 저도 인지하게 된 것 같아요. 상담이 만능키는 아니지만, 답답하던 가슴이 한번씩 후련해지는 경험을 했습니다. 감사했습니다!',2967),(3460,'2018-09-20 00:00:00.000000',4,'저라는 사람 자체에 대해 많이 알고 문제에 접근하려고 애쓰셨습니다. 오늘은 응급처치같은 즉각적인 솔루션이 필요했었는데, 그 부분에 대해서는 만족할만큼 얻지 못했습니다. 그러나 짧은 시간동안 이해하려고 노력해주셔서 감사했습니다. ',2968),(3461,'2019-03-05 00:00:00.000000',3,'마음을 헤아려주는 것 같아서 좋았어요. 