.000000',3.5,'제 이야기를 많이 들어주시려고 해주신 점이 좋았습니다. \n스스로 기분이 좋아질 수 있는 것들을 찾아가려고 노력하고 있습니다. 제 고민의 원인을 찾아나가는 과정에서 좀 생각이 정리 될 수 있었어요. \n\n\n\n\n',2988),(3482,'2020-04-16 00:00:00.000000',5,'항상 친절하게 공감하시는 모습 감사했ㅂ니다',2985),(3483,'2020-04-15 00:00:00.000000',4,'생각을 정리할 수 있어서 좋았습니다.',2989),(3484,'2020-04-15 00:00:00.000000',4,'시간이넘짧게느껴지지만 그짧은시간에서도\n한마디한마디가 뭔가제마음을시원하게해주는게있었어요분명!ㅎ\n다음에또할것같아요ㅎ',2990),(3485,'2020-04-13 00:00:00.000000',5,'상담 할 때 잘 들어주셔서 좋았어요 ㅎㅎ',2991),(3486,'2020-04-09 00:00:00.000000',5,'처음 받아보는 상담이라 막연하게 무서웠는데 친절히 안내해 주셨어요. 제 감정을 더 직시할 수 있었고, 해결을 위해 생각을 시작해봐야 할 것들을 발견했어요. 너무 심하게 엉켜서 골칫덩이이던 실뭉치에서 실마리를 발견한 기분입니다. 풀어내는게 쉽진 않겠지만, 지금 현실적으로 당장 생각할 수 있는 것, 시도해볼 수 있는 것이 생겼어요. 제가 당장 할 수 있는 것들을 시도해보고 또 신청 할거에요!',2992),(3487,'2020-03-27 00:00:00.000000',5,'도움이 되었고 앞으로 상담을 조금 더 받아보고싶다는 생각을 하였습니다.',2993),(3488,'2020-03-18 00:00:00.000000',5,'제 얘기를 찬찬히 잘 들어 주시고 바로바로 피드백을 주셔서 좋았어요',2994),(3489,'2020-03-12 00:00:00.000000',5,'현재 시기에 맞는 솔루션을 발견했어요\n이전 상황에 대해서도 돌아보면서 현재 상황에 대한 이유도 파악이 되어 현재 생각중인 솔루션을 실행하는데 의심없이 진행할 수 있겠어요\n+새로운 시각을 제시해주어 큰도움이됩니다\n혼자 6개월 생각한거 30분만에 이해됐어요ㅎㅎㅎㅎ\n\n',2995),(3490,'2020-03-09 00:00:00.000000',5,'태어나서 처음 받아봤는데 심적으로 굉장히 많은 도움이 되었습니다. 상담에대한 선입견을 가지고 있었어요. \n타인에게 내 마음 속 깊은 감정들을 이야기 하는 게 쉬운 일은 아니니까요..혹시라도 나에 대한 비밀을 보장해주지 않는 것은 아닐까 나를 이상하게 보진 않을까 여러가지 생각들에 망설였었는데 비대면으로 진행되니 압박감과 부담감도 비교적 덜 하고 상담선생님이 편안하게 이끌어주니 제 감정을 자유롭게 표현할 수 있었어요 감사합니다.^^',2996),(3491,'2020-03-07 00:00:00.000000',5,'감사했습니다',2997),(3492,'2020-02-20 00:00:00.000000',5,'첫 상담이었는데 많은 이야기를 천천히 들어주셔서 좋았어요. 중간에 내용정리해주시고 저의 감정도 헤아려주싱게 느껴졌어요. 50분이 너무 짧게 느껴지네요ㅠㅠ주기적으로 상담하면 차근차근 문제를 해결할 수 있겠다라는 생각이 들기도 하구요. 감사합니다 상담사님:)',2998),(3493,'2020-02-20 00:00:00.000000',5,'상담사분의 느낌이 참 좋아요ㅎㅎ\n나이많고 경력많으신 상담사분도 좋지만 제 나이에서 \n일어나는 일, 생각을 얘기했을때 서로 이해되고 공감할수 있다는게 큰 장점인거 같습니다.\n같이 공감해주시고 잘하고 있다는말에 용기내서 더 노력해보려구요!\n다음에 마음이 힘들어지면 또 찾아올게요 감사합니다ㅎㅎ\n',2999),(3494,'2020-02-18 00:00:00.000000',5,'여러 사람에게 상처받고 인간관계 때문에 너무 힘들어할 때 트로스트를 알게됐고 상담 받아볼까 싶어서 상담사님과 얘기를 나누기 시작한지 벌써 6주째가 됐어요. 내가 잊고있었던 정말 오래전에 일어났던 일이 아직도 나한테 큰 영향을 주고있다는걸 상담사님과 상담을 하면서 알게 되었고, 상처받았던 그 때의 나를 안아줄 수 있었어요. 내가 무의식적으로 한 말을 놓치지 않고 그거에 대해서 질문해주시고, 내가 느끼는 감정에 완전히 공감을 해주셨어요. 주로 그냥 생각나는대로 얘기를 했는데 찬찬히 잘 들어주신 뒤에 간결히 정리해주셔서 정말 귀기울여 들어주신다는 느낌을 받았어요. 알려주신 여러 방향으로 생각하는 방법도 도움이 많이 되고 있어요. 그래서 상담이 한 회씩 끝날 때마다 마음이 더 홀가분해지고 문제 해결에 가까워지는 걸 느꼈어요. 상담사님 지금까지 너무 감사하구 앞으로도 잘 부탁드릴게요 :)',3000),(3495,'2020-02-16 00:00:00.000000',5,'텍스트 상담이긴 하지만 진지하게 얘기를 들어주시고 상담해주시는게 느껴져서 기대 이상이었습니다  저도 모르게 많은 이야기를 꺼내게 되었어요 ',2998),(3496,'2020-02-03 00:00:00.000000',5,'제 이야기를 풀어놓을 데가 없었는데 어쩌다 알게 된 어플에서 숨겨놨던 고민을 얘기하고 공감이랑 위로를 받을 수 있어서 감동이였고 아마 쉽게 해결하지 못할 좀 복잡한 내용인데도 깊이 이해해주셔서 신기했어요 좋은 기회였던 것 같습니당',3001),(3497,'2020-02-03 00:00:00.000000',5,'감사합니다. 마음에 정리가 많이 되네요\n\n',3002),(3498,'2020-01-22 00:00:00.000000',5,'잘 들어주셔서 감사합니다.\n\n\n\n',3002),(3499,'2020-01-21 00:00:00.000000',5,'정말 만족스러웠어요 처음엔 제 얘기를 다들어주시고\n공감해주셔서 너무 속이 좀 후련한듯한 느낌이고\n상담시간 외에도 정말 진심으로 걱정해주시고\n물어봐주셔서 너무 감사했습니다 상담을 2회만 받아서\n아직 상태가 나아진건 아니지만 추가로 스케줄 맞춰 상담을 \n진행할 생각입니다 정말 친절한 상담 너무 감사합니다\n',3003),(3500,'2020-01-20 00:00:00.000000',5,'따뜻한 격려와 말씀 늘 감사드려요 :) ',2984),(3501,'2020-01-20 00:00:00.000000',5,'상담사님 감사합니다',3004),(3502,'2020-01-19 00:00:00.000000',5,'일단 잘 들어주셔서 감사했고, 생각지도 못한 질문을 해 주셔서 여전히 제가 어떤 굴레 속에 갇혀있다는 걸 깨닫게 되었어요. 좀 더 받아보고 싶다, 더 많이 받아야겠다, 좋아질 수 있다는 어떤 희망이 좀 생겼구요. 더 자세히 많이 받고 싶어요. 무엇보다도 친절하고 따뜻하게 대해주셔서 제가 편하게 말할 수 있었어요. 감사합니다! 다음 주에 또 뵐게요. ㅎㅎ ',3005),(3503,'2020-01-19 00:00:00.000000',5,'고맙습니다.. 절망에 있던 제 자존감을 끌어올려주셨어요 나라는 내 자신을 다시 돌아보고 이겨낼 수 있는 힘을 주셨어요 또 상담 받으려구요. 그냥 아무말이 필요없네요 저에겐 참 고마웠어요',3006),(3504,'2020-01-16 00:00:00.000000',5,'일단 무엇보다도 제 말을 끝까지 잘 들어주셔서 감사했습니다. 특히 저 스스로도 모르고 있었던 제 생각과 마음을 자연스레 끄집어낼 수 있도록 유도해 주셔서, 제 생각을 정리하는 데에 큰 도움이 되었습니다. 첫 상담사님 선택이였는데 가능하다면 지속적으로 상담받고 싶다는 생각이 들었습니다:)',3007),(3505,'2020-01-12 00:00:00.000000',5,'제 이야기를 잘 들어주세요 ㅎㅎ',3008),(3506,'2020-01-12 00:00:00.000000',5,'네 만족스러웠어요. 항상 친절하시고 매순간 성의있게 상담해주시는게 특히 좋았어요. 얘기도 잘 들어주시고 적절한 조언도 잘 해주신것 같았어요. 요즘 여러모로 많이 힘들고 또 외로운데 상담을 하고 덜외로워진 느낌이에요. 또 저 스스로를 정리하는 시간도 갖게되서 좋았던것같네요. \n\n 저는 후기 작성하고 또 4회차 결제하러갑니당~^^',3009),(3507,'2020-01-08 00:00:00.000000',5,'감사합니다 조금더 두고두고 이야기나누면 답을 찾을수 있을듯합니다\n\n',3010),(3508,'2020-01-07 00:00:00.000000',5,'항상 감사합니다.',3011),(3509,'2020-01-03 00:00:00.000000',5,'감사합니다',3012),(3510,'2019-12-23 00:00:00.000000',5,'상담사님 친절하고 좋으세요 :) \n',3013),(3511,'2019-12-16 00:00:00.000000',5,'좋았어요 생각하지 못한 부분을 연습해볼게요',3014),(3512,'2019-12-14 00:00:00.000000',5,'3달째 상담을 계속하고 있습니다. 다양한 방법으로 제 문제를 들여다봐 주셔서 감사드려요. ',3015),(3513,'2019-12-09 00:00:00.000000',5,'너무 도움됐고 마음도 편해졌고 전문적인 말씀을 조리있고 알아듣기 쉽게 말씀해주셔서 너무 만족합니다.\n다음에 상황과 여건이 될땐 장기적인 상담 신청하고 싶어요.',3016),(3514,'2019-12-02 00:00:00.000000',5,'저를 돌아보게 되었어요',3017),(3515,'2019-11-22 00:00:00.000000',5,'첫상담 즐거웠습니다',3018),(3516,'2019-11-13 00:00:00.000000',5,'꾸준히 상담 받고 있습니다\n제가 모르고 있거나 놓치고 있는 제 마음에 대해 아시게끔 도와주셨던 부분이 좋았습니다~ :)\n조만간 또 연락드릴게요!\n',3019),(3517,'2019-11-11 00:00:00.000000',5,'중간에 업무적인 스트레스가 겹쳐서 상담을 미루거나 취소하고 싶을때가 있었으나 그렇게 하지 않은게 다행이었습니다. 앞으로 더 진행하겠지만 마음의 위안을 얻을  수 있는 시간이 었던것 같습니다.',3020),(3518,'2019-11-09 00:00:00.000000',4,'제 얘기를 귀기울여서 들어주셨습니다',3021),(3519,'2019-11-01 00:00:00.000000',4,'시작단계이기 때문에 지속적으로 더 받아야 할 것 같다는 생각이 듭니다. 상담사분은 친절하셨습니다.',3022),(3520,'2019-10-29 00:00:00.000000',5,'얘기 다들어주시고 공감해주시고 \n잘 이끌어주시는것같아서 너무 좋았습니다!\n마음의 안정을 찾아가는것 같아 감사해서 \n또 상담드렸는데 이번에도 마음의 위안 얻고갑니다\n',3023),(3521,'2019-10-29 00:00:00.000000',5,'\n쫓기듯이 자책하며 달려왔는데\n잘했다고 격려해주신 상담사님의 위로가\n큰 힘이 됐어요',3024),(3522,'2019-10-27 00:00:00.000000',5,'늘 감사드려요^^ 제스스로 답을 찾게해주셔서 감사합니다',3015),(3523,'2019-10-25 00:00:00.000000',5,'제 얘기 잘 받아주시고 상담받고 기분이 너무좋았습니다\n다음에 또 상담하고 싶을정도예요',3023),(3524,'2019-10-24 00:00:00.000000',5,'제가 하고 싶었던 누구에게도 하지 못한 가슴 깊숙히 박힌 말들을 꺼낼 수 있게 도와주셔서 정말 감사해요',3025),(3525,'2019-10-23 00:00:00.000000',5,'마음에 위안이 좀 됐어요',3026),(3526,'2019-10-23 00:00:00.000000',5,'연인으로 인해 제가 많이 힘들었었고 그걸 잘 인지하고 풀어내는게 중요했는데 상담을 통해 잘 풀어낼 수 있어서 좋았습니다. 잘 들어주시고 제 자신에 대해 다르게 바라보는 질문도 던져주셔서 제 자신을 더 잘 돌볼 수 있게된 것 같아요~\n\n상담 후에 마음이 편안해져서 3번째 상담을 받았네요.\n항상 감사합니다~ :)',3027),(3527,'2019-10-15 00:00:00.000000',5,'얘기도 잘 들어주시고 공감도 해주시면서 정말 진심으로 큰 위로를 받은것같습니다\n너무 힘들었던지라 아직은 생각이 크게 변화된것같지는 않지만 다음 상담으로 찾아뵐게요 감사합니다',3028),(3528,'2019-10-13 00:00:00.000000',5,'친절하게 상담 해주셔서 좋았어요 ',3014),(3529,'2019-10-12 00:00:00.000000',5,'차분하게 말씀해주셔서 너무 좋았어요.\n저는 제 상황과 심리 상태를 상담사님이 보시기에 어떤지는 궁금했거든요.\n그래도 희망이 있는 것 같아서 좋았어요.\n저는 혼자서 최악의 결과만 생각하고 있었거든요.\n상담사님 감사합니다~ \n',3029),(3530,'2019-10-11 00:00:00.000000',5,'우선 제 이야기를 잘 들어주실 분이 가장 필요했던 상황이었는데 잘 들어주신다는 느낌도 좋았고 무엇보다 공감을 깊게 해주시는 부분이 진심으로 다가와서 좋았습니다.\n\n제 상황과 감정이 무척 복잡해서 이야기를 듣는게 어려우실 수도 있었는데 잘 파악해주시고 여러가지 추측되는 부분을 얘기해주셔서 답답함도 잘 해소가 되었습니다\n\n남자 상담사분께는 처음 상담 받아보는데 이야기도 따뜻하게 건네주시고 제가 오랜만에 정말 위로받고 있고 안전하다는 느낌이 들었어요. 그런 부분이 가장 감사했습니다 ^^',3019),(3531,'2019-10-11 00:00:00.000000',5,'트로스트 이용해서 상담몇차례받아보았는데\n저에게는 가장 도움을 많이주셨던\n선생님이세요...가장 도움되었던부분은\n경험이나 상황들을 객관적으로 질문해주시는방식으로\n작은해답을 이끌어주십니다..\n제가 정말원하고 내마음속에 있는 생각이어떤것인지\n선생님이 해주신 그 질문을통해서 알수있었어요 \n너무감사합니다....\n',3030),(3532,'2019-09-27 00:00:00.000000',5,'천주녕 상담사님과는 12회기째가 끝났습니다. 또 추가해서 이어나갈 계획이고요. 저도 잊고 있었던 저에 대한 탐구 과정이 너무 좋네요. 감사합니다 상담사님!',3031),(3533,'2019-09-26 00:00:00.000000',5,'이야기 할 사람이 없어서 속에 가둬두기만 한 내 자신을 조금 풀어준 느낌\n처음엔 이게 과연 상담 효과가 있을까 싶어 2회기만 끊었는데 더 끊을 생각이 있다. 짧지만 좋았던 순간 정말 감사합니다',3032),(3534,'2019-09-20 00:00:00.000000',5,'누구나 한번씩은 위기가 오기 마련이고, 혹은 매 순간을 위기로 느끼고 살아갑니다. 위기에 잘 대처하면 좋겠지만 저는 대부분의 위기상황에 스스로 무너지고 불안해 하였습니다. \n최근 혼자가 되었다고 느껴지는 순간이 찾아왔고 많이 힘들었습니다. \n단 한번의 경험도 없는 개인 상담에 반신반의하였는데, 한 달 간의 전화상담으로 기분좋은 반전을 경험하였습니다. 첫 날 선생님의 따뜻한 태도로 인해 울컥하기도 했습니다. 방금 마지막 상담을 선생님과 서로 웃으며 끝냈습니다. 아쉽지만 다행스럽게도 당분간은 상담이 필요없을 것 같습니다. 고마운 일입니다. 스스로 위기에 대처할 수 있는 방법에 대한 힌트도 얻었고, 이보다 더욱 중요한 것은 스스로 용기를 얻었다는 것입니다. 선생님이 해결책을 제시하는것이 아닌 제 스스로 해결책을 찾아가게 됩니다. 제 스스로 해결책을 찾게 하신 선생님, 정말, 감사드립니다.',3033),(3535,'2019-09-15 00:00:00.000000',5,'잘 들어주시고 정리 잘 해주셔서 좋아요 ㅎㅎ 앞으로 또 상담 받고싶습니당 ',3014),(3536,'2019-09-08 00:00:00.000000',5,'인간미도 있으시고 프로 다움도 있으셔요^^ 다양한 방법으로 제 심리 상태를 점검해주셔서 신뢰가 많이 갔네요 :) 감사합니다',3015),(3537,'2019-09-07 00:00:00.000000',5,'4회기 상담 진행하고 추가로 4회기까지 마쳤습니다. 확실히 제가 마음에 여유가 생긴 것 같습니다. 4회기를 더 등록해서 천주녕 상담사님과 더 진행해 볼까 합니다^^ 감사드립니다.',3031),(3538,'2019-08-30 00:00:00.000000',5,'상담사분에게 말씀드리면서 스