나를 믿고 지켜나갈수 있을 것 같아요.\n명홛하게 짚어주셔거 감사합니다.',3089),(3604,'2019-11-11 00:00:00.000000',5,'좋아요\n용기를 얻었어요',3090),(3605,'2019-11-01 00:00:00.000000',5,'정리정돈 안되던 저의감정을 잘파악하시고\n스스로 사랑하고 아껴주는 마음을\n가질수있도록 도와주셨어요~\n감사합니다~!!',3091),(3606,'2019-10-29 00:00:00.000000',5,'웃는 거 하면 자타공인 저였는데, 회사다니면서 웃음을 잃었습니다 ㅋㅋㅋ ㅜ\n먼저 회사생활하던 친구가 이 어플로 도움을 받았다고 소개해줘서 저도 난생 처음 전문가분께 상담을 받았습니다.\n처음엔 할까말까 하다가... 어느 순간 진짜 폭발해버릴 것 같다는 생각이 들었고, 톡상담 50분 4주로 결제 때렸습니다ㅎㅎ\n제 감정과 언행을 이해해주고 분석하고 설명해주고 방향을 같이 찾아가는 대화를 통해, 나와 내 상황을 좀더 이성적으로 객관적으로 바라보고 해결할 수 있었어서 너무 좋았습니다ㅎㅎ\n사람의 마음을 치료한다는 것이 얼마나 어려울까 짐작이 되지 않고 낯설기만 합니다. 모든 상담사분들 정말 존경스럽고, 저라는 사람을 들여다보고 함께 걱정해주었던 우리 한아름 상담사님 정말 감사드립니다....ㅜㅜㅜ 쌤 적게 일하고 많이 버세요 행복하세요 감사합니다!!!\n',3092),(3607,'2019-10-15 00:00:00.000000',5,'진솔하게 질문해주시고 대화해주셔서 감사합니다.\n',3093),(3608,'2019-09-21 00:00:00.000000',5,'기분을 항상 체크해주시고 정성을 다해 상담해주셔서 좋았습니다. 그동안 많은 상담을 받아왔는데 가장 만족스러웠습니다.',3094),(3609,'2019-08-22 00:00:00.000000',5,'멘탈 관리에 좀 좋아요\n',3093),(3610,'2019-08-21 00:00:00.000000',5,'감사합니다. 공허감때문에 힘든것은 사라졌어요\n\n',3095),(3611,'2019-08-19 00:00:00.000000',5,'한아름 상담사님이랑 한주에 1회씩 4회의 상담을 진행하는 동안 저 자신에 대해서 돌아보게되면서 더욱 저를 사랑하게 됐어요, 나를 사랑하는 마음, 나의 슬퍼하는 마음 모두 괜찮은거라 알려주시고 본인의 아픔처럼 공감해주시고 위로하주셔서 정말 감사드렸어요. 감사합니다 \n',3096),(3612,'2019-08-15 00:00:00.000000',5,'선생님 너무 감사합니다\n익명이라 좀 제지인에게 알리기어려운 사정도 편하게 이야기 할 수 있었고 지인에게 알리더라도 전문적인 피드백 받을 수 없었는데 상담하고나니 정말 저에게 필요한게 뭔지 어떤 방법을 연습해야하는지 알게되어서 좋았습니다 말하면서도 제가 위로받고있다는 마음도 많이 들었구요 선생님만나게되어 너무 기분좋았습니다 해주신 말씀 항상 마음으로 머리로 기억하면서 살겠습니다!\n혹시나 또 다른문제로 마음이 힘들때 선생님  찾아뵙고 싶습니다! 2회로 진행된 상담동안에 큰힘되어주셔서 감사합니다!^_^!!!',3097),(3613,'2019-08-06 00:00:00.000000',5,'상담사님께 정말 감사하다는 말씀 드리고 싶어요. 저는 다시 상담 신청하려구요, 물론 2회로도 큰 만족이 되었지만 제 자신을 잘 돌아볼 수 있는 기회가 될 것 같아서요. 차분하게 공감해주시고 쉽지않은 마음으로 위로해주셔서 감사드려요. ',3096),(3614,'2019-08-04 00:00:00.000000',5,'첫 상담에 제가 생각지 못한 저의 과거를 보면서 상처받은 제 안의 아이를 보았어요\n그동안 제가 늘 생각하고 있던 부분이라 그런지 선생님께서 얘기해주시는 부분이 금방 와닿았어요\n올라오는 감정들도 다 저의 모습이라는 말씀을 듣고 눈물이 울컥했네요\n다 인정하고 있는 그대로의 제 자신과 마주할 용기가 생겼네요\n앞으로 스트레스 받고 심하게 감정이 올라올때 상담하려고 합니다\n상담하면서 제 감정을 볼수가 있고 전문적으로 코칭을 받아서 엄청 도움이 됐어여\n공감해주시고 따뜻하게 말씀해주신 선생님 감사합니다\n\n',3098),(3615,'2019-08-03 00:00:00.000000',5,'말투가 좀 공격적? 채팅이라 어쩔수없나..?',3099),(3616,'2019-07-23 00:00:00.000000',5,'가장 좋았던 점은 공감과 이해 그리고 방법제시였습니다 ~ 사실 같은 여자분을 할까 고민하다가 그냥 끌리는대로 정했는데 후회없는 선택이었어요. 공감과 이해는 성별이랑은 전혀 무관했고 한아름 상담사님이랑 상담하는 시간이 즐겁고도 뭉클했습니다 ! \n\n저는 지푸라기라도 잡는 심정으로 상담을 했는데 제가 개떡같이 말해도 찰떡같이 정리도 잘 해주시고 제 답답했던 감정들이나 마음을 글로 표현해 주시니깐 좋았어요\n\n제 기억에 오래오래 남을 순간이었습니다\n정말 감사해요 ! \n\n아쉬운점은 맨날 받고 싶다는 아쉬움 ? ㅎㅎ\n\n망설이고 있다면 망설이지 마세요',3100),(3617,'2019-07-22 00:00:00.000000',5,'상담사님 적절한 격려와 현실적인 조언 해주셔서 감사합니다~!',3101),(3618,'2019-07-16 00:00:00.000000',4,'선생님께서 때로는 전문가처럼 또 때로는 정말 친한 친구처럼 반응해주셔서 재밌었어요:) 공감능력이 좋은 선생님이신 것 같습니다.\n나와 다른 사람을 이해하고 나 자신을 보듬어주는 법을 알게 된 것 같아요. 때로는 게으르고 나약한 내 자신도 사랑해주어야겠어요',3102),(3619,'2019-04-02 00:00:00.000000',5,'고민에 공감도 많이 해주시고 현실적인 대안도 주셔서 좋았다. 도움이 됐다.',3103),(3620,'2019-02-08 00:00:00.000000',5,'제 불안증과 맞서 싸울 수 있는 자신감이 생겨서 너무 좋아요. 평소에 하지 못했던 인생에 대한 진지한 고민도 해볼 수 있었구요. 그동안 제 감정을 얼마나 무시하고 감추고 살았는지 깨달았어요ㅠㅠ앞으로 제가 더 행복해지기 위해 살아갈게요. 감사합니다!',3104),(3621,'2019-04-27 00:00:00.000000',4.5,'한아름 상담사님은 생각지도 못한 부분들을 짚어주셔서\n다시금 생각해볼 수 있게 해주셨습니다.\n직면과 공감을 잘 해주시며, 따뜻함을 많이 느끼게 되었습니다.\n이 시기에 상담사님과 상담할 수 있어서 저는 참 행복하다고 생각했습니다.\n감사합니다.',3105),(3622,'2019-04-04 00:00:00.000000',5,'마음이 너무 급해서 상담받았는데 상담도 빨리 진행해주셔서 좋았어요! 저한테 먼저 필요한 방법을 단호하게 제안해주셔서 감사했고 덕분에 제 상황을 객관적으로 볼 수 있었습니다! 지금은 마음이 많이 편해졌어요 :) ',3106),(3623,'2019-05-23 00:00:00.000000',5,'짧은 시간동안에 많은 도움을 받았습니다. \n이야기에 공감도 해주시고, 적절한 방법도 제시해주시고 유익한 시간이었습니다. 상담사님 감사합니다. ',3107),(3624,'2019-03-13 00:00:00.000000',5,'마음을편안하게해주시고 잘 이해해주셔서 제마음의 감정을 잘끌어낼수있었어요~ 텍스트로는 처음 상담해보는데 내감정과 상황에대해 잔잔히 생각해보고 답 드릴수있어서 좋은것같아요 앞으로 기회되면 또 상담하도록하겠습니다 ~ㅎㅎ',3108),(3625,'2018-12-08 00:00:00.000000',3.5,'이야기도 잘 들어주시고 흔들리는 마음을 잘 잡아주신거 같아서 좋았습니다 :)',3109),(3626,'2019-04-29 00:00:00.000000',4,'스스로도 외면하는 아픔을 봐주고 공감하려고 해주셔서 너무 감사했습니다.',3110),(3627,'2018-04-27 00:00:00.000000',4.5,'  좋았던 점: 공감을 잘해주시고 격려해주셔서 좋았다.   아쉬운 점:아무래도 타자를 쳐야하니까 상담흐름이 끊기는 느낌이었다.',3111),(3628,'2018-12-09 00:00:00.000000',5,'용기를 주시는 진실된 말들이 정말 도움이 많이 되었네요!\n정말 감사드리고,\n다음번에 고민이 생길땐 찾아오고 싶습니다.',3112),(3629,'2019-04-29 00:00:00.000000',5,'제 마음을 잘 알아주시고 방향을 잡아주십니다\n현실적으로도 접근을 하셔서 조언도 해주시고\n도움이 많이 되었으며 힘이 되었습니다\n',3113),(3630,'2018-10-10 00:00:00.000000',3,'기분을 잘 헤아려주시려고 하는게 좋았어요.\n그리고 좀더 좋은 방향으로 제시해주신것들이 있어서\n잘 생각해보려합니다.',3114),(3631,'2018-04-30 00:00:00.000000',5,'  좋았던 점: 차분하게 잘 들어주시고 공감해주셔서 마음이 편해졌어요\n  아쉬운 점:없습니다       \n',3115),(3632,'2019-06-14 00:00:00.000000',5,'50분동안 집중해서 들어주시고 상담도 명확하게 해주시고 도움이 많이 됐어요 감사합니다',3116),(3633,'2018-06-16 00:00:00.000000',5,'차분하게 이야기를 끌어주시고 공감해주셔서 좋았습니다.\n',3117),(3634,'2017-11-06 00:00:00.000000',2,'  좋았던 점: 제 감정을 정리하고 공감해주고 위로해주고 인정해주려고 하는것 같아서 좋았어요  아쉬운 점:채팅속도도 느리고,\n그냥 시간때우기 같은 앵무새같은 느낌을 상담 받는내내 \n떨칠수가 없었습니다...상담보단 제 이야기만 한것 같아요..',3118),(3635,'2018-12-13 00:00:00.000000',3.5,'직관적이고 심리이론에 대한 지식이 풍부하다는 점이 좋았습니다 저도 모르는 저의 행동패턴과 장점을 상세하게 설명해주셔서 도움이 되었습니다 수용을 잘 해주고 솔직하게 사과하는 모습이 좋았습니다 빠르게 보내려다 보니 오탈자가 있어 아쉬웠습니다',3119),(3636,'2018-03-10 00:00:00.000000',5,'  좋았던 점: 제 삶의 빛이 되어준 상담입니다! 상담 후 마법처럼 가슴속 우울감이 말끔히 사라졌습니다. 제게 문제가 있을 때 어떤 마음가짐을 가져야 하는지 근본적인 것을 배웠습니다. 외로움,우울,중독,자해,자책이 사라졌습니다. 정말 진심을 담아 상담사님 고맙습니다.  아쉬운 점:없습니다!!!!!! 정말 감사합니다!!!!!! ㅠㅠㅠㅠㅠㅠㅠㅠㅠ',3120),(3637,'2018-05-01 00:00:00.000000',5,'  좋았던 점: 카톡형 채팅이 가진 불편함과 설명이 부족하고 보기에 좋지 않는 이야기임에도 하고 싶은 말을 열심히 봐주시고 계시다는 느낌을 받았고 군더더기 없는 위로와 이해해 한다는 말, 응원과 칭찬까지 해주셔서 너무 좋았습니다.   아쉬운 점:상담에 대한 아쉬움은 없고 전해질까는 모르겠지만 마음담아 감사하다는 인사 밖에 못 드려서 아쉽습니다. ',3121),(3638,'2018-12-13 00:00:00.000000',4,'따뜻하고 안전한 느낌이 들어요\n헉헉대던 마음에 한줄기 쉼표 위로받았네요\n위트도 있으신듯ㅎㅎ\n\n',3122),(3639,'2018-05-02 00:00:00.000000',3.5,'  좋았던 점: 저에 대해 자신의 감정을 말해주는 게 좋았습니다.  아쉬운 점:저를 안타깝게(?) 여기는 좀 슬펐어요 ㅠㅠ 힘들어서 의지하려고 상담하는 건데 역시 나는 슬픈 존재인가 싶어서',3123),(3640,'2017-11-07 00:00:00.000000',3.5,'  좋았던 점: 잘들어주시고 친절하셨어요\n\n\n\n  아쉬운 점:다좋았어요 첫상담이라 제가 무언갈 얻어가는 느낌보단 정말 조금이나마 덜어가는 느낌..?',3124),(3641,'2018-12-16 00:00:00.000000',5,'감사합니다! 고생하셨습니다!',3125),(3642,'2018-10-13 00:00:00.000000',4,'한없이 제입장에서 공감해주시고 직설적으로 제 문제점이 무엇인지 콕 집어주시고 변화할 수 있는 길을 알려주셨어요!',3126),(3643,'2019-07-03 00:00:00.000000',5,'구체적이고 실제로 해볼 수 있는 방법을 배울 수 있었다\n시간이 좀 지났는데도 상담을 끝까지 마무리해주시려는 노력이 인상적이었다.',3127),(3644,'2018-08-31 00:00:00.000000',0.5,'상담을 위해서 자세한 내용이나 이해가 필요한 것은 맞지만, 불필요하게 상세한 설명을 해야하는 느낌을 받아서 시간이 아깝다는 생각이 들었습니다. 텍스트로 하는 상담의 한계인지는 몰라도 서로간의 소통이 힘든 느낌도 받았습니다. ',3128),(3645,'2019-05-05 00:00:00.000000',5,'고민의 기저를 잘 파악해주시고 공감해주셔섳도움이되었습니다\n',3129),(3646,'2018-05-12 00:00:00.000000',5,'  좋았던 점: 나도 이해할 수 없었던 나의 여러 행동들의 원인을 정확하게 짚어주셨다. 내가 잘못된 게 아니라고 진심을 다해 말해주셨고, 위로받았다. 나의 상태를 제대로 알 수 있게 해주신 게 가장 감사하다  아쉬운 점:텍스트로 진행되는 상담이 장단점이 있지만, 시간이 짧은 느낌이었다는 것 와에는 없습니다',3130),(3647,'2019-04-09 00:00:00.000000',4,'현실적으로 조언해주셔서 더 와닿았고 감사했습니다. 횡설수설하고 막연하게 털어놓기만 했는데 성심성의껏 답변해주셔서 좋았어요',3131),(3648,'2017-11-08 00:00:00.000000',5,'  좋았던 점: 공감을 많이 해주시고\n내담자가 어느 포인트에 묶여있는지 그 부분을 찝어주셔서 너무좋았습니다.  아쉬운 점:없어요',3132),(3649,'2019-03-19 00:00:00.000000',4,'상담사님의 예상치못한질문들에 생각들을 정리하고 나를돌아보게되었습니다',3133),(3650,'2018-05-07 00:00:00.000000',5,'  좋았던 점: 자세한 설명이 없었음에도 제한된 시간에 문제를 바로바로 잘 짚어주셔서 도움이 됐습니다.  아쉬운 점:만족했습니다',3134),(3651,'2019-05-28 00:00:00.000000',5,'질책하지않고, 정말 있는 그대로 감정을 존중해주시는 것 같아서 감사했어요. 판단받지않고 온전히 이해받고 공감받으며 돌아보는 시간이었습니다.',3135),(3652,'2018-05-07 00:00:00.000000',4,'  좋았던 점: 자신의 마음 속에 있는 답을 찾아가도록 도움을 주세요  아쉬운 점:없습니다...............',3136),(3653,'2018-07-01 00:00:00.000000',4,'얘기를 정말 잘 들어주시고 해결방안도 말씀해줘서 위로 많이 받고 희망이 생겼어요 정말 감사합니다',3137),(3654,'2018-10-17 00:00:00.000000',4,'처음 받아보는 상담이라 제가 초반에 질문에 답변하며 갈피를 잘 잡지 못 했는데 상담사님께서 방향을 잡아 잘 정리 해주시며 상담 이끌고 조언해주셔서 감사했습니다. 다음에 다시 상담받아보게 된다면 좀 더 제 이야기를 잘 할 수 있을 것 같아요. 아무도 제게 해주지 않았던 현실적인 조언 정말 감사했습니다.',3138),(3655,'2018-10-17 00:00:00.000000',4,'잘들어주시고 제가 어떤상태인지 잘 알아주셨어요\n당장 작게라도 도움이 되주시려고 해서 감사했습니다~',3139),(3656,'2017-11-09 00:00:00.000000',3,'  좋았던 점: 공감을 잘해주셨다.  아쉬운 점:아이고 같은 감탄사가 너무나 많았다. ',3140),(3657,'2018-03-17 00:00:00.000000',5,'  좋았던 점:  큰 깨달음을 주는 시간이었어요! 기회가 되면 다시하고 싶은 상담이었습니다!\n  아쉬운 점:크게 없습니다!\n',3141),(3658,'2018-03-17 00:00:00.000000',4,'  좋았던 점: 질문에 대해 긍정적으로 위로의 말씀 뿐 아니라 해결 방안과 수시로 저의 기분을 알아가려고 하셔서 좋았어요  아쉬운 점:어플의 오류가 있어서 대화를 할 때 사라졌다가 생기는 현상이 조금 불편했지만 상담을 하는데 문제는 없었습니다',3142),(3659,'2017-11-28 00:00:00.000000',5,'  좋았던 점: 좋았어요  아쉬운 점:물결\n',3143),(3660,'2019-07-05 00:00:00.000000',5,'가지고 있던 고민들이 내탓이기보다 그 상황이 충분히 그럴수 있는 상황이었다는걸 알게 해주셨어요. 덕분에 앞으로 고민이 생겼을때 나한테서만 잘잘못을 따질게 아니라 그당시 상황이 어땠는지등 좀 더 폭넓게 생각해봐야겠다는 생각이 들었어요. 자다깨서 두서없이 말했는데도 끝까지 제 입장에서 이해해주실려고 질문도 많이 해주시고 경청해주셔서 감사했어요. 그리고 마지막에 제 상황을 딱 캐치해서 해주신 말씀에 상담하면서 안 울줄 알았는데 저도 모르게 이미 눈물이 맺혀 있더라구요ㅋㅋ암튼 좋은 상담이었습니다~!',3144),(3661,'2019-07-05 00:00:00.000000',5,'정말 선생님께서 제 말을 잘 들어주시고 형식적인 답안이 아니라 진심으로 대해 주셔서 정말 감사했습니다 글로만  대화 하는거여서 많이 기대 하지않았는데 선생님께서 잘 이해해주시고 하셔서 울컥했네요..  알려주신대로 하다가  어려움이 생기면 한아름 상담사 선생님 찾을거같아요.. 진심으로 대화해주셔서 정말로 감사합니다...\n',3145),(3662,'2019-02-22 00:00:00.000000',4,'제 입장에서 계속 들어봐주시려고 하시는게 좋았어요 재가 위로와 공감을 선택해서 그런지 끊임없이 공감 해주시고 또 위로해주시고 기분이 아떤지도 계속 확인해주시고 다음엔 해결 방안과 같이 제가 변화할수 있는 방향을 상담받아보고 싶어요 ',3146),(3663,'2019-04-12 00:00:00.000000',4,'텍스트로 하는 상담이 처음이라 어색하다 생각했는데 상담사님이 잘 경청해주셔서 좋았습니다. 이렇게 하고 저렇게 하라고 실질적인 가이드라인을 주는 것이 아닌 내 감정을 정리하고 마주 할수 있도록 도와주셔서 감사합니다.',3147),(3664,'2017-11-10 00:00:00.000000',5,'  좋았던 점: 상담사분이 제가 한 말을 반복하시면서 자신이 이해하고있는것이 맞는지 확인시켜주시는게 좋았어요. 제 이야기에 집중하고 있다는 느낌이 들어서 되게 편안한 느낌을 받았어요.  아쉬운 점:아쉬운점은 없었습니다.',3148),(3665,'2017-11-10 00:00:00.000000',5,'  좋았던 점: 잘 리드해주셔서 편하게 말씀드릴 수 있었습니다. 제 말을 반복해주시며 공감해주시는게 귀여우셨어요. 감정과 생각을 혼동하고 있었는데 집요하게 차근차근 감정을 알 수 있도록 이끌어주셔서 감동받았습니다.  아쉬운 점:딱히 없어요. 과도한 물결 정도?ㅋㅋ ',3149),(3666,'2017-12-03 00:00:00.000000',5,'  좋았던 점: 너무 잘들어주시고요 공감과 이해를 잘 해주셔서 좋았습니다  아쉬운 점:없습니다',3150),(3667,'2017-11-12 00:00:00.000000',4,'  좋았던 점: 질문도 부드럽게 해주시고 무엇보다 제 말의 핵심을 잘 뽑아주신다는게 제일 좋았던거 같아요.\n되물어보시면서 이게 맞는지 제 의견을 존중해주시는거 같아 상담할때 많이 도움이 됬어요.  아쉬운 점:뭔가 기계적인 말투...ㅎㅎㅎ\n물결표를 많이 좋아하시는거 같아요!\n그것 말곤 크게 없던거 같습니다!',3151),(3668,'2018-01-31 00:00:00.000000',5,'  좋았던 점: 저를 이해해주시고 한없이 공감해주셨어요. 현실적인 따끔하게 말해주신 부분도 있고요.   아쉬운 점:없습니다. ',3152),(3669,'2018-10-28 00:00:00.000000',5,'제가 문제로 삼았던 중독이란 것의 근본적인 원인을 깨닫게 해주셔서 좋았습니다. 중간중간 공감어린 따뜻한 말씀도 좋았습니다.',3153),(3670,'2017-11-12 00:00:00.000000',4.5,'  좋았던 점: 제 말을 잘들어주시고.. 제가 말했던 요점들을 잘 집어주셔서\n대화를 하는데 너무 편했어요.. 바로 옆에서가 아닌 대화이지만 옆에서 저를 다독여주는 듯한 느낌을 받아서 좋았던 것 같습니다..  아쉬운 점:크게 없는것 같습니다',3154),(3671,'2017-12-10 00:00:00.000000',1.5,'  좋았던 점: 아직 잘 모르겠어요  아쉬운 점:아직 잘 모르겠어요',3155),(3672,'2018-02-04 00:00:00.000000',4,'  좋았던 점: 제가 듣고싶은 말을 잘 해주신것 같아요\n저는 뭐.. 그건 그래서다 저래서다 이런 설명도 듣고싶었지만\n제 잘못이 아니라는 말이 가장 필요했던 것 같습니다\n제 잘못이 아니라는 말에 마음이 많이 유연해졌어요  아쉬운 점:없습니다',3156),(3673,'2018-08-04 00:00:00.000000',5,'상담 받기 전, 사실 굉장히 많이 망설였어요.\n정말 마지막이다! 라고 생각하고 10회권이나 상담해보았는데요. 사실 당장의 해결 이라기 보다 마음에 힘을 받는 경험을 했어요. 마음이 좀 더 단단해져서, 스스로 답을 찾는 힘이 되었어요. 망설이지 마세요 ',3157),(3674,'2018-10-31 00:00:00.000000',5,'제 감정을 돌아보게 됐어요..\n제 고민을 하찮게 생각하실까봐 걱정했는데..잘 경청해주셔서 좋았어요',3158),(3675,'2019-04-17 00:00:00.000000',5,'문제는 있는것 같으나 목표나 핵심을 모르고 상담을 시작했어요.\n문제가 여러방면으로 뻗쳐서 정리가 안되는 상황에서 곁가지 다 쳐내주시고 크게 카테고리를 나눠주신것 같아요.\n4회를 진행했으나 시간이 부족해 아쉬운 느낌도있지만.. \n그래도 조금의 방법은 알것 같으니 시도는 해보고 안되면 다시 상담해보려구요.\n4주동안 잘들어주시고 딴길로 자꾸 세면 다시 잡아주시고 고생많으셨어요.',3159),(3676,'2018-02-05 00:00:00.000000',4,'  좋았던 점: 공감해주시고 응원해주신게 좋았습니다.  아쉬운 점:초반에 제가 했던 말들을 그대로 복붙한듯한 맞장구가 조금 성의없게 느껴졌는데 중반으로 넘어가면서 괜찮아졌습니다.',3160),(3677,'2018-05-20 00:00:00.000000',3,'  좋았던 점: 긍정, 배려  아쉬운 점:특별히 없음\n',3161),(3678,'2019-03-26 00:00:00.000000',5,'처음 해보는 상담유형이었는데 특별한 경험이었어요 나쁘지 않네요',3162),(3679,'2018-05-20 00:00:00.000000',4.5,'  좋았던 점: 제 얘기를 들어주시는 것만으로도 위로가 됐던거 같아요. 감사합니다.  아쉬운 점:시간이 정해져있다보니, 갑작스럽게 마무리되는 점이요.',3163),(3680,'2018-11-03 00:00:00.000000',5,'헛소리 해도 잘 받아주셔서 감사합니다\n제가 상담할 만큼 정리가 안돼있는데 신경써주셔서 감사해요',3164),(3681,'2019-04-18 00:00:00.000000',5,'이해해주시고 공감해주시는게 좋았어요.\n감정의 이유를 찾는데 도와주시고 앞으로의 과제를 이끌어주셔서 감사했습니다 힘낼게요!',3165),(3682,'2018-09-18 00:00:00.000000',4,'사정이 있어서 불가피하게 상담에서 좀 자주 늦었었는데 오히려 늦은 시간에도 받아주시면서 상담을 진행해주시고 상담횟수가 깎이면 힘들지 않을까 제 걱정을 해주셨어요. 상담을 받으며 존중받는 느낌을 받았고 불안을 덜어주시려고 경청을 하고 있다는 말씀을 건네면서 최대한 경청을 해주시고 그 때의 감정을 공감하시듯 말씀하시는 부분에서 진심이 느껴졌어요. 최선을 다해 상담해주셔서 감사합니다.(리액션으로 ^^과 ~~를 많이 쓰시던데 반응이 귀여우셨어요ㅎㅎ)',3166),(3683,'2019-06-05 00:00:00.000000',5,'상담을 계속하면서 외면하고 있던 제 감정에 대해 알게 되었습니다. 2번의 짧은 상담이었는데도 나름대로 앞으로 나아갈 실마리도 잡을 수 있었어요. \n\n제가 생각하기에 문제 없다고 생각한 부분이 사실은 제가 이렇게 상담을 하게된 감정의 원인이었어서, 아무래도 상담을 신청하지 못했다면 영원히 발견하지 못했을지도 모르겠네요.\n\n텍스트로 진행되다보니까 말하면서 생각도 하고 정리도 되는것 같아서 좋았습니다.\n앞으로도 힘들거다 갈피를 잡고 싶은 기분이 들면 또 찾아뵙고 싶네요:)',3167),(3684,'2019-03-28 00:00:00.000000',5,'비슷한 상황을 겪어서인지 쉽게 이해해주셨습니다',3168),(3685,'2019-06-05 00:00:00.000000',5,'상담사님께 정말 많은 도움 받았습니다. \n제가 어떤 이유 때문에 지금같은 심리상태에 처해있을수 있는지 이해하도록 도와주셔서, 저도 몰랐던 제 자신에 대해 이해할수 있어서 마음이 많이 편해졌습니다. 응원의 말씀과 단기 장기 조언 주신 내용도 참 많이 와닿았네요. 더 잘해볼 용기가 생겼습니다~',3169),(3686,'2019-05-18 00:00:00.000000',5,'선생님께서 공감을 잘해주시고 경청해주십니다. 그리고 자신감을 길러주세요. 정말 좋았습니다',3170),(3687,'2017-12-18 00:00:00.000000',3,'  좋았던 점: 감정도 잘 정리해주시고 잘 공감해 주셔서 좋았고, 내면을 파고들 수 있게 잘 질문해주셨어요  아쉬운 점:제가 스마트폰 자판 치는게 힘들었어욬ㅋㅋpc로도 채팅 할 수 있었으면 좋았을텐데',3171),(3688,'2017-12-18 00:00:00.000000',3.5,'  좋았던 점: 잘 공감해주셔서 많은 위로와 힘이 되었어요\n잘 들어주시니까 말을 하기 편했어요  아쉬운 점:크게 없었던 것 같아요',3171),(3689,'2018-04-10 00:00:00.000000',5,'  좋았던 점: 생각보다 훨씬 깊에 들어가서 놀랍고 좋았어요! 앞으로도 종종 받으면 좋을 거 같아요 ^.^   아쉬운 점:시간도 적당했고 전체적으로 만족도 높습니다 ^^*',3172),(3690,'2019-06-26 00:00:00.000000',5,'제 감정에 공감을 많이 해주셔서 늘 감사했습니다. 저도차도 몰랐던 제 감정을 많이 깨닫고 바라볼 수 있는 시간이었습니다. 어떻게든 살아가야 하겠다는 희망도 조금은 얻었습니다. ',3173),(3691,'2019-04-20 00:00:00.000000',5,'정말 감사합니다. 제가 정리하는 것도 되게 뒤죽박죽이라 맥락 잡는 게 되게 힘드셨을거 같은데 50분동안 되게 진지하게 들어주셨어요. ',3174),(3692,'2018-11-13 00:00:00.000000',4.5,'텍스트 테라피를 통해 나의 많은 감정을 돌아볼수있게 됐습니다. 비록 그 감정이 어렵더라도, 무시할수만없는 감정이라고 생각이 들었어요. 정말 힘든과정이지만 최선을 다해 노력을 해볼께요. 감사합니다 ^^',3175),(3693,'2018-11-13 00:00:00.000000',5,'근본적인 우울감 원인부터 찾아내고 단계적인 해결법을 제시해주셔서 감사했습니다. 요즘 행복한게 뭔지 생각해보지도 못했는데 잊고있던 행복했던 취미에대한 얘기를 하다보니 즐거웠어요 ^^ 상담 감사합니다.',3176),(3694,'2018-07-20 00:00:00.000000',5,'심리상담은 처음이라 기계적으로 말할거라는 불신이있었는데 진심으로 상담해주시고 궁금했던것도 친절히 설명해주셔서 좋았습니다\n외면하고살았는지도모를 제마음을 알아갈수있게된것같아 다행입니다',3177),(3695,'2017-11-15 00:00:00.000000',3,'  좋았던 점: 네~ 하는건 가식으로 느껴졌어요 진심으로 말씀해주시는건 감사했고 저렵한얘기들어주셔서 고마웠습니다  아쉬운 점:난 진지한디 네~는 섭섭했어요',3178),(3696,'2018-11-14 00:00:00.000000',3.5,'제 속마음을 이렇게 까지 말한건 처음이에요. 덕분에 저를 제대로 바라볼 수 있었어요.',3179),(3697,'2019-05-20 00:00:00.000000',5,'저는 여자이지만, 남편과의 관계에 도움을 받고싶어서 남자선생님을 찾았고, 한번의 상담이었지만 굉장히 도움이 되었습니다. \n다음에 부부관계에 대한 문제가 있을 때 또 찾고싶어질 것 같아요~! \n',3180),(3698,'2018-11-15 00:00:00.000000',4,'제 고민에 대한 상담 뿐 아니라 더 도움을 받을 수 있는 기관도 알려주시고 도움을 받아야하는 이유도 말해주셔서 좋았어요\n상담을 처음 받는거라 문제에 대한 근본적인 해답을 완전히 알진 못했지만 해결할 수 있는 방법을 조금이라도 알아서 좋았습니다',3181),(3699,'2018-11-15 00:00:00.000000',5,'많은 도움이 되어서 바뀔수있다는 생각이 들었습니다\n30분 상담을 했는데 더하고 싶어지네요\n',3182),(3700,'2018-04-16 00:00:00.000000',3.5,'  좋았던 점: 짧은 시간임에도 많은 말씀 주시는 것이 좋았습니다  아쉬운 점:없습니다\n',3183),(3701,'2017-10-26 00:00:00.000000',5,'  좋았던 점: 잘들어주시고, 질문도 잘 던져주셔서 좋았습니다. 누군가에게 털어 놓는 것 만으로도 많이 힘이 되네요.  아쉬운 점:또 이어서 하고 싶어요ㅎㅎ',3184),(3702,'2018-05-31 00:00:00.000000',5,'  좋았던 점: 좋았어요^^  아쉬운 점:약간 시간이 짧다ㅠㅠ',3185),(3703,'2018-04-19 00:00:00.000000',5,'  좋았던 점: 잘 들어주시고 공감해주셨습니다  아쉬운 점:딱히 없습니다',3186),(3704,'2019-06-10 00:00:00.000000',3.5,'앞으로의 구체적인 방향이라기보다도 현재 내 감정이 어떠한지, 이 감정의 원인이 무엇인지 등 이 순간의 내 자신에 대해 알 수 있게 되어 좋았습니다.',3187),(3705,'2017-12-29 00:00:00.000000',4.5,'  좋았던 점: 공감해주셔서 좋았어요  아쉬운 점:잘모르겠어요',3188),(3706,'2019-03-10 00:00:00.000000',4,'친구에 대한 고민이었는데 결국 저에 대한 생각을 더 갖고 가게 된 것 같고요. 그렇게 포커스를 옮김으로 인해서 답의 방향을 찾을 것 같아요. 혼자서 그렇게 생각하기 어려웠는데 상담사님이 분명하게 짚어주셨던 것 같습니다.\n',3139),(3707,'2018-06-01 00:00:00.000000',5,'  좋았던 점: 위로받고 있다는 감정이 들었어요. 질문이 화들짝 놀라게 하는 질문이여서 자신을 되돌아 볼 수 있는 진짜 원인이 뭔가를 고민할 수 있게 해주십니다. 매주 변화하는 제가 보였어요. 감사합니다  아쉬운 점:딱히 없었습니다.',3189),(3708,'2020-04-12 00:00:00.000000',5,'많은 도움이 되었습니다. 제가 누군가에게 말을 하지 않고 모든 고민을 앉고 가는편인데 누군가에게 말을 할 수 있고 제가 고민하는 것을 좋은 방향으로 이끌어주셔서 감사했습니다. \n이야기를 잘 들어주셨고 좋은 방향을 제시해주십니다. 믿음이 없는 사람들은 믿음관련 얘기하면 안좋게 보는 경향이 있어서  종교를 믿는게 어떤 것인지 아는 상담사님을 선택했는데 좋은 결과 주셔서 감사합니다. ',3190),(3709,'2020-04-08 00:00:00.000000',5,'생각지 못했던 저의 고민과 상처를 알아서 많은 도움이 되었어요 아침에 개운하게 일어날수 있어서 좋았습니다',3191),(3710,'2020-02-12 00:00:00.000000',5,'감사했습니다 ',3192),(3711,'2020-01-12 00:00:00.000000',5,'항상 저의 입장에서 말씀해주시고 공감해주시는 모습에 감동했습니다\n따뜻한 말 한마디한마디에 울컥했던적이 한두번이 아니였습니다ㅠ\n상담사님과 좋고 든든한 한달을 보낸것같아요\n상담이 제게 이렇게 큰 변화와 도움이 될줄 몰랐습니다\n상담사님 감사합니다',3193),(3712,'2020-01-10 00:00:00.000000',5,'좋았어요 ㅎ 필요한 정보들을 뽑아주셨어요',3194),(3713,'2020-01-09 00:00:00.000000',5,'공감도받고 조언도얻고 좋았어요~!\n\n\n\n\n ',3195),(3714,'2020-01-09 00:00:00.000000',5,'선생님 덕분에 주저하던 제가 심리상담을 받을 수 있었습니다.   좀 더 나를 위하는 방법을 알게 된 것 같아요. 감사합니다.',3196),(3715,'2020-01-08 00:00:00.000000',5,'제가 장황하게 이야기 하고 나면 그에 일일이 반응해 주시고 정리해서 한번 더 이야기 해주시고 어떤방향으로 나아가야 할지 조언도 해주셨어요. 그리고 근본적인 문제를 파악하는데 도움이 될만한 심리검사나 치료 등도 추천해 주셨구요. \n상담이 끝날때 마다 다음 상담때까지 이런저런 것들을 생각해보고 적어오도록 숙제도 내주셨는데 저에대해 더 많이 돌아보게 된 계기가 된 것 같아요. 감사했습니다. ',3197),(3716,'2020-01-05 00:00:00.000000',5,'좋았습니다 심리적으로 안정됐어요 ',3198),(3717,'2019-12-26 00:00:00.000000',5,'이야기 잘 들어주셔서 감사합니다\n',3199),(3718,'2019-12-20 00:00:00.000000',4,'신앙관련의\n시선을 교유 할 수 있어서 안도감 속에서 상담 할 수 있었습니다. 친구처럼 편안한 분위기에서\n대화 할 수 있었습니다. \n경청과 공감 해 주시고, 맥락을 잘 짚어 주셔서 \n마음이 불안한 제\n입장에서는 길을 잃지 않으며\n차분히 저를 돌아 보게 되는 시간 이었습니다. ',3200),(3719,'2019-12-19 00:00:00.000000',5,'감사합니다. 잘 들어주셔서 마음이 편했어요.',3201),(3720,'2019-12-19 00:00:00.000000',5,'누군가 들어주는 사실로 큰 위안이 됩니다.\n가까운 친구, 지인, 가족이기에 털어두지 못하는 말을 할 수 있다는 사실은 그거 자체만으로 마음의 짐을 조금 덜 수 있었어요\n들어주고 답볍을 듣고 생각을 물어보고 어찌보면 단순한 과정이지만 너무나 따뜻하게 느껴지는 순간이었습니다.',3202),(3721,'2019-12-11 00:00:00.000000',5,'상담이 처음이고 제가 느끼기에 상담을 받을정도일까싶었는데 막상 받아보니\n제가 마음속 말을 하는것만으로도 많은 위로가 되더라구요\n친절하게 말씀해주시고 좋았습니다\n힘들때 한번씩 받아보는게 좋은것같아요',3203),(3722,'2019-12-09 00:00:00.000000',5,'처음에는 저의 감정(우울감)에 대해 두리뭉술하게 얘기했는데,, 왜 그런 감정을 느끼는지 잘 이끌어내 주셨고, 가장 좋았던 부분은 단순히 들어주시는 것 뿐만 아니라 객관적인 자료로도 얘기해주셔서 위로가 많이 되었습니다. 또한 구체적인 해결방안도 얻게 되었네요. 짧은 시간이었는데도 굉장히 만족하고 좋은 상담이었습니다! 감사합니다!',3204),(3723,'2019-12-09 00:00:00.000000',5,'돈을 투자해서 과연 나에게 도움이 될까싶었지만 정말 너무 도움이 되고 제 마음을 알아주시고 내가 어떻게 하면되는지 방향을 제시해주셔서 너무 감사해요!어떻게 해야될지 모르고 쓸모없는 사람인줄알았는데 그게 아니라는걸 알것같아요!',3205),(3724,'2019-12-08 00:00:00.000000',5,'트로스트 앱이랑 웹 둘다 튕겨서 상담이 지연됐고 그래서 20분정도 늦게 시작했습니다. 하지만 상담에 있어서는 제가 결국 궁극적으로 원하는 지향하는 바가 무엇인지 볼 수 있도록 이끌어주셔서 좋았습니다.',3206),(3725,'2019-12-05 00:00:00.000000',5,'도움이 많이 됐습니다.\n',3207),(3726,'2019-12-04 00:00:00.000000',5,'감사합니다. 용기를 주셔서',3208),(3727,'2019-12-04 00:00:00.000000',5,'처음엔 어떻게 시작해야할지 몰라 우물쭈물했지만,상담하며 점차 제 안에 있던 속얘기를 꺼내게 되었어요.그 과정이 조금 어려웠지만 점차 풀리는것같은 기분에 조금은 박하사탕먹은듯 화해졌어요',3209),(3728,'2019-12-03 00:00:00.000000',5,'공감 많이 해주셨어요 해결책도 제시 해주셨지만 제 노력이 가장 중요하다는 것을 알게 되었어요 짧은 상담시간 이었지만 누군가가 제 이야기를 진지하게 들어줬다는 점만으로도 만족스러워요 \n',3210),(3729,'2019-12-01 00:00:00.000000',5,'처음에 상담을 받으려던 계기가 불면증이 생겼기 때문이었는데 불면증은 이제 사라졌구요, 상담사 선생님께서 많이 얘기를 끄집어내려고 해주셔서 마음에 담았던 것을 많이 내려놓기도하고 다시 생각해보기도 했습니다. ',3211),(3730,'2019-11-27 00:00:00.000000',5,'짧은 상담이라 많은걸 할수 없어 아쉬웠지만 그래도 힘들던 삶을 돌릴 힘을 준 터닝포인트 정도는 된 것 같습니다.',3212),(3731,'2019-11-26 00:00:00.000000',5,'새로운 개념도 제시해주시고 좋습니당\n',3213),(3732,'2019-11-08 00:00:00.000000',4,'확실히 격려와 지지를 많이 해주셔서 그 부분은 좋았어요\n좀 더 회기를 많이 진행할걸 그랬나 하는 아쉬움이 남네요',3214),(3733,'2019-11-04 00:00:00.000000',5,'짧은 기간이 아니었어요. 근 10년간 안고있던 고민이었습니다. 10년짜리가 상담 4주만에 밑바닥을 보이고 있네요\n\n직접적인 도움이 아닌 제 스스로 답을 얻을 수 있도록 질문으로 유도해주신 점 감사드립니다. 스스로 얻어낸 답이라 더욱 더 가치가 있는 듯 합니다. \n\n제가 했던 행동들과 그 행동의 원인들까지 짚어주셨을 때 좀 충격적이었습니다. 아무리 무의식적으로 한 행동이라고 해도 그런 이유가 있는지는 몰랐으니까요. 이젠 그 행동들을 상대방이 어떤 마음으로 받아들였는지, 받으면서 어떤 기분이었을지 어느정도는 깨닫게 되었습니다. 어떻게 보면 너무 늦어버렸지만 이제라도 알게 된 걸 다행이라 생각합니다. 또한 이제라도 알게 되었으니 다음번엔 너무 늦기전에 바로잡을 수 있겠네요. 감사합니다\n\n4주는 어떻게보면 참 짧은 시간이었어요. 초반에는 다음 상담까지의 일주일이 못견디도록 힘들고 길게 느껴졌지만 2회차 3회차로 넘어 갈 수록 점점 여유도 생기고 일주일이라는 시간이 그저 대기기간이 아닌 혼자서 생각하고 정리할 수 있는 소중한 시간이었다고 생각합니다. 이제서야 그 일주일의 의미를 알게되었네요.\n\n제게 던져주셨던 질문들, 해주셨던 말씀과 조언들 평생 새기면서 살아보겠습니다. 감사합니다.\n\n',3214),(3734,'2019-11-01 00:00:00.000000',5,'매 상담마다 길고 긴 이야기를 툭툭 던지듯 남겼지만 하나하나 깊은 공감을 해주신 것에 너무 감사하고 현실적인 조언을 해주신 점이 인상 깊었습니다. 미처 내가 짚지 못했던 것들을 캐치하고 조곤조곤 납득할 수 있도록 해주셔서 감사합니다.',3215),(3735,'2019-10-30 00:00:00.000000',5,'너무 막막하게 힘들었는데 조금 괜찮아질수 있겠다는 생각이 들어요. 짧은 시간이였는데도 제 이야기를 잘 들어주시고 문제의 원인을 생각할수있게 이끌어주셔서 너무 뜻깊은 시간이였어요. 상담한번 받는것조차 무서웠는데 텍스트임에도 상담사님의 따뜻함이 느껴져서 정말 좋았아요! 감사합니다ㅠㅠ',3216),(3736,'2019-10-26 00:00:00.000000',5,'처음 상담 받을때 제 이야기를 잘 들어주시고 위로 해주셨어요!\n이렇게 해 보면 좋겠다고 도움도 주셨고, 저도 알려주신대로 실행해보니 도움이 되었어요.\n상담사님께 많은 도움 받았어요.\n또 마음이 힘들어지먄 상담사님을 찾아가게요 ^_^',3217),(3737,'2019-10-22 00:00:00.000000',5,'그냥 다 털어놓을 수 있어서 좋았습니다.\n누군가에게 말할수 없던 일들도 말할 수 있어서 좋았어요 큰 상처였지만 글로쓰면서 정리해보니 별일 아닌거 처럼 느껴지기도 했구요 친한 지인에게 털어놀 수 있는 용기가 생겼습니다 ',3218),(3738,'2019-10-11 00:00:00.000000',5,'일요일 저녁에 상담을 받게 되었는데도, 친절하게 안내해주셨던 것이 기억납니다. 제가 가지고 있던 고민에 대해 새로운 관점을 제시해주셔서 현재 마음이 한결 편해졌습니다. 다행히도 문제가 해결되는 쪽으로 흘러가서 요즘은 정말 편안한 마음으로 지내고 있어요. 적절히 공감 해주시면서도 필요한 조언을 말씀해주실 때는 단호하게 말씀해주셔서 도움이 많이 되었습니다. 제가 총 2회권을 결제하였으나 상담은 1회에 끝나게 되었는데, 1회로 적당할 것 같다며 환불할 수 있도록 도와주신 점도 감사했습니다. 상담을 지나치게 권유하거나 강요하지 않아서 좋았습니다. 이 다음에 또 해당 어플을 이용하게 된다면 상담사님과 함께 하고 싶습니다. 고맙습니다^_^',3219),(3739,'2019-09-29 00:00:00.000000',5,'친절하시고 제 말에 귀 기울여 주시는것같아 너무 많은 도움이 됐습니다^^',3220),(3740,'2019-09-24 00:00:00.000000',5,'공감과 지지가 필요하신 분들께 추천드려요 \n',3221),(3741,'2019-09-19 00:00:00.000000',5,'한번뿐이긴하지만 친절하게 해주셔서 감사합니다...,마음풀고갑니다...',3222),(3742,'2019-09-09 00:00:00.000000',5,'제 일을 상담사님 일 같이 같이 걱정해주시고 격려해주셔서 감사합니다 힘내볼게요:)',3223),(3743,'2019-09-09 00:00:00.000000',3,'시간이 짧아 아쉽네요~',3224),(3744,'2019-09-08 00:00:00.000000',5,'제 이야기를 잘 들어주시고 제편이 되어서 이야기도 해주시고 따끔한 조언도 해주셔서 이제는 제대로 된 삶을 살아보기로 마음먹었어요 감사합니다 ',3225),(3745,'2019-09-02 00:00:00.000000',4,'상담 예약문자도 빠르게 답장해주시고 구구절절 긴 이야기 들어주셔서 감사합니다~!! 해주신 얘기 잘 듣고 해결해보도록 하겠습니다!',3226),(3746,'2019-08-25 00:00:00.000000',5,'전혀 생각치 못했던 방향으로 사건을 볼 수 있어서 좋았어요. 이래서 다들 상담을 받나봐요. ',3227),(3747,'2019-08-23 00:00:00.000000',5,'\n바쁘신데도 연달아 끝까지 지친기색없이 제 이야기를 끝까지 들어주셔서 감사했어요. 앞으로는 힘들때마다 자주 찾아뵐려구요. 무엇보다 그냥 막 들어주기만 한게아니라 중간중간 제상황을 이해해주고 해줘서 제편이 있는 느낌이 들었구 마지막은 조언도 아낌없이 해줘서 너무고마웠습니다.감사드려요 선생님 성공일기 잊지 않겠습니다^,^\n',3228),(3748,'2019-08-21 00:00:00.000000',5,'메신저로만 하는 상담이라서 정말 마지막 소통의 창구로 선택했는데 오히려 매우 큰 도움을 받을 수 있었어요. 가끔은 제 얘기를 들어주시고 공감을 해주시고 가끔은 해결책을 제시해 주시거나 좋은 방향 여러개를 제안해주시기도 하셔서 정말 제 생각의 변화가 일어날 수 있게 많은 도움을 받았습니다.',3229),(3749,'2019-08-16 00:00:00.000000',5,'괜찮았어요 잘들어주셔서 ㅜㅜ..\n\n50분 생각보다 긴데요?\n\n마지막에 해보라고하신 조언보다 \n\n세상에 이런저런 감정이있으니까 남 의식하지말고 괜찮다고 해주신 말이 마니도움됐어요\n',3230),(3750,'2019-08-16 00:00:00.000000',4,'솔직하게 내 얘기를 할 수 있어서 좋았다. 처음이라 뭐가 뭔지 몰라서 와르르 쏟아내 버린 게 아쉬웠다. 조금 적극적으로 상담을 이끌어 주셨으면 좋겠다는 생각이 들었다. ',3231),(3751,'2019-08-12 00:00:00.000000',5,'현실적으로 말씀해주신점이 가장 좋았습니다\n',3232),(3752,'2019-08-09 00:00:00.000000',5,'제가 과한 걱정을 한다는 것을 상기시켜주셔서 감사하고 이젠 친구 연락 행동 하나에 제 걱정을 대입시켜 생각하기 보다는 그냥 제 할 일 하면서 잘 지내볼게요! 감사해요^~^',3233),(3753,'2019-08-09 00:00:00.000000',5,'덕분에 좋은시간 보내고 갑니당~~♡♡♡',3234),(3754,'2019-08-08 00:00:00.000000',5,'질문도 해주시고 문제에 대한 해결 방안도 제시해주셔서 많은 도움을 받았습니다',3235),(3755,'2019-08-06 00:00:00.000000',5,'상담 할 때 이야기를 천천히 잘 경청해주시고 공감도 잘해주셔서 위로가 되었어요:) 그리고 내가 처한 상황에 맞게 대책을 제안해주셔서 좋았어요-:) ',3236),(3756,'2019-08-02 00:00:00.000000',5,'얘기 잘 들어주셔서 속이 시원해졌어요\n잘 들어주시는데다 전문가적 의견도 내주시니 더 위로가 되었습니다',3237),(3757,'2019-07-22 00:00:00.000000',5,'처음이라 잘은 모르겠지만 경청해주셔서 좋았습니다.',3238),(3758,'2019-07-14 00:00:00.000000',5,'감사합니다.. \n❤ 하트.. 잘안쓰는데..ㅎ',3239);
